(2, 1225, 'roberto carlos mario gomez baru tiga hari ini tinggal di kota malang meski begitu pelatih baru arema fc sudah langsung jatuh hati dengan suasana kota malang saya senang dengan kondisi kota ini ujar gomez belum lama ini cuaca yang tidak panas tapi juga tidak terlalu dingin dinilai memberi efek yang bagus bagi para pemain apalagi bila arema fc berlatih di lapangan yang representatif dengan kondisi rumput yang bagus saya hanya ingin lapangan yang mendukung karena kondisi lapangan itu penting bagi saya kata pelatih berkewarganegaraan argentina ini selama tiga hari antara kamis  sampai sabtu  arema fc menggelar latihan di stadion gajayana tapi mulai hari ini hingga beberapa hari ke depan arema fc berlatih di lapangan kusuma agrowisata kota batu coach gomez suka di daerah pegunungan seperti batu malang tukas general manajer arema fc ruddy widodo bagi gomez kota batu juga bukan tempat yang asing musim lalu saat masih menjadi pelatih borneo fc gomez juga menggelar training center tc selama seminggu di kota batu', 'roberto carlos mario gomez tinggal kota malang pelatih arema fc langsung jatuh hati suasana kota malang senang kondisi kota gomez cuaca panas dingin dinilai efek bagus pemain arema fc berlatih lapangan representatif kondisi rumput bagus lapangan mendukung kondisi lapangan pelatih berkewarganegaraan argentina kamis  sabtu  arema fc menggelar latihan stadion gajayana arema fc berlatih lapangan kusuma agrowisata kota batu coach gomez suka daerah pegunungan batu malang tukas general manajer arema fc ruddy widodo gomez kota batu asing musim pelatih borneo fc gomez menggelar training center tc seminggu kota batu', 'roberto carlos mario gomez tinggal kota malang latih arema fc langsung jatuh hati suasana kota malang senang kondisi kota gomez cuaca panas dingin nilai efek bagus main arema fc latih lapang representatif kondisi rumput bagus lapang dukung kondisi lapang latih berkewarganegaraan argentina kamis  sabtu  arema fc gelar latih stadion gajayana arema fc latih lapang kusuma agrowisata kota batu coach gomez suka daerah gunung batu malang tukas general manajer arema fc ruddy widodo gomez kota batu asing musim latih borneo fc gomez gelar training center tc minggu kota batu'),
(3, 1226, 'abduh lestaluhu dan angga saputra seharusnya sudah berkostum persebaya surabaya sebab versi tim berjuluk green force tersebut keduanya sudah membukukan tanda tangan kontrak dengan persebaya bahkan abduh dan angga sudah menerima sebagian uang muka namun ketika sudah tanda tangan kontrak dengan persebaya keduanya malah bergabung dengan persikabo abduh juga sudah berlatih bersama tim asal kota hujan tersebut informasi bahwa abduh dan angga sudah tanda tangan kontrak dengan persebaya diungkapkan aji santoso kepada jawa pos kemarin pagi  di sela-sela latihan di stadion universitas negeri yogyakarta uny pelatih persebaya itu menyebut tanda tangan kontrak terjadi beberapa waktu lalu yakni saat ikatan keduanya dengan ps tira persikabo nama persikabo sebelumnya sudah berakhir persebaya surabaya karena keduanya sudah tanda tangan kontrak dengan kami urusan ini saya serahkan ke manajemen persebaya kata aji dia meminta manajemen persebaya melakukan pembicaraan dengan manajemen persikabo saya tentu berharap hal yang terbaik untuk kami ujarnya mantan pelatih tim nasional tersebut berharap abduh dan angga bisa bergabung dengan persebaya sebab keduanya sudah disiapkan sebagai bagian dari tim utama persebaya musim  abduh mengisi bek kiri yang ditinggalkan ruben sanadi di posisi itu persebaya baru memiliki nasir sementara itu angga diharapkan bisa mengisi posisi di bawah mistar setelah kepergian miswar saputra satu kiper lain rencananya diisi rivky mokodompit persebaya pun kini masih menunggu kedatangan rivky untuk bergabung dalam pemusatan latihan di jogjakarta karena masih kosong selama beberapa hari jalannya pemusatan latihan posisi kiper untuk sementara memakai dua penjaga gawang yang dipinjam dari persebaya u- ababil syahbela bram susanto putra dan andika ramadani soal angga dan abduh kami akan segera berbicara dengan manajemen persikabo sebab angga dan abduh memang sudah tanda tangan kontrak dengan kami mereka juga sudah menerima sebagian dp kata sekretaris persebaya surahman persebaya tentu akan mencari solusi terbaik dalam pembicaraan dengan manajemen persikabo agar semua pihak tidak sama-sama dirugikan termasuk mencari solusi terbaik soal karir angga dan abduh sebagai pemain bola sekaligus prajurit ujar pria yang akrab disapa ram tersebut sementara itu kemarin sore salah seorang pemain muda persebaya m supriadi telah bergabung dengan skuad green force di jogjakarta supriadi bergabung ke persebaya setelah pulang dari seleksi timnas u- dia pulang lantaran cedera engkel supriadi memang sudah memberi tahu kami kalau soal rivky mokodompit nanti saja dibicarakan yang ada saja dulu ucap ram saat dikonfirmasi tentang supriadi dan rencana bergabungnya rivky', 'abduh lestaluhu angga saputra berkostum persebaya surabaya versi tim berjuluk green force membukukan tanda tangan kontrak persebaya abduh angga menerima uang muka tanda tangan kontrak persebaya bergabung persikabo abduh berlatih tim kota hujan informasi abduh angga tanda tangan kontrak persebaya aji santoso jawa pos kemarin pagi  sela-sela latihan stadion universitas negeri yogyakarta uny pelatih persebaya menyebut tanda tangan kontrak ikatan ps tira persikabo nama persikabo persebaya surabaya tanda tangan kontrak urusan serahkan manajemen persebaya aji manajemen persebaya pembicaraan manajemen persikabo berharap terbaik mantan pelatih tim nasional berharap abduh angga bergabung persebaya disiapkan tim utama persebaya musim  abduh mengisi bek kiri ditinggalkan ruben sanadi posisi persebaya memiliki nasir angga diharapkan mengisi posisi mistar kepergian miswar saputra kiper rencananya diisi rivky mokodompit persebaya menunggu kedatangan rivky bergabung pemusatan latihan jogjakarta kosong jalannya pemusatan latihan posisi kiper memakai penjaga gawang dipinjam persebaya u- ababil syahbela bram susanto putra andika ramadani angga abduh berbicara manajemen persikabo angga abduh tanda tangan kontrak menerima dp sekretaris persebaya surahman persebaya mencari solusi terbaik pembicaraan manajemen persikabo dirugikan mencari solusi terbaik karir angga abduh pemain bola prajurit pria akrab disapa ram kemarin sore salah pemain muda persebaya m supriadi bergabung skuad green force jogjakarta supriadi bergabung persebaya pulang seleksi timnas u- pulang lantaran cedera engkel supriadi rivky mokodompit dibicarakan ram dikonfirmasi supriadi rencana bergabungnya rivky', 'abduh lestaluhu angga saputra kostum persebaya surabaya versi tim juluk green force buku tanda tangan kontrak persebaya abduh angga terima uang muka tanda tangan kontrak persebaya gabung persikabo abduh latih tim kota hujan informasi abduh angga tanda tangan kontrak persebaya aji santoso jawa pos kemarin pagi  sela latih stadion universitas negeri yogyakarta uny latih persebaya sebut tanda tangan kontrak ikat ps tira persikabo nama persikabo persebaya surabaya tanda tangan kontrak urus serah manajemen persebaya aji manajemen persebaya bicara manajemen persikabo harap baik mantan latih tim nasional harap abduh angga gabung persebaya siap tim utama persebaya musim  abduh isi bek kiri tinggal ruben sanad posisi persebaya milik nasir angga harap isi posisi mistar pergi miswar saputra kiper rencana isi rivky mokodompit persebaya tunggu datang rivky gabung pusat latih jogjakarta kosong jalan pusat latih posisi kiper maka jaga gawang pinjam persebaya u- ababil syahbela bram susanto putra andika ramadan angga abduh bicara manajemen persikabo angga abduh tanda tangan kontrak terima dp sekretaris persebaya surahman persebaya cari solusi baik bicara manajemen persikabo rugi cari solusi baik karir angga abduh main bola prajurit pria akrab sapa ram kemarin sore salah main muda persebaya m supriadi gabung skuad green force jogjakarta supriadi gabung persebaya pulang seleksi timnas u- pulang lantar cedera engkel supriadi rivky mokodompit bicara ram konfirmasi supriadi rencana gabung rivky'),
(4, 1227, 'pertemuan klasik terjadi di sektor ganda putra pasangan nomor satu dunia marcus fernaldi gideonkevin sanjaya sukamuljo kembali bersua ganda nomor dua dunia hendra setiawanmohammad ahsan keduanya berhasil menjaga tradisi all indonesian final ini sudah kali keenam mereka menyegel gelar bagi indonesia bahkan sebelum pertandingan berlangsung tahun lalu ada lima partai puncak yang memperseterukan pasangan senior dan junior itu dua di antaranya terjadi di istora semuanya dimenangi marcuskevin hendraahsan selalu mengaku sulit mengimbangi kecepatan sang lawan yang berjuluk minions itu bisa jadi hasil yang sama akan terulang bisa juga hendraahsan yang bangkit dan menang marcus fernaldi gideonkevin sanjaya sukamuljo akan berusaha mempertahankan gelar juara di istora senayan jakarta hari ini  nafielah mahmudahpp pbsi nggak ada persiapan khusus penting fokus pada permainan sendiri dan persiapan yang terbaik saja ucap marcus soal kans hari ini mereka punya banyak kelebihan salah satunya pengalaman kami sudah hafal satu sama lain kami harus fokus dan tak boleh lengah timpal kevin minions saat ini memantapkan pola baru mereka memperbaiki rotasi memang belum mulus kadang-kadang mereka kehilangan fokus dan menjadi gampang ditekan lawan itu bisa dilihat dari laga babak pertama melawan marcus ellischris langridge asal inggris serta perempat final melawan goh sze feinur izzuddin asal malaysia tadi malam hampir terjadi lagi di game kedua dalam kondisi tidak diuntungkan angin minions merasakan tekanan lawan semakin besar mereka tertinggal - saat interval kami belum dapat feeling-nya di awal game kedua pertengahan game baru dapat jelas marcus melawan hendrahsan yang begitu cermat memanfaatkan angin itu tak boleh terjadi lagi the daddies julukan hendraahsan di sisi lain mengaku belum menemukan taktik untuk mengalahkan minions mereka hanya berencana istirahat dan menjaga kondisi marcuskevin indonesia vs ahsanhendra indonesia  peringkat   usia   cm cm tinggi  cm cm  hh  pertemuan terakhir  denmark open marcuskevin menang - -', 'pertemuan klasik sektor ganda putra pasangan nomor dunia marcus fernaldi gideonkevin sanjaya sukamuljo bersua ganda nomor dunia hendra setiawanmohammad ahsan berhasil menjaga tradisi all indonesian final kali keenam menyegel gelar indonesia pertandingan partai puncak memperseterukan pasangan senior junior istora dimenangi marcuskevin hendraahsan mengaku sulit mengimbangi kecepatan sang lawan berjuluk minions hasil terulang hendraahsan bangkit menang marcus fernaldi gideonkevin sanjaya sukamuljo berusaha mempertahankan gelar juara istora senayan jakarta  nafielah mahmudahpp pbsi nggak persiapan khusus fokus permainan persiapan terbaik marcus kans kelebihan salah satunya pengalaman hafal fokus lengah timpal kevin minions memantapkan pola memperbaiki rotasi mulus kadang-kadang kehilangan fokus gampang ditekan lawan laga babak melawan marcus ellischris langridge inggris serta perempat final melawan goh sze feinur izzuddin malaysia malam game kondisi diuntungkan angin minions merasakan tekanan lawan tertinggal - interval feeling-nya game pertengahan game marcus melawan hendrahsan cermat memanfaatkan angin the daddies julukan hendraahsan sisi mengaku menemukan taktik mengalahkan minions berencana istirahat menjaga kondisi marcuskevin indonesia vs ahsanhendra indonesia  peringkat   usia   cm cm  cm cm  hh  pertemuan  denmark open marcuskevin menang - -', 'temu klasik sektor ganda putra pasang nomor dunia marcus fernaldi gideonkevin sanjaya sukamuljo sua ganda nomor dunia hendra setiawanmohammad ahsan hasil jaga tradisi all indonesian final kali enam segel gelar indonesia tanding partai puncak seteru pasang senior junior istora menang marcuskevin hendraahsan mengaku sulit imbang cepat sang lawan juluk minions hasil ulang hendraahsan bangkit menang marcus fernaldi gideonkevin sanjaya sukamuljo usaha tahan gelar juara istora senayan jakarta  nafielah mahmudahpp pbsi nggak siap khusus fokus main siap baik marcus kans lebih salah satu alam hafal fokus lengah timpal kevin minions mantap pola baik rotasi mulus kadang hilang fokus gampang tekan lawan laga babak lawan marcus ellischris langridge inggris serta empat final lawan goh sze feinur izzuddin malaysia malam game kondisi untung angin minions rasa tekan lawan tinggal - interval feeling nya game tengah game marcus lawan hendrahsan cermat manfaat angin the daddies juluk hendraahsan sisi mengaku temu taktik kalah minions rencana istirahat jaga kondisi marcuskevin indonesia vs ahsanhendra indonesia  peringkat   usia   cm cm  cm cm  hh  temu  denmark open marcuskevin menang - -'),
(5, 1228, 'butuh waktu sepuluh bulan bagi greysia poliiapriyani rahayu untuk bisa menembus babak final turnamen bwf tour kali terakhir hal itu terjadi di india open  greysiaapriyani tahun lalu berhasil mencapai dua final sebelumnya mereka mencapai partai puncak malaysia masters  namun hanya di india itulah pasangan nomor delapan dunia tersebut bablas menjadi juara setelah itu fenomena hebat tersebut tak pernah terjadi lagi kemarin mereka memastikan tiket final setelah mengalahkan pasangan korea selatan yang sedang naik daun kim so-yeongkong hee-yong dalam straight games - - itu adalah kemenangan perdana mereka atas pasangan nomor empat dunia tersebut hari ini lawan mereka agak berbeda bukan pasangan jepang maupun korsel yang lain melainkan pasangan kejutan yakni maiken fruergaardsara thygesen asal denmark lolosnya fruergaardthygesen ke final sungguh tak disangka dalam perjalanannya ganda putri nomor  denmark yang menempati peringkat ke- dunia tersebut sangat impresif mereka menghajar pasangan nomor tiga dunia yuki fukushimasayaka hirota di babak  besar lalu kemarin  giliran unggulan keempat yang juga peraih emas olimpiade rio  misaki matsutomoayaka takahashi yang dipulangkan itu menjadi sinyal bahwa mereka sangat berbahaya sara thygesen kiri dan maiken fruergaard mengaku tidak takut kepada tekanan penonton istora senayan jakarta di final hari ini  bwf badminton kami rasa tekanan ada di pihak tuan rumah sedangkan kami tidak punya tekanan apa pun ujar fruergaard dalam konferensi pers setelah pertandingan dia melanjutkan gemuruh istora yang mengerikan tidak membuat dirinya dan thygesen takut itu malah bisa jadi beban buat greysiaapriyani penonton mengharapkan pemain indonesia yang menang kami akan main tanpa beban saja dan berusaha sebaik-baiknya kata fruergaard sudah lima kali greysiaapriyani bertemu dengan fruergaardthygesen selama itu pula kemenangan selalu berpihak kepada indonesia melihat tren permainan greysiaapriyani kemarin kans juara jelas ada apri tampil hebat dengan smes-smesnya yang keras tak hanya powerful pemain  tahun itu juga cerdik dalam penempatan bola dia juga mampu melakukan cover lapangan yang sangat baik mengejar bola dengan vitalitas sangat tinggi juga yang paling penting clean minim error di sisi lain greysia perlu memperbaiki servisnya yang sering tanggung jaga kondisi sih yang paling penting recovery karena ini posisi sudah - lagi hasil yang tadi harus dilupakan harus pikirkan pertandingan selanjutnya tegas apri setelah pertandingan kami belum puas dengan hasil ini masih ada satu pertandingan lagi final red dan harus dimenangi imbuh greysia', 'butuh sepuluh greysia poliiapriyani rahayu menembus babak final turnamen bwf tour kali india open  greysiaapriyani berhasil mencapai final mencapai partai puncak malaysia masters  india pasangan nomor delapan dunia bablas juara fenomena hebat kemarin tiket final mengalahkan pasangan korea selatan daun kim so-yeongkong hee-yong straight games - - kemenangan perdana pasangan nomor dunia lawan berbeda pasangan jepang korsel pasangan kejutan maiken fruergaardsara thygesen denmark lolosnya fruergaardthygesen final sungguh disangka perjalanannya ganda putri nomor  denmark menempati peringkat ke- dunia impresif menghajar pasangan nomor dunia yuki fukushimasayaka hirota babak  kemarin  giliran unggulan keempat peraih emas olimpiade rio  misaki matsutomoayaka takahashi dipulangkan sinyal berbahaya sara thygesen kiri maiken fruergaard mengaku takut tekanan penonton istora senayan jakarta final  bwf badminton tekanan tuan rumah tekanan fruergaard konferensi pers pertandingan melanjutkan gemuruh istora mengerikan thygesen takut beban greysiaapriyani penonton mengharapkan pemain indonesia menang main beban berusaha fruergaard kali greysiaapriyani bertemu fruergaardthygesen kemenangan berpihak indonesia tren permainan greysiaapriyani kemarin kans juara apri tampil hebat smes-smesnya keras powerful pemain  cerdik penempatan bola cover lapangan mengejar bola vitalitas clean minim error sisi greysia memperbaiki servisnya tanggung jaga kondisi sih recovery posisi - hasil dilupakan pikirkan pertandingan apri pertandingan puas hasil pertandingan final red dimenangi imbuh greysia', 'butuh puluh greysia poliiapriyani rahayu tembus babak final turnamen bwf tour kali india open  greysiaapriyani hasil capai final capai partai puncak malaysia masters  india pasang nomor delapan dunia bablas juara fenomena hebat kemarin tiket final kalah pasang korea selatan daun kim so yeongkong hee yong straight games - - menang perdana pasang nomor dunia lawan beda pasang jepang korsel pasang kejut maiken fruergaardsara thygesen denmark lolos fruergaardthygesen final sungguh sangka jalan ganda putri nomor  denmark tempat peringkat ke- dunia impresif hajar pasang nomor dunia yuk fukushimasayaka hirota babak  kemarin  gilir unggul empat raih emas olimpiade rio  misaki matsutomoayaka takahashi pulang sinyal bahaya sara thygesen kiri maiken fruergaard mengaku takut tekan tonton istora senayan jakarta final  bwf badminton tekan tuan rumah tekan fruergaard konferensi pers tanding lanjut gemuruh istora erik thygesen takut beban greysiaapriyani tonton harap main indonesia menang main beban usaha fruergaard kali greysiaapriyani bertemu fruergaardthygesen menang pihak indonesia tren main greysiaapriyani kemarin kans juara apri tampil hebat smes keras powerful main  cerdik tempat bola cover lapang kejar bola vitalitas clean minim error sisi greysia baik servis tanggung jaga kondisi sih recovery posisi - hasil lupa pikir tanding apri tanding puas hasil tanding final red menang imbuh greysia'),
(6, 1229, 'keterlibatan yasonna h laolly dalam kasus pergantian antar-waktu caleg pdip menuai banyak sorotan salah satunya dari kalangan pakar pengamat politik dari political and public policy jerry massie meminta agar yasonna h laoly lebih fokus sebagai menteri hukum dan hak asasi manusia menkumham daripada terlibat dalam pembentukan tim hukum pdip itu terkait kasus suap komisioner komisi pemilihan umum wahyu setiawan dan kaburnya harun masiku harusnya yasonna lebih fokus ke tupoksinya sebagai menkumham kata jerry di jakarta minggu menurut dia keterlibatan yasonna dalam pembelaan pdip yang membentuk tim hukum secara etika politik kurang elegan di pdip banyak kan para advokat lawyer kan bisa memberikan mereka kesempatan ujar jerry jerry melihat pdip saat ini tengah memainkan politik bela diri saat kadernya harun masiku terlibat dalam kasus dugaan suap komisioner kpu wahyu setiawan yang terkena ott oleh kpk beberapa waktu lalu jerry pun mengakui bahwa jika memiliki tugas ganda memang agak berat antara negara dan kepentingan partai di pdip yasonna menjabat sebagai ketua dpp pdip bidang bidang hukum dan perundang-undangan saran saya pak yasonna lebih fokus ke masalah hukum seperti kasus seorang pelajar yang membela pacarnya dari begal justru terancam hukuman seumur hidup dan memperbaiki lapas-lapas yang bermasalah tuturnya meskipun menurutnya belum ada uu yang melarang tugas menkumham untuk melakukan dukungan terhadap kepentingan partai terlebih yasonna menjabat ketua dpp pdip karena kan ada wakilnya yang bisa menggantikan posisinya pertanyaan saya kenapa mereka ngotot membentuk tim untuk membela partai habis-habisan semua akan terjawab dalam persidangan tipikor ujarnya sementara itu peneliti dan pengamat politik centre for strategic and international studies csis arya fernandes menilai para menteri yang telah terpilih dalam kabinet pemerintahan sebaiknya melepas jabatan yang melekat di partai untuk menghindari terjadinya konflik kepentingan di kemudian hari menurut saya sebaiknya secara etik para menteri yang berasal dari partai politik memang sebaiknya harus memilih jika fokus menjadi menteri tentu dengan melepaskan jabatan di partai politiknya ujar arya saat dihubungi antara minggu arya juga mengatakan sikap itu juga akan menimbulkan persepsi publik yang negatif terkait profesionalitas kabinet pada akhirnya sikap para menteri yang seperti ini juga akan merugikan presiden joko widodo arya pun berharap presiden memiliki peraturan untuk menterinya agar bisa profesional menjalankan tugas pemerintahan sebaiknya presiden punya kebijakan khusus untuk meminta menteri-menteri tersebut bekerja profesional sebagai pejabat publik ini untuk menghindari konflik kepentingan seperti ini ujar arya sebelumnya menteri hukum dan ham yasonna laoly memperoleh kritikan dari sejumlah pihak setelah hadir dalam konferensi pers pdi perjuangan menindaklanjuti ott kpk terkait kasus dugaan suap paw anggota dpr namun yasonna mengklarifikasi hal tersebut dengan menyebut bahwa kapasitasnya pada acara itu bukan sebagai menkumham melainkan sebagai ketua dpp pdip bidang hukum dan perundang-undangan untuk mengumumkan pembentukan tim hukum terkait kasus dugaan suap yang menjerat komisioner kpu wahyu setiawan dan politikus pdip harun masiku saya tidak ikut di tim hukum saya ketua dpp-nya membentuk tim hukum waktu kita bentuk saya umumkan itulah tugas saya tim hukum koordinatornya pak teguh samudra kata dia di yogyakarta jumat  hal ini terkait menteri hukum dan ham yasonna laoly yang memperoleh kritikan dari sejumlah pihak setelah hadir dalam konferensi pers pdi perjuangan menindaklanjuti ott kpk terkait kasus dugaan suap paw anggota dpr namun belakangan yasonna mengklarifikasi hal tersebut dengan menyebut bahwa kapasitasnya pada acara itu bukan sebagai menkumham melainkan sebagai ketua dpp pdip bidang hukum dan perundang-undangan untuk mengumumkan pembentukan tim hukum terkait kasus dugaan suap yang menjerat komisioner kpu wahyu setiawan dan politikus pdip harun ma