(7, 1230, 'tiga puluh ribu buruh bakal serbu gedung dewan perwakilan rakyat dpr senayan jakarta besok  massa buruh menuntut draf rancangan undang-undang ruu cipta lapangan kerja melalui mekanisme omnibus law didrop buruh menilai omnibus law klaster ketenagakerjaan tidak proburuh dimulai dari pembahasan yang tidak melibatkan unsur buruh hingga poin-poin yang dirasa bakal mereduksi pekerja dalam negeri sekretaris jenderal federasi serikat pekerja metal indonesia fspmi riden hatam aziz menuturkan dua hal paling krusial dalam poin omnibus law cipta lapangan kerja yakni soal hubungan kerja dan upah minimum soal hubungan kerja fleksibilitas yang digaungkan pemerintah sejatinya menyesatkan status hubungan kerja yang dipermudah malah bisa memunculkan ketidakjelasan status pekerja kontrak saja kami menolak karena tidak ada kepastian kerja apalagi sekarang fleksibel pasti lebih tidak jelas ujarnya dalam acara pernyataan bersama serikat buruh yang tergabung dalam konfederasi serikat pekerja indonesia kspi di jakarta kemarin  menyoal tentang upah minimum buruh memiliki pandangan sama skema upah per jam yang dilemparkan oleh menteri ketenagakerjaan menaker ida fauziyah justru menjerumuskan sebab dengan hitungan gaji per jam skema jaminan sosial jadi tidak jelas pasalnya selama ini jaminan sosial dihitung berdasar gaji per bulan', 'puluh ribu buruh serbu gedung dewan perwakilan rakyat dpr senayan jakarta besok  massa buruh menuntut draf rancangan undang-undang ruu cipta lapangan kerja mekanisme omnibus law didrop buruh menilai omnibus law klaster ketenagakerjaan proburuh pembahasan melibatkan unsur buruh poin-poin dirasa mereduksi pekerja negeri sekretaris jenderal federasi serikat pekerja metal indonesia fspmi riden hatam aziz krusial poin omnibus law cipta lapangan kerja hubungan kerja upah minimum hubungan kerja fleksibilitas digaungkan pemerintah sejatinya menyesatkan status hubungan kerja dipermudah memunculkan ketidakjelasan status pekerja kontrak menolak kepastian kerja fleksibel acara pernyataan serikat buruh tergabung konfederasi serikat pekerja indonesia kspi jakarta kemarin  menyoal upah minimum buruh memiliki pandangan skema upah jam dilemparkan menteri ketenagakerjaan menaker ida fauziyah menjerumuskan hitungan gaji jam skema jaminan sosial pasalnya jaminan sosial dihitung berdasar gaji', 'puluh ribu buruh serbu gedung dewan wakil rakyat dpr senayan jakarta besok  massa buruh tuntut draf rancang undang ruu cipta lapang kerja mekanisme omnibus law drop buruh nilai omnibus law klaster ketenagakerjaan proburuh bahas libat unsur buruh poin rasa reduksi kerja negeri sekretaris jenderal federasi serikat kerja metal indonesia fspmi riden hatam aziz krusial poin omnibus law cipta lapang kerja hubung kerja upah minimum hubung kerja fleksibilitas gaung perintah sejati sesat status hubung kerja mudah muncul ketidakjelasan status kerja kontrak tolak pasti kerja fleksibel acara nyata serikat buruh gabung konfederasi serikat kerja indonesia kspi jakarta kemarin  soal upah minimum buruh milik pandang skema upah jam lempar menteri ketenagakerjaan menaker ida fauziyah jerumus hitung gaji jam skema jamin sosial pasal jamin sosial hitung dasar gaji'),
(8, 1231, 'menteri hukum dan ham menkumham yasonna hamonangan laoly dinilai tidak profesional sebagai jajaran menteri kabinet indonesia maju bahkan yasonna dipandang harus diberikan sanksi terkait keterlibatannya dalam tim hukum pdi perjuangan fenomena ini menunjukkan kegagalan dari pemerintah sekarang yang tidak bisa membedakan antara kepentingan kelompok partai politik dengan kepentingan negara selain itu ini juga menunjukan betapa tidak profesional dan kompetennya para pejabat negara yang dipilih oleh jokowi kata aktivis antikorupsi erwin natosmal oemar kepada jawaposcom sabtu  bahkan erwin menilai sistem presidensial dianggap belum berhasil karena jokowi masih berada di bawah bayang-bayang partai politik dari sudut ketatanegaraan hal ini menunjukan bahwa sistem presidensial tidak berhasil posisi presiden di era jokowi masih di bawah bayang-bayang partai politik ucap erwin oleh karena itu erwin menganjurkan untuk mengembalikan kepercayaan publik yasonna harus diberi sanksi meski memang dirinya berlatarbelakang politikus pdip namun sejatinya dia merupakan menteri kabinet indonesia maju untuk mengembalikan ketidakpercayaan masyarakat kepada kepemimpinan jokowi jokowi dan menkopolhukam harus memberikan sanksi dan opsi kepada menkumham apakah jadi pejabat negara yang profesional atau pejabat partai politik pungkasnya sebelumnya menteri hukum dan ham yasonna h laoly terlihat turut mendampingi pimpinan pdi perjuangan sekjen hasto kristiyanto saat memberi pernyataan pers di kantor dpp pdip jalan diponegoro menteng jakarta pusat pada rabu  kemarin pada kesempatan itu yasonna menyampaikan dibentuknya tim hukum dpp pdip untuk meluruskan pemberitaan mengenai keterlibatan dpp pdip dalam kasus suap wahyu setiawan belakangan ini nampaknya pemberitaan sudah semakin mengarah ke mana-mana tanpa boleh kami katakan tanpa didukung oleh fakta dan data yang benar karenanya dpp menugaskan di samping kami bagian dari anggota fraksi kami juga kami menunjuk beberapa pengacara untuk menjadi tim hukum kami pungkasnya', 'menteri hukum ham menkumham yasonna hamonangan laoly dinilai profesional jajaran menteri kabinet indonesia maju yasonna dipandang sanksi terkait keterlibatannya tim hukum pdi perjuangan fenomena kegagalan pemerintah membedakan kepentingan kelompok partai politik kepentingan negara menunjukan betapa profesional kompetennya pejabat negara dipilih jokowi aktivis antikorupsi erwin natosmal oemar jawaposcom sabtu  erwin menilai sistem presidensial dianggap berhasil jokowi bayang-bayang partai politik sudut ketatanegaraan menunjukan sistem presidensial berhasil posisi presiden era jokowi bayang-bayang partai politik erwin erwin menganjurkan mengembalikan kepercayaan publik yasonna sanksi berlatarbelakang politikus pdip sejatinya menteri kabinet indonesia maju mengembalikan ketidakpercayaan masyarakat kepemimpinan jokowi jokowi menkopolhukam sanksi opsi menkumham pejabat negara profesional pejabat partai politik pungkasnya menteri hukum ham yasonna h laoly mendampingi pimpinan pdi perjuangan sekjen hasto kristiyanto pernyataan pers kantor dpp pdip jalan diponegoro menteng jakarta pusat rabu  kemarin kesempatan yasonna dibentuknya tim hukum dpp pdip meluruskan pemberitaan keterlibatan dpp pdip suap wahyu setiawan nampaknya pemberitaan mengarah mana-mana didukung fakta data dpp menugaskan samping anggota fraksi pengacara tim hukum pungkasnya', 'menteri hukum ham menkumham yasonna hamonangan laoly nilai profesional jajar menteri kabinet indonesia maju yasonna pandang sanksi kait keterlibatannya tim hukum pdi juang fenomena gagal perintah bedak penting kelompok partai politik penting negara tunjuk betapa profesional kompeten jabat negara pilih jokowi aktivis antikorupsi erwin natosmal oemar jawaposcom sabtu  erwin nilai sistem presidensial anggap hasil jokowi bayang partai politik sudut ketatanegaraan tunjuk sistem presidensial hasil posisi presiden era jokowi bayang partai politik erwin erwin anjur kembali percaya publik yasonna sanksi berlatarbelakang politikus pdip sejati menteri kabinet indonesia maju kembali ketidakpercayaan masyarakat kepemimpinan jokowi jokowi menkopolhukam sanksi opsi menkumham jabat negara profesional jabat partai politik pungkas menteri hukum ham yasonna h laoly damping pimpin pdi juang sekjen hasto kristiyanto nyata pers kantor dpp pdip jalan diponegoro menteng jakarta pusat rabu  kemarin sempat yasonna bentuk tim hukum dpp pdip lurus berita keterlibatan dpp pdip suap wahyu setiawan nampaknya berita arah mana dukung fakta data dpp tugas samping anggota fraksi acara tim hukum pungkas'),
(9, 1232, 'indonesia corruption watch icw menyesalkan pernyataan presiden joko widodo jokowi yang menyebut undang-undang nomor  tentang kpk tidak melemahkan kinerja pemberantasan korupsi padahal kpk terbukti telah melakukan operasi tangkap tangan ott terhadap bupati sidoarjo saiful ilah dan komisioner kpu wahyu setiawan pernyataan tersebut semakin menggambarkan bahwa presiden jokowi memang tidak memahami kondisi pemberantasan korupsi yang terjadi saat ini kata peneliti icw kurnia ramadhana dalam keterangannya sabtu  kurnia mengatakan adanya uu kpk hasil revisi terbukti melemahkan kinerja kpk hal ini dilihat dari gagalnya kpk melakukan penggeledahan di kantor dpp pdip padahal dengan uu kpk lama proses penggeledahan yang sifatnya mendesak bisa dilakukan tanpa harus melalui izin pengadilan negeri namun karena perubahan regulasi prosesnya semakin lambat karena mesti melalui izin dari dewan pengawas ucap kurnia kurnia tak habis pikir mengapa presiden jokowi menyebut kpk tetap kuat meski adanya revisi uu dia memandang aktor pelemahan kpk sebenarnya merupakan presiden jokowi hal terpenting adalah bahwa presiden joko widodo adalah salah satu aktor utama selain dari dpr yang membuat suram kondisi pemberantasan korupsi sesalnya sebelumnya presiden jokowi menepis soal anggapan pelemahan kinerja kpk dalam aturan barunya yaitu undang-undang nomor  tahun  dua operasi tangkap tangan ott yang dilakukan kpk terakhir disebut jokowi sebagai bukti kpk masih bertaji buktinya saya sudah sampaikan kpk melakukan ott ke bupati dan kpu meskipun komisonernya masih baru dewasnya masih baru kata jokowi di kompleks istana kepresidenan jakarta jumat ', 'indonesia corruption watch icw menyesalkan pernyataan presiden joko widodo jokowi menyebut undang-undang nomor  kpk melemahkan kinerja pemberantasan korupsi kpk terbukti operasi tangkap tangan ott bupati sidoarjo saiful ilah komisioner kpu wahyu setiawan pernyataan menggambarkan presiden jokowi memahami kondisi pemberantasan korupsi peneliti icw kurnia ramadhana keterangannya sabtu  kurnia uu kpk hasil revisi terbukti melemahkan kinerja kpk gagalnya kpk penggeledahan kantor dpp pdip uu kpk proses penggeledahan sifatnya mendesak izin pengadilan negeri perubahan regulasi prosesnya lambat mesti izin dewan pengawas kurnia kurnia habis pikir presiden jokowi menyebut kpk kuat revisi uu memandang aktor pelemahan kpk presiden jokowi terpenting presiden joko widodo salah aktor utama dpr suram kondisi pemberantasan korupsi sesalnya presiden jokowi menepis anggapan pelemahan kinerja kpk aturan barunya undang-undang nomor   operasi tangkap tangan ott kpk jokowi bukti kpk bertaji buktinya kpk ott bupati kpu komisonernya dewasnya jokowi kompleks istana kepresidenan jakarta jumat ', 'indonesia corruption watch icw sesal nyata presiden joko widodo jokowi sebut undang nomor  kpk lemah kinerja berantas korupsi kpk bukti operasi tangkap tangan ott bupati sidoarjo saiful ilah komisioner kpu wahyu setiawan nyata gambar presiden jokowi paham kondisi berantas korupsi teliti icw kurnia ramadhana terang sabtu  kurnia uu kpk hasil revisi bukti lemah kinerja kpk gagal kpk geledah kantor dpp pdip uu kpk proses geledah sifat desak izin adil negeri ubah regulasi proses lambat mesti izin dewan awas kurnia kurnia habis pikir presiden jokowi sebut kpk kuat revisi uu pandang aktor lemah kpk presiden jokowi penting presiden joko widodo salah aktor utama dpr suram kondisi berantas korupsi sesal presiden jokowi tepis anggap lemah kinerja kpk atur baru undang nomor   operasi tangkap tangan ott kpk jokowi bukti kpk taji bukti kpk ott bupati kpu komisonernya dewasnya jokowi kompleks istana presiden jakarta jumat '),
(10, 1233, 'skuad arema fc belum sepenuhnya lengkap khususnya untuk slot legiun asing saat ini baru oh in-kyun yang merapat dari total empat kuota pemain asing yang diperbolehkan di liga   artinya perburuan untuk tiga pemain makin gencar dilakukan sebelumnya arema hampir memiliki satu pemain yang menjadi incaran yakni santiago nicolas carrera namun pemain asal uruguay yang sebelumnya bermain di tim serie c italia itu batal bergabung bagi pelatih arema fc roberto carlos mario gomez untuk slot asing tersebut terbilang penting pasalnya bakal menjadi penunjang tim seperti diketahui untuk kompetisi tahun ini arema kedatangan beberapa aktor lapangan hijau yang potensial di antarannya adalah pandi lestaluhu dave musataine bagas adi nugroho sampai kushedya hari yudo jika kami mendapatkan tambahan pemain bagus saya rasa kesempatan semakin besar untuk kompetisi mendatang ungkap pria asal argentina itu nah siapa sosok yang bakal merapat ke malang baik gomez maupun manajemen singo edan seperti bersepakat masih menyembunyikan nama itu tapi mantan pelatih borneo fc menginginkan sosok yang mau bekerja keras terpenting bermain dengan karakter ungkap pria berusia  tahun itu terkait perburuan pemain asing pelatih asal argentina itu dikabarkan bakal membawa mantan anak asuhnya ke arema di antaranya jonathan bauman dan ezechiel ndouassel yang semula dilatih gomez saat masih di persib bandung gomez juga tidak memungkiri jika kualitas dua pemain itu akan cocok dengan skemanya tentang eze dan bauman mereka adalah pemain yang bagus ungkapnya meski memberikan pujian namun pelatih berusia  tahun masih enggan mengiyakan apakah bauman dan eze akan masuk skuad arema mereka memang bagus tapi tidak hanya mereka daftar pemain bagus ungkap mario sementara itu menurut sumber di internal arema bauman dan eze memang menjadi salah satu yang direkomendasi gomez namun jika tidak sesuai budget maka sangat mungkin untuk mencari sosok yang lain informasinya untuk dua striker terkendala dia angka dan administrasi terang sumber itu jadi dia menambahkan dengan kompetisi yang semakin dekat sangat besar peluang mencari sosok lainnya sudah disiapkan plan b untuk strikernya kata dia informasinya adalah penyerang belum pernah berlaga di liga  tapi secara kemampuan sudah diketahui pelatih imbuh sumber itu meski masih abu-abu namun singo edan santer dirumorkan dengan banyak nama di antaranya mantan anak asuh gomez di tim yang pernah dilatih sebelumnya di antaranya dua mantan anak asuhnya di klub liga malaysia jorge pereyra diaz dan gabriel miguel guerra sampai bojan malisic mantan pemainnya di persib bandung', 'skuad arema fc sepenuhnya lengkap slot legiun asing oh in-kyun merapat total kuota pemain asing diperbolehkan liga   perburuan pemain gencar arema memiliki pemain incaran santiago nicolas carrera pemain uruguay bermain tim serie c italia batal bergabung pelatih arema fc roberto carlos mario gomez slot asing terbilang pasalnya penunjang tim kompetisi arema kedatangan aktor lapangan hijau potensial antarannya pandi lestaluhu dave musataine bagas adi nugroho kushedya yudo tambahan pemain bagus kesempatan kompetisi pria argentina sosok merapat malang gomez manajemen singo edan bersepakat menyembunyikan nama mantan pelatih borneo fc sosok keras terpenting bermain karakter pria berusia  terkait perburuan pemain asing pelatih argentina dikabarkan membawa mantan anak asuhnya arema jonathan bauman ezechiel ndouassel dilatih gomez persib bandung gomez memungkiri kualitas pemain cocok skemanya eze bauman pemain bagus pujian pelatih berusia  enggan mengiyakan bauman eze masuk skuad arema bagus daftar pemain bagus mario sumber internal arema bauman eze salah direkomendasi gomez sesuai budget mencari sosok informasinya striker terkendala angka administrasi terang sumber kompetisi peluang mencari sosok disiapkan plan b strikernya informasinya penyerang berlaga liga  kemampuan pelatih imbuh sumber abu-abu singo edan santer dirumorkan nama mantan anak asuh gomez tim dilatih mantan anak asuhnya klub liga malaysia jorge pereyra diaz gabriel miguel guerra bojan malisic mantan pemainnya persib bandung', 'skuad arema fc sepenuh lengkap slot legiun asing oh in kyun rapat total kuota main asing boleh liga   buru main gencar arema milik main incar santiago nicolas carrera main uruguay main tim serie c italia batal gabung latih arema fc roberto carlos mario gomez slot asing bilang pasal tunjang tim kompetisi arema datang aktor lapang hijau potensial antar pandi lestaluhu dave musataine bagas adi nugroho kushedya yudo tambah main bagus sempat kompetisi pria argentina sosok rapat malang gomez manajemen singo edan sepakat sembunyi nama mantan latih borneo fc sosok keras penting main karakter pria usia  kait buru main asing latih argentina kabar bawa mantan anak asuh arema jonathan bauman ezechiel ndouassel latih gomez persib bandung gomez mungkir kualitas main cocok skema eze bauman main bagus puji latih usia  enggan iya bauman eze masuk skuad arema bagus daftar main bagus mario sumber internal arema bauman eze salah rekomendasi gomez sesuai budget cari sosok informasi striker kendala angka administrasi terang sumber kompetisi peluang cari sosok siap plan b striker informasi serang laga liga  mampu latih imbuh sumber abu singo edan santer rumor nama mantan anak asuh gomez tim latih mantan anak asuh klub liga malaysia jorge pereyra diaz gabriel miguel guerra bojan malisic mantan main persib bandung'),
(11, 1234, 'manajer timnas indonesia shin tae-yong memastikan hanya membawa  pemain seleksi timnas u- indonesia atau berkurang dua dari rencana sebelumnya  pemain untuk menjalani pemusatan latihan tc di thailand tadinya memang saya mau memilih  orang tetapi saat ini berubah menjadi  pemain saya melihat mereka memiliki kekhasan dan kemampuan berbeda di setiap posisi ujar tae-yong setelah memimpin seleksi hari terakhir di stadion wibawa mukti cikarang timur jumat ke- pemain itu akan diumumkan secara resmi dalam laman resmi pssi menurut pelatih asal korea selatan itu para pemain seleksi timnas u- memiliki kemampuan olah bola yang bagus bahkan di luar perkiraannya akan tetapi pesepak bola muda tanah air itu mempunyai kelemahan yang mencolok yaitu fisik fisik menjadi masalah terbesar kemampuan mereka memang lebih bagus dari perkiraan saya tetapi kondisi fisik mereka lebih buruk dari prediksi kata tae-yong sebanyak  pemain kelahiran  dan  mengikuti seleksi timnas u- di stadion wibawa mukti dari  sampai  januari  ke- pemain akan berangkat ke negeri gajah putih pada  januari  pada  timnas u- akan mengikuti piala aff u- yang waktunya belum ditentukan dan piala asia u-  yang digelar pada - oktober  di uzbekistan setelah itu garuda nusantara bersiap tampil pada piala dunia u- ', 'manajer timnas indonesia shin tae-yong membawa  pemain seleksi timnas u- indonesia berkurang rencana  pemain menjalani pemusatan latihan tc thailand memilih  orang berubah  pemain memiliki kekhasan kemampuan berbeda posisi tae-yong memimpin seleksi stadion wibawa mukti cikarang timur jumat ke- pemain diumumkan resmi laman resmi pssi pelatih korea selatan pemain seleksi timnas u- memiliki kemampuan olah bola bagus perkiraannya pesepak bola muda tanah air kelemahan mencolok fisik fisik terbesar kemampuan bagus perkiraan kondisi fisik buruk prediksi tae-yong  pemain kelahiran   mengikuti seleksi timnas u- stadion wibawa mukti   januari  ke- pemain berangkat negeri gajah putih  januari   timnas u- mengikuti piala aff u- ditentukan piala asia u-  digelar - oktober  uzbekistan garuda nusantara tampil piala dunia u- ', 'manajer timnas indonesia shin tae yong bawa  main seleksi timnas u- indonesia kurang rencana  main jalan pusat latih tc thailand pilih  orang ubah  main milik khas mampu beda posisi tae yong pimpin seleksi stadion wibawa mukti cikarang timur jumat ke- main umum resmi laman resmi pssi latih korea selatan main seleksi timnas u- milik mampu olah bola bagus kira sepak bola muda tanah air lemah colok fisik fisik besar mampu bagus kira kondisi fisik buruk prediksi tae yong  main lahir   ikut seleksi timnas u- stadion wibawa mukti   januari  ke- main berangkat negeri gajah putih  januari   timnas u- ikut piala aff u- tentu piala asia u-  gelar - oktober  uzbekistan garuda nusantara tampil piala dunia u- ');
