(15, 1238, 'ketua mpr bambang soesatyo mengajak pemerintah amerika serikat bersama menjaga situasi kondusif keamanan di berbagai belahan dunia tak terkecuali di kawasan semenanjung korea terlebih korea selatan dan korea utara sudah saling membuka diri di asian games  lalu yang diadakan di jakarta korea selatan dan korea utara bisa bersatu dibawah bendera unifikasi korea di tiga cabang olahraga yakni kano dayung dan basket langkah baik tersebut kata politikus yang biasa disapa bamsoet itu harus disambut dan didukung berbagai negara terutama amerika serikat reunifikasi korea akan membuat asia timur semakin damai tak hanya di asia timur ketegangan yang beberapa waktu lalu terjadi di asia tenggara terkait sikap tiongkok yang tak menghormati keputusan unclos  di laut natuna juga perlu mendapat perhatian serius dari amerika yang memiliki hak veto di perserikatan bangsa-bangsa pbb sebagai anggota tetap dewan keamanan pbb ujar bamsoet usai menerima duta besar amerika serikat untuk indonesia joseph r donovan jr di ruang kerja ketua mpr ri jakarta senin  menurut bamsoet sikap amerika serikat yang menghormati kedaulatan indonesia seharusnya juga dicontoh tiongkok ketidakpatuhan negeri tirai bambu itu terhadap hukum unclos  yang membuat ketegangan antara tiongkok dengan indonesia di laut natuna tak boleh dibiarkan karena bisa membuat preseden buruk di kemudian hari mantan ketua dpr ri - ini menekankan walaupun antara indonesia dengan amerika serikat memiliki perbedaan pandangan terkait berbagai situasi geopolitik internasional seperti situasi di iran dan palestina namun perbedaan tersebut jangan sampai mengganggu hubungan baik kedua negara yang telah terjalin erat sejak tahun  kedua negara harus tetap saling menghormati dan menghargai pandangannya masing-masing dengan tetap membuka ruang dialog untuk mencari solusi terbaik dalam mewujudkan dunia yang lebih aman dan damai paparnya dijelaskan bamsoet salah satu tujuan berbangsa dan bernegara indonesia sebagaima dituliskan dalam pembukaan uud nri  yakni ikut melaksanakan ketertiban dunia yang berdasarkan kemerdekaan perdamaian abadi dan keadilan sosial karena itu terkait kondisi di iran yang akhir-akhir ini sedang menegang kita harapkan baik iran dan amerika bisa saling menahan diri demi menjaga situasi timur tengah tetap kondusif dan menghindari kemungkinan terjadinya perang terbuka jelas bamsoet bamsoet yang merupakan wakil ketua umum kadin indonesia ini juga mengapresiasi kesepakatan mou antara amerika serikat dengan tiongkok yang ditandatangani presiden amerika serikat donald trump dan wakil perdana menteri china liu he di amerika rabu  waktu setempat mou tersebut sangat membantu meredakan ketegangan perang dagang amerika  tiongkok yang juga berdampak pada berbagai negara tak terkecuali indonesia akibat semakin tegangnya amerika dan tiongkok selama lebih kurang dua tahun ini menyebabkan penurunan pertumbuhan ekonomi global lebih dari  persen karena itu kesepakatan tersebut membawa angin segar bagi berbagai negara semakin kondusifnya perekonomian global juga akan membawa keuntungan bagi indonesia tandas bamsoet', 'ketua mpr bambang soesatyo mengajak pemerintah amerika serikat menjaga situasi kondusif keamanan belahan dunia terkecuali kawasan semenanjung korea korea selatan korea utara membuka asian games  diadakan jakarta korea selatan korea utara bersatu dibawah bendera unifikasi korea cabang olahraga kano dayung basket langkah politikus disapa bamsoet disambut didukung negara amerika serikat reunifikasi korea asia timur damai asia timur ketegangan asia tenggara terkait sikap tiongkok menghormati keputusan unclos  laut natuna perhatian serius amerika memiliki hak veto perserikatan bangsa-bangsa pbb anggota dewan keamanan pbb bamsoet menerima duta amerika serikat indonesia joseph r donovan jr ruang kerja ketua mpr ri jakarta senin  bamsoet sikap amerika serikat menghormati kedaulatan indonesia dicontoh tiongkok ketidakpatuhan negeri tirai bambu hukum unclos  ketegangan tiongkok indonesia laut natuna dibiarkan preseden buruk mantan ketua dpr ri - menekankan indonesia amerika serikat memiliki perbedaan pandangan terkait situasi geopolitik internasional situasi iran palestina perbedaan mengganggu hubungan negara terjalin erat  negara menghormati menghargai pandangannya membuka ruang dialog mencari solusi terbaik mewujudkan dunia aman damai paparnya bamsoet salah tujuan berbangsa bernegara indonesia sebagaima dituliskan pembukaan uud nri  melaksanakan ketertiban dunia berdasarkan kemerdekaan perdamaian abadi keadilan sosial terkait kondisi iran akhir-akhir menegang harapkan iran amerika menahan menjaga situasi timur kondusif menghindari perang terbuka bamsoet bamsoet wakil ketua kadin indonesia mengapresiasi kesepakatan mou amerika serikat tiongkok ditandatangani presiden amerika serikat donald trump wakil perdana menteri china liu he amerika rabu  mou membantu meredakan ketegangan perang dagang amerika  tiongkok berdampak negara terkecuali indonesia akibat tegangnya amerika tiongkok menyebabkan penurunan pertumbuhan ekonomi global  persen kesepakatan membawa angin segar negara kondusifnya perekonomian global membawa keuntungan indonesia bamsoet', 'ketua mpr bambang soesatyo ajak perintah amerika serikat jaga situasi kondusif aman belah dunia kecuali kawasan semenanjung korea korea selatan korea utara buka asi games  adakan jakarta korea selatan korea utara satu bawah bendera unifikasi korea cabang olahraga kano dayung basket langkah politikus sapa bamsoet sambut dukung negara amerika serikat reunifikasi korea asia timur damai asia timur tegang asia tenggara kait sikap tiongkok hormat putus unclos  laut natuna perhati serius amerika milik hak veto serikat bangsa pbb anggota dewan aman pbb bamsoet terima duta amerika serikat indonesia joseph r donovan jr ruang kerja ketua mpr ri jakarta senin  bamsoet sikap amerika serikat hormat daulat indonesia contoh tiongkok ketidakpatuhan negeri tirai bambu hukum unclos  tegang tiongkok indonesia laut natuna biar preseden buruk mantan ketua dpr ri - tekan indonesia amerika serikat milik beda pandang kait situasi geopolitik internasional situasi iran palestina beda ganggu hubung negara jalin erat  negara hormat harga pandang buka ruang dialog cari solusi baik wujud dunia aman damai papar bamsoet salah tuju bangsa negara indonesia sebagaima tulis buka uud nri  laksana tertib dunia dasar merdeka damai abadi adil sosial kait kondisi iran akhir tegang harap iran amerika tahan jaga situasi timur kondusif hindar perang buka bamsoet bamsoet wakil ketua kadin indonesia apresiasi sepakat mou amerika serikat tiongkok ditandatangani presiden amerika serikat donald trump wakil perdana menteri china liu he amerika rabu  mou bantu reda tegang perang dagang amerika  tiongkok dampak negara kecuali indonesia akibat tegang amerika tiongkok sebab turun tumbuh ekonomi global  persen sepakat bawa angin segar negara kondusif ekonomi global bawa untung indonesia bamsoet'),
