(26, 1249, 'andmesh kamaleng termasuk penyanyi muda berbakat yang lagu-lagunya masuk dalam top chart platform digital streaming baik video maupun audio lagu-lagunya juga masuk dalam top chart situs berbagi video youtube sepanjang tahun  lagu-lagunya masuk dalam pencarian tertinggi nama andmesh pun kini masuk dalam empat nominasi sekaligus di ajang pemberian penghargaan billboard indonesia music awards  yaitu kategori top  song the year top streaming song of the year audio top streaming song of the year video dan top radio airplay of the year lagu yang dibawakan andmesh bertajuk hanya rindu masuk dalam nominasi kategori top  song the year billboard music awards  andmesh bersaing dengan nomine lainnnya yang memiliki jam terbang di atasnya di industri hiburan tanah air seperti yovie widianto tulus glenn fredly adu rayu judika cinta karena cinta marion jola laleilmanino rayu dan budi doremi tolong pada kategori top streaming song of the year video lagu cinta luar biasa andmesh kamaleng bersaing dengan cinta karena cinta judika kartonyo medot janji denny caknan salah apa aku  ilir  dan tolong  budi doremi sementara pada kategori top streaming song of the year audio andmash kamaleng berrajuk cinta luar biasa bersaing dengan nomine yaitu yovie widianto tulus glenn fredly adu rayu judika  cinta karena cinta  marion jola laleilmanino rayu dan budi doremi tolong andmesh lewat lagu hanya rindu juga dihadapkan pada pesaing yang tidak kalah hebatnya pada kategori top radio airplay of the year karena pesaingnya adalah yovie widianto tulus glenn fredly adu rayu noah wanitaku judika cinta karena cinta dan marion jola laleilmanino rayu bisa masuk empat nominasi sekaligus di ajang pemberian penghargaan billboard music awards  andmesh kamaleng mengaku tidak percaya dia tidak pernah menyangka kalau dirinya yang merupakan penyanyi pendatang baru bisa menapat kesempatan masuk ke dalam nominasi sebanyak itu masih enggak nyangka ya tapi bangga karena top five itu empat lagunya andmesh yang