(27, 1250, 'ajang pemberian penghargaan billboard music awards  digelar untuk pertama kalinya di indonesia penghargaan ini diberikan guna mengapresiasi insan musik tanah air yang sudah bekerja keras melahirkan karya malam puncak perhelatan billboard indonesia music awards  akan dilaksanakan pada  februari  mendatang dan dimeriahkan oleh sederet penyanyi yang juga menjadi nominasi diantaranya adalah andmesh kamaleng cakra khan dan masih banyak lagi yang lainnya berbeda dari ajang pemberian penghargaan lainnya billboard indonesia music awards memasukkan daftar nominasi berdasarkan data-data yang masuk  peringkat tertinggi tangga lagu bukan hanya pada tangga lagu billboard saja tapi juga memasukkan chart lain dan juga pemeringkatan tertinggi yang diperoleh dari media sosial perbedaannya dari cara menghasilkan nominasinya kalaborasi billboard dari berbagai platform musik dikumpulkan semua datanya yang kemudian menjadi nominasi kedua mengenai periode waktu tidak hanya terpaku pada periode tertentu saja ini menariknya dan membedakan sama penghargaan yang lain malam puncaknya pada  februari dan tayang live di rcti ungkap dini putri selaku direktur program rcti dalam jumpa pers di bilangan kebon jeruk jakarta barat senin  sementara itu adib hidayat selaku editor in chief billboard indonesia mengatakan bahwa ajang pemberian penghargaan ini sengaja dibuat untuk memotivasi para penyanyi supaya mau mempromosikan lagu yang sudah dirilis sebagai barometer sebuah kesuksesan lagu adib sendiri sempat tercengang beberapa nama baru melejit di tangga lagu yang belum dikenalinya sebelumnya tentu semuanya mengacu pada apa yang sedang terjadi di luar sana chart membuat teman-teman semangat menciptakan lagu-lagu buat label juga bisa kerja keras bagaimana lagu artisnya bisa masuk tangga lagu karena semuanya sistem digital kadang kita enggak hafal tapi ketika nama-nama baru muncul orang akan langsung oh ini andmesh kamaleng atau yang lainnya tutur adib hidayat billboard indonesia music award