(28, 1251, 'menteri badan usaha milik negara bumn erick thohir telah menunjuk irfan setiaputra untuk memimpin pt garuda indonesia persero tbk menggantikan ari askhara irfan berkomitmen untuk membawa garuda menjadi perusahaan yang lebih baik lagi irfan mengatakan dirinya akan menjaga kekompakan dengan para direksi dan komisaris menurutnya keterbukaan disetiap perbedaan pendapat dapat menentukan titik tengah dalam mencari solusi terbaik untuk kemajuan perseroan saya selalu menganggap perbedaan pedapat itu karunia dan  kepala jauh lebih bagus dari  kepala saya orang mau terbuka terhadap semua inputan mestinya ngga ada yang melimit kita untuk diskusikan segala macam apapun perbedaan pendapat saya ngga bilang konfilik ya dan saya rasa di banyak perusahaan selalu ada perbedaan perbedaan pendapat yg mengedepankan azas ujarnya saat dihubungi oleh wartawan rabu  irfan menekankan apapun keputusan yang diambil oleh manajemen tidak mengganggu keselamatan atau menciptakan persepsi palsu dengan demikian keuntungan perusahaan dapat dicapai ini tanggung jawab semua karyawan ucapnya namun kata irfan dalam mengejar keuntungan tidak boleh mengorbankan faktor keselamatan dan pelayanan termasuk persoalan harga tiket jadi kita musti ketemu satu titik harga itu harus reasonable reasonable ini nggak semua orang bisa naik garuda tapi buat kita perusahaan ini bisa untung mengurangi cicilan dan mengembangkan jelasnya irfan mengaku dirinya juga tidak ingin garuda mendapat suntikan dana terus-menerus sehingga manajemen akan terus melakukan inovasi dan mencari strategi terbaik dengan tetap meraup untung dari penjualan tiket pesawat kalau perusahaan ngga untung kan mesti disuntik terus tapi sebagai ceo kok saya malu hati juga kalau begitu tapi kan banyak penumpang yang nggak peduli sama harga terutama yang kantor ya saya akan bicara dengan corporate or copilot ratusan juta dolar kok ngotot bener naik garuda murahan tutupnya', 'menteri badan usaha milik negara bumn erick thohir irfan setiaputra memimpin pt garuda indonesia persero tbk menggantikan ari askhara irfan berkomitmen membawa garuda perusahaan irfan menjaga kekompakan direksi komisaris menurutnya keterbukaan disetiap perbedaan pendapat menentukan titik mencari solusi terbaik kemajuan perseroan menganggap perbedaan pedapat karunia  kepala bagus  kepala orang terbuka inputan mestinya ngga melimit diskusikan apapun perbedaan pendapat ngga bilang konfilik ya perusahaan perbedaan perbedaan pendapat yg mengedepankan azas dihubungi wartawan rabu  irfan menekankan apapun keputusan diambil manajemen mengganggu keselamatan menciptakan persepsi palsu keuntungan perusahaan dicapai tanggung karyawan irfan mengejar keuntungan mengorbankan faktor keselamatan pelayanan harga tiket musti ketemu titik harga reasonable reasonable nggak orang garuda perusahaan untung mengurangi cicilan mengembangkan irfan mengaku garuda suntikan dana terus-menerus manajemen inovasi mencari strategi terbaik meraup untung penjualan tiket pesawat perusahaan ngga untung mesti disuntik ceo malu hati penumpang nggak peduli harga kantor ya bicara corporate or copilot ratusan juta dolar ngotot bener garuda murahan tutupnya', 'menteri badan usaha milik negara bumn erick thohir irfan setiaputra pimpin pt garuda indonesia persero tbk ganti ari askhara irfan komitmen bawa garuda usaha irfan jaga kompak direksi komisaris turut keterbukaan disetiap beda dapat tentu titik cari solusi baik maju persero anggap beda dapat karunia  kepala bagus  kepala orang buka inputan mesti ngga limit diskusi apa beda dapat ngga bilang konfilik ya usaha beda beda dapat yg mengedepankan azas hubung wartawan rabu  irfan tekan apa putus ambil manajemen ganggu selamat cipta persepsi palsu untung usaha capai tanggung karyawan irfan kejar untung korban faktor selamat layan harga tiket musti ketemu titik harga reasonable reasonable nggak orang garuda usaha untung kurang cicil kembang irfan mengaku garuda suntik dana terus manajemen inovasi cari strategi baik raup untung jual tiket pesawat usaha ngga untung mesti suntik ceo malu hati tumpang nggak peduli harga kantor ya bicara corporate or copilot ratus juta dolar ngotot bener garuda murah tutup'),
(29, 1252, 'abduh lestaluhu dan angga saputra sejatinya sudah bergabung dengan persebaya surabaya kedua pemain itu sudah melakukan teken kontrak bahkan keduanya juga sudah menerima uang dari manajemen green force julukan persebaya tapi abduh dan angga memilih bertahan di tira persikabo bogor bahkan abduh sempat memposting tanda tangan perpanjangan kontrak dengan tira persikabo di akun instagram-nya postingan tersebut kini sudah dihapus apakah itu sinyal kalau angga dan abduh ke persebaya persebaya surabaya sejauh ini masih proses semoga dalam satu atau dua hari ke depan ada kejelasan soal status mereka kata ram surahman sekretaris persebaya ram menegaskan sejauh ini manajemen green force tak melakukan pelanggaran dalam proses kontrak dua pemain itu dalam regulasi disebutkan bahwa setiap tim bisa melakukan negosiasi dengan pemain yang tinggal menyisakan satu bulan masa kontrak dengan klubnya kebetulan persebaya melakukan negosiasi dalam masa tersebut artinya kan tidak ada masalah hanya saya nggak bisa buka kapan tanggal pastinya kami melakukan tanda tangan kontrak jelas ram saat ini pihak persebaya sudah menjalin komunikasi dengan seluruh elemen untuk kembali mendapatkan dua pemain itu sebab tidak mudah bisa menyelesaikan permasalahan tersebut yang jelas kami sudah menjalin komunikasi dengan manajemen tira persikabo termasuk dengan atasan abduh di kesatuannya terang ram ram berharap proses transfer dua pemain ini segera rampung sebab persebaya berencana melakukan launching tim pada awal bulan depan di sisi lain pihak tira persikabo melalui direktur pengembangan bisnis rhendie arindra menegaskan sampai sekarang belum ada kesepakatan apapun dengan persebaya soal kedua pemain tersebut namun rhendie membenarkan jika kemarin  pihaknya dan persebaya bertemu di jakarta kedua belah pihak membahas soal abduh dan angga tapi tidak menyepakati apapun ya tegasnya artinya rhendie secara tegas menyatakan kalau kedua pemain tersebut masih milik timnya kedua pemain tersebut sudah dikontrak secara resmi untuk satu musim ke depan bahkan sudah ikut latihan dalam rangka persiapan menuju liga   abduh dan angga masih pemain kami itu yang benar katanya', 'abduh lestaluhu angga saputra sejatinya bergabung persebaya surabaya pemain teken kontrak menerima uang manajemen green force julukan persebaya abduh angga memilih bertahan tira persikabo bogor abduh memposting tanda tangan perpanjangan kontrak tira persikabo akun instagram-nya postingan dihapus sinyal angga abduh persebaya persebaya surabaya proses semoga kejelasan status ram surahman sekretaris persebaya ram manajemen green force pelanggaran proses kontrak pemain regulasi tim negosiasi pemain tinggal menyisakan kontrak klubnya persebaya negosiasi nggak buka tanggal pastinya tanda tangan kontrak ram persebaya menjalin komunikasi elemen pemain mudah menyelesaikan permasalahan menjalin komunikasi manajemen tira persikabo atasan abduh kesatuannya terang ram ram berharap proses transfer pemain rampung persebaya berencana launching tim sisi tira persikabo direktur pengembangan bisnis rhendie arindra kesepakatan apapun persebaya pemain rhendie membenarkan kemarin  persebaya bertemu jakarta belah membahas abduh angga menyepakati apapun ya rhendie pemain milik timnya pemain dikontrak resmi musim latihan rangka persiapan liga   abduh angga pemain', 'abduh lestaluhu angga saputra sejati gabung persebaya surabaya main teken kontrak terima uang manajemen green force juluk persebaya abduh angga pilih tahan tira persikabo bogor abduh memposting tanda tangan panjang kontrak tira persikabo akun instagram nya postingan hapus sinyal angga abduh persebaya persebaya surabaya proses moga jelas status ram surahman sekretaris persebaya ram manajemen green force langgar proses kontrak main regulasi tim negosiasi main tinggal sisa kontrak klub persebaya negosiasi nggak buka tanggal pasti tanda tangan kontrak ram persebaya jalin komunikasi elemen main mudah selesai masalah jalin komunikasi manajemen tira persikabo atas abduh satu terang ram ram harap proses transfer main rampung persebaya rencana launching tim sisi tira persikabo direktur kembang bisnis rhendie arindra sepakat apa persebaya main rhendie benar kemarin  persebaya bertemu jakarta belah bahas abduh angga sepakat apa ya rhendie main milik tim main kontrak resmi musim latih rangka siap liga   abduh angga main'),
(30, 1253, 'juara dunia junior  leo rolly carnandodaniel marthin menjalani debutnya pada ajang super  dengan baik leodaniel yang sekarang menempati ranking  dunia itu lolos ke babak utama thailand masters  via kemenangan atas ganda putra tuan rumah maneepong jongjitkrit tantianankul dalam rubber game dengan skor - - - pada babak pertama besok  leodaniel akan menghadapi rekannya sesama pemain pelatnas pbsi mohammad reza pahlevi isfahanisabar karyaman gutama kami sudah sama-sama tahu permainannya yang penting besok harus lebih fight dan siap lagi harus all out kata daniel dalam siaran pers pp pbsi yang diterima jawa pos target kami ingin mengeluarkan permainan terbaik saja dulu fokus setiap babak dan jangan lengah dari lawan imbuh leo pertandingan babak kualifikasi di indoor stadium huamark bangkok hari ini  berlangsung ketat leodaniel baru bisa menang dalam tempo  menit pada game pertama leodaniel sempat tertinggal - namun mereka berhasil mencetak lima angka beruntun dan unggul - pertandingan kemudian menjadi intens jongjittantianankul sempat mencapai game point lebih dulu dalam kondisi - namun leodaniel membalik dan memimpin - pertandingan semakin menegangkan adu setting terjadi namun jongjittantianankul berhasil mengambil momentum menang untuk merebut game pertama dalam keunggulan - pada game kedua leodaniel tidak memberikan kesempatan bagi lawan untuk berkembang sejak awal mereka terus unggul dalam perolehan angka dan mengambil game kedua dengan nyaman pada game penentuan leodaniel sempat tertekan dan tertinggal - namun mereka dengan sabar terus mencetak angka dan akhirnya bisa menyamakan kedudukan dalam posisi - setelah itu kejar-mengejar poin terjadi dan sejak unggul - leodaniel tidak pernah lagi tertinggal dari lawan mereka akhirnya mampu memenangkan pertandingan dan merebut tiket babak utama bolanya di sini berat lawannya juga nggak gampang mati mereka kuat apalagi salah satu pemainnya tadi juga senior jongjit berusia  tahun red sudah banyak pengalamannya kata daniel selain bolanya berat di sini lapangan juga ada angin terus mereka juga main defensenya bagus tambah leo', 'juara dunia junior  leo rolly carnandodaniel marthin menjalani debutnya ajang super  leodaniel menempati ranking  dunia lolos babak utama thailand masters  via kemenangan ganda putra tuan rumah maneepong jongjitkrit tantianankul rubber game skor - - - babak besok  leodaniel menghadapi rekannya pemain pelatnas pbsi mohammad reza pahlevi isfahanisabar karyaman gutama permainannya besok fight all out daniel siaran pers pp pbsi diterima jawa pos target mengeluarkan permainan terbaik fokus babak lengah lawan imbuh leo pertandingan babak kualifikasi indoor stadium huamark bangkok  ketat leodaniel menang tempo  menit game leodaniel tertinggal - berhasil mencetak angka beruntun unggul - pertandingan intens jongjittantianankul mencapai game point kondisi - leodaniel membalik memimpin - pertandingan menegangkan adu setting jongjittantianankul berhasil mengambil momentum menang merebut game keunggulan - game leodaniel kesempatan lawan berkembang unggul perolehan angka mengambil game nyaman game penentuan leodaniel tertekan tertinggal - sabar mencetak angka menyamakan kedudukan posisi - kejar-mengejar poin unggul - leodaniel tertinggal lawan memenangkan pertandingan merebut tiket babak utama bolanya berat lawannya nggak gampang mati kuat salah pemainnya senior jongjit berusia  red pengalamannya daniel bolanya berat lapangan angin main defensenya bagus leo', 'juara dunia junior  leo rolly carnandodaniel marthin jalan debut ajang super  leodaniel tempat ranking  dunia lolos babak utama thailand masters  via menang ganda putra tuan rumah maneepong jongjitkrit tantianankul rubber game skor - - - babak besok  leodaniel hadap rekan main pelatnas pbsi mohammad reza pahlevi isfahanisabar karyaman gutama main besok fight all out daniel siar pers pp pbsi terima jawa pos target keluar main baik fokus babak lengah lawan imbuh leo tanding babak kualifikasi indoor stadium huamark bangkok  ketat leodaniel menang tempo  menit game leodaniel tinggal - hasil cetak angka untun unggul - tanding intens jongjittantianankul capai game point kondisi - leodaniel balik pimpin - tanding tegang adu setting jongjittantianankul hasil ambil momentum menang rebut game unggul - game leodaniel sempat lawan kembang unggul oleh angka ambil game nyaman game tentu leodaniel tekan tinggal - sabar cetak angka samak keduduk posisi - kejar poin unggul - leodaniel tinggal lawan menang tanding rebut tiket babak utama bola berat lawan nggak gampang mati kuat salah main senior jongjit usia  red alam daniel bola berat lapang angin main defensenya bagus leo'),
(31, 1254, 'kasus siswa sma yang membunuh begal di malang terdengar sampai jakarta kasus yang hari ini memasuki sidang pembacaan tuntutan itu bahkan mendapat atensi dari jaksa agung st burhanuddin dia menyatakan jaksa hanya akan menuntut za inisial siswa sma itu dengan hukuman dikembalikan ke orang tuanya pernyataan tersebut disampaikan burhanuddin setelah rapat kerja dengan komisi iii di gedung dpr kemarin  dia menyatakan pembunuhan itu terjadi karena za berusaha membela diri namun za tidak dalam keadaan terpaksa penuh sebab kata dia sebenarnya si begal tidak punya keinginan memerkosa pacar za namun za kadung membawa senjata tajam senjata itulah yang digunakan pelajar tersebut untuk membela diri dan menghabisi korban burhanuddin menegaskan bahwa kejaksaan tidak menahan za menurut dia hari ini ada pembacaan tuntutan dari jaksa penuntut umum jpu tuntutannya juga akan kami kembalikan ke orang tuanya tegasnya sementara itu kemarin  diadakan sidang tertutup di ruang sidang anak pengadilan negeri kepanjen agendanya mendengarkan keterangan saksi-saksi salah seorang saksi adalah vn teman perempuan za yang berada di lokasi kejadian saat ditemui seusai sidang vn kembali menceritakan peristiwa tersebut semua berawal pada  september  saat itu za dan vn selesai menonton konser musik di stadion kanjuruhan perempuan kelahiran  itu menerangkan waktu kejadian sekitar pukul  di ladang tebu serangan gondanglegi malang za memilih jalur alternatif untuk pulang jalur tersebut dianggap lebih cepat lantaran aksesnya lebih enak namun jalan itu sepi melewati ladang tebu katanya pada saat itulah mereka dibuntuti empat orang yang mengendarai dua motor para pelaku langsung memepet dan memaksa za menepikan motornya kemudian pelaku merampas handphone dan motor korban handphone mas za sudah diberikan karena diancam cerita vn dua pelaku yakni misnan dan aliwafa hendak merampas motor za di situ saya inget betul saya juga diancem-ancem mau diperkosa jelas dia mendengar ancaman pemerkosaan itu za yang semula menurut akhirnya melawan dia mengambil pisau dapur yang berada di jok motor pisau itu ditusukkan ke misnan za lalu ganti mengancam aliwafa ndredeg gak keruan mas aku langsung ambil motornya untuk ditarik ke belakang karena disuruh mas za jelas vn menurut dia za tidak tahu bahwa misnan akhirnya meninggal dunia ', 'siswa sma membunuh begal malang terdengar jakarta memasuki sidang pembacaan tuntutan atensi jaksa agung st burhanuddin jaksa menuntut za inisial siswa sma hukuman dikembalikan orang tuanya pernyataan burhanuddin rapat kerja komisi iii gedung dpr kemarin  pembunuhan za berusaha membela za terpaksa penuh si begal memerkosa pacar za za kadung membawa senjata tajam senjata pelajar membela menghabisi korban burhanuddin kejaksaan menahan za pembacaan tuntutan jaksa penuntut jpu tuntutannya kembalikan orang tuanya kemarin  diadakan sidang tertutup ruang sidang anak pengadilan negeri kepanjen agendanya mendengarkan keterangan saksi-saksi salah saksi vn teman perempuan za lokasi kejadian ditemui sidang vn menceritakan peristiwa  september  za vn selesai menonton konser musik stadion kanjuruhan perempuan kelahiran  menerangkan kejadian  ladang tebu serangan gondanglegi malang za memilih jalur alternatif pulang jalur dianggap cepat lantaran aksesnya enak jalan sepi melewati ladang tebu dibuntuti orang mengendarai motor pelaku langsung memepet memaksa za menepikan motornya pelaku merampas handphone motor korban handphone mas za diancam cerita vn pelaku misnan aliwafa merampas motor za situ inget diancem-ancem diperkosa mendengar ancaman pemerkosaan za melawan mengambil pisau dapur jok motor pisau ditusukkan misnan za ganti mengancam aliwafa ndredeg gak keruan mas langsung ambil motornya ditarik disuruh mas za vn za misnan meninggal dunia ', 'siswa sma bunuh begal malang dengar jakarta masuk sidang baca tuntut atensi jaksa agung st burhanuddin jaksa tuntut za inisial siswa sma hukum kembali orang tua nyata burhanuddin rapat kerja komisi iii gedung dpr kemarin  bunuh za usaha bela za paksa penuh si begal perkosa pacar za za kadung bawa senjata tajam senjata ajar bela habis korban burhanuddin jaksa tahan za baca tuntut jaksa tuntut jpu tuntut kembali orang tua kemarin  adakan sidang tutup ruang sidang anak adil negeri kepanjen agenda dengar terang saksi salah saksi vn teman perempuan za lokasi jadi temu sidang vn cerita peristiwa  september  za vn selesai tonton konser musik stadion kanjuruhan perempuan lahir  terang jadi  ladang tebu serang gondanglegi malang za pilih jalur alternatif pulang jalur anggap cepat lantar akses enak jalan sepi lewat ladang tebu buntut orang kendara motor pelaku langsung mepet paksa za tepik motor pelaku rampas handphone motor korban handphone mas za ancam cerita vn pelaku misnan aliwafa rampas motor za situ inget diancem ancem perkosa dengar ancam perkosa za lawan ambil pisau dapur jok motor pisau tusuk misnan za ganti ancam aliwafa ndredeg gak keruan mas langsung ambil motor tarik suruh mas za vn za misnan tinggal dunia '),
(32, 1255, 'kementerian komunikasi dan informatika kemenkominfo mengajak operator seluler bank dan masyarakat selaku pengguna untuk lebih waspada dan berhati-hati hal tersebut berkaitan dengan modus penipuan registrasi kartu dan menggunakan penggantian subscriber identity module sim atau kartu sim hal tersebut disampaikan menkominfo johnny gplate setelah beredar upaya pembobolan rekening bank melalui pergantian sim card yang dialami salah satu pengguna layanan seluler indosat ooredoo beberapa waktu lalu direktur jenderal aplikasi informatika aptika kemenkominfo semuel abrijani pangerapan mengatakan bahwa perlu suatu kehati-hatian dalam melakukan registrasi ataupun pergantian kartu sim kalau kita lihat dari kasus yang teman-teman ketahui ini adalah suatu rangkaian tidak bisa satu saja yang bisa menjadi wujud permasalahan semuel dalam konferensi pers terkait pembobolan rekening bank melalui pergantian sim card di gedung kemenkominfo jakarta rabu  pria yang akrab disapa semmy itu juga menyebut kasus ini adalah salah satu dari banyak kasus serupa yang mengemuka dan perlu diwaspadai ini adalah pembelajaran bagi kita semua baik bagi operator bank terkait dan juga masyarakat bahwa di era digital ini makin banyak kegiatan-kegiatan yang bisa mencari kelemahan-kelemahan dari pada sistem yang ada ini adalah suatu pembelajaran bagi kita dan untuk perbaikan untuk semuanya jelasnya lebih lanjut semmy menambahkan kemenkominfo dan brti telah mengeluarkan surat edaran kepada operator seluler untuk kembali mengingatkan lebih berhati-hati dalam menyikapi persoalan yang terjadi kami dari kominfo dan juga dari pihak brti sudah mengeluarkan surat edaran untuk mengingatkan kembali kepada operator untuk selalu berhati-hati menerapkan kehati-hatian dalam melakukan registrasi apabila terjadi proses pergantian sim card yang dibutuhkan oleh konsumennya imbuhnya di wilayah regulasi katanya pemerintah juga sebenarnya sudah mempunyai aturan terkait tata kelola registrasi dan pergantian sim card yakni peraturan menteri nomor  tahun  yang sudah diperbaharui menjadi peraturan pemerintah nomor  tahun  terkait registrasi pelanggan jasa telekomunikasi dalam kesempatan yang sama komisioner brti i ketut prihadi kresna menyatakan kalau pihaknya akan memperketat sop terkait mekanisme pergantian kartu sim pascabayar berkaca pada kasus pembobolan rekening bank melalui pergantian kartu sim ketut menyatakan brti dalam waktu dekat akan melakukan evaluasi bersama operator untuk mekanisme penggantian kartu kalau memang ada celah bisa tidak dilakukan standarisasi untuk sistem keamanan yang ada jadi tidak hanya berdasarkan kepada satu identitas tapi lebih dari satu identitas untuk bisa menutup celah-celah keamanan tadi ungkapnya terkait dengan carut marut registrasi sim dengan melibatkan data kependudukan berupa ktp atau kk dirinya tak memungkiri bahwa memang masih banyak kebocoran terkait penggunaan data orang lain kita sudah bicara dengan operator ini saya minta untuk lebih ketat tegasnya', 'kementerian komunikasi informatika kemenkominfo mengajak operator seluler bank masyarakat pengguna waspada berhati-hati berkaitan modus penipuan registrasi kartu penggantian subscriber identity module sim kartu sim menkominfo johnny gplate beredar upaya pembobolan rekening bank pergantian sim card dialami salah pengguna layanan seluler indosat ooredoo direktur jenderal aplikasi informatika aptika kemenkominfo semuel abrijani pangerapan kehati-hatian registrasi pergantian kartu sim lihat teman-teman ketahui rangkaian wujud permasalahan semuel konferensi pers terkait pembobolan rekening bank pergantian sim card gedung kemenkominfo jakarta rabu  pria akrab disapa semmy menyebut salah mengemuka diwaspadai pembelajaran operator bank terkait masyarakat era digital kegiatan-kegiatan mencari kelemahan-kelemahan sistem pembelajaran perbaikan semmy kemenkominfo brti mengeluarkan surat edaran operator seluler berhati-hati menyikapi kominfo brti mengeluarkan surat edaran operator berhati-hati menerapkan kehati-hatian registrasi proses pergantian sim card dibutuhkan konsumennya imbuhnya wilayah regulasi pemerintah aturan terkait tata kelola registrasi pergantian sim card peraturan menteri nomor   diperbaharui peraturan pemerintah nomor   terkait registrasi pelanggan jasa telekomunikasi kesempatan komisioner brti i ketut prihadi kresna memperketat sop terkait mekanisme pergantian kartu sim pascabayar berkaca pembobolan rekening bank pergantian kartu sim ketut brti evaluasi operator mekanisme penggantian kartu celah standarisasi sistem keamanan berdasarkan identitas identitas menutup celah-celah keamanan terkait carut marut registrasi sim melibatkan data kependudukan ktp kk memungkiri kebocoran terkait penggunaan data orang bicara operator ketat', 'menteri komunikasi informatika kemenkominfo ajak operator seluler bank masyarakat guna waspada hati kait modus tipu registrasi kartu ganti subscriber identity module sim kartu sim menkominfo johnny gplate edar upaya bobol rekening bank ganti sim card alami salah guna layan seluler indosat ooredoo direktur jenderal aplikasi informatika aptika kemenkominfo semuel abrijani pangerapan hati registrasi ganti kartu sim lihat teman tahu rangkai wujud masalah semuel konferensi pers kait bobol rekening bank ganti sim card gedung kemenkominfo jakarta rabu  pria akrab sapa semmy sebut salah mengemuka waspada pembelajaran operator bank kait masyarakat era digital kegiatan cari kelemahan sistem pembelajaran baik semmy kemenkominfo brti keluar surat edar operator seluler hati sikap kominfo brti keluar surat edar operator hati terap hati registrasi proses ganti sim card butuh konsumen imbuh wilayah regulasi perintah atur kait tata kelola registrasi ganti sim card atur menteri nomor   baharu atur perintah nomor   kait registrasi langgan jasa telekomunikasi sempat komisioner brti i ketut prihadi kresna ketat sop kait mekanisme ganti kartu sim pascabayar kaca bobol rekening bank ganti kartu sim ketut brti evaluasi operator mekanisme gan