(33, 1256, 'anda yang bermain aplikasi kencan online sebaiknya berhati-hati pasalnya lebih dari  ribu foto perempuan pengguna tinder dibagikan tanpa izin pada suatu forum kejahatan siber hal ini berpotensi merugikan pengguna dalam jangka panjang dalam hal penipuan dan pelanggaran privasi dikutip dari fox business  aaron devera peneliti di cybersecurity white ops mengatakan telah menemukan hampir  ribu foto pengguna tinder di website yang biasa dikenal sebagai trading malware data sejenis ini umumnya menarik para penipu biasa digunakan sebagai koleksi akun palsu untuk meyakinkan korban di platform lain ujar devera stalker atau penguntit biasanya menggunakan cara yang lebih tertarget dalam upaya untuk menambah koleksi data yang digunakan secara individu sambungnya devera mengatakan kepada gizmodo bahwa foto-foto tersebut itu dikaitkan dengan file teks yang berisi sekitar  id pengguna tinder untuk sementara mengubah kata sandi akun dapat menjadi langkah awal untuk melindungi privasi pengguna tinder lebih lanjut belum diketahui secara pasti apakah tinder menginformasikan pengguna yang terkena kejahatan siber ini', 'bermain aplikasi kencan online berhati-hati pasalnya  ribu foto perempuan pengguna tinder dibagikan izin forum kejahatan siber berpotensi merugikan pengguna jangka penipuan pelanggaran privasi dikutip fox business  aaron devera peneliti cybersecurity white ops menemukan  ribu foto pengguna tinder website dikenal trading malware data sejenis menarik penipu koleksi akun palsu korban platform devera stalker penguntit tertarget upaya menambah koleksi data individu sambungnya devera gizmodo foto-foto dikaitkan file teks berisi  id pengguna tinder mengubah sandi akun langkah melindungi privasi pengguna tinder tinder menginformasikan pengguna terkena kejahatan siber', 'main aplikasi kencan online hati pasal  ribu foto perempuan guna tinder bagi izin forum jahat siber potensi rugi guna jangka tipu langgar privasi kutip fox business  aaron devera teliti cybersecurity white ops temu  ribu foto guna tinder website kenal trading malware data jenis tarik tipu koleksi akun palsu korban platform devera stalker kuntit target upaya tambah koleksi data individu sambung devera gizmodo foto kait file teks isi  id guna tinder ubah sandi akun langkah lindung privasi guna tinder tinder informasi guna kena jahat siber');
