(34, 1257, 'qualcomm technologies resmi mengumumkan peluncuran tiga mobile platform terbaru yakni qualcomm snapdragon g  dan  ketiga mobile platform tersebut mendukung konektivitas cepat g menggunakan fitur kunci wi-fi  dan bluetooth  selain itu terintegrasi dengan teknologi audio qualcomm fastconnect dan masih banyak lagi vice president product management qualcomm technologies inc kedar kondap mengatakan pengguna ponsel pintar saat ini menginginkan konektivitas yang cepat tanpa batas fitur-fitur canggih dan baterai yang tahan lama perluasan portofolio g kami membuat mitra kami dapat menawarkan solusi canggih yang memenuhi permintaan dunia dan memberikan pengalaman gaming yang luar biasa di berbagai lapisan dan segmen harga ujarnya dalam keterangan tertulisnya kepada jawaposcom selain itu ketiga chipset tersebut juga menjadi yang pertama kalinya didukung qualcomm location suite yang didukung hingga tujuh satelit secara bersamaan di perangkat seluler termasuk di dalamnya penggunaan semua satelit operasi navic untuk lokasi yang lebih akurat penguncian lokasi awal atau ttff time-to-first-fix yang lebih cepat dan peningkatan layanan berbasis lokasi agar lebih akurat perangkat berbasis snapdragon g diharapkan tersedia secara komersial pada q  dan perangkat berbasis snapdragon  dan  diperkirakan akan tersedia secara komersial pada akhir  snapdragon g chipset ini hadir dengan fitur-fitur qualcomm snapdragon elite gaming kemampuan fotografi atau video yang ditingkatkan dan kinerja yang diklaim lebih cerdas memanfaatkan fitur snapdragon elite gaming dari platform mobile kelas premium snapdragon g menghadirkan permainan game hdr yang disebut lebih baik dari qualcomm aptx adaptive selain bermain game konten video hdr dan streaming video super-smooth dengan qualcomm spectra l isp image signal processor juga diklaim hadir pada chipset ini user nantinya juga dapat mengambil video k atau mengambil foto hingga besaran  megapiksel snapdragon g juga menghadirkan qualcomm ai engine generasi kelima terbaru dengan qualcomm hexagon tensor accelerator yang ditingkatkan dan memungkinkan sejumlah pengalaman ai baru untuk gaming fotografi voice assistant dan kesadaran kontekstual yang always on selain itu dengan subsistem fastconnect  snapdragon g dapat menggandakan kecepatan dan jangkauan wifi untuk permainan dan penelusuran website chipset g juga menghadirkan fitur utama dari wifi  seperti penggunaan antena  dengan mimo multi target wake time untuk efisiensi daya hingga  persen dan rangkaian keamanan wpa yang lengkap bluetooth  terintegrasi dengan kemampuan audio canggih user disebut akan merasakan penghematan daya dan peningkatan kinerja hal itu karena proses teknologi nm snapdragon g dan arsitektur cpu yang ditingkatkan snapdragon  untuk pertama kalinya snapdragon  menghadirkan kemampuan kamera dan ai yang menakjubkan ke seri  dengan menampilkan qualcomm spectra t terbaru yang mendukung konfigurasi tiga kamera baru dan peralihan yang mulus di antara keduanya isp yang lebih kuat akan mendukung pengambilan foto dalam format heif high efficiency image file untuk kualitas gambar yang menakjubkan dengan ukuran setengahnya penambahan pada qualcomm ai engine generasi ketiga dengan hexagon vector extensions dan qualcomm spectra t juga disebut akan memberikan pengalaman pengguna berbasis ai seperti avatar fotografi malam dan otentikasi wajah serta suara snapdragon  juga dilengkapi snapdragon x lte modem baru dengan kecepatan unduh hingga  mbps berkat -carrier aggregation  mimo dan modulasi -qam dengan kecepatan unggah hingga  mbps snapdragon  pada seri chipset ekonomis dikatakan merupakan lompatan besar dalam kinerja pada semua seri  chipset seri  digadang-gadang membawa banyak peningkatan dalam segi konektivitas ai dan kamera untuk pasar ponsel pintar generasi selanjutnya untuk pertama kalinya dalam seri  snapdragon  menampilkan performa cpu dan arsitektur gpu yang diperbarui masing-masing menghasilkan peningkatan hingga  persen untuk inti cpu dan  persen 