(40, 1263, 'beberapa hari lalu realme meluncurkan realme i varian paling murah di antara keluarga realme  series lainnya yang sudah hadir lebih dulu perangkat dijual dengan harga yang terbilang sangat terjangkau hal tersebut merujuk kepada spesifikasi jeroan realme i yang ditopang oleh system on chip soc qualcomm snapdragon  menariknya perangkat dengan jeroan yang sama dari kompetitor realme i adalah redmi note  reguler redmi note  juga menjadi device yang terang-terangan diadu spesifikasinya oleh realme indonesia kala peluncuran realme i pada rabu  lalu handset tersebut hadir lebih dulu dari realme i dengan tawaran harga yang sedikit lebih mahal dari realme i oleh karenanya jawaposcom ingin mengadu teknis keduanya realme i vs redmi note  tawaram chipset yang sama dengan rentang harga berbeda performa dan dapur pacu pertama mengawali langkah yang paling penting pada adu teknis kali ini yakni sektor jeroan kami akan mulai dari urusan jeroan atau dapur pacu lengkap dengan performanya sebagai permulaan kami memulai lebih dahulu dari realme i sebagai perangkat yang paling anyar baru kemudian redmi note  dari sektor dapur pacu realme i membawa bekal prosesor bikinan qualcomm yakni snapdragon snapdragon  aie atau artificial intelligence engine sebagai informasi perangkat dengan jargon quad camera battery king ini hadir dengan snapdragon  yang diproduksi dalam fabrikasi  nm dan arsitektur delapan inti kryo masih untuk urusan performa chipset qualcomm snapdragon  aie membawa detail performa octa-core  ghz kryo  gold   ghz kryo  silver mendukung keandalan perangkat realme i dilengkapi pula gpu adreno  untuk menjamin kinerja grafis yang lancar mendukung keandalan performa handset ini hadir dengan pilihan ramrom  gb  gb dan  gb tenang jika memori internalnya kurang kamu bisa menambahkan penyimpanannya menggunakan microsd hingga  gb urusan kantong perangkat ini ditawarkan dengan harga masing-masing varian yakni rp  jutaan rp  jutaan dan rp  jutaan untuk varian ramrom  gb  gb dan  gb beralih ke produk selanjutnya yakni redmi note  handset yang resmi melenggang di indonesia pada  oktober lalu ini datang dalam tiga varian penyimpanan ramrom juga redmi note  ditawarkan dengan harga mulai rp  jutaan untuk varian ramrom  gb kemudian banderol rp  jutaan untuk model  gb dan rp  jutaan untuk model paling tinggi dengan ramrom  gb dari sektor performa dan dapur pacunya di atas kertas realme i dengan redmi note  tampak imbang keduanya ditawarkan dengan jeroan yang sama dengan kemampuan yang sama yakni snapdragon  aie dengan proses fabrikasi  nm dan arsitektur delapan inti kryo smartphone xiaomi redmi note  pro rian alfiantojawaposcom layar dan desain aspek kedua yang juga kami bandingkan antara realme i dengan redmi note  adalah layar dan desain dari segi layar keduanya terdapat kesamaan keduanya sama-sama mengusung layar bertakik atau notch berbentuk serupa huruf v dengan gaya tetesan air di ujung tengah bagian atas layarnya sebagai rumah dari kamera selfie-nya dimulai dari realme i perangkat yang bersangkutan hadir dengan layar water drop notch  inci yang menyajikan rasio screen-to-body sebesar  persen yang menghasilkan tampilan lebar layar realme  memiliki aspek rasio  dengan resolusi hd plus dengan  x  piksel masih di bagian layar material layar realme i masih sama dengan realme series sebelumnya yakni ips lcd capacitive touchscreen  m colors secara garis besar layarnya terbilang tajam dan terang dengan kemampuan menangkal sinar matahari yang baik dan cukup cerah beralih ke redmi note  handset tersebut kurang lebih sama dengan realme i untuk sektor layar yakni melenggang dengan layar ips lcd  m colors bedanya terletak pada ukurannya yakni hanya  inci saja sementara realme i memiliki ukuran yang sedikit lebih luas sebesar  inci dari sektor layar keduanya juga sama-sama bisa tampil baik bergeser ke bagian belakang kedua perangkat yang kami bandingkan juga sama-sama hadir dengan desain kekinian yang kinclong namun untuk urusan desain realme i tampak lebih segar jika kini dibandingkan dengan redmi note  realme i di bagian belakang hadir dengan sentuhan warna baru yang unik finishing-nya tetap berkilauan tetapi tidak mengkilap seperti kaca hal ini kami suka perangkat jadi terkesan taft alias gagah rigid di genggaman tangan dan tentunya tidak mudah tergores sementara untuk redmi note  kendati sama kinclongnya sayang bagian desain di belakang perangkat masih berkilauan cenderung pasaran untuk kasus ini memang agak subjektif suka-sukaan tinggal pilih mana desain yang kamu suka dari sektor desain utamanya layar menurut kami realme i lebih unggul ketimbang redmi note  hal itu terlihat dari ukurannya redmi note  hanya membawa layar berukuran  inci sementara realme i hadir dengan bentang  inci buat yang suka layar lega realme i tentu lebih menarik kamera faktor selanjutnya yang tidak kalah penting dalam pertimbangan konsumen mana kala membeli smartphone baru saat ini adalah urusan fotografi atau kamera meski hadir menyasar segmen dan target market yang sama yakni segmen ekonomis realme i hadir dengan ukuran kamera yang lebih kecil ketimbang redmi note  yakni pada sektor kamera utama realme i seperti juga sudah kami ulas sebelumnya handset tersebut hadir dengan empat kamera di bagian belakang angka-angka kamera realme  sendiri yang disebut sebagai ai quad camera masing-masing berukuran  mp pdaf f  mp wide angle f lensa makro  mp f dan lensa depth sensor  mp berada di bagian depan realme i disematkan kamera depan  mp dengan aperture f beralih ke redmi note  handset tersebut unggul ketimbang realme i kalau bicara angka mp rincian kamera redmi note  untuk kamera belakangnya masing-masing mempunyai sensor  mp f wide  mp f  mm ultrawide  mp f macro dan  mp f sensor kedalaman jika realme i hanya hadir dengan kamera selfie  mp redmi note  hadir dengan kamera selfie  mp f dari aspek kamera kedua perangkat memang membawa keunggulan dan kekurangan masing-masing redmi note  misalnya unggul dari segi ukuran namun begitu realme i juga tak boleh dianggap remeh perangkat tersebut kini hadir sebagai smartphone dengan fitur quad camera termurah di pasaran jawabannya siapa yang lebih unggul tergantung kamu mau menang angka mp dengan sedikit lebih mahal atau jumlah kamera sama yang dapat ditebus dengan budget yang minim sesuaikan sendiri perbandingan spesifikasi redmi note  vs realme i rian alfiantojawaposcom baterai security dan harga perbandingan terakhir yang ingin jawaposcom ulik adalah dari segi baterai fitur keamanan security dan apalagi kalau bukan urusan kantong kalau realme i kalah di sektor kamera ketimbang redmi note  di sisi baterai tidak demikian realme i hadir dengan batera besar berukuran  mah sementara redmi note  hanya  mah saja dengan baterai segitu user tentu leluasa menggunakan perangkat untuk beragam kebutuhan tanpa takut kehabisan daya sepanjang hari tren baterai besar sendiri dimulai awal  dengan kehadiran samsung galaxy m series dan asus zenfone max pro m menyuplai daya baterai yang besar handset realme i dibekali sistem pengisian daya  w dalam paket pembelian juga tersedia va adapter charger sementara untuk keamanannya realme i hadir dengan fitur yang terbilang komplet sebut saja fitur face unlock dan fitur keamanan biometrik seperti fingerprint scanner hadir pada perangkat ini sistem keamanan tersebut merupakan pelengkap dari yang sudah ada seperti nomor sandi dan pola fitur face unlock-nya cepat dibandingkan dengan metode unlock lainnya begitu pun fingerprint-nya yang multifungsi ini dapat membuka realme i dengan sangat cepat fitur keamanan fingerprint di realme i juga memiliki medan sentuh yang terbilang luas dan sensitif di keseluruhan areanya dari segi harga perangkat terbilang hadir dengan banderol yang sangat kompetitif melihat segmen yang ditujunya dan lawan-lawannya di pasaran realme i di pasaran ditawarkan dengan tiga pilihan harga sesuai dengan kapasitas penyimpanan ramrom yakni rp  jutaan rp  jutaan dan rp  jutaan untuk varian ramrom  gb  gb dan  gb terakhir untu