(41, 1264, 'suasana bahagia terpancar dari aula kampus  itn institut teknologi nasional malang selasa  di tempat itu civitas akademika itn khususnya yang beragama nasrani menggelar perayaan natal kali ini perayaan natal mengangkat tema hiduplah sebagai sahabat tema ini diambil dari kitab yohanes ayat - event ini tak hanya melibatkan dosen dan mahasiswa tapi juga staf hadir pula ketua ppun perkumpulan pengelola pendidikan umum dan teknologi nasional ir kartiko ardi widodo rektor itn dr ir kustamar mt berharap perayaan ini bisa mendorong pengembangan karakter di kampus itn juga meningkatkan kerukunan dan nilai kebangsaan antar seasama saya berharap kita dapat kompak mengembangkan karakter kita dan meningkatkan kerukunan dan kebangsaan diantara kita ujarnya sementara itu ketua panitia acara dortauli situmeang ssos mengatakan yang istiewa dari perayaan kali ini adalah hadirnya para purna atau pensiunan itn baik dosen maupun staf pihak kampus senagaja mengundang mereka agar tali persaudaraan tetap terjaga sebagai cinderamata kampus memberikan karikatur kepada mereka mereka masih bagian dari keluarga itn kata dia', 'suasana bahagia terpancar aula kampus  itn institut teknologi nasional malang selasa  civitas akademika itn beragama nasrani menggelar perayaan natal kali perayaan natal mengangkat tema hiduplah sahabat tema diambil kitab yohanes ayat - event melibatkan dosen mahasiswa staf hadir ketua ppun perkumpulan pengelola pendidikan teknologi nasional ir kartiko ardi widodo rektor itn dr ir kustamar mt berharap perayaan mendorong pengembangan karakter kampus itn meningkatkan kerukunan nilai kebangsaan seasama berharap kompak mengembangkan karakter meningkatkan kerukunan kebangsaan ketua panitia acara dortauli situmeang ssos istiewa perayaan kali hadirnya purna pensiunan itn dosen staf kampus senagaja mengundang tali persaudaraan terjaga cinderamata kampus karikatur keluarga itn', 'suasana bahagia pancar aula kampus  itn institut teknologi nasional malang selasa  civitas akademika itn agama nasrani gelar raya natal kali raya natal angkat tema hidup sahabat tema ambil kitab yohanes ayat - event libat dosen mahasiswa staf hadir ketua ppun kumpul kelola didik teknologi nasional ir kartiko ardi widodo rektor itn dr ir kustamar mt harap raya dorong kembang karakter kampus itn tingkat rukun nilai bangsa seasama harap kompak kembang karakter tingkat rukun bangsa ketua panitia acara dortauli situmeang ssos istiewa raya kali hadir purna pensiun itn dosen staf kampus senagaja undang tali saudara jaga cinderamata kampus karikatur keluarga itn'),
(42, 1265, 'sebagai orangtua anda pasti ingin memberikan segala hal yang terbaik bagi anak salah satu kebutuhan yang wajib diberikan kepada anak adalah pendidikan saat mulai menginjak usia  tahun kebutuhan pendidikan bagi buah hati harus anda siapkan dengan baik keperluan untuk mengenyam ilmu itu pun harus anda berikan setidaknya hingga anak lulus sma sudah dapat dibayangkan berapa banyak biaya yang harus dikucurkan demi memenuhi kebutuhan tersebut belum lagi jika anda menginginkan tingkat pendidikan lebih tinggi bagi anak perguruan tinggi bisa menghabiskan dana hingga ratusan juta rupiah jika jurusan yang diambil cukup bergengsi dengan tingginya biaya pendidikan yang harus disiapkan menabung untuk kebutuhan tersebut tentu hendaknya anda lakukan sejak dini perkiraan untuk dana pendidikan yang diperlukan juga sudah harus diperhitungkan dengan matang agar kegiatan menabung bisa dilakukan secara terencana menghitung dana pendidikan tentu membutuhkan banyak pertimbangan tentang apa saja yang diperlukan sang anak saat memilih edukasi yang bakal ditempuh dengan mempunyai perencanaan yang matang tentang pendidikan biaya yang perlu disisihkan juga menjadi lebih jelas oleh karena itu dalam menyiapkan biaya pendidikan yang dibutuhkan anak hendaknya anda mempertimbangkan dengan baik bila saat ini anda tengah menyiapkan dana pendidikan anak sebaiknya perhatikan hal ini dulu seperti dikutip dari cermaticom senin   ketahui alur pendidikan yang diinginkan menentukan alur pendidikan yang bakal dijalani anak dapat memberikan gambaran tentang nominal biaya yang harus anda siapkan meski perhitungannya tidak bisa didapatkan secara akurat setidaknya anda dapat membuat skala pada perkiraan dana yang dibutuhkan untuk memenuhi pendidikan tersebut pastinya saat anda ingin buah hati mendapatkan gelar s atau bahkan s biaya yang harus disiapkan juga cukup tinggi dengan begitu perencanaan anggaran juga harus anda lakukan dengan matang selain itu beberapa hal yang lebih kecil seperti lokasi sekolah dan pemilihan antara sekolah negeri atau swasta juga akan memengaruhi total dana yang dibutuhkan dana bahkan pemilihan jurusan juga memiliki keperluan yang berbeda pula saat di sekolah jadi rencanakan terlebih dahulu alur pendidikan anak anda agar gambaran pengeluaran bisa didapatkan bila perlu tanyakan pada relasi anda yang memiliki anak dalam usia sekolah perihal kebutuhan yang harus disiapkan dalam memberikan fasilitas pendidikan yang memadai  perhitungkan kenaikan biaya pendidikan di masa depan bukan rahasia umum bahwa biaya pendidikan akan selalu meningkat setiap tahunnya terlebih lagi untuk sekolah swasta karena tidak mendapat subsidi pemerintah kenaikan tarif di sekolah swasta bisa sangat signifikan per tahunnya inflasi pada biaya pendidikan memang lumrah terjadi tak jarang pula kenaikan biaya pendidikan jauh lebih tinggi ketimbang kenaikan harga kebutuhan pokok dengan alasan tersebut hendaknya anda memperkirakan tingkat inflasi pada sekolah yang ingin dituju menanyakan kepada pihak sekolah secara langsung mengenai aturan inflasi biaya juga bukan hal yang dilarang dengan begitu perkiraan kenaikan biaya pendidikan yang anda inginkan akan menjadi lebih akurat  tentukan durasi menabung untuk biaya pendidikan setelah mengetahui biaya pendidikan dan tingkat inflasi yang mungkin terjadi gambaran tentang banyaknya dana yang harus anda kumpulkan tentu menjadi lebih jelas dengan begitu merencanakan lama waktu menabung bisa anda hitung dengan seksama memulai menabung untuk biaya pendidikan memang hendaknya anda lakukan sejak dini dengan begitu kondisi keuangan anda nantinya akan menjadi lebih siap dalam memenuhi kebutuhan pendidikan anak biasanya biaya pendidikan yang wajib anda lunasi dengan segera adalah uang pangkal dalam memenuhi kewajiban tersebut anda dapat mencicilnya dengan cara menabung biasa atau dengan berinvestasi  pertimbangkan jenis investasi yang bisa dipilih jika masa mengenyam pendidikan anak masih lama mengumpulkan dana dengan cara berinvestasi adalah cara terbaik yang bisa anda pilih secara umum ada  jenis investasi yang bisa anda pilih yaitu investasi logam mulia surat utang negara reksa dana dan saham jika lama waktu menyiapkan dana pendidikan anak lebih dari  tahun anda bebas memilih satu dari  instrumen investasi tersebut namun jika durasi persiapan kurang dari  tahun sebaiknya anda memilih jenis investasi logam mulia atau surat utang negara karena investasi tersebut bisa diperjualbelikan saat dibutuhkan', 'orangtua terbaik anak salah kebutuhan wajib anak pendidikan menginjak usia  kebutuhan pendidikan buah hati siapkan keperluan mengenyam ilmu anak lulus sma dibayangkan biaya dikucurkan memenuhi kebutuhan tingkat pendidikan anak perguruan menghabiskan dana ratusan juta rupiah jurusan diambil bergengsi tingginya biaya pendidikan disiapkan menabung kebutuhan lakukan perkiraan dana pendidikan diperhitungkan matang kegiatan menabung terencana menghitung dana pendidikan membutuhkan pertimbangan sang anak memilih edukasi ditempuh perencanaan matang pendidikan biaya disisihkan biaya pendidikan dibutuhkan anak mempertimbangkan dana pendidikan anak perhatikan dikutip cermaticom senin   ketahui alur pendidikan menentukan alur pendidikan dijalani anak gambaran nominal biaya siapkan perhitungannya didapatkan akurat skala perkiraan dana dibutuhkan memenuhi pendidikan pastinya buah hati gelar s s biaya disiapkan perencanaan anggaran lakukan matang lokasi sekolah pemilihan sekolah negeri swasta memengaruhi total dana dibutuhkan dana pemilihan jurusan memiliki keperluan berbeda sekolah rencanakan alur pendidikan anak gambaran pengeluaran didapatkan relasi memiliki anak usia sekolah perihal kebutuhan disiapkan fasilitas pendidikan memadai  perhitungkan kenaikan biaya pendidikan rahasia biaya pendidikan meningkat tahunnya sekolah swasta subsidi pemerintah kenaikan tarif sekolah swasta signifikan tahunnya inflasi biaya pendidikan lumrah jarang kenaikan biaya pendidikan ketimbang kenaikan harga kebutuhan pokok alasan tingkat inflasi sekolah dituju sekolah langsung aturan inflasi biaya dilarang perkiraan kenaikan biaya pendidikan akurat  tentukan durasi menabung biaya pendidikan biaya pendidikan tingkat inflasi gambaran banyaknya dana kumpulkan merencanakan menabung hitung seksama menabung biaya pendidikan lakukan kondisi keuangan memenuhi kebutuhan pendidikan anak biaya pendidikan wajib lunasi uang pangkal memenuhi kewajiban mencicilnya menabung berinvestasi  pertimbangkan jenis investasi dipilih mengenyam pendidikan anak mengumpulkan dana berinvestasi terbaik pilih  jenis investasi pilih investasi logam mulia surat utang negara reksa dana saham dana pendidikan anak  bebas memilih  instrumen investasi durasi persiapan  memilih jenis investasi logam mulia surat utang negara investasi diperjualbelikan dibutuhkan', 'orangtua baik anak salah butuh wajib anak didik injak usia  butuh didik buah hati siap perlu kenyam ilmu anak lulus sma bayang biaya kucur penuh butuh tingkat didik anak guru habis dana ratus juta rupiah jurus ambil gengsi tinggi biaya didik siap tabung butuh laku kira dana didik hitung matang giat tabung rencana hitung dana didik butuh timbang sang anak pilih edukasi tempuh rencana matang didik biaya sisih biaya didik butuh anak timbang dana didik anak perhati kutip cermaticom senin   tahu alur didik tentu alur didik jalan anak gambar nominal biaya siap hitung dapat akurat skala kira dana butuh penuh didik pasti buah hati gelar s s biaya siap rencana anggar laku matang lokasi sekolah pilih sekolah negeri swasta pengaruh total dana butuh dana pilih jurus milik perlu beda sekolah rencana alur didik anak gambar luar dapat relasi milik anak usia sekolah perihal butuh siap fasilitas didik mada  hitung naik biaya didik rahasia biaya didik tingkat tahun sekolah swasta subsidi perintah naik tarif sekolah swasta signifikan tahun inflasi biaya didik lumrah jarang naik biaya didik ketimbang naik harga butuh pokok alas tingkat inflasi sekolah tuju sekolah langsung atur inflasi biaya larang kira naik biaya didik akurat  tentu durasi tabung biaya didik biaya didik tingkat inflasi gambar banyak dana kumpul rencana tabung hitung seksama tabung biaya didik laku kondisi uang penuh butuh didik anak biaya didik wajib lunas uang pangkal penuh wajib cicil tabung investasi  timbang jenis investasi pilih kenyam didik anak kumpul dana investasi baik pilih  jenis investasi pilih investasi logam mulia surat utang negara reksa dana saham dana didik anak  bebas pilih  instrumen investasi durasi siap  pilih jenis investasi logam mulia surat utang negara investasi diperjualbelikan butuh'),
(43, 1266, 'tahun lalu wali kota malang sutiaji menetapkan kawasan kayutangan sebagai ibukota heritage malang raya sebelum pencanangan itu dosen itn institut teknologi nasional malang prof dr ir lalu mulyadi telah melakukan riset di kawasan tersebut riset itu dia tuangkan dalam paper arsitektur kota berkelanjutan berbasis kearifan lokal profesor bidang ilmu arsitektur ini menjelaskan  tujuan utama arsitektur kota yakni aspek kenyamanan aspek kekuatan atau kekokohan dan terakhir aspek keindahan jika dikaitkan dengan pembangunan berwawasan identitas fungsi dan peran arsitektur kota menjadi signifikan dalam menjaga warisan budaya yang tercermin ujar lalu saat orasi bersamaan dengan pengukuhannya ia juga meluncurkan buku yang digarap bersama dua dosen itn malang lainnya buku yang berjudul potensi kampung heritage kayutangan sebagai destinasi wisata di kota malang itu merupakan wujud dari penelitiannya di buku tersebut dijabarkan bahwa selain arsitekturnya yang khas kayutangan juga mencerminkan wajah kota seperti gereja dan masjid yang bersanding toko buku toko eskrim sampai hotel dengan bangunan kunonya oleh karena itu ia mengusulkan agar ada konsep ulang untuk bisnis yang ada di lingkungan sekitar kayutangan bersamaan dengan itu pun promosinya harus melaju kencang seperti malioboro di yogyakarta termasuk jalur pedestrian yang perlu pembenahan pesan untuk pemerintah keraifan lokal itu sebagai suatu eleman yang menunjang untuk kenyamanan bagi yang tinggal di sana ibaratnya rumah bagaimana rumah itu bisa nyaman ditinggali meski dijujuk banyak wisatawan bebernya sementara itu rektor itn malang dr ir kustamar mt mengatakan bahwa prof lalu merupakan profesor ke  itn malang dan sekaligus profesor aktif kedua ia menargetkan tahun ini ada - guru besar baru di itn malang insya allah nambah jadi  atau  para dosen ini sekarang sedang berproses ya semoga saja sampai akbir  mencapai target dalam pengukuhan itu hadir pula kepala lembaga layanan pendidikan tinggi ll dikti wilayah vii jawa timur prof dr ir suprapto dea hebat sekali itn malang ini memang di  ini saya targetkan universitas swasta meencetak minimal  guru besar ujar dia', 'wali kota malang sutiaji menetapkan kawasan kayutangan ibukota heritage malang raya pencanangan dosen itn institut teknologi nasional malang prof dr ir mulyadi riset kawasan riset tuangkan paper arsitektur kota berkelanjutan berbasis kearifan lokal profesor bidang ilmu arsitektur  tujuan utama arsitektur kota aspek kenyamanan aspek kekuatan kekokohan aspek keindahan dikaitkan pembangunan berwawasan identitas fungsi peran arsitektur kota signifikan menjaga warisan budaya tercermin orasi bersamaan pengukuhannya meluncurkan buku digarap dosen itn malang buku berjudul potensi kampung heritage kayutangan destinasi wisata kota malang wujud penelitiannya buku dijabarkan arsitekturnya khas kayutangan mencerminkan wajah kota gereja masjid bersanding toko buku toko eskrim hotel bangunan kunonya mengusulkan konsep ulang bisnis lingkungan kayutangan bersamaan promosinya melaju kencang malioboro yogyakarta jalur pedestrian pembenahan pesan pemerintah keraifan lokal eleman menunjang kenyamanan tinggal rumah rumah nyaman ditinggali dijujuk wisatawan bebernya rektor itn malang dr ir kustamar mt prof profesor  itn malang profesor aktif menargetkan - guru itn malang insya allah nambah   dosen berproses ya semoga akbir  mencapai target pengukuhan hadir kepala lembaga layanan pendidikan ll dikti wilayah vii jawa timur prof dr ir suprapto dea hebat itn malang  targetkan universitas swasta meencetak minimal  guru', 'wali kota malang sutiaji tetap kawasan kayutangan ibukota heritage malang raya canang dosen itn institut teknologi nasional malang prof dr ir mulyadi riset kawasan riset tuang paper arsitektur kota berkelanjutan basis arif lokal profesor bidang ilmu arsitektur  tuju utama arsitektur kota aspek nyaman aspek kuat kokoh aspek indah kait bangun wawas identitas fungsi peran arsitektur kota signifikan jaga waris budaya tercermin o