(44, 1267, 'acara puncak peringatan hut ke- smpn  malang sabtu  berlangsung meriah apalagi dengan hadirnya wakil wali kota malang sofyan edi jarwoko edi hadir tidak hanya dalam kapasitasnya sebagai wakil wali kota tapi juga sebagai alumni ya edi tercatat sebagai alumni smpn  malang angkatan  saya sangat senang bisa datang ke almamater sekolah saya ini semoga di hari jadi yang k- tahun ini smpn  malang semakin rajin mengukir prestasi yang jelas saya bangga menjadi alumninya selamat ulang tahun kata edi saat memberi sambutan usai memberikan sambutan edi menyerahkan secara simbolis bantuan pendidikan yang dihimpun dari para alumni bantuan itu berupa uang tunai senilai rp  juta yang diberikan kepada  siswa kurang mampu semoga bantuan ini bermanfaat dan bisa digunakan sebaik-baiknya dan jangan lupa untuk terus belajar dan mengembangkan diri sambung politisi partai golkar tersebut setelah itu edi berdiri di dekat pagar smpn  malang sambil membawa bendera start dia pun lantas mengangkat bendera itu sebagai tanda dimulainya jalan sehat hati-hati di jalan utamakan keselamatan kata pria  tahun ini sebelum meninggalkan lokasi edi juga sempat mengelilingi stan bazar ada  stan dari wali murid  stan alumni dan  stan sponsor stan-stan itu menjual berbagai macam makanan souvenir alumni sampai menjual frame kacamata di tengahnya terlihat panggung berdiri yang diisi pentas seni dari para siswa ada penampilan tari band hingga pembagian doorprize menarik para siswa pun terlihat asik meramaikan acara sambil mengunyah kudapan bazarnya disela-sela gelaran ini hadir pula direktur jawa pos radar malang kurniawan muhammad dan kepala dinas pendidikan kota malang dra zubaidah hari ini harus lebih baik dari kemarin hari esok harus lebih baik dari sekarang kata zubaidah sementara itu kepala smpn  malang risna widyawati spd berharap prestasi sekolah yang ia pimpin semakin meningkat dan kolaborasi dengan berbagai pihak semakin luas saya sampaikan juga terima kasih kepada alumni yang sudah membantu menggelar acara semeriah ini tuturnya', 'acara puncak peringatan hut ke- smpn  malang sabtu  meriah hadirnya wakil wali kota malang sofyan edi jarwoko edi hadir kapasitasnya wakil wali kota alumni ya edi tercatat alumni smpn  malang angkatan  senang almamater sekolah semoga k- smpn  malang rajin mengukir prestasi bangga alumninya selamat ulang edi sambutan sambutan edi menyerahkan simbolis bantuan pendidikan dihimpun alumni bantuan uang tunai senilai rp  juta  siswa semoga bantuan bermanfaat lupa belajar mengembangkan sambung politisi partai golkar edi berdiri pagar smpn  malang membawa bendera start lantas mengangkat bendera tanda jalan sehat hati-hati jalan utamakan keselamatan pria  meninggalkan lokasi edi mengelilingi stan bazar  stan wali murid  stan alumni  stan sponsor stan-stan menjual makanan souvenir alumni menjual frame kacamata tengahnya panggung berdiri diisi pentas seni siswa penampilan tari band pembagian doorprize menarik siswa asik meramaikan acara mengunyah kudapan bazarnya disela-sela gelaran hadir direktur jawa pos radar malang kurniawan muhammad kepala dinas pendidikan kota malang dra zubaidah kemarin esok zubaidah kepala smpn  malang risna widyawati spd berharap prestasi sekolah pimpin meningkat kolaborasi luas terima kasih alumni membantu menggelar acara semeriah', 'acara puncak ingat hut ke- smpn  malang sabtu  riah hadir wakil wali kota malang sofyan edi jarwoko edi hadir kapasitas wakil wali kota alumni ya edi catat alumni smpn  malang angkat  senang almamater sekolah moga k- smpn  malang rajin ukir prestasi bangga alumni selamat ulang edi sambut sambut edi serah simbolis bantu didik dihimpun alumni bantu uang tunai nilai rp  juta  siswa moga bantu manfaat lupa ajar kembang sambung politis partai golkar edi diri pagar smpn  malang bawa bendera start lantas angkat bendera tanda jalan sehat hati jalan utama selamat pria  tinggal lokasi edi keliling stan bazar  stan wali murid  stan alumni  stan sponsor stan jual makan souvenir alumni jual fr