(45, 1268, 'smpn  malang genap berusia  tahun pada  januari lalu sebagai bagian dari peringatan hari jadinya smpn  malang menggelar sejumlah acara jumat  dan sabtu  mengusung tema ukir prestasi jadi prasasti acara hut melibatkan ika spenmal ikatan alumni smpn  malang di antaranya para alumni menjadi pengajar pada program alumni mengajar mulai angkatan  semuanya terlibat mereka bukan mengajar pelajaran tapi lebih kepada motivasi ada  kelas yang diajar kelas - ujar kepala smpn  malang risna widyawati spd selain itu digelar pula tasyakuran istigosah dan pembagian sembako gratis sebanayk  paket sembako didistribusikan siswa ke daerah di sekitar smpn  malang terutama di kelurahan bareng isinya ada beras minyak kecap dan masih banyak lagi ini juga bagian dari sumbangan alumni untuk kami imbuhnya adapun hari ini alumni juga menghimpun dana untuk sumbangan pendidikan bagi siswa yang kurang mampu totalnya senilai rp  juta untuk  siswa dan diberikan secara simbolis oleh wakil wali kota malang sofyan edi jarwoko selaku alumni smpn  malang tahun  di kemeriahan acara jalan sehat dan bazar hari ini pun alumni juga menggeber sembako murah menjual beragam bahan pokok seperti beras sampai minyak dengan harga yang lebih murah dari harga pasaran ini juga berkat alumni lho timpalnya sementara ketua ika spenmal sugiyono mengatakan bahwa sejak  tahun terakhir memang alumni selalu aktif memeriahkan hari jadi smpn  malang pria yang akrab disapa yangkung ini merinci untuk acara tersebut para alumni mengumpulkan data kurang lebih rp  juta ini lebih banyak tahun kemarin hanya rp  juta uangnya kami serahkan pada panitia semua terserah dibuat konten acara apa yang penting kami ingin acara ini meriah dan bisa menimbulkan kesan ungkap alumni smpn  tahun  itu ia berharap momen ulang tahun tak hanya menjadi selebrasi tapi juga saat-saat mengingat sejarah disini tempat mengingat mengenang kembali dedikasi smpn  malang dari gurunya staffnya semoga smpn  semakin berprestasi imbuh dia', 'smpn  malang g