(47, 1270, 'menteri pendidikan dan kebudayaan mendikbud nadiem makarim mengatakan pihaknya akan melakukan terobosan dalam menciptakan sumber daya manusia sdm unggul seperti keinginan presiden ri joko widodo nadiem mengaku mengatasi masalah di sektor pendidikan sangat sulit bahkan negara maju sekalipun membutuhkan waktu sekitar  hingga  tahun sehingga dirinya akan mencoba melakukan lompatan yang dapat menarik sistem hingga  persen saya di sini bukan untuk benerin tapi melakukan lompatan enggak bisa dicapai  tahun tapi mungkin - persen sistem ini bisa lompat - tahun itu bisa ke tarik dari  persen ini ujarnya di gedung tribrata jakarta jumat  menurutnya menciptakan sdm membutuhkan adanya transformasi sdm unggul tidak akan terwujud jika hanya mengandalkan kebijakan pemerintah peran masyarakat orang tua serta guru juga dibutuhkan sdm unggul bukan hanya unggul di indonesia unggul itu relatif di panggung dunia imbuhnya nadiem menyebut selama ini pemerintah menggunakan administrasi pendidikan dan regulasi untuk menciptakan sdm unggul padahal administrasi pendidikan bukanlah suatu metode pembelajaran atas dasar itu dirinya akan membuat terobosan yakni program merdeka belajar program ini akan membebaskan guru dalam mengimplementasikan metode yang cocok untuk siswa-siswinya tadinya saya kira sistem manajemen yang bisa dikasih insentif secara otomatis pendidikannya akan baik tapi enggak karena produk ini bukan suatu layanan atau apps tapi manusia tingkat kompleksitas enggak sama dengan private sector pungkasnya', 'menteri pendidikan kebudayaan mendikbud nadiem makarim terobosan menciptakan sumber daya manusia sdm unggul presiden ri joko widodo nadiem mengaku mengatasi sektor pendidikan sulit negara maju membutuhkan   mencoba lompatan menarik sistem  persen benerin lompatan dicapai  - persen sistem lompat - tarik  persen gedung tribrata jakarta jumat  menurutnya menciptakan sdm membutuhkan transformasi sdm unggul terwujud mengandalkan kebijakan pemerintah peran masyarakat orang tua serta guru dibutuhkan sdm unggul unggul indonesia unggul relatif panggung dunia imbuhnya nadiem menyebut pemerintah administrasi pendidikan regulasi menciptakan sdm unggul administrasi pendidikan metode pembelajaran dasar terobosan program merdeka belajar program membebaskan guru mengimplementasikan metode cocok siswa-siswinya sistem manajemen dikasih insentif otomatis pendidikannya produk layanan apps manusia tingkat kompleksitas private sector pungkasnya', 'menteri didik budaya mendikbud nadiem makarim terobos cipta sumber daya manusia sdm unggul presiden ri joko widodo nadiem mengaku atas sektor didik sulit negara maju butuh   coba lompat tarik sistem  persen benerin lompat capai  - persen sistem lompat - tarik  persen gedung tribrata jakarta jumat  turut cipta sdm butuh transformasi sdm unggul wujud andal bijak perintah peran masyarakat orang tua serta guru butuh sdm unggul unggul indonesia unggul relatif panggung dunia imbuh nadiem sebut perintah administrasi didik regulasi cipta sdm unggul administrasi didik metode pembelajaran dasar terobos program merdeka ajar program bebas guru implementasi metode cocok siswa siswi sistem manajemen kasih insentif otomatis didik produk layan apps manusia tingkat kompleksitas private sector pungkas'),
(48, 1271, 'universitas brawijaya ub pada minggu  telah meluncurkan aplikasi gapura ub aplikasi ini merupakan sistem informasi layanan terpadu yang memberikan kemudahan terkait sistem informasi ub sistem ini menyediakan seluruh menu dari website gapura ub ya menggunakan sistem single sign on sso yang berkolaborasi dengan gsuite sejak dilaunching data jumat  aplikasi ini sudah diunduh sebanyak  ribu kali kepala upt tik ub achmad basuki stmmgphd mengatakan kemunculan gapura ub merupakan wujud gapura ub yang berambisi dengan motto satu aplikasi banyak kemudahan tidak banyak aplikasi mobile satu aplikasi yang bisa untuk orang tua mahasiswa dosen dan karyawan jadi ada dua pilihan mengakses gapura ub sebagai pengunjung saja untuk mengetahui informasi secara umum misal fakultasnya apa saja termasuk statistik dan kalender akademik ada ujar abas sapaan akrabnya saat ini abas mengatakan aplikasi tersebut sudah diunduh oleh  ribu lebih pengguna android dan  lebih pengguna iphone meskipun gapura ub belum bisa memenuhi harapan semua pengguna namun ke depan aplikasi ini akan terus mengalami perbaikan termasuk memperbanyak fitur responnya positif ratingnya bagus dan banyak masukan pengguna yang banyak kan mahasiswa dan dosen dengan gapura ub mereka sangat terbantu meskipun saat ini konsepnya masih baca informasi kedepan akan pelan-pelan akan kami integrasikan demi pelayanan lebih baik bebeenya perlu diketahui kemudahan yang ditawarkan pada aplikasi ini adalah terkait mengakses informasi satu aplikasi menampilkan banyak informasi termasuk menampilkan menu yang berbeda antara dosen mahasiswa karyawan orang tua dan pengunjung biasa mahasiswa bisa mengakses semua informasi yang masuk melalui hanya dengan login menggunakan nomor induk mahasiswa nim menu yang tersaji pun akan berbeda dengan pengunjung biasa terdapat informasi khusus contohnya melihat profil mahasiswa status pembayaran biaya kuliah dan tagihan waktu pembayaran rekap hasil studi di masing-masing semester dan lain sebagainya buat orang tua pun juga beda dengan masuk menggunakan akun yang kami sediakan melalui fakultas juga bisa melihat perkembangan studi anaknya demikian pula bagi dosen bisa melihat jadwal mengajarnya mahasiswa bimbingan akademiknya dan ada informasi mengenai remunerasi beliau urainya ', 'universitas brawijaya ub minggu  meluncurkan aplikasi gapura ub aplikasi sistem informasi layanan terpadu kemudahan terkait sistem informasi ub sistem menyediakan menu website gapura ub ya sistem single sign on sso berkolaborasi gsuite dilaunching data jumat  aplikasi diunduh  ribu kali kepala upt tik ub achmad basuki stmmgphd kemunculan gapura ub wujud gapura ub berambisi motto aplikasi kemudahan aplikasi mobile aplikasi orang tua mahasiswa dosen karyawan pilihan mengakses gapura ub pengunjung informasi fakultasnya statistik kalender akademik abas sapaan akrabnya abas aplikasi diunduh  ribu pengguna android  pengguna iphone gapura ub memenuhi harapan pengguna aplikasi mengalami perbaikan memperbanyak fitur responnya positif ratingnya bagus masukan pengguna mahasiswa dosen gapura ub terbantu konsepnya baca informasi kedepan pelan-pelan integrasikan pelayanan bebeenya kemudahan ditawarkan aplikasi terkait mengakses informasi aplikasi menampilkan informasi menampilkan menu berbeda dosen mahasiswa karyawan orang tua pengunjung mahasiswa mengakses informasi masuk login nomor induk mahasiswa nim menu tersaji berbeda pengunjung informasi khusus contohnya profil mahasiswa status pembayaran biaya kuliah tagihan pembayaran rekap hasil studi semester orang tua beda masuk akun sediakan fakultas perkembangan studi anaknya dosen jadwal mengajarnya mahasiswa bimbingan akademiknya informasi remunerasi beliau urainya ', 'universitas brawijaya ub minggu  luncur aplikasi gapura ub aplikasi sistem informasi layan padu mudah kait sistem informasi ub sistem sedia menu website gapura ub ya sistem single sign on sso kolaborasi gsuite dilaunching data jumat  aplikasi unduh  ribu kali kepala upt tik ub achmad basuki stmmgphd muncul gapura ub wujud gapura ub ambisi motto aplikasi mudah aplikasi mobile aplikasi orang tua mahasiswa dosen karyawan pilih akses gapura ub unjung informasi fakultas statistik kalender akademik abas sapa akrab abas aplikasi unduh  ribu guna android  guna iphone gapura ub penuh harap guna aplikasi alami baik banyak fitur responnya positif ratingnya bagus masuk guna mahasiswa dosen gapura ub bantu konsep baca informasi depan pelan integrasi layan bebeenya mudah tawar aplikasi kait akses informasi aplikasi tampil informasi tampil menu beda dosen mahasiswa karyawan orang tua unjung mahasiswa akses informasi masuk login nomor induk mahasiswa nim menu saji beda unjung informasi khusus contoh profil mahasiswa status bayar biaya kuliah tagih bayar rekap hasil studi semester orang tua beda masuk akun sedia fakultas kembang studi anak dosen jadwal ajar mahasiswa bimbing akademik informasi remunerasi beliau urai '),
(49, 1272, 'mahasiswa sering dalam sikap berbahasa tidak memperdulikan etika padahal bahasa pun ada etikanya tergantung dengan siapa kita berbicara tindak tutur di diri mahasiswa itu perlu dibiasakan ada hal-hal yang tidak tepat simpel tapi perlu dibenahi terkait kesantunan bahasa khususnya ke dosen tukas suryantoro mpd ketua program studi pendidikan bahasa dan sastra indonesia unikama dalam acara sarasehan mahasiswa dan dosen prodi pendidikan bahasa dan sastra indonesia jumat  menurut suryantoro ranah komunikasi di umum dan akademik harus dibedakan keduanya itu harus dipisahkan perlu kesadaran dari diri mahasiswa untuk tambah surya di aula sarwakirti unikama menyebut contoh mahasiswa yang sering menghubungi dosen melalui perpesanan instant whatsapp seringkali mengabaikan etika berbahasa ini maka dari itu unikama mencoba menyatukan visi dan pandangan lewat forum bertajuk sarasehan semua mahasiswa angkatan dan dosen kaprodi hingga dekanat prodi pendidikan bahasa indonesia disatukan dalam sebuah forum informal acaranya simpel mereka duduk bersama lesehan unikama ingin mahasiswa lebih menghargai bahasa kedua pihak yang disatukan dalam jaring akademik itu pun bertukar ilmu dan pandangan sengaja acara dikemas dalam forum sarasehan begini agar tidak ada sekat diantara mahasiswa dan dosen kami mencoba mensosialisasikan penggunaan bahasa dalam forum yang rileks jadi tidak ada jarak dan sekat tuturnya sementara itu acara ini dibuat juga sebagai rangkaian dari peringatan hari bahasa nasional atau yang biasa disebut bulan bahasa narasumbernya berasal dari dosen internal unikama acara ini juga mengajari pendewasaan karakter melalui bahasa kepada mahasiswa terutama di media sosial mahasiswa unikama nantinya kami harap bisa jadi semacam contoh dalam penggunaan bahasa yang baik di medsos tutupnya', 'mahasiswa sikap berbahasa memperdulikan etika bahasa etikanya tergantung berbicara tindak mahasiswa dibiasakan hal-hal simpel dibenahi terkait kesantunan bahasa dosen tukas suryantoro mpd ketua program studi pendidikan bahasa sastra indonesia unikama acara sarasehan mahasiswa dosen prodi pendidikan bahasa sastra indonesia jumat  suryantoro ranah komunikasi akademik dibedakan dipisahkan kesadaran mahasiswa surya aula sarwakirti unikama menyebut contoh mahasiswa menghubungi dosen perpesanan instant whatsapp seringkali mengabaikan etika berbahasa unikama mencoba menyatukan visi pandangan forum bertajuk sarasehan mahasiswa angkatan dosen kaprodi dekanat prodi pendidikan bahasa indonesia disatukan forum informal acaranya simpel duduk lesehan unikama mahasiswa menghargai bahasa disatukan jaring akademik bertukar ilmu pandangan sengaja acara dikemas forum sarasehan sekat mahasiswa dosen mencoba mensosialisasikan penggunaan bahasa forum rileks jarak sekat acara rangkaian peringatan bahasa nasional bahasa narasumbernya berasal dosen internal unikama acara mengajari pendewasaan karakter bahasa mahasiswa media sosial mahasiswa unikama harap contoh penggunaan bahasa medsos tutupnya', 'mahasiswa sikap bahasa duli etika bahasa etika gantung bicara tindak mahasiswa biasa hal simpel benah kait santun bahasa dosen tukas suryantoro mpd ketua program studi didik bahasa sastra indonesia unikama acara sarasehan mahasiswa dosen prodi didik bahasa sastra indonesia jumat  suryantoro ranah komunikasi akademik bedak pisah sadar mahasiswa surya aula sarwakirti unikama sebut contoh mahasiswa hubung dosen pesan instant whatsapp seringkali abai etika bahasa unikama coba satu visi pandang forum tajuk sarasehan mahasiswa angkat dosen kaprodi dekanat prodi didik bahasa indonesia satu forum informal acara simpel duduk leseh unikama mahasiswa harga bahasa satu jaring akademik tukar ilmu pandang sengaja acara kemas forum sarasehan sekat mahasiswa dosen coba sosialisasi guna bahasa forum rileks jarak sekat acara rangkai ingat bahasa nasional bahasa narasumber asal dosen internal unikama acara ajar dewasa karakter bahasa mahasiswa media sosial mahasiswa unikama harap contoh guna bahasa medsos tutup'),
(50, 1273, 'kementerian pendidikan dan kebudayaan berencana akan mengubah penyaluran program bantuan operasional sekolah bos pada tahun ini bantuan tersebut akan langsung disalurkan dari pemerintah pusat ke sekolah harapannya agar bisa segera digunakan oleh sekolah yang membutuhkan plt direktur jenderal pendidikan anak usia dini pendidikan dasar dan menengah paud dikdasmen harris iskandar membenarkan adanya perubahan mekanisme penyaluran bos nanti akan diluncurkan oleh mas menteri mendikbud nadiem makarim mimggu depan tunggu saja ucapnya kepada jawa pos kamis  sekretaris jenderal kemendikbud ainun naim menilai perubahan penyaluran bos langsung ke sekolah lebih efektif bisa diterima lebih cepat ke sekolah yang memang membutuhkan penyalurannya dari kementerian keuangan langsung kepada sekolah kemendikbud berperan memberikan data sekolah untuk menentukan jumlah anggaran yang dibutuhkan sementara itu pemerintah daerah pemda yang selama ini menjadi tangan kedua menyalurkan dana bos kini bertugas memonitor kinerja sekolah saja selain itu untuk pengawasan dan pengelolaan bos selanjutnya sudah ada perangkat seperti inspektorat pusat maupun daerah setiap kementerianlembaga tentu ada guideline-nya terang ainun perubahan tersebut ditengarai akibat banyak laporan sekolah yang terlambat menerima dana bos pengamat pendidikan indra charismiadji membenarkan hal tersebut tidak dimungkiri lanjut dia banyak permainan terkait dana pendidikan di tingkat pemda misalnya menggunakan dana pendidikan untuk program lain yang tidak sesuai peruntukannya saya lebih suka penyaluran dana bos langsung ucap indra jadi sudah tidak ada lagi penyalahgunaan maupun penyelewengan anggaran pendidikan di tingkat pemda hanya saja sampai saat ini indra mempertanyakan tidak adanya evaluasi terkait bos mulai dari sisi efektivitas pelaksanaan dan hasilnya penggunaan anggaran bisa jadi bos yang membuat mutu pendidikan kita stagnan karena orang sibuk ngurusin administrasi tandas indra', 'kementerian pendidikan kebudayaan berencana mengubah penyaluran program bantuan operasional sekolah bos bantuan langsung disalurkan pemerintah pusat sekolah harapannya sekolah membutuhkan plt direktur jenderal pendidikan anak usia pendidikan dasar menengah paud dikdasmen harris iskandar membenarkan perubahan mekanisme penyaluran bos diluncurkan mas menteri mendikbud nadiem makarim mimggu tunggu jawa pos kamis  sekretaris jenderal kemendikbud ainun naim menilai perubahan penyaluran bos langsung sekolah efektif diterima cepat sekolah membutuhkan penyalurannya kementerian keuangan langsung sekolah kemendikbud berperan data sekolah menentukan anggaran dibutuhkan pemerintah daerah pemda tangan menyalurkan dana bos bertugas memonitor kinerja sekolah pengawasan pengelolaan bos perangkat inspektorat pusat daerah kementerianlembaga guideline-nya terang ainun perubahan ditengarai akibat laporan sekolah terlambat menerima dana bos pengamat pendidikan indra charismiadji membenarkan dimungkiri permainan terkait dana pendidikan tingkat pemda dana pendidikan program sesuai peruntukannya suka penyaluran dana bos langsung indra penyalahgunaan penyelewengan anggaran pendidikan tingkat pemda indra evaluasi terkait bos sisi efektivitas pelaksanaan hasilnya penggunaan anggaran bos mutu pendidikan stagnan orang sibuk ngurusin administrasi indra', 'menteri didik budaya rencana ubah salur program bantu operasional sekolah bos bantu langsung salur perintah pusat sekolah harap sekolah butuh plt direktur jenderal didik anak usia didik dasar tengah paud dikdasmen harris iskandar benar ubah mekanisme salur bos luncur mas menteri mendikbud nadiem makarim mimggu tunggu jawa pos kamis  sekretaris jenderal kemendikbud ainun naim nilai ubah salur bos langsung sekolah efektif terima cepat sekolah butuh salur menteri uang langsung sekolah kemendikbud peran data sekolah tentu anggar butuh perintah daerah pemda tangan salur dana bos tugas monitor kinerja sekolah awas kelola bos perangkat inspektorat pusat daerah kementerianlembaga guideline nya terang ainun ubah tengara akibat lapor sekolah lambat terima dana bos amat didik indra charismiadji benar mungkir main kait dana didik tingkat pemda dana didik program sesuai untuk suka salur dana bos langsung indra penyalahgunaan seleweng anggar didik tingkat pemda indra evaluasi kait bos sisi efektivitas laksana hasil guna anggar bos mutu didik stagnan orang sibuk ngurusin administrasi indra'),
(51, 1274, 'siswa kelas xii smasmk sudah bisa mendaftarkan diri untuk mengikuti snmptn seleksi nasional masuk perguruan tinggi nasional bagi yang ingin kuliah di fk fakultas kedokteran di malang pilihannya beragam salah satunya di fkik fakultas kedokteran dan ilmu kesehatan uin maliki universitas islam negeri maulana malik ibrahim apa saja nilai plus kuliah di fk uin maliki berikut ulasannya  bakal jadi dokter religius di uin malang setiap maba mahasiswa baru termasuk dari fkik wajib masuk mahad atau asrama selama dua semester khusus untuk mahasiswa fkik akan ditempatkan di mahad kedokteran atau mabna ar-razi yang lokasinya berada di kampus ii uin aliki di kota batu selama di asrama para mahasiswa juga mendapatkan pembekalan tentang agama islam jadi diharapkan ketika lulus nanti mereka akan menjadi pribadi yang religius  bakal punya rumah sakit pendidikan bersamaan dengan dibukanya fkik uin maliki malang juga menyiapkan pembangunan rumah sakit pendidikan rencananya pembangunan rumah sakit ini akan dilakukan mulai tahun ini lokasinya di kampus ii uin maliki malang di kota batu sembari menunggu rampungnya pembangunan rumah sakit itu saat ini uin malang memanfaatkan rst soepraoen sebagai rumah sakit pendidikannya berbagai praktik dan transfer ilmu telah dijalin uin malang bersama kesdam v brawijaya  bisa koas di saudi arabia beberapa waktu yang lalu rektor uin malang prof dr abdul haris mag mengatakan bahwa sejumlah mahasiswa kedokteran akan dikirim koas ko asisten atau praktik menjadi asisten dokter di saudi arabia keberangkatan mereka direncanakan bulan juli ya di jurusan kedokteran uin malang mahasiswa disediakan pilihan kompetensi dokter haji sehingga mahasiswa yang memilih fokus itu akan dikirim ke saudi arabia untuk belajar memeriksa jamaah haji disana', 'siswa kelas xii smasmk mendaftarkan mengikuti snmptn seleksi nasional masuk perguruan nasional kuliah fk fakultas kedokteran malang pilihannya beragam salah satunya fkik fakultas kedokteran ilmu kesehatan uin maliki universitas islam negeri maulana malik ibrahim nilai plus kuliah fk uin maliki ulasannya  dokter religius uin malang maba mahasiswa fkik wajib masuk mahad asrama semester khusus mahasiswa fkik ditempatkan mahad kedokteran mabna ar-razi lokasinya kampus ii uin aliki kota batu asrama mahasiswa pembekalan agama islam diharapkan lulus pribadi religius  rumah sakit pendidikan bersamaan dibukanya fkik uin maliki malang pembangunan rumah sakit pendidikan rencananya pembangunan rumah sakit lokasinya kampus ii uin maliki malang kota batu sembari menunggu rampungnya pembangunan rumah sakit uin malang memanfaatkan rst soepraoen rumah sakit pendidikannya praktik transfer ilmu dijalin uin malang kesdam v brawijaya  koas saudi arabia rektor uin malang prof dr abdul haris mag mahasiswa kedokteran dikirim koas ko asisten praktik asisten dokter saudi arabia keberangkatan direncanakan juli ya jurusan kedokteran uin malang mahasiswa disediakan pilihan kompetensi dokter haji mahasiswa memilih fokus dikirim saudi arabia belajar memeriksa jamaah haji disana', 'siswa kelas xii smasmk daftar ikut snmptn seleksi nasional masuk guru nasional kuliah fk fakultas dokter malang pilih agam salah satu fkik fakultas dokter ilmu sehat uin maliki universitas islam negeri maulana malik ibrahim nilai plus kuliah fk uin maliki ulas  dokter religius uin malang maba mahasiswa fkik wajib masuk mahad asrama semester khusus mahasiswa fkik tempat mahad dokter mabna ar razi lokasi kampus ii uin alik kota batu asrama mahasiswa bekal agama islam harap lulus pribadi religius  rumah sakit didik sama buka fkik uin maliki malang bangun rumah sakit didik rencana bangun rumah sakit lokasi kampus ii uin maliki malang kota batu sembari tunggu rampung bangun rumah sakit uin malang manfaat rst soepraoen rumah sakit didik praktik transfer ilmu jalin uin malang kesdam v brawijaya  koas saudi arabia rektor uin malang prof dr abdul haris mag mahasiswa dokter kirim koas ko asisten praktik asisten dokter saudi arabia berangkat rencana juli ya jurus dokter uin malang mahasiswa sedia pilih kompetensi dokter haji mahasiswa pilih fokus kirim saudi arabia ajar periksa jamaah haji sana'),
(52, 1275, 'sebanyak  mahasiswa kkn universitas muhammadiyah malang umm tiba di malaysia para mahasiswa kkn yang datang bersama kepala divisi kkn direktorat penelitian dan pengabdian kepada masyarakat universitas muhammadiyah malang dppkm umm disambut oleh konsulat jenderal kinabalu sabah malaysia khrisna djelani dalam sambutannya khrisna mengungkapkan malaysia siap menerima pengabdian mahasiswa kkn umm dengan program-program yang sudah dirancang termasuk bidang pendidikan menjalani program pengabdian masyarakat melalui kkn ini nantinya kalian akan turut aktif membantu proses pembelajaran di sekolah-sekolah clc community learning center yang membina anak-anak pekerja migran indonesia pmi di sabah malaysia juga mendapat banyak pembelajaran pengalaman dan kesan tersendiri dalam memaknai nasionalisme di luar negeri jaga diri dengan baik dan harumkan nama indonesia selalu membawa paspor selama berada di luar negeri sabah malaysia pesan khrisna di kota pusat pemerintahan untuk pantai barat negeri sabah ini diperkirakan ada lebih dari  ribu warga negara indonesia wni jumlah ini baru perkiraan dari berbagai aktivitas yang dilakukan oleh konsulat jenderal republik indonesia kjri kinabalu malaysia yang tercatat di kantor kami hanya  ribu orang ujar cahyono rustam pelaksana fungsi penerangan sosial budaya kjri kota kinabalu saat memberi kuliah umum pada agenda pengarahan dan pelepasan kuliah kerja nyata kkn universitas muhamamdiyah malang umm semester genap  senin  rata-rata para wni yang datang ke kinabalu untuk bekerja ada yang legal memiliki majikan dan surat izin kerja adapula yang ilegal melalui berbagai jalan tikus tiap bulan kami memfasilitasi pemulangan wni oleh malaysia jumlahnya sekitar -an orang tuturnya pekerja migran indonesia pmi sebutan pengganti tki tidak hanya bekerja ada juga yang menikah lalu memiliki anak anak-anak yang lahir dari hasil pernikahan para pmi ini mayoritas tidak memiliki surat keterangan resmi seperti akta kelahiran mereka menikah hanya dengan syarat agama mahasiswa kkn umm bersama-putra putri pekerja imigran dari indonesia dalam hal ini kjri bertugas mengusahakan untuk membuatkan berbagai surat keterangan sepadan untuk anak-anak para pmi untuk pendidikan anak-anak pmi tidak dapat bersekolah di sekolah negeri malaysia hal ini terkait dengan undang-undang yang dimiliki malaysia bagi orang asing yang memiliki pendapatan di bawah  ringgit malaysia anak-anaknya tidak dapat disekolahkan di sekolah negeri ucapnya keadaan ini membuat pemerintah melalui kjri menginisiasi berbagai metode demi pendidikan anak-anak pmi agar tetap mendapatkan asupan pengetahuan indonesia melakukan negosiasi dengan pemerintahan malaysia untuk mendirikan sekolah-sekolah alternatif negosiasi ini pun berhasil indonesia mendapatkan izin untuk mendirikan sekolah alternatif antusias wni begitu besar pada saat awal berdirinya saja ada -an murid yang belajar mahasiswi kkn umm berinteraksi dengan konjen ri kinabalu malaysia saat acara penyambutan pada  indonesia melakukan negosiasi lagi dengan malaysia untuk mendirikan lingkup belajar yang lebih besar bernama community learning center clc pemerintah serius menangani berbagai masalah yang dihadapi para wni di malaysia utamanya pendidikan bagi anak-anak anda-anda yang yang kkn di sana nanti mari kita bantu mendidik anak-anak wni untuk berwawasan luas dan mencintai indonesia kata cahyono yang pernah menjadi pengajar sementara di fisip umm ini', ' mahasiswa kkn universitas muhammadiyah malang umm malaysia mahasiswa kkn kepala divisi kkn direktorat penelitian pengabdian masyarakat universitas muhammadiyah malang dppkm umm disambut konsulat jenderal kinabalu sabah malaysia khrisna djelani sambutannya khrisna malaysia menerima pengabdian mahasiswa kkn umm program-program dirancang bidang pendidikan menjalani program pengabdian masyarakat kkn aktif membantu proses pembelajaran sekolah-sekolah clc community learning center membina anak-anak pekerja migran indonesia pmi sabah malaysia pembelajaran pengalaman kesan tersendiri memaknai nasionalisme negeri jaga harumkan nama indonesia membawa paspor negeri sabah malaysia pesan khrisna kota pusat pemerintahan pantai barat negeri sabah  ribu warga negara indonesia wni perkiraan aktivitas konsulat jenderal republik indonesia kjri kinabalu malaysia tercatat kantor  ribu orang cahyono rustam pelaksana fungsi penerangan sosial budaya kjri kota kinabalu kuliah agenda pengarahan pelepasan kuliah kerja nyata kkn universitas muhamamdiyah malang umm semester genap  senin  rata-rata wni kinabalu legal memiliki majikan surat izin kerja adapula ilegal jalan tikus memfasilitasi pemulangan wni malaysia -an orang pekerja migran indonesia pmi sebutan pengganti tki menikah memiliki anak anak-anak lahir hasil pernikahan pmi mayoritas memiliki surat keterangan resmi akta kelahiran menikah syarat agama mahasiswa kkn umm bersama-putra putri pekerja imigran indonesia kjri bertugas mengusahakan membuatkan surat keterangan sepadan anak-anak pmi pendidikan anak-anak pmi bersekolah sekolah negeri malaysia terkait undang-undang dimiliki malaysia orang asing memiliki pendapatan  ringgit malaysia anak-anaknya disekolahkan sekolah negeri pemerintah kjri menginisiasi metode pendidikan anak-anak pmi asupan pengetahuan indonesia negosiasi pemerintahan malaysia mendirikan sekolah-sekolah alternatif negosiasi berhasil indonesia izin mendirikan sekolah alternatif antusias wni berdirinya -an murid belajar mahasiswi kkn umm berinteraksi konjen ri kinabalu malaysia acara penyambutan  indonesia negosiasi malaysia mendirikan lingkup belajar bernama community learning center clc pemerintah serius menangani dihadapi wni malaysia utamanya pendidikan anak-anak anda-anda kkn mari bantu mendidik anak-anak wni berwawasan luas mencintai indonesia cahyono pengajar fisip umm', ' mahasiswa kkn universitas muhammadiyah malang umm malaysia mahasiswa kkn kepala divisi kkn direktorat teliti abdi masyarakat universitas muhammadiyah malang dppkm umm sambut konsulat jenderal kinabalu sabah malaysia khrisna djelani sambut khrisna malaysia terima abdi mahasiswa kkn umm program rancang bidang didik jalan program abdi masyarakat kkn aktif bantu proses pembelajaran sekolah clc community learning center bina anak kerja migran indonesia pmi sabah malaysia pembelajaran alam kesan sendiri makna nasionalisme negeri jaga harum nama indonesia bawa paspor negeri sabah malaysia pesan khrisna kota pusat perintah pantai barat negeri sabah  ribu warga negara indonesia wni kira aktivitas konsulat jenderal republik indonesia kjri kinabalu malaysia catat kantor  ribu orang cahyono rustam laksana fungsi terang sosial budaya kjri kota kinabalu kuliah agenda arah lepas kuliah kerja nyata kkn universitas muhamamdiyah malang umm semester genap  senin  rata wni kinabalu legal milik majikan surat izin kerja adapula ilegal jalan tikus fasilitas pulang wni malaysia -an orang kerja migran indonesia pmi sebut ganti tki meni milik anak anak lahir hasil nikah pmi mayoritas milik surat terang resmi akta lahir meni syarat agama mahasiswa kkn umm sama putra putri kerja imigran indonesia kjri tugas usaha buat surat terang padan anak pmi didik anak pmi seko sekolah negeri malaysia kait undang milik malaysia orang asing milik dapat  ringgit malaysia anak sekolah sekolah negeri perintah kjri inisiasi metode didik anak pmi asupan tahu indonesia negosiasi perintah malaysia diri sekolah alternatif negosiasi hasil indonesia izin diri sekolah alternatif antusias wni diri -an murid ajar mahasiswi kkn umm interaksi konjen ri kinabalu malaysia acara sambut  indonesia negosiasi malaysia diri lingkup ajar nama community learning center clc perintah serius tangan hadap wni malaysia utama didik anak anda kkn mari bantu didik anak wni wawas luas cinta indonesia cahyono ajar fisip umm'),
(53, 1276, 'mengajak belajar sambil bermain merupakan metode ampuh agar anak antusias apalagi jika hal tersebut dilakukan untuk mengajar mata pelajaran matematika yang biasanya kurang diminati salah satu permainan yang cocok menjadi teman belajar adalah wendell  yang mana permainan berjenis kartu itu mengajak para murid untuk menghitung tanpa alat bantu kepala sekolah sdn  pasar minggu awaluddin yang menjadi sekolah pertama yang diperkenalkan dengan metode ini menyebutkan bahwa dia sangat senang sebab anak didiknya menjadi antusias dalam belajar menghitung sangat menyenangkan keren banget itu anak-anak kita itu berkembang ini-nya otak kalau dulu kan  tambah  berapa  kan kalau sekarang itu istilahnya diketahui kalau jumlahnya  murid-murid ayo cari angka yang sesuai kata dia kepada jawaposcom di lokasi jakarta rabu  yang di maksudkan antusias oleh awaluddin yaitu adalah murid tidak hanya melihat atau terdiam saja namun juga ikut aktif untuk berpikir didalam permainan wendell  luar biasa langsung terlibat semua ini kelebihannya permainan saya bersama guru-guru juga sudah membicarakan hal itu diterapkan saya akan briefing dulu untuk nerapin hal ini saya yakin nggak ada yang diem aja kalau dengan model begini terlibat semua kita terapkan dalam pembelajaran dan kita sesuaikan dengan studi artinya mengaktifkan anak itu dengan cara seperti ini kerja kelompok misalnya katanya salah satu murid yang ikut bermain adalah radit sambil tersenyum ia mengaku senang dan ingin belajar sambil bermain lagi seru seru banget itu gampang kok mainnya ucap murid kelas  itu hal yang sama juga diungkapkan oleh desila yang menceritakan bahwa permainan itu dapat dipahami dengan mudah apalagi card game ini membuat dirinya bisa berkompetisi dengan murid yang lain bisa kok mainnya seru dan seneng banget itu kan tadi cari angka   sama  dan kita tadi dikasih  kartu angka-angkanya itu dari  sampai  misalnya ada angka     dan   tambah  tambah  kan  itu kita dapet  poin soalnya kan kita gunain  kartu seru banget mau main lagi jelasnya girang', 'mengajak belajar bermain metode ampuh anak antusias mengajar mata pelajaran matematika diminati salah permainan cocok teman belajar wendell  permainan berjenis kartu mengajak murid menghitung alat bantu kepala sekolah sdn  pasar minggu awaluddin sekolah diperkenalkan metode senang anak didiknya antusias belajar menghitung menyenangkan keren banget anak-anak berkembang ini-nya otak    istilahnya  murid-murid ayo cari angka sesuai jawaposcom lokasi jakarta rabu  maksudkan antusias awaluddin murid terdiam aktif berpikir didalam permainan wendell  langsung terlibat kelebihannya permainan guru-guru membicarakan diterapkan briefing nerapin nggak diem aja model terlibat terapkan pembelajaran sesuaikan studi mengaktifkan anak kerja kelompok salah murid bermain radit tersenyum mengaku senang belajar bermain seru seru banget gampang mainnya murid kelas  desila menceritakan permainan dipahami mudah card game berkompetisi murid mainnya seru seneng banget cari angka    dikasih  kartu angka-angkanya   angka          dapet  poin gunain  kartu seru banget main girang', 'ajak ajar main metode ampuh anak antusias ajar mata pelajaran matematika minat salah main cocok teman ajar wendell  main jenis kartu ajak murid hitung alat bantu kepala sekolah sdn  pasar minggu awaluddin sekolah kenal metode senang anak didik antusias ajar hitung senang keren banget anak kembang ini nya otak    istilah  murid ayo cari angka sesuai jawaposcom lokasi jakarta rabu  maksud antusias awaluddin murid diam aktif pikir dalam main wendell  langsung libat lebih main guru bicara terap briefing nerapin nggak diem aja model libat terap pembelajaran sesuai studi aktif anak kerja kelompok salah murid main radit senyum mengaku senang ajar main seru seru banget gampang main murid kelas  desila cerita main paham mudah card game kompetisi murid main seru neng banget cari angka    kasih  kartu angka   angka          dapet  poin gunain  kartu seru banget main girang'),
(54, 1277, 'bagi sebagian banyak orang matematika yang berisi angka-angka bukanlah hal yang diminati untuk dipelajari akan tetapi dengan adanya permainan wendell  matematika yang awalnya membosankan dapat menjadi menyenangkan wendell  sendiri merupakan sebuah permainan kartu yang dicetuskan oleh wendell parnell pada  lalu permainan ini tercipta atas kekhawatirannya terhadap generasi sekarang yang lebih mengandalkan mesin daripada otak untuk berhitung wendell saat ditemui jawaposcom ketika memperkenalkan pertama kalinya card game di indonesia lokasi tepatnya di sdn  pasar minggu jakarta selatan mengatakan bahwa rencananya permainan ini akan ditambahkan variasinya jadi bukan hanya pertambahan nantinya akan ada pengurangan pembagian dan perkalian dengan metode kartu itu nanti akan kita bicarakan karena masih proses sekarang masih langkah awal kita akan launching secara bertahap tuturnya di lokasi jakarta rabu  alasan utama mengunjungi indonesia adalah untuk menimbulkan rasa bahwa matematika adalah suatu hal yang menyenangkan sebab pada dasarnya anak-anak biasa menganggap kalau pelajaran tersebut menyebalkan karena saya tertarik dengan  juta lebih penduduk indonesia khususnya anak-anak yang mungkin tidak memiliki komputer untuk bermain wendell  ini juga bisa dimainkan di mana saja sekaligus belajar matematika tanpa harus menggunakan teknologi seperti yang tadi kita lihat anak-anak itu merasa sangat antusias ketika dia bermain ini dan mereka itu tidak menganggap kalau itu adalah pelajaran matematika tuturnya dirinya bersama tim tidak hanya mengunjungi satu sekolah selama memperkenalk permainan tersebut di indonesia akan tetapi juga di  sekolah lain mulai dari tingkat sd sampai sma yang akan berlangsung hingga  januari mendatang nanti akan ada orang yang mengembangkan mengenalkan permainan wendell  khusus di indonesia bermain ini tidak harus setiap hari bisa dalam satu bulan itu  kali di mana  kelas itu bisa dibuat  tim karena itu bisa mengembangkan kreativitas dan kompetisi mereka ujar dia ia berharap bahwa suatu saat permainan ini dapat berdampak positif pada masyarakat indonesia khususnya yang masih mengenyam pendidikan saat ini kan mereka gampangin karena adanya kalkuator saya ingin mengembangkan pemikiran-pemikiran anak-anak saat ini di mana mereka menggunakan otaknya bukan mesin untuk menghitung dengan adanya ini saya berharap bisa terkenang nantinya menjadi salah satu pencipta permainan matematika yang menyenangkan jelasnya untuk mendapatkan wendell  masyarakat dapat mengakses website wwwwendellcom dan membelinya dengan harga aud  atau rp  kita akan jual lebih murah di indonesia kita akan produksi di sini dan harganya lebih murah mungkin tahun-tahun ini sudah produksi kartunya kata wendell', 'orang matematika berisi angka-angka diminati dipelajari permainan wendell  matematika membosankan menyenangkan wendell  permainan kartu dicetuskan wendell parnell  permainan tercipta kekhawatirannya generasi mengandalkan mesin otak berhitung wendell ditemui jawaposcom memperkenalkan kalinya card game indonesia lokasi tepatnya sdn  pasar minggu jakarta selatan rencananya permainan variasinya pertambahan pengurangan pembagian perkalian metode kartu bicarakan proses langkah launching bertahap lokasi jakarta rabu  alasan utama mengunjungi indonesia menimbulkan matematika menyenangkan dasarnya anak-anak menganggap pelajaran menyebalkan tertarik  juta penduduk indonesia anak-anak memiliki komputer bermain wendell  dimainkan belajar matematika teknologi lihat anak-anak antusias bermain menganggap pelajaran matematika tim mengunjungi sekolah memperkenalk permainan indonesia  sekolah tingkat sd sma  januari orang mengembangkan mengenalkan permainan wendell  khusus indonesia bermain  kali  kelas  tim mengembangkan kreativitas kompetisi berharap permainan berdampak positif masyarakat indonesia mengenyam pendidikan gampangin kalkuator mengembangkan pemikiran-pemikiran anak-anak otaknya mesin menghitung berharap terkenang salah pencipta permainan matematika menyenangkan wendell  masyarakat mengakses website wwwwendellcom membelinya harga aud  rp  jual murah indonesia produksi harganya murah tahun-tahun produksi kartunya wendell', 'orang matematika isi angka minat dipelajari main wendell  matematika bosan senang wendell  main kartu cetus wendell parnell  main cipta khawatir generasi andal mesin otak hitung wendell temu jawaposcom kenal kali card game indonesia lokasi tepat sdn  pasar minggu jakarta selatan rencana main variasi tambah kurang bagi kalian metode kartu bicara proses langkah launching tahap lokasi jakarta rabu  alas utama unjung indonesia timbul matematika senang dasar anak anggap pelajaran sebal tarik  juta duduk indonesia anak milik komputer main wendell  main ajar matematika teknologi lihat anak antusias main anggap pelajaran matematika tim unjung sekolah memperkenalk main indonesia  sekolah tingkat sd sma  januari orang kembang kenal main wendell  khusus indonesia main  kali  kelas  tim kembang kreativitas kompetisi harap main dampak positif masyarakat indonesia kenyam didik gampangin kalkuator kembang pemikiran anak otak mesin hitung harap kenang salah cipta main matematika senang wendell  masyarakat akses website wwwwendellcom beli harga aud  rp  jual murah indonesia produksi harga murah tahun produksi kartu wendell'),
(55, 1278, 'pada  tahun silam sebuah meteor jatuh ke bumi dan mendarat di australia penelitian terbaru mengungkap temuan mengagetkan bahwa meteor itu mengandung debu bintang atau stardust yang terbentuk sekitar  sampai  miliar tahun lalu diketahui meteor dan debu bintangnya adalah material solid tertua yang pernah ditemukan di planet ini sebagai gambaran matahari kita berumur sekitar  miliar tahun sehingga debu bintang itu sudah eksis jauh sebelum matahari dan tata surya debu bintang di meteor bernama murchison itu disebut sebagai butiran pra matahari karena terbentuk sebelum adanya bintang kita dikutip dari cnn  bintang lahir saat gas debu dan panas berpadu dengan cara yang tepat mereka bisa eksis jutaan sampai miliaran tahun sebelum sekarat dan melepaskan penyusun utamanya ke antariksa meteor seandainya tidak menabrak terlalu banyak benda dapat menjadi semacam kapsul waktu dengan material pembentuk bintang yang terjebak di tubuhnya namun penemuan debu bintang di meteor yang jatuh ke bumi sangat jarang hanya  persen di antaranya mengandung material tersebut studi terbaru soal murchison dipublikasikan di jurnal national academy of sciences ini merupakan salah satu studi paling menarik yang pernah saya kerjakan kata philip heck salah satu peneliti dari university of chicago itu adalah material solid tertua yang pernah ditemukan dan memberitahu kita terkait bagaimana bintang terbentuk di galaksi kita itu adalah sampel solid dari bintang jelasnya sebagian debu bintang yang didapat berusia sekitar  sampai  miliar tahun sebagian lagi lebih tua dari  miliar tahun disimpulkan pula bahwa  miliar tahun silam bintang-bintang mulai banyak terbentuk sangat menarik mengamati sejarah galaksi kita debu bintang adalah material tertua yang pernah menyambangi bumi dan darinya kita bisa belajar soal bintang asal karbon di tubuh kita dan dari mana oksigen berasal dengan debu bintang kita bisa melacak material sebelum adanya matahari pungkasnya', ' silam meteor jatuh bumi mendarat australia penelitian terbaru mengungkap temuan mengagetkan meteor mengandung debu bintang stardust terbentuk   miliar meteor debu bintangnya material solid tertua ditemukan planet gambaran matahari berumur  miliar debu bintang eksis matahari tata surya debu bintang meteor bernama murchison butiran pra matahari terbentuk bintang dikutip cnn  bintang lahir gas debu panas berpadu eksis jutaan miliaran sekarat melepaskan penyusun utamanya antariksa meteor seandainya menabrak benda kapsul material pembentuk bintang terjebak tubuhnya penemuan debu bintang meteor jatuh bumi jarang  persen mengandung material studi terbaru murchison dipublikasikan jurnal national academy of sciences salah studi menarik kerjakan philip heck salah peneliti university of chicago material solid tertua ditemukan memberitahu terkait bintang terbentuk galaksi sampel solid bintang debu bintang berusia   miliar tua  miliar disimpulkan  miliar silam bintang-bintang terbentuk menarik mengamati sejarah galaksi debu bintang material tertua menyambangi bumi darinya belajar bintang karbon tubuh oksigen berasal debu bintang melacak material matahari pungkasnya', ' silam meteor jatuh bumi darat australia teliti baru ungkap temu kaget meteor kandung debu bintang stardust bentuk   miliar meteor debu bintang material solid tua temu planet gambar matahari umur  miliar debu bintang eksis matahari tata surya debu bintang meteor nama murchison butir pra matahari bentuk bintang kutip cnn  bintang lahir gas debu panas padu eksis juta miliar sekarat lepas susun utama antariksa meteor andai tabrak benda kapsul material bentuk bintang jebak tubuh temu debu bintang meteor jatuh bumi jarang  persen kandung material studi baru murchison publikasi jurnal national academy of sciences salah studi tarik kerja philip heck salah teliti university of chicago material solid tua temu memberitahu kait bintang bentuk galaksi sampel solid bintang debu bintang usia   miliar tua  miliar simpul  miliar silam bintang bentuk tarik amat sejarah galaksi debu bintang material tua sambang bumi dari ajar bintang karbon tubuh oksigen asal debu bintang lacak material matahari pungkas'),
(56, 1279, 'prestasi mahasiswa institut teknologi nasional itn malang semakin melejit saja di awal tahun ini sebanyak  mahasiswa berhasil memborong  medali di bidang taekwondo keempat mahasiswa tersebut berhasil membawa pulang medali itu dari kejuaraan nd instiper di yogyakarta pada - januari  yang digelar institut pertanian stiper instiper yogyakarta dengan jumlah peserta  orang bernika natasya ifada mahasiswa teknik geodesi bahkan meraih  medali yakni perak dan perunggu ia meraih medali perak poomsae senijurus bela diri individual putri dan medali perunggu kyorugi fight female under  latihannya lumayan dadakan tapi kalau saya alhamdulillah memang dari dulu terlatih beladiri yang dinilai dari keindahan ya jadi bersyukur lancar ceritanya sedangkan kawannya reva nabila putri mahasiswa teknik lingkungan membawa medali emas ia meraih medali itu di cabang kyorugi fight female under  latihannya mepet banget kurang seminggu sempat diet air putih juga agar bisa turunin berat badan  kg eh tapi gagal ya bersyukur itu nggak jadi masalah ungkapnya lain cerita lagi dengan pamungkas hutapea yang meraih medali perunggu kyorugifight under  ia mengatakan sebenarnya sangat ingin mengikuti kejuaraan di kelas berat bawahnya yakni under  tapi saya ada masalah berat badan usai liburan akhirnya ya naik kelas sempat mau nurunin ya gagal ya sudah ikur kelas  akhirnya curhat mahasiswa teknik sipil ini terakhir cerita alvin ahlunnizar peraih medali perak kyorugi fight male under  mahasiswa teknik geodesi ini mengaku jelang pertandingan tubuhnya penuh dengan lebam dan sempat membuatnya resah selama latihan ada bekas cidera kayak lebam-lebam gitu tapi masih kuat tanding sebenarnya target saya emas nanti lag lain kesempatan tegasnya wakil rektor iii bidang kemahasiswaan alumni dan kerjasama itn malang fourry handoko st ssmt phd mengatakan bakal terus mendorong mahasiswa mengikuti ajang di luar kanpus baik akademik maupun non akademik selalu kami dukung apa yang mereka ikuti tidak cuma akademik saja non akademik juga kami dorong jelasnya', 'prestasi mahasiswa institut teknologi nasional itn malang melejit  mahasiswa berhasil memborong  medali bidang taekwondo keempat mahasiswa berhasil membawa pulang medali kejuaraan nd instiper yogyakarta - januari  digelar institut pertanian stiper instiper yogyakarta peserta  orang bernika natasya ifada mahasiswa teknik geodesi meraih  medali perak perunggu meraih medali perak poomsae senijurus bela individual putri medali perunggu kyorugi fight female under  latihannya lumayan dadakan alhamdulillah terlatih beladiri dinilai keindahan ya bersyukur lancar ceritanya kawannya reva nabila putri mahasiswa teknik lingkungan membawa medali emas meraih medali cabang kyorugi fight female under  latihannya mepet banget seminggu diet air putih turunin berat badan  kg eh gagal ya bersyukur nggak cerita pamungkas hutapea meraih medali perunggu kyorugifight under  mengikuti kejuaraan kelas berat bawahnya under  berat badan liburan ya kelas nurunin ya gagal ya ikur kelas  curhat mahasiswa teknik sipil cerita alvin ahlunnizar peraih medali perak kyorugi fight male under  mahasiswa teknik geodesi mengaku jelang pertandingan tubuhnya penuh lebam membuatnya resah latihan bekas cidera kayak lebam-lebam gitu kuat tanding target emas lag kesempatan wakil rektor iii bidang kemahasiswaan alumni kerjasama itn malang fourry handoko st ssmt phd mendorong mahasiswa mengikuti ajang kanpus akademik non akademik dukung ikuti akademik non akademik dorong', 'prestasi mahasiswa institut teknologi nasional itn malang lejit  mahasiswa hasil borong  medali bidang taekwondo empat mahasiswa hasil bawa pulang medali juara nd instiper yogyakarta - januari  gelar institut tani stiper instiper yogyakarta serta  orang bernika natasya ifada mahasiswa teknik geodesi raih  medali perak perunggu raih medali perak poomsae senijurus bela individual putri medali perunggu kyorugi fight female under  latih lumayan dadak alhamdulillah latih beladiri nilai indah ya syukur lancar cerita kawan reva nabila putri mahasiswa teknik lingkung bawa medali emas raih medali cabang kyorugi fight female under  latih mepet banget minggu diet air putih turunin berat badan  kg eh gagal ya syukur nggak cerita pamungkas hutapea raih medali perunggu kyorugifight under  ikut juara kelas berat bawah under  berat badan libur ya kelas nurunin ya gagal ya ikur kelas  curhat mahasiswa teknik sipil cerita alvin ahlunnizar raih medali perak kyorugi fight male under  mahasiswa teknik geodesi mengaku jelang tanding tubuh penuh lebam buat resah latih bekas cidera kayak lebam gitu kuat tanding target emas lag sempat wakil rektor iii bidang mahasiswa alumni kerjasama itn malang fourry handoko st ssmt phd dorong mahasiswa ikut ajang kanpus akademik non akademik dukung ikut akademik non akademik dorong');
