(64, 1287, 'pedangdut idul daratista berulang tahun ke- tahun belum lama ini di usianya sekarang istri dari adam suseno itu ingin memberikan manfaat yang sebesar-besarnya untuk banyak orang inul pun kepikiran membuat yayasan yang dapat menampung anak-anak kurang beruntung di momen ultahnya tahun ini sebenarnya yang belum kesampian saya mau bikin semacam kayak yayasan satu tempat yang bisa bikin saya damai di sana ada masjid atau musala dan ada anak-anak yatim ujar inul daratista saat ditemui bilangan pejaten village jakarta selatan rabu  untuk saat ini inul belum dapat merealisasikan keinginannya tersebut karena masih banyak hal yang perlu dipersiapkan salah satu yang paling mendasar inul belum menemukan lokasi yang tepat untuk membangun panti asuhan inul pun sudah mencari informasi terkait lokasi strategis yang kemungkinan bisa dijadikan tempat berdirinya panti asuhan kepikirannya sekarang masih cari lahan prosesnya seperti apa masih cari-cari informasi ucap pemilik nama lahir ainur rokhimah tersebut sementara cita-cita yang sudah tercapai di usianya ke- inul daratista bisa memberangkatkan umrah  orang secara gratis mereka terdiri dari  orang pelanggan bisnis karaoke miliknya dan  orang lainnya karyawan dari pemilik goyang ngebor selama berada di tanah suci inul memastikan fasilitas yang diberikannya kepada  orang tersebut sama dengan yang didapat jamaah umrah lain rencananya mereka akan berangkat rame-rame ke tanah suci pada maret  mendatang di sana mereka selama sekitar  hari di madina  malam di mekkah  malam mereka dapat fasilitas yang didapat pada umumnya umrah yang lain ini full ibadah ucap inul daratista ', 'pedangdut idul daratista berulang ke- usianya istri adam suseno manfaat sebesar-besarnya orang inul kepikiran yayasan menampung anak-anak beruntung momen ultahnya kesampian bikin kayak yayasan bikin damai masjid musala anak-anak yatim inul daratista ditemui bilangan pejaten village jakarta selatan rabu  inul merealisasikan keinginannya dipersiapkan salah mendasar inul menemukan lokasi membangun panti asuhan inul mencari informasi terkait lokasi strategis dijadikan berdirinya panti asuhan kepikirannya cari lahan prosesnya cari-cari informasi pemilik nama lahir ainur rokhimah cita-cita tercapai usianya ke- inul daratista memberangkatkan umrah  orang gratis  orang pelanggan bisnis karaoke miliknya  orang karyawan pemilik goyang ngebor tanah suci inul fasilitas  orang jamaah umrah rencananya berangkat rame-rame tanah suci maret   madina  malam mekkah  malam fasilitas umrah full ibadah inul daratista ', 'dangdut idul daratista ulang ke- usia istri adam suseno manfaat besar orang inul pikir yayasan tampung anak untung momen ultahnya kesampian bikin kayak yayasan bikin damai masjid musala anak yatim inul daratista temu bilang pejaten village jakarta selatan rabu  inul realisasi ingin siap salah dasar inul temu lokasi bangun panti asuh inul cari informasi kait lokasi strategis jadi diri panti asuh pikir cari lahan proses cari informasi milik nama lahir ainur rokhimah cita capai usia ke- inul daratista berangkat umrah  orang gratis  orang langgan bisnis karaoke milik  orang karyawan milik goyang ngebor tanah suci inul fasilitas  orang jamaah umrah rencana berangkat rame tanah suci maret   madina  malam mek  malam fasilitas umrah full ibadah inul daratista '),
(65, 1288, 'teddy suami dari mendiang lina jubaedah sudah menyerahkan aset berupa rumah dan ruko kepada putri delina anak perempuannya dan komedian entis sutisna alias sule penyerahan itu dilaksanakan sesuai amanah dari mendiang lina sebelum meninggal kabar penyerahan aset tersebut diungkapkan teddy betul itu amanahnya sebelum almarhumah istri meninggal sudah ada ucapan dikasih nama teh putri ucap teddy melalui pesan singkat menurut penuturannya aset berupa rumah dan ruko itu diberikan lina secara langsung kepada putri teddy pun sempat menyaksikan prosesi penyerahan tersebut kalau sertifikatnya baru kemarin karena sebelumnya masih dititip di koper travel merah ibunya ungkapnya lebih lanjut teddy kini bisa lebih tenang karena amanah almarhumah lina sudah dia mulai tunaikan satu per satu dia pun mengatakan akan menuntaskan semua anamah dari mendiang istri termasuk kepada rizky febian iya semua amanat bakalan dikasihkan sesuai keinginan almarhumah alhamdulillah walaupun pemberitaan beda dengan kenyataan saya terima asal almarhumah istri tenang tutur teddy seperti diketahui lina jubaedah meninggal di bandung jawa barat pada sabtu  januari  jenazahnya awalnya dimakamkan di pemakaman sekelimus namun akhirnya dipindah ke tpu nagrog ujung berung bandung atas kesepakatan bersama antara rizky febian dan teddy usai dilakukan otopsi belakangan diketahui kalau mendiang lina meninggalkan aset dalam jumlah besar jika dikalkulasi harta peninggalan mantan istri komedian sule itu diperkirakan mencapai rp  miliar asetnya terbagi berupa rumah kontrakan  pintu tanah salon tanah dan yang lainnya', 'teddy suami mendiang lina jubaedah menyerahkan aset rumah ruko putri delina anak perempuannya komedian entis sutisna alias sule penyerahan dilaksanakan sesuai amanah mendiang lina meninggal kabar penyerahan aset teddy amanahnya almarhumah istri meninggal ucapan dikasih nama teh putri teddy pesan singkat penuturannya aset rumah ruko lina langsung putri teddy menyaksikan prosesi penyerahan sertifikatnya kemarin dititip koper travel merah ibunya teddy tenang amanah almarhumah lina tunaikan menuntaskan anamah mendiang istri rizky febian iya amanat dikasihkan sesuai almarhumah alhamdulillah pemberitaan beda kenyataan terima almarhumah istri tenang teddy lina jubaedah meninggal bandung jawa barat sabtu  januari  jenazahnya dimakamkan pemakaman sekelimus dipindah tpu nagrog ujung berung bandung kesepakatan rizky febian teddy otopsi mendiang lina meninggalkan aset dikalkulasi harta peninggalan mantan istri komedian sule mencapai rp  miliar asetnya terbagi rumah kontrakan  pintu tanah salon tanah', 'teddy suami mendiang lina jubaedah serah aset rumah ruko putri delina anak perempuan komedian entis sutisna alias sule serah laksana sesuai amanah mendiang lina tinggal kabar serah aset teddy amanah almarhumah istri tinggal ucap kasih nama teh putri teddy pesan singkat tutur aset rumah ruko lina langsung putri teddy saksi prosesi serah sertifikat kemarin titip koper travel merah ibu teddy tenang amanah almarhumah lina tunai tuntas anamah mendiang istri rizky febian iya amanat kasih sesuai almarhumah alhamdulillah berita beda nyata terima almarhumah istri tenang teddy lina jubaedah tinggal bandung jawa barat sabtu  januari  jenazah makam makam sekelimus pindah tpu nagrog ujung berung bandung sepakat rizky febian teddy otopsi mendiang lina tinggal aset kalkulasi harta tinggal mantan istri komedian sule capai rp  miliar aset bagi rumah kontrak  pintu tanah salon tanah'),
(66, 1289, 'kepolisian bergerak cepat menindaklanjuti laporan yang dilakukan rizky febian terkait meninggalnya lina jubedah yang diduga tidak wajar selain melakukan otopsi jenazah polisi juga sudah memeriksa sejumlah saksi sedikitnya sudah ada  saksi yang berhasil dimintai keterangan oleh penyidik dari mapolrestabes bandung jawa barat para saksi tersebut terdiri dari saksi pelapor yaitu rizky febian dokter rumah sakit al islam satpam orang yang memandikan jenazah lina dan yang lainnya sudah ada  saksi yang sudah dimintai keterangan terakhir dokter rumah sakit al islam yang kami mintai keterangan ucap kabid humas polda jawa barat kombes pol saptono erlangga kepada wartawan rabu  dokter rumah sakit al islam bandung diminta keterangannya lantaran lina sempat dilarikan ke rumah sakit tersebut sebelum akhirnya meninggal dunia penyidik merasa perlu untuk mendapatkan informasi dari dokter yang menangani untuk mengetahui kondisi terakhir lina sudah cukup banyak saksi yang diperiksa kini penyidik tengah menunggu hasil otopsi atas jenazah lina yang kemungkinan akan keluar dalam waktu dekat hasil otopsi sangat penting karena akan mengungkap fakta penyebab meninggalnya istri teddy tersebut jika hasil otopsi menyatakan bahwa kematian lina tidak wajar maka polisi akan mengembangkan kasus ini tentunya guna memburu siapa pelaku yang harus bertanggungjawab karena tugas penyelidik membuat terang suatu tindak pidana ucap saptono erlangga lebih lanjut seperti diketahui lina jubaedah yang merupakan ibunda dari penyanyi rizky febian dan putri delina meninggal pada sabtu  januari  ia menghembuskan napas terakhir pada waktu subuh setelah sempat pingsan di rumah dan dilarikan ke rumah sakit al islam bandung jawa barat penyebab meninggalnya lina awalnya disebut karena darah tinggi dan adanya permasalahan pada bagian lambung namun belakangan rizky febian mempertanyakan penyebab meninggalnya lina yang menduga ada ketidakwajaran sehingga dia pun membuat lapora polisi ke polrestabes bandung jawa barat pada  januari ', 'kepolisian bergerak cepat menindaklanjuti laporan rizky febian terkait meninggalnya lina jubedah diduga wajar otopsi jenazah polisi memeriksa saksi  saksi berhasil keterangan penyidik mapolrestabes bandung jawa barat saksi saksi pelapor rizky febian dokter rumah sakit al islam satpam orang memandikan jenazah lina  saksi keterangan dokter rumah sakit al islam mintai keterangan kabid humas polda jawa barat kombes pol saptono erlangga wartawan rabu  dokter rumah sakit al islam bandung keterangannya lantaran lina dilarikan rumah sakit meninggal dunia penyidik informasi dokter menangani kondisi lina saksi diperiksa penyidik menunggu hasil otopsi jenazah lina hasil otopsi mengungkap fakta penyebab meninggalnya istri teddy hasil otopsi kematian lina wajar polisi mengembangkan memburu pelaku bertanggungjawab tugas penyelidik terang tindak pidana saptono erlangga lina jubaedah ibunda penyanyi rizky febian putri delina meninggal sabtu  januari  menghembuskan napas subuh pingsan rumah dilarikan rumah sakit al islam bandung jawa barat penyebab meninggalnya lina darah permasalahan lambung rizky febian penyebab meninggalnya lina menduga ketidakwajaran lapora polisi polrestabes bandung jawa barat  januari ', 'polisi gerak cepat menindaklanjuti lapor rizky febian kait tinggal lina jubedah duga wajar otopsi jenazah polisi periksa saksi  saksi hasil terang sidik mapolrestabes bandung jawa barat saksi saksi lapor rizky febian dokter rumah sakit al islam satpam orang mandi jenazah lina  saksi terang dokter rumah sakit al islam minta terang kabid humas polda jawa barat kombes pol saptono erlangga wartawan rabu  dokter rumah sakit al islam bandung terang lantar lina larik rumah sakit tinggal dunia sidik informasi dokter tangan kondisi lina saksi periksa sidik tunggu hasil otopsi jenazah lina hasil otopsi ungkap fakta sebab tinggal istri teddy hasil otopsi mati lina wajar polisi kembang buru pelaku bertanggungjawab tugas selidik terang tindak pidana saptono erlangga lina jubaedah ibunda penyanyi rizky febian putri delina tinggal sabtu  januari  hembus napas subuh pingsan rumah larik rumah sakit al islam bandung jawa barat sebab tinggal lina darah masalah lambung rizky febian sebab tinggal lina duga ketidakwajaran lapora polisi polrestabes bandung jawa barat  januari '),
(67, 1290, 'momen brad pitt dan jennifer aniston saat bersama dulu sudah  tahun sejak brad pitt dan jennifer aniston bercerai tapi hubungan keduanya kembali menjadi sorotan mereka ramai menjadi perbincangan setelah masing-masing memenangkan penghargaan sag pada  januari lalu brad pitt dan jennifer aniston mengadakan reuni hangat di belakang panggung sebuah foto yang diambil keduanya yang menikah dari  hingga  tengah melakukan percakapan tak usah banyak kata-kata tetapi bahasa tubuh mereka menyimpan sejuta makna apalagi ketika brad pitt menatap mantan istrinya dan memegang pergelangan tangannya mata brad pitt senyuman dan ekspresi gembira saat memandang jennifer aniston seolah terjadi percikan saat itu apakah mereka akan bernostalgia dilansir dari oprahmagcom rabu  pakar bahasa tubuh patti woods mengatakan publik tidak salah untuk langsung sampai pada kesimpulan bahwa ada chemistry di antara mereka dia menyebut ada koneksi yang mendalam lewat foto wood menunjuk ke tangan kanan pitt yang memegangi penghargaan penghargaannya ada di tangannya tetapi dia memegangnya rendah di bawah pinggangnya yang penting baginya adalah jennifer kata wood momen brad pitt dan jennifer aniston saat pegangan tangan getty imagesboldsky tangan kiri pitt yang menggenggam tangan kanan aniston mengatakan tetaplah di sini bersamaku wood melihat aniston punya sikap peduli pada pitt ekspresinya adalah kombinasi yang sangat tulus dari tawa dan air mata kata wood kontras dengan posisi tubuhnya meski begitu aniston berusaha untuk tetap membatasi diri sikap itu bisa dimengerti sebab pasti masih tersisa rasa sedih dari masalah mereka terdahulu pernikahan mereka berakhir pada  setelah brad pitt bertemu angelina jolie calon istrinya saat syuting mr dan mrs smith menurut wood ini adalah momen interaksi yang paling kuat terlebih saat brad pitt tetap memegang tangan jennifer aniston saat ingin pergi lalu bagaimana dengan jennifer lihat bagaimana jari-jarinya jennifer aniston bertumpu pada dada brad pitt dengan jari-jari canggung dan tidak rata terentang dengan beberapa jari tertekuk penempatan jari yang canggung dan ketegangan jari menunjukkan pertentangan batinnya keinginannya ingin tetap terhubung tapi masih membatasi kata wood dalam laman us magazine momen manis di belakang panggung tersebut berasal dari jepretan seorang fotografer vivien killilea best dia berbagi detail foto di instagram setelah pertunjukan menggambarkan brad pitt yang penuh semangat memanggil nama aniston ketika ia berada di belakang panggung saya berada di belakang panggung di penghargaan sag dan mendengar suara yang akrab berteriak aniston  aniston saya langsung berbalik dan melihat momen langka sesaat ini terjadi kata sang fotografer dalam foto itu keduanya terlihat sebentar berpegangan tangan dan berpelukan tatapan matanya tampak senang melihat satu sama lain bahkan ketika berada di belakang panggung brad pitt menatap lewat layar tanpa berkedip saat mantan istrinya mengucapkan terima kasih atas penghargaan yang diterima', 'momen brad pitt jennifer aniston  brad pitt jennifer aniston bercerai hubungan sorotan ramai perbincangan memenangkan penghargaan sag  januari brad pitt jennifer aniston mengadakan reuni hangat panggung foto diambil menikah   percakapan kata-kata bahasa tubuh menyimpan sejuta makna brad pitt menatap mantan istrinya memegang pergelangan tangannya mata brad pitt senyuman ekspresi gembira memandang jennifer aniston percikan bernostalgia dilansir oprahmagcom rabu  pakar bahasa tubuh patti woods publik salah langsung kesimpulan chemistry menyebut koneksi mendalam foto wood tangan kanan pitt memegangi penghargaan penghargaannya tangannya memegangnya rendah pinggangnya baginya jennifer wood momen brad pitt jennifer aniston pegangan tangan getty imagesboldsky tangan kiri pitt menggenggam tangan kanan aniston tetaplah bersamaku wood aniston sikap peduli pitt ekspresinya kombinasi tulus tawa air mata wood kontras posisi tubuhnya aniston berusaha membatasi sikap dimengerti tersisa sedih pernikahan  brad pitt bertemu angelina jolie calon istrinya syuting mr mrs smith wood momen interaksi kuat brad pitt memegang tangan jennifer aniston pergi jennifer lihat jari-jarinya jennifer aniston bertumpu dada brad pitt jari-jari canggung terentang jari tertekuk penempatan jari canggung ketegangan jari pertentangan batinnya keinginannya terhubung membatasi wood laman us magazine momen manis panggung berasal jepretan fotografer vivien killilea best berbagi detail foto instagram pertunjukan menggambarkan brad pitt penuh semangat memanggil nama aniston panggung panggung penghargaan sag mendengar suara akrab berteriak aniston  aniston langsung berbalik momen langka sang fotografer foto sebentar berpegangan tangan berpelukan tatapan matanya senang panggung brad pitt menatap layar berkedip mantan istrinya terima kasih penghargaan diterima', 'momen brad pitt jennifer aniston  brad pitt jennifer aniston cerai hubung sorot ramai bincang menang harga sag  januari brad pitt jennifer aniston adakan reuni hangat panggung foto ambil meni   cakap kata bahasa tubuh simpan juta makna brad pitt tatap mantan istri pegang gelang tangan mata brad pitt senyum ekspresi gembira pandang jennifer aniston percik nostalgia lansir oprahmagcom rabu  pakar bahasa tubuh patti woods publik salah langsung simpul chemistry sebut koneksi dalam foto wood tangan kanan pitt pegang harga harga tangan pegang rendah pinggang bagi jennifer wood momen brad pitt jennifer aniston pegang tangan getty imagesboldsky tangan kiri pitt genggam tangan kanan aniston tetap sama wood aniston sikap peduli pitt ekspresi kombinasi tulus tawa air mata wood kontras posisi tubuh aniston usaha batas sikap dimengerti sisa sedih nikah  brad pitt bertemu angelina jolie calon istri syuting mr mrs smith wood momen interaksi kuat brad pitt pegang tangan jennifer aniston pergi jennifer lihat jari jennifer aniston tumpu dada brad pitt jari canggung terentang jari tekuk tempat jari canggung tegang jari tentang batin ingin hubung