(68, 1291, 'penyebab kematian ibunda penyanyi rizky febian dan putri delita lina jubaedah masih menunggu hasil otopsi seperti diketahui pihak yang berwajib telah melakukan otopsi terhadap jenazah lina pada  januari  lalu lantas sejauh mana perkembangannya kabid humas polda jawa barat kombes pol saptono erlangga sebelumnya mengatakan hasil otopsi lina diperkirakan akan keluar setelah  hari kerja mengacu pada keterangan yang disampaikan tersebut hasil otopsi lina akan keluar dalam waktu dekat dia meminta untuk menunggu dalam satu atau dua hari ke depan untuk hasil otopsi kita tunggu dalam satu atau dua hari ke depan karena normatifnya kan  hari kerja disampaikan dari laboratorium forensik  ujar kombes pol saptono erlangga rabu  dia pun berharap hasil otopsi lina bisa diungkap dalam waktu dekat supaya ada kepastian terkait penyebab meninggalnya lina yang menghembuskan napas terakhir pada sabtu  jauari  hasil otopsi akan mengungkap fakta apakah kematian mantan istri sule itu termasuk wajar atau tidak wajar nanti kita lihat hasil otopsinya seperti apa apakah ada ketidakwajaran atau wajar karena sakit kami juga lagi menunggu hasilnya katanya lebih lanjut jika ada temuan kalau meninggalnya lina tidak wajar saptono erlangga menegaskan pihak berwajib akan menindaklanjutinya tentunya untuk mengetahui siapa pelaku yang bertanggung jawab melakukan dugaan tindak pidana tersebut hasil otopsi ini erat kaitannya dengan perkembangan laporan rizky febian yang membuat laporan polisi ke polrestabes bandung jawa barat pada  januari  kalau ditemukan adanya ketidakwajaran maka tugas penyidik mengungkap pelakunya ungkap kombes pol saptono erlangga', 'penyebab kematian ibunda penyanyi rizky febian putri delita lina jubaedah menunggu hasil otopsi berwajib otopsi jenazah lina  januari  lantas perkembangannya kabid humas polda jawa barat kombes pol saptono erlangga hasil otopsi lina  kerja mengacu keterangan hasil otopsi lina menunggu hasil otopsi tunggu normatifnya  kerja laboratorium forensik  kombes pol saptono erlangga rabu  berharap hasil otopsi lina diungkap kepastian terkait penyebab meninggalnya lina menghembuskan napas sabtu  jauari  hasil otopsi mengungkap fakta kematian mantan istri sule wajar wajar lihat hasil otopsinya ketidakwajaran wajar sakit menunggu hasilnya temuan meninggalnya lina wajar saptono erlangga berwajib menindaklanjutinya pelaku bertanggung dugaan tindak pidana hasil otopsi erat kaitannya perkembangan laporan rizky febian laporan polisi polrestabes bandung jawa barat  januari  ditemukan ketidakwajaran tugas penyidik mengungkap pelakunya kombes pol saptono erlangga', 'sebab mati ibunda penyanyi rizky febian putri delita lina jubaedah tunggu hasil otopsi wajib otopsi jenazah lina  januari  lantas kembang kabid humas polda jawa barat kombes pol saptono erlangga hasil otopsi lina  kerja acu terang hasil otopsi lina tunggu hasil otopsi tunggu normatif  kerja laboratorium forensik  kombes pol saptono erlangga rabu  harap hasil otopsi lina ungkap pasti kait sebab tinggal lina hembus napas sabtu  jauari  hasil otopsi ungkap fakta mati mantan istri sule wajar wajar lihat hasil otopsinya ketidakwajaran wajar sakit tunggu hasil temu tinggal lina wajar saptono erlangga wajib menindaklanjutinya pelaku tanggung duga tindak pidana hasil otopsi erat kait kembang lapor rizky febian lapor polisi polrestabes bandung jawa barat  januari  temu ketidakwajaran tugas sidik ungkap laku kombes pol saptono erlangga'),
(69, 1292, ' tahun berkarya di panggung film indonesia aktris dian sastrowardoyo akhirnya memberanikan diri menjadi produser lewat film pertamanya bergenre komedi guru-guru gokil dian sastro siap bergerak di belakang layar bagi dian sastro keputusannya untuk menjadi produser bukan tanpa perhitungan bermodal pengalaman dan jaringannya dian yakin kalau ia bisa mengangkat film yang berkualitas ke layar lebar tapi dalam film guru-guru gokil dian pun masih tampil di depan layar hanya saja diakuinya peran yang dimainkan dian tidak besar sebab dia khawatir jika porsinya dalam film ini besar malah justru akan mengganggu fokusnya sebagai produser sebenarnya gue enggak mau main awalnya terus terang saja aku mundur ke pemeran pendukung karena aku enggak berani gimana aku bisa fokus belajar jadi produser kalau peran aku terlalu besar di film aku kata dian sastro saat ditemui di plaza senayan jakarta selasa  dalam film guru- guru gokil dian sastro berperan sebagai nimala seorang ibu yang tengah hamil namun harus tetap menjalani karir selain dian film ini dibintangi gading marten ibnu jamil asri welas faradina mufti kevin ardivola shakira jasmine boris bokir dan yang lainnya film arahan sutradara sammaria sari simanjuntak itu bercerita tentang taat gading marten seorang yang berambisi untuk sukses mengejar pundi-pundi namun kerap menemui kegagalan dalam karir keadaan kemudian memaksa taat untuk bekerja menjadi guru pengganti di sebuah sekolah tak lama setelah itu terjadi insiden yang menimpa para guru dari situ pandangan taat terhadap uang dan sebuah kesuksesan jadi berubah', ' berkarya panggung film indonesia aktris dian sastrowardoyo memberanikan produser film pertamanya bergenre komedi guru-guru gokil dian sastro bergerak layar dian sastro keputusannya produser perhitungan bermodal pengalaman jaringannya dian mengangkat film berkualitas layar lebar film guru-guru gokil dian tampil layar diakuinya peran dimainkan dian khawatir porsinya film mengganggu fokusnya produser gue main terang mundur pemeran pendukung berani gimana fokus belajar produser peran film dian sastro ditemui plaza senayan jakarta selasa  film guru- guru gokil dian sastro berperan nimala hamil menjalani karir dian film dibintangi gading marten ibnu jamil asri welas faradina mufti kevin ardivola shakira jasmine boris bokir film arahan sutradara sammaria sari simanjuntak bercerita taat gading marten berambisi sukses mengejar pundi-pundi kerap menemui kegagalan karir memaksa taat guru pengganti sekolah insiden menimpa guru situ pandangan taat uang kesuksesan berubah', ' karya panggung film indonesia aktris dian sastrowardoyo berani produser film pertama genre komedi guru gokil dian sastro gerak layar dian sastro putus produser hitung modal alam jaring dian angkat film kualitas layar lebar film guru gokil dian tampil layar aku peran main dian khawatir porsi film ganggu fokus produser gue main terang mundur peran dukung berani gimana fokus ajar produser peran film dian sastro temu plaza senayan jakarta selasa  film guru  guru gokil dian sastro peran nimala hamil jalan karir dian film bintang gading marten ibnu jamil asri welas faradina mufti kevin ardivola shakira jasmine boris bokir film arah sutradara sammaria sari simanjuntak cerita taat gading marten ambisi sukses kejar pundi kerap temu gagal karir paksa taat guru ganti sekolah insiden timpa guru situ pandang taat uang sukses ubah'),
(70, 1293, ' baby archie digendong oleh ibunya meghan markle cosmopolitan jawaposcom  meski sudah resmi mundur dari kerajaan inggris pengamanan bagi keluarga meghan markle dan pangeran harry masih tetap melekat keluarga mereka tetap dijaga bodyguard dari pihak kepolisian inggris dan kanada salah satu contohnya terlihat saat meghan markle sedang berjalan-jalan santai bersama anaknya archie dan  anjing kesayangannya dilansir dari daily mail rabu  pengawal kepolisian inggris menjaga meghan harry dan archie di vancouver yang telah berkoordinasi dengan pihak kanada meskipun masih menjadi perdebatan siapa yang akan menanggung beban biaya pengamanan mereka selanjutnya meghan ceria sambil tersenyum berjalan melintasi hutan bersama archie dan dua anjingnya meghan mengenakan busana olahraga training sambil menggunakan gendongan bayi di depan tubuhnya sementara dua polisi tetap mengawal dari jarak yang cukup dekat tak hanya meghan tentunya suaminya pangeran harry juga dikawal duke of sussex yang mendarat di kanada dikawal di pesawat oleh polisi meghan dijaga oleh pengawalnya polisi inggris dan seorang polisi kanada mountie harry terbang dengan pengawal juga tadi malam kata sumber kepada mailonline polisi mounties ternyata sudah lama akrab dengan meghan markle polisi tersebut juga ditempatkan di luar rumah meghan di toronto ketika ia mulai berkencan dengan harry pada  dan sudah melindungi gubernur jenderal kanada perwakilan ratu di negara itu perdana menteri justin trudeau telah mengisyaratkan bahwa negaranya akan mengambil sebagian dari pengeluaran keamanan akan tetapi sebuah jajak pendapat terhadap  orang dewasa kanada mengungkapkan minggu lalu bahwa  persen tidak ingin pemerintah mereka membayar biaya keamanan bagi pasangan itu terlepas dari semua itu meghan markle terlihat ceria bersama archie dan memang bersiap memulai kehidupan baru dengan keluarga kecilnya dan archie akan semakin dekat dengan ibunda meghan markle doria ragland', ' baby archie digendong ibunya meghan markle cosmopolitan jawaposcom  resmi mundur kerajaan inggris pengamanan keluarga meghan markle pangeran harry melekat keluarga dijaga bodyguard kepolisian inggris kanada salah contohnya meghan markle berjalan-jalan santai anaknya archie  anjing kesayangannya dilansir daily mail rabu  pengawal kepolisian inggris menjaga meghan harry archie vancouver berkoordinasi kanada perdebatan menanggung beban biaya pengamanan meghan ceria tersenyum berjalan melintasi hutan archie anjingnya meghan mengenakan busana olahraga training gendongan bayi tubuhnya polisi mengawal jarak meghan suaminya pangeran harry dikawal duke of sussex mendarat kanada dikawal pesawat polisi meghan dijaga pengawalnya polisi inggris polisi kanada mountie harry terbang pengawal malam sumber mailonline polisi mounties akrab meghan markle polisi ditempatkan rumah meghan toronto berkencan harry  melindungi gubernur jenderal kanada perwakilan ratu negara perdana menteri justin trudeau mengisyaratkan negaranya mengambil pengeluaran keamanan jajak pendapat  orang dewasa kanada minggu  persen pemerintah membayar biaya keamanan pasangan terlepas meghan markle ceria archie kehidupan keluarga kecilnya archie ibunda meghan markle doria ragland', ' baby archie gendong ibu meghan markle cosmopolitan jawaposcom  resmi mundur raja inggris aman keluarga meghan markle pangeran harry lekat keluarga jaga bodyguard polisi inggris kanada salah contoh meghan markle jalan santai anak archie  anjing sayang lansir daily mail rabu  awal polisi inggris jaga meghan harry archie vancouver koordinasi kanada debat tanggung beban biaya aman meghan ceria senyum jalan lintas hutan archie anjing meghan enak busana olahraga training gendong bayi tubuh polisi awal jarak meghan suami pangeran harry kawal duke of sussex darat kanada kawal pesawat polisi meghan jaga awal polisi inggris polisi kanada mountie harry terbang awal malam sumber mailonline polisi mounties akrab meghan markle polisi tempat rumah meghan toronto kencan harry  lindung gubernur jenderal kanada wakil ratu negara perdana menteri justin trudeau isyarat negara ambil luar aman jajak dapat  orang dewasa kanada minggu  persen perintah bayar biaya aman pasang lepas meghan markle ceria archie hidup keluarga kecil archie ibunda meghan markle doria ragland'),
(71, 1294, 'kini tugas kerajaan dilakukan oleh kate middleton sepenuhnya setelah iparnya meghan markle memilih keluar dari kerajaan usai mengawali tugas kerajaannya dengan bertemu para pemimpin afrika dalam ktt investasi inggris-afrika kali ini ibunda  anak itu melakukan survei untuk melihat angka kesehatan dan kebahagiaan anak dilansir dari daily mail rabu  kate melakukan survei kesehatan anak usia dini dia berharap bisa mendapatkan data yang pasti untuk membuat perubahan bagi generasi yang akan datang duchess of cambridge menghabiskan  jam keliling negara itu untuk mempublikasikan programnya itu sebagai orang tua saya tahu betapa kami sangat menghargai kesehatan dan kebahagiaan masa depan anak-anak kami saya ingin mendengar masalah-masalah utama yang mempengaruhi keluarga dan masyarakat sehingga saya dapat memfokuskan pekerjaan saya di tempat yang paling dibutuhkan ambisi saya adalah untuk memberikan perubahan yang langgeng bagi generasi yang akan datang kata istri pangeran william itu kate menggulirkan survei jajak pendapat lima isu atau masalah besar bagi balita program ini dianggap sebagai program terbesar yang dilakukannya kate middleton melakukan survei untuk mengetahui tingkat kesehatan dan kebahagiaan anak pa berbicara di minibrum sebuah kota mini seukuran anak di thinktank museum sains birmingham kate menyapa anak-anak di sana dengan senyum ramah kate menyambut curhatan para orang tua soal anak orang tua wali dan keluarga merawat anak-anak pada tahun-tahun awal golden age jadi itu sebabnya saya benar-benar ingin mendengarkan para orang tua tutur kate menurut kate tahun-tahun awal perkembangan anak sangat penting bagi kesehatan dan kebahagiaan di masa depan cantik mengenakan kemeja bermotif hijau cerah dan celana panjang berkaki lebar kate tur keliling kota mini oleh walikota mini berusia  tahun poppy jordan anak-anak dari henley montessori school dan st pauls nursery di balsall heath menyambut kate dengan hangat dia juga mengunjungi sebuah sudut bangunan membantu mengangkat batu bata karet ke derek dan membantu seorang anak kecil untuk mengenakan topi keselamatannya kate bertemu dengan orang tua muda untuk memastikan bahwa ibu baru jangan merasa sendiri kelompok ini kemudian duduk bersama untuk membahas berbagai masalah seputar orang tua apa yang kita alami antara usia nol sampai lima tahun membentuk otak anak berkembang sebagai seorang ibu itu memberi saya perspektif yang berbeda katanya ada begitu banyak tekanan pada orang tua untuk merasa tanggung jawab pada anak tambahnya jajak pendapat akan dilakukan selama sebulan dengan hasil yang akan terungkap pada bulan maret setelah itu langkah selanjutnya akan dilakukan kate telah mengerjakan program inisiatif sejak pernikahannya delapan tahun lalu mendedikasikan sebagian besar keterlibatan publik dan pribadinya untuk pelayanan pada  ia mengumpulkan sekelompok ahli dari akademisi pendidikan kesehatan dan bidang lainnya untuk fokus membantu keluarga mengatasi perilaku anti-sosial kecanduan dan kesehatan mental yang telah memainkan peran penting dalam menyusun survei', 'tugas kerajaan kate middleton sepenuhnya iparnya meghan markle memilih kerajaan mengawali tugas kerajaannya bertemu pemimpin afrika ktt investasi inggris-afrika kali ibunda  anak survei angka kesehatan kebahagiaan anak dilansir daily mail rabu  kate survei kesehatan anak usia berharap data perubahan generasi duchess of cambridge menghabiskan  jam keliling negara mempublikasikan programnya orang tua betapa menghargai kesehatan kebahagiaan anak-anak mendengar masalah-masalah utama mempengaruhi keluarga masyarakat memfokuskan pekerjaan dibutuhkan ambisi perubahan langgeng generasi istri pangeran william kate menggulirkan survei jajak pendapat isu balita program dianggap program terbesar dilakukannya kate middleton survei tingkat kesehatan kebahagiaan anak pa berbicara minibrum kota mini seukuran anak thinktank museum sains birmingham kate menyapa anak-anak senyum ramah kate menyambut curhatan orang tua anak orang tua wali keluarga merawat anak-anak tahun-tahun golden age benar-benar mendengarkan orang tua kate kate tahun-tahun perkembangan anak kesehatan kebahagiaan cantik mengenakan kemeja bermotif hijau cerah celana berkaki lebar kate tur keliling kota mini walikota mini berusia  poppy jordan anak-anak henley montessori school st pauls nursery balsall heath menyambut kate hangat mengunjungi sudut bangunan membantu mengangkat batu bata karet derek membantu anak mengenakan topi keselamatannya kate bertemu orang tua muda kelompok duduk membahas seputar orang tua alami usia nol membentuk otak anak berkembang perspektif berbeda tekanan orang tua tanggung anak jajak pendapat sebulan hasil terungkap maret langkah kate program inisiatif pernikahannya delapan mendedikasikan keterlibatan publik pribadinya pelayanan  mengumpulkan sekelompok ahli akademisi pendidikan kesehatan bidang fokus membantu keluarga mengatasi perilaku anti-sosial kecanduan kesehatan mental memainkan peran menyusun survei', 'tugas raja kate middleton sepenuh ipar meghan markle pilih raja awal tugas raja bertemu pimpin afrika ktt investasi inggris afrika kali ibunda  anak survei angka sehat bahagia anak lansir daily mail rabu  kate survei sehat anak usia harap data ubah generasi duchess of cambridge habis  jam keliling negara publikasi program orang tua betapa harga sehat bahagia anak dengar masalah utama mempengaruhi keluarga masyarakat fokus kerja butuh ambisi ubah langgeng generasi istri pangeran william kate gulir survei jajak dapat isu balita program anggap program besar laku kate middleton survei tingkat sehat bahagia anak pa bicara minibrum kota mini ukur anak thinktank museum sains birmingham kate sapa anak senyum ramah kate sambut curhatan orang tua anak orang tua wali keluarga rawat anak tahun golden age benar dengar orang tua kate kate tahun kembang anak sehat bahagia cantik enak kemeja motif hijau cerah celana kaki lebar kate tur keliling kota mini walikota mini usia  poppy jordan anak henley montessori school st pauls nursery balsall heath sambut kate hangat unjung sudut bangun bantu angkat batu bata karet derek bantu anak enak topi selamat kate bertemu orang tua muda kelompok duduk bahas putar orang tua alami usia nol bentuk otak anak kembang perspektif beda tekan orang tua tanggung anak jajak dapat bulan hasil ungkap maret langkah kate program inisiatif nikah delapan dedikasi keterlibatan publik pribadi layan  kumpul kelompok ahli akademisi didik sehat bidang fokus bantu keluarga atas perilaku anti sosial candu sehat mental main peran susun survei'),
(72, 1295, 'meghan markle dan pangeran harry sudah memulai kehidupan mereka sebagai orang biasa di kanada meski sudah berstatus rakyat jelata tetap saja mereka jadi sorotan media sudah resmi keluar dari lingkaran kerajaan meghan markle tampak begitu bahagia dan lepas hal itu ditunjukkan meghan saat sedang berjalan-jalan dengan kedua anjingnya sambil menggendong archie dilansir dari daily mail selasa  meghan archie dan anjing-anjingnya terlihat berjalan-jalan di taman regional horth hill tak jauh dari rumah yang mereka sewa seharga  juta poundsterling usd  juta atau setara rp -an miliar wajah meghan nampak begitu berseri-seri meghan tak cuma melakukan jalan-jalan biasa kegiatan itu ia lakukan untuk berolahraga disebutkan bahwa the duchess of sussex menghabiskan sejumlah uang untuk busana olahraganya tak kurang dari usd   poundsterling atau setara rp  jutaan ia keluarkan untuk membeli legging lululemon align zip-up angkatan laut dan beanie rajutan meghan melengkapi penampilannya dengan sepatu sienna seharga usd   poundsterling atau setara rp  jutaan dari merek kanada diperkirakan meghan akan lebih sering olahraga hiking pilates dan yoga', 'meghan markle pangeran harry kehidupan orang kanada berstatus rakyat jelata sorotan media resmi lingkaran kerajaan meghan markle bahagia lepas meghan berjalan-jalan anjingnya menggendong archie dilansir daily mail selasa  meghan archie anjing-anjingnya berjalan-jalan taman regional horth hill rumah sewa seharga  juta poundsterling usd  juta setara rp -an miliar wajah meghan nampak berseri-seri meghan jalan-jalan kegiatan lakukan berolahraga the duchess of sussex menghabiskan uang busana olahraganya usd   poundsterling setara rp  jutaan keluarkan membeli legging lululemon align zip-up angkatan laut beanie rajutan meghan melengkapi penampilannya sepatu sienna seharga usd   poundsterling setara rp  jutaan merek kanada meghan olahraga hiking pilates yoga', 'meghan markle pangeran harry hidup orang kanada status rakyat jelata sorot media