(73, 1296, 'ada-ada saja yang dipikirkan warganet saat menanggapi isu hangat yang menerpa selebriti brad pitt dan jennifer aniston isu itu berlanjut lantaran keduanya tertangkap kamera media sedang reuni dan berbicara hangat satu sama lain di belakang panggung screen actor guild sag awards dilansir dari mirror selasa  spekulasi atau tebak-tebakan netizen semakin liar saat melihat foto jennifer aniston di akun media sosialnya di mana ada  foto foto pertama menunjukkan aniston sedang berada di mobil dengan gaun yang ia kenakan di acara sag awards foto kedua aniston sengaja meletakkan gaun dan sepatu yang ia kenakan tadi di lantai kamar mandi dengan penghargaan yang dia raih di dekat bath tub penggemar langsung menggoda aniston bahwa ada pitt di dalam mobil itu candaan ini dilontarkan setelah pertemuan romantis aniston dan pitt di belakang panggung sag awards karuan saja netizen langsung menyerbu kolom komentar foto tersebut apakah brad ada di sana bersama anda kata salah satu netizen apakah brad yang mengambil gambar tanya netizen lain tak kalah penasaran ayo kembali dengan brad anda berdua cocok bersama lagi sergah para netizen lainnya pitt sendiri terlihat tidak mau ambil pusing dengan rumor itu saat diwawancara extra tv renee bargh presenter asal australia renee sempat menggoda pitt dengan mengatakan ia punya chemistry yang luar biasa aniston pitt dengan santai mengedipkan mata ke arah kamera sambil menganggukkan kepalanya ke arah presenter', 'ada-ada dipikirkan warganet menanggapi isu hangat menerpa selebriti brad pitt jennifer aniston isu berlanjut lantaran tertangkap kamera media reuni berbicara hangat panggung screen actor guild sag awards dilansir mirror selasa  spekulasi tebak-tebakan netizen liar foto jennifer aniston akun media sosialnya  foto foto aniston mobil gaun kenakan acara sag awards foto aniston sengaja meletakkan gaun sepatu kenakan lantai kamar mandi penghargaan raih bath tub penggemar langsung menggoda aniston pitt mobil candaan dilontarkan pert