(74, 1297, 'betrand peto untuk pertama kalinya akan merayakan imlek setelah diadopsi oleh ruben onsu tak cuma itu betrand juga akan mendapat nama tionghoa diungkapkan ruben onsu betrand sangat antusias untuk menyambut perayaan imlek di tahun ini dia ingin tahu perayaan imlek di keluarga ayah rubenred itu seperti apa karena dia sudah semakin tahu tentang kami kata ruben onsu saat ditemui di bilangan tendean jakarta selatan selasa  ruben menuturkan ia ingin memberi betrand peto nama tionghoa karena semua anaknya juga memiliki nama tionghoa meskipun nama itu tidak untuk digunakan sebagai nama panggilan dalam kehidupan sehari-hari thalia putri ruben red kan punya nama chinese thania juga punya akhirnya saya juga memberi nama chinese untuk betrand tuturnya lebih lanjut menurut penuturan ruben pemberian nama chinese untuk betrand menggunakan perhitungan tanggal lahir hari dan jam baru setelah itu dilakukan penjumlahan untuk kemudian dirumuskan nama yang paling tepat namun sayangnya dalam kesempatan itu ruben belum mau buka-bukaan terkait nama yang diberikannya untuk betrand akan tetapi ruben berjanji mau memberi tahu ke publik ketika hari raya imlek tiba yang akan jatuh pada sabtu  januari  mendatang pokoknya nanti dikasih tahu lah ucap ruben onsu', 'betrand peto kalinya merayakan imlek diadopsi ruben onsu betrand nama tionghoa ruben onsu betrand antusias menyambut perayaan imlek perayaan imlek keluarga ayah rubenred ruben onsu ditemui bilangan tendean jakarta selatan selasa  ruben betrand peto nama tionghoa anaknya memiliki nama tionghoa nama nama panggilan kehidupan sehari-hari thalia putri ruben red nama chinese thania nama chinese betrand penuturan ruben pemberian nama chinese betrand perhitungan tanggal lahir jam penjumlahan dirumuskan nama sayangnya kesempatan ruben buka-bukaan terkait nama betrand ruben berjanji publik raya imlek jatuh sabtu  januari  pokoknya dikasih ruben onsu', 'betrand peto kali raya imlek adopsi ruben onsu betrand nama tionghoa ruben onsu betrand antusias sambut raya imlek raya imlek keluarga ayah rubenred ruben onsu temu bilang tendean jakarta selatan selasa  ruben betrand peto nama tionghoa anak milik nama tionghoa nama nama panggil hidup hari thalia putri ruben red nama chinese thania nama chinese betrand tutur ruben beri nama chinese betrand hitung tanggal lahir jam jumlah rumus nama sayang sempat ruben buka kait nama betrand ruben janji publik raya imlek jatuh sabtu  januari  pokok kasih ruben onsu'),
(75, 1298, 'tora sudiro dikenal sebagai salah satu artis yang memiliki banyak tato pada sejumlah bagian tubuhnya namun dia tertantang untuk menghilangkan tato yang memenuhi bagian- bagian tubuhnya itu demi totalitas perannya dalam film mangga muda bukan menghilangkan secara permanen tora memilih menghilangkannya dengan menggunakan make-up khsusus tato enggak kelihatan ditutupin pakai make-up khusus kalau orang sewa aku sudah include makeup-nya jadi memang bisa nutupin sendiri kata tora sudiro saat ditemui di xxi plaza senayan jakarta pusat belum lama ini terbiasa memiliki tato terus tiba-tiba hal itu tidak terlihat di badannya tora sudiro sempat merasa ada yang kurang dia bahkan sempat merasa terganggu akibat perubahan drastis tersebut namun untungnya seiring berjalannya waktu syuting tora sudiro mulai bisa beradaptasi dengan penampilan barunya menghilangkan tato menggunakan make-up ternyata tidak mampu bertahan lama menurut penuturan tora tato yang didempul dengan make-up hanya bisa bertahan paling lama sekitar setengah hari dalam kesempatan itu dia juga mengatakan sejatinya tora tidak diminta untuk menghilangkan tato yang melekat di tubuhnya oleh sang sutradara namun mengingat karakter yang diperankannya itu dia anggap tidak tepat jika menggunakan tato tora sudiro memiliki inisiatif sendiri untuk menghilangkannya sutradaranya justru santai dia bilang enggak apa-apa kalau mau tatoan cuma gue pikir kayaknya kurang cocok kalau peran ini bertato akhirnya gue tutupin tutur pemain film warkop dki reborn itu dalam film mangga muda tora sudiro berperan sebagai agil yang merupakan seorang supir taksi film ini mengisahkan lika-liku hidup agil yang ingin memiliki keturunan namun tidak kunjung hamil demi memiliki anak agil sempat bernazar akan mengikuti semua permintaan istrinya ketika hamil namun siapa sangka permintaan luli malah membuat agil pusing tujuh keliling selain tora sudiro pemain lainnya adalah alexandra gottardo gary iskak dan nafa urbach film tersebut akan tayang di bioskop tanah air mulai  januari ', 'tora sudiro dikenal salah artis memiliki tato tubuhnya tertantang menghilangkan tato memenuhi bagian- tubuhnya totalitas perannya film mangga muda menghilangkan permanen tora memilih menghilangkannya make-up khsusus tato ditutupin pakai make-up khusus orang sewa include makeup-nya nutupin tora sudiro ditemui xxi plaza senayan jakarta pusat terbiasa memiliki tato badannya tora sudiro terganggu akibat perubahan drastis untungnya seiring berjalannya syuting tora sudiro beradaptasi penampilan barunya menghilangkan tato make-up bertahan penuturan tora tato didempul make-up bertahan kesempatan sejatinya tora menghilangkan tato melekat tubuhnya sang sutradara karakter diperankannya anggap tato tora sudiro memiliki inisiatif menghilangkannya sutradaranya santai bilang apa-apa tatoan gue pikir kayaknya cocok peran bertato gue tutupin pemain film warkop dki reborn film mangga muda tora sudiro berperan agil supir taksi film mengisahkan lika-liku hidup agil memiliki keturunan kunjung hamil memiliki anak agil bernazar mengikuti permintaan istrinya hamil sangka permintaan luli agil pusing tujuh keliling tora sudiro pemain alexandra gottardo gary iskak nafa urbach film tayang bioskop tanah air  januari ', 'tora sudiro kenal salah artis milik tato tubuh tantang hilang tato penuh bagi  tubuh totalitas peran film mangga muda hilang permanen tora pilih hilang make up khsusus tato ditutupin pakai make up khusus orang sewa include makeup nya nutupin tora sudiro temu xxi plaza senayan jakarta pusat biasa milik tato badan tora sudiro ganggu akibat ubah drastis untung iring jalan syuting tora sudiro adaptasi tampil baru hilang tato make up tahan tutur tora tato dempul make up tahan sempat sejati tora hilang tato lekat tubuh sang sutradara karakter peran anggap tato tora sudiro milik inisiatif hilang sutradara santai bilang apa tato gue pikir kayak cocok peran tato gue tutupin main film warkop dki reborn film mangga muda tora sudiro peran agil supir