(79, 1302, 'sejak kamis  helmy yahya dinyatakan resmi diberhentikan sebagai direktur utama dirut tvri oleh dewan pengawas dewas lpp tvri namun helmy pun tak tinggal diam dengan menempuh jalur hukum sejumlah karyawan pun sempat protes dengan menyegel kantor dewas lantas apa saja sih sebenarnya pembenahan yang dianggap berhasil dilakukan helmy yahya menurut helmy dirinya berhasil menaikkan rating dan share televisi berplat merah tersebut sebelum menjabat sebagai dirut share tvri tidak sampai  persen namun setelah helmy yahya menjadi dirut share naik menjadi  bahkan tahun lalu sempat menembus share  tvri waktu kami masuk dalam kondisi yang sangat memprihatinkan tidak ditonton sharenya di bawah  persen kalau share di bawah  persen itu seperti meraung di ruang hampa tidak ada yang mendengar ucap helmy yahya di bawah kepemimpinan lelaki kelahiran  maret  ini dilakukan rebranding logo setelah sebelumnya disebut-sebut jadul helmy mengubahnya jadi lebih kekinian dengan sentuhan menarik rebranding ini juga menjadi momentum baginya untuk melakukan perbaikan secara internal ganti logo bukan semata-mata ganti logo tapi juga mengganti sistem karyawan bekerja mengganti spirit dan luar biasa hasil dari rebranding programnya jadi bagus orang mulai nonton logo kami dikagumi dan karyawan sangat bangga sebagai karyawan tvri dan itu penting ungkap helmy yahya tvri memiliki sejarah baru mempunyai peralatan terbaik bahkan stasiun tv milik pemerintah ini sudah percaya diri untuk menggarap event besar berkat canggihnya peralatan yang dimiliki dulu peralatan tvri dikatain tapi sekarang alatnya menjadi salah satu yang paling canggih di republik ini detik-detik proklamasi itu peralatannya tvri debat capres pertama itu peralatan tvri ujarnya perlu diketahui helmy yahya bersama chandra hamzah tengah mempersiapkan langkah hukum terbaik guna mengahadapi dewas mantan wakil ketua kpk dalam jumpa pers mengatakan bahwa ada sejumlah langkah hukum yang tersedia untuk mengadvokasi kasus yang menimpa helmy yahya namun sayangnya chandra hamzah masih enggan untuk memberikan bocorannya', 'kamis  helmy yahya dinyatakan resmi diberhentikan direktur utama dirut tvri dewan pengawas dewas lpp tvri helmy tinggal diam menempuh jalur hukum karyawan protes menyegel kantor dewas lantas sih pembenahan dianggap berhasil helmy yahya helmy berhasil menaikkan rating share televisi berplat merah menjabat dirut share tvri  persen helmy yahya dirut share  menembus share  tvri masuk kondisi memprihatinkan ditonton sharenya  persen share  persen meraung ruang hampa mendengar helmy yahya kepemimpinan lelaki kelahiran  maret  rebranding logo disebut-sebut jadul helmy mengubahnya kekinian sentuhan menarik rebranding momentum baginya perbaikan internal ganti logo ganti logo mengganti sistem karyawan mengganti spirit hasil rebranding programnya bagus orang nonton logo dikagumi karyawan bangga karyawan tvri helmy yahya tvri memiliki sejarah peralatan terbaik stasiun tv milik pemerintah percaya menggarap event berkat canggihnya peralatan dimiliki peralatan tvri dikatain alatnya salah canggih republik detik-detik proklamasi peralatannya tvri debat capres peralatan tvri helmy yahya chandra hamzah langkah hukum terbaik mengahadapi dewas mantan wakil ketua kpk jumpa pers langkah hukum tersedia mengadvokasi menimpa helmy yahya sayangnya chandra hamzah enggan bocorannya', 'kamis  helmy yahya nyata resmi diberhentikan direktur utama dirut tvri dewan awas dewas lpp tvri helmy tinggal diam tempuh jalur hukum karyawan protes segel kantor dewas lantas sih benah anggap hasil helmy yahya helmy hasil naik rating share televisi berplat merah jabat dirut share tvri  persen helmy yahya dirut share  tembus share  tvri masuk kondisi memprihatinkan tonton sharenya  persen share  persen raung ruang hampa dengar helmy yahya kepemimpinan lelaki lahir  maret  rebranding logo sebut jadul helmy ubah kini sentuh tarik rebranding momentum bagi baik internal ganti logo ganti logo ganti sistem karyawan ganti spirit hasil rebranding program bagus orang nonton logo kagum karyawan bangga karyawan tvri helmy yahya tvri milik sejarah alat baik stasiun tv milik perintah percaya garap event berkat canggih alat milik alat tvri dikatain alat salah canggih republik detik proklamasi alat tvri debat capres alat tvri helmy yahya chandra hamzah langkah hukum baik mengahadapi dewas mantan wakil ketua kpk jumpa pers langkah hukum sedia advokasi timpa helmy yahya sayang chandra hamzah enggan bocor');
