(80, 1303, 'ayah meghan markle thomas markle ikut angkat bicara tentang keputusan putrinya dan pangeran harry untuk tidak lagi menjadi anggota keluarga kerajaan thomas markle marah atas keputusan putrinya itu dan menyebut keputusan itu sebagai perbuatan yang memalukan dilansir dari people senin  alam sebuah wawancara dengan channel  di inggris thomas  mengklaim bahwa pasangan itu sudah menghancurkan imej dan membuat keputusan murahan bagi keluarga kerajaan dia menyesalkan sikap putrinya itu agak memalukan bagi saya katanya ketus sebab ketika mereka menikah mereka sudah sepakat mengambil kewajiban dan kewajiban itu adalah untuk menjadi bagian dari bangsawan dan untuk mewakili bangsawan dan itu keputusan bodoh bagi mereka jika tidak melakukannya tambah thomas baginya ketika sudah memutuskan untuk menikah dengan keluarga kerajaan artinya itu seperti keputusan mengikat selamanya yang tak bisa keluar begitu saja hal itu seharusnya sudah menjadi bagian dari komitmen dan mereka meghan dan harry menghancurkannya mereka membuatnya seperti murahan tukasnya dalam wawancara dengan channel  thomas mengatakan dia tidak berpikir meghan atau harry akan menemuinya usai kehidupan baru nanti namun thomas melihat meghan dan harry seperti kehilangan arah saya pikir mereka berdua berubah menjadi jiwa yang hilang pada saat ini saya tidak tahu apa yang mereka cari saya rasa mereka tidak tahu apa yang mereka cari tukasnya dilansir dari mirror thomas markle juga membandingkan keputusan putrinya dengan harapan serta impian perempuan lainnya di dunia ini justru perempuan lain berharap dirinya bisa menjadi seorang putri tetapi meghan justru melepasnya dengan meghan dan harry berpisah dari royals itu mengecewakan karena sebenarnya meghan benar-benar sudah mendapatkan impian setiap gadis setiap gadis muda ingin menjadi seorang putri dan meghan mendapatkan itu dan sekarang dia membuang itu kata thomas thomas markle juga mengkritik meghan dan harry yang menggunakan dana publik untuk merenovasi rumah di frogmore cottage meskipun harry akhirnya telah setuju untuk membayar biaya perbaikan tersebut tampaknya usd  juta dan rumah  kamar tidak cukup puas bagi mereka itu agak memalukan bagi saya tambahnya sementara itu istana buckingham mengatakan duke dan duchess of sussex berniat untuk membayar  juta poundsterling perbaikan rumah tersebut dan berusaha untuk mandiri secara finansial sedangkan meghan markle memutuskan akan membeli rumah baru di kanada dan tinggal menetap di sana bersama keluarga kecilnya', 'ayah meghan markle thomas markle angkat bicara keputusan putrinya pangeran harry anggota keluarga kerajaan thomas markle marah keputusan putrinya menyebut keputusan perbuatan memalukan dilansir people senin  alam wawancara channel  inggris thomas  mengklaim pasangan menghancurkan imej keputusan murahan keluarga kerajaan menyesalkan sikap putrinya memalukan ketus menikah sepakat mengambil kewajiban kewajiban bangsawan mewakili bangsawan keputusan bodoh melakukannya thomas baginya memutuskan menikah keluarga kerajaan keputusan mengikat komitmen meghan harry menghancurkannya membuatnya murahan tukasnya wawancara channel  thomas berpikir meghan harry menemuinya kehidupan thomas meghan harry kehilangan arah pikir berdua berubah jiwa hilang cari cari tukasnya dilansir mirror thomas markle membandingkan keputusan putrinya harapan serta impian perempuan dunia perempuan berharap putri meghan melepasnya meghan harry berpisah royals mengecewakan meghan benar-benar impian gadis gadis muda putri meghan membuang thomas thomas markle mengkritik meghan harry dana publik merenovasi rumah frogmore cottage harry setuju membayar biaya perbaikan usd  juta rumah  kamar puas memalukan istana buckingham duke duchess of sussex berniat membayar  juta poundsterling perbaikan rumah berusaha mandiri finansial meghan markle memutuskan membeli rumah kanada tinggal menetap keluarga kecilnya', 'ayah meghan markle thomas markle angkat bicara putus putri pangeran harry anggota keluarga raja thomas markle marah putus putri sebut putus buat malu lansir people senin  alam wawancara channel  inggris thomas  mengklaim pasang hancur imej putus murah keluarga raja sesal sikap putri malu ketus meni sepakat ambil wajib wajib bangsawan wakil bangsawan putus bodoh laku thomas bagi putus meni keluarga raja putus ikat komitmen meghan harry hancur buat murah tukas wawancara channel  thomas pikir meghan harry temu hidup thomas meghan harry hilang arah pikir dua ubah jiwa hilang cari cari tukas lansir mirror thomas markle banding putus putri harap serta impi perempuan dunia perempuan harap putri meghan lepas meghan harry pisah royals kecewa meghan benar impi gadis gadis muda putri meghan buang thomas thomas markle mengkritik meghan harry dana publik renovasi rumah frogmore cottage harry tuju bayar biaya baik usd  juta rumah  kamar puas malu istana buckingham duke duchess of sussex niat bayar  juta poundsterling baik rumah usaha mandiri finansial meghan markle putus beli rumah kanada tinggal tetap keluarga kecil'),
(81, 1304, 'penyanyi rb rihanna baru saja dikabarkan putus dengan miliarder asal arab saudi hassan jameel karena sedang berstatus single maka siapapun pria yang dekat dengan rihanna langsung menjadi obrolan penggemarnya dilansir dari cosmopolitan senin  baru-baru ini rihanna beberapa kali tersorot publik telah menghabiskan waktu dengan rapper aap rocky meskipun belum terkonfirmasi apa hubungan mereka namun keduanya baru tampak sebatas dekat us weekly melaporkan bahwa pada jumat  malam riri sapaan rihanna tersenyum dan tertawa saat nongkrong dengan aap rocky di belakang panggung di konser yams day benefit di brooklyn new york lokasi ini juga menunjukkan rihanna dan rocky punya catatan sejarah karena pada  mereka terlihat berciuman saat sedang syuting video musik bersama namun keduanya sepertinya masih asyik dengan status teman mereka juga pernah bersama terlihat nongkrong selama paris fashion week pada juni  dan mereka juga pernah berjalan di karpet merah bersama di the fashion awards di london pada bulan desember  mungkin keduanya hanya berteman dan tak ada yang bisa menebak apakah rihanna sudah move-on atau belum dari hassan jameel ditambah lagi rihanna sosok yang cenderung tertutup soal kehidupan pribadinya publik bahkan tidak tahu mengapa atau alasan apa yang membuat rihanna dan hassan putus apakah ada orang ketiga atau ada alasan lain apa pun itu publik menunggu kabar bahagia lanjutan dari rihanna dan tentunya tetap dengan berbagai karyanya yang diharapkan akan menggebrak pada  ini', 'penyanyi rb rihanna dikabarkan putus miliarder arab saudi hassan jameel berstatus single pria rihanna langsung obrolan penggemarnya dilansir cosmopolitan senin  baru-baru rihanna kali tersorot publik menghabiskan rapper aap rocky terkonfirmasi hubungan sebatas us weekly melaporkan jumat  malam riri sapaan rihanna tersenyum tertawa nongkrong aap rocky panggung konser yams day benefit brooklyn new york lokasi rihanna rocky catatan sejarah  berciuman syuting video musik asyik status teman nongkrong paris fashion week juni  berjalan karpet merah the fashion awards london desember  berteman menebak rihanna move-on hassan jameel ditambah rihanna sosok cenderung tertutup kehidupan pribadinya publik alasan rihanna hassan putus orang ketiga alasan publik menunggu kabar bahagia lanjutan rihanna karyanya diharapkan menggebrak ', 'penyanyi rb rihanna kabar putus miliarder arab saudi hassan jameel status single pria rihanna langsung obrol gemar lansir cosmopolitan senin  baru rihanna kali sorot publik habis rapper aap rocky konfirmasi hubung batas us weekly lapor jumat  malam riri sapa rihanna senyum tertawa nongkrong aap rocky panggung konser yams day benefit brooklyn new york lokasi rihanna rocky catat sejarah  cium syuting video musik asyik status teman nongkrong paris fashion week juni  jalan karpet merah the fashion awards london desember  teman tebak rihanna move on hassan jameel tambah rihanna sosok cenderung tutup hidup pribadi publik alas rihanna hassan putus orang tiga alas publik tunggu kabar bahagia lanjut rihanna karya harap gebrak '),
(82, 1305, 'kemesraan penyanyi rb rihanna dengan miliarder asal arab saudi hassan jameel tampaknya tak akan terlihat lagi sebab pasangan itu dikabarkan sudah putus dan kini justru rihanna digosipkan sedang dekat dengan rapper drake dilansir dari cosmopolitan minggu  menurut laporan us weekly rihanna dan hassan putus setelah berpacaran hampir selama tiga tahun rapper drake disebut-sebut sedang pdkt dengan rihanna dan sudah terlihat beberapa kali bareng rihanna memang sebelumnya rihanna beberapa kali mengungkapkan hubungannya pada hassan rihanna tampaknya saat itu memang belum berniat untuk menikah dalam waktu cepat hanya tuhan yang tahu itu kapan menikah nak kami hanya berencana kan katanya dalam sebuah wawancara sumber-sumber sebelumnya menceritakan tentang betapa hebatnya dinamika hubungan rihanna dan hassan yang menyenangkan memang keduanya menjalin hubungan serius dan saling memahami dengan baik namun entah mengapa mereka kini memutuskan untuk berpisah rihanna dan drake baru-baru ini sedang dekat terlihat saat drake mendekati rihanna dengan hadir di pesta ulang tahun rihanna pada oktober tentu saja kehadirannya di pesta tidak berarti apa-apa tetapi bisa jadi menjadi awal percikan di antara keduanya', 'kemesraan penyanyi rb rihanna miliarder arab saudi hassan jameel pasangan dikabarkan putus rihanna digosipkan rapper drake dilansir cosmopolitan minggu  laporan us weekly rihanna hassan putus berpacaran rapper drake disebut-sebut pdkt rihanna kali bareng rihanna rihanna kali hubungannya hassan rihanna berniat menikah cepat tuhan menikah nak berencana wawancara sumber-sumber menceritakan betapa hebatnya dinamika hubungan rihanna hassan menyenangkan menjalin hubungan serius memahami memutuskan berpisah rihanna drake baru-baru drake mendekati rihanna hadir pesta ulang rihanna oktober kehadirannya pesta apa-apa percikan', 'mesra penyanyi rb rihanna miliarder arab saudi hassan jameel pasang kabar putus rihanna gosip rapper drake lansir cosmopolitan minggu  lapor us weekly rihanna hassan putus pacar rapper drake sebut pdkt rihanna kali bareng rihanna rihanna kali hubung hassan rihanna niat meni cepat tuhan meni nak rencana wawancara sumber cerita betapa hebat dinamika hubung rihanna hassan senang jalin hubung serius paham putus pisah rihanna drake baru drake dekat rihanna hadir pesta ulang rihanna oktober hadir pesta apa percik'),
(83, 1306, 'usai mengumumkan mundur dari kerajaan inggris pangeran harry dan meghan markle serius menetap tinggal di kanada selama ini sejak liburan mereka tinggal menyewa sebuah villa di kanada ternyata tak ingin terus-terusan menyewa meghan markle sedang berburu properti untuk membeli rumah tinggal di sana meghan markle sedang mengincar sebuah rumah di salah satu daerah paling eksklusif di kanada rumah di tepi laut itu seharga usd  juta atau setara rp  miliar di vancouver kanada itu artinya mereka memang serius berencana untuk pindah permanen dan menetap dilansir dari pagesix minggu  meghan markle suka dengan sebuah rumah berukurab  meter persegi di lingkungan kitsilano vancouver dengan pemandangan samudra pasifik dan cakrawala vancouver yang indah seperti dikutip dari the sun rumah empat lantai itu memiliki  kamar tidur dan  kamar mandi dan pagar tinggi untuk privasi meghan telah menyatakan minatnya pada rumah yang indah ini itu akan jadi tempat tingal sempurna untuknya harry dan archie kecil kata seorang makelar minggu lalu lingkungan itu dikenal sebagai surga bagi orang-orang kaya yang ingin suasana yang sangat santai saya yakin mereka meghan archie harry akan sangat bahagia jelasnya lingkungan rumah tersebut adalah lingkungan bagi sekelompok pengusaha kaya termasuk miliarder kanada chip wilson yang memiliki rumah di sana bernilai lebih dari usd  juta atau setara rp  miliar meghan markle memang punya selera tinggi keputusannya untuk menetap di kanada jangka panjang memang bukan isapan jempol pulau vancouver adalah suatu tempat di mana keluarga itu bisa lebih nyaman di tepi lautan selama ini meghan tinggal di toronto kanada menyewa sebuah villa itu terserah pada duke dan duchess apakah mereka akan memilih rumah di toronto atau vancouver dalam laman hello magazine disebutkan kanada memang punya kenangan manis bagi pasangan itu saat masih pacaran mereka tampil go public pertama kali pada bulan september  di invictus games pangeran harry diperkirakan akan pulang dari inggris pekan depan setelah pengumuman mundur duchess of sussex kini juga sudah mulai kembali hidup normal dengan melakukan sejumlah agenda salah satunya kunjungan ke markas organisasi untuk anak dan perempuan di vancouver duke dan duchess mengatakan mereka berencana untuk membagi waktu mereka antara inggris dan amerika utara setelah mengumumkan mundur dari kerajaan', 'mengumumkan mundur kerajaan inggris pangeran harry meghan markle serius menetap tinggal kanada liburan tinggal menyewa villa kanada terus-terusan menyewa meghan markle berburu properti membeli rumah tinggal meghan markle mengincar rumah salah daerah eksklusif kanada rumah tepi laut seharga usd  juta setara rp  miliar vancouver kanada serius berencana pindah permanen menetap dilansir pagesix minggu  meghan markle suka rumah berukurab  meter persegi lingkungan kitsilano vancouver pemandangan samudra pasifik cakrawala vancouver indah dikutip the sun rumah lantai memiliki  kamar tidur  kamar mandi pagar privasi meghan minatnya rumah indah tingal sempurna untuknya harry archie makelar minggu lingkungan dikenal surga orang-orang kaya suasana santai meghan archie harry bahagia lingkungan rumah lingkungan sekelompok pengusaha kaya miliarder kanada chip wilson memiliki rumah bernilai usd  juta setara rp  miliar meghan markle selera keputusannya menetap kanada jangka isapan jempol pulau vancouver keluarga nyaman tepi lautan meghan tinggal toronto kanada menyewa villa terserah duke duchess memilih rumah toronto vancouver laman hello magazine kanada kenangan manis pasangan pacaran tampil go public kali september  invictus games pangeran harry pulang inggris pekan pengumuman mundur duchess of sussex hidup normal agenda salah satunya kunjungan markas organisasi anak perempuan vancouver duke duchess berencana membagi inggris amerika utara mengumumkan mundur kerajaan', 'umum mundur raja inggris pangeran harry meghan markle serius tetap tinggal kanada libur tinggal sewa villa kanada terus sewa meghan markle buru properti beli rumah tinggal meghan markle incar rumah salah daerah eksklusif kanada rumah tepi laut harga usd  juta tara rp  miliar vancouver kanada serius rencana pindah permanen tetap lansir pagesix minggu  meghan markle suka rumah berukurab  meter persegi lingkung kitsilano vancouver pandang samudra pasifik cakrawala vancouver indah kutip the sun rumah lantai milik  kamar tidur  kamar mandi pagar privasi meghan minat rumah indah tingal sempurna untuk harry archie makelar minggu lingkung kenal surga orang kaya suasana santai meghan archie harry bahagia lingkung rumah lingkung kelompok usaha kaya miliarder kanada chip wilson milik rumah nilai usd  juta tara rp  miliar meghan markle selera putus tetap kanada jangka isap jempol pulau vancouver keluarga nyaman tepi laut meghan tinggal toronto kanada sewa villa serah duke duchess pilih rumah toronto vancouver laman hello magazine kanada kenang manis pasang pacar tampil go public kali september  invictus games pangeran harry pulang inggris pekan umum mundur duchess of sussex hidup normal agenda salah satu kunjung markas organisasi anak perempuan vancouver duke duchess rencana bagi inggris amerika utara umum mundur raja'),
(84, 1307, 'demi mendekatkan diri ke anak andika mahesa membuat keputusan besar meninggalkan ibukota dan kini tinggal di daerah kelahirannya di lampung mau tak mau ia harus bolak-balik jakarta-lampung ketika bekerja di industri hiburan tanah air iya bolak balik jakarta-lampung dekat lah cuma  menit naik pesawat kadang mau tidur belum tidur sudah keburu sampe ucap andika mahesa saat ditemui di bilangan kebayoran baru jakarta selatan sabtu  selain dengan alasan keluarga dan anak andika memutuskan untuk tinggal di lampung supaya jaringan pertemanannya jadi lebih terjaga apalagi sebelumnya andika mahesa sempat berurusan dengan hukum akibat terjerat kasus penyalahgunaan narkoba gue juga mulai milih-milih teman kalau dulu gue sama siapa saja berteman akhirnya malah nganterin gue ke bnn kalau gue jatuh ke lubang yang sama dua kali gue bodoh papar andika selain menyeleksi pertemanan penyanyi berjuluk babang tamvan itu juga tidak mau lagi pergi ke tempat hiburan malam di usianya sekarang ini andika merasa sudah bukan waktunya lagi dia melakukan kesenangan semu semacam itu dugem sekarang gue juga gak mau paling lebih nongkrong di kafe ada live musik nyanyi gitu aja tandas andika mahesa ', 'mendekatkan anak andika mahesa keputusan meninggalkan ibukota tinggal daerah kelahirannya lampung bolak-balik jakarta-lampung industri hiburan tanah air iya bolak jakarta-lampung  menit pesawat kadang tidur tidur keburu sampe andika mahesa ditemui bilangan kebayoran jakarta selatan sabtu  alasan keluarga anak andika memutuskan tinggal lampung jaringan pertemanannya terjaga andika mahesa berurusan hukum akibat terjerat penyalahgunaan narkoba gue milih-milih teman gue berteman nganterin gue bnn gue jatuh lubang kali gue bodoh papar andika menyeleksi pertemanan penyanyi berjuluk babang tamvan pergi hiburan malam usianya andika kesenangan semu dugem gue gak nongkrong kafe live musik nyanyi gitu aja andika mahesa ', 'dekat anak andika mahesa putus tinggal ibukota tinggal daerah lahir lampung bolak-balik jakarta lampung industri hibur tanah air iya bolak jakarta lampung  menit pesawat kadang tidur tidur keburu sampe andika mahesa temu bilang kebayoran jakarta selatan sabtu  alas keluarga anak andika putus tinggal lampung jaring teman jaga andika mahesa urus hukum akibat jerat penyalahgunaan narkoba gue milih teman gue teman nganterin gue bnn gue jatuh lubang kali gue bodoh papar andika seleksi teman penyanyi juluk babang tamvan pergi hibur malam usia andika senang semu dugem gue gak nongkrong kafe live musik nyanyi gitu aja andika mahesa '),
(85, 1308, 'andika mahesa mengungkapkan bahwa semua lelaki di dunia ini bisa dikatakan ganteng karena tercipta sebagai makhluk terbaik di antara makhluk-makhluk tuhan lainnya ketampanan bagi andika bukan semata-mata diukur dari fisik menurutnya tolok ukur utama ketampanan seseorang adalah hati dan perilaku hatinya yang ganteng bukan wajahnya memiliki wajah ganteng tapi suka nyakitin cewek ya sama saja ucap andika mahesa saat diminta komentarnya terkait definisi ganteng di sebuah acara yang mengusung tajuk siap ganteng di  bareng shopee di bilangan kebayoran baru jakarta selatan sabtu  selain andika mahesa acara ini juga dimeriahkan oleh podcaster bkr brothers dan pegiat musik kiki aulia ucup dalam kesempatan itu andika juga diminta untuk menyebut sosok ganteng versi dirinya setelah sempat berpikir sejenak andika kemudian menyebut tukul arwana sebagai sosok ganteng dalam imajinasinya dia menilai tukul adalah sosok yang ganteng karena sukses memikat banyak orang lewat candaan dan kelucuan tukul arwana karena menurut gue dia lucu ganteng itu relatif karena menurut gue semua cowok di dunia itu ganteng tuturnya andika mahesa yang selama ini dijuluki sebagai babang tamvan dengan senang hati mau menerima julukan itu gara-gara predikat tersebut katanya para penggemar sekaligus barisan pembencinya jadi semakin banyak gue senang banyak haters karena setelah gue mengerti gue jadi enggak baper buah kalau manis itu ditimpukin batu kalau buah enggak manis enggak akan ditimpukin batu tutur andika agak filosofis', 'andika mahesa lelaki dunia ganteng tercipta makhluk terbaik makhluk-makhluk tuhan ketampanan andika diukur fisik menurutnya tolok ukur utama ketampanan hati perilaku hatinya ganteng wajahnya memiliki wajah ganteng suka nyakitin cewek ya andika mahesa komentarnya terkait definisi ganteng acara mengusung tajuk ganteng  bareng shopee bilangan kebayoran jakarta selatan sabtu  andika mahesa acara dimeriahkan podcaster bkr brothers pegiat musik kiki aulia ucup kesempatan andika menyebut sosok ganteng versi berpikir andika menyebut tukul arwana sosok ganteng imajinasinya menilai tukul sosok ganteng sukses memikat orang candaan kelucuan tukul arwana gue lucu ganteng relatif gue cowok dunia ganteng andika mahesa dijuluki babang tamvan senang hati menerima julukan gara-gara predikat penggemar barisan pembencinya gue senang haters gue mengerti gue baper buah manis ditimpukin batu buah manis ditimpukin batu andika filosofis', 'andika mahesa lelaki dunia ganteng cipta makhluk baik makhluk tuhan tampan andika ukur fisik turut tolok ukur utama tampan hati perilaku hati ganteng wajah milik wajah ganteng suka nyakitin cewek ya andika mahesa komentar kait definisi ganteng acara usung tajuk ganteng  bareng shopee bilang kebayoran jakarta selatan sabtu  andika mahesa acara dimeriahkan podcaster bkr brothers giat musik kiki aulia ucup sempat andika sebut sosok ganteng versi pikir andika sebut tukul arwana sosok ganteng imajinasi nilai tukul sosok ganteng sukses mikat orang canda lucu tukul arwana gue lucu ganteng relatif gue cowok dunia ganteng andika mahesa juluk babang tamvan senang hati terima juluk gara-gara predikat gemar baris benci gue senang haters gue erti gue baper buah manis ditimpukin batu buah manis ditimpukin batu andika filosofis'),
(86, 1309, 'andika mahesa kini lebih pilih-pilih pekerjaan vokalis kangen band yang sukses menaklukkan hati sejumlah perempuan cantik itu memiliki alasan kuat di balik keputusannya tersebut andika mengaku dirinya sempat terjatuh sakit beberapa waktu lalu yang membuatnya harus memikirkan kondisi kesehatan kalau dulu kan kerjaan ditubruk semua karena kemarin sempat masuk rumah sakit jadi tahu bahwa sakit itu nggak enak sekarang agak milih-milih lah pekerjaan ucap andik mahesa saat ditemui di bilangan kebayoran baru jakarta selatan sabtu  selain pertimbangan kondisi kesehatan andika mahesa juga sengaja membantasi pekerjaan demi keluarganya lebih sibuk sama anak kali ya sibuknya dibagi sekarang kan dari kemarin sudah di jakarta kalau gak malam ini atau besok sudah harus di lampung tempat tinggal andika red waktunya sama anak tuturnya buah dari pengalaman hidup yang sudah dialaminya andika kini menyadari akan pentingnya keluarga dia pun berusaha untuk lebih mendekatkan diri ke anak bahkan ia kerap membawa anaknya jalan-jalan supaya bisa semakin mendekatkan diri kepada buah hati di lampung itu selain menenangkan diri juga lebih bisa jalan-jalan sama anak-anak kalau di jakarta kan kebanyakan nyasar di jakarta kan banyak aturanya ganjir genap segala macam tutur penyanyi berusia  tahun itu', 'andika mahesa pilih-pilih pekerjaan vokalis kangen band sukses menaklukkan hati perempuan cantik memiliki alasan kuat keputusannya andika mengaku terjatuh sakit membuatnya memikirkan kondisi kesehatan kerjaan ditubruk kemarin masuk rumah sakit sakit nggak enak milih-milih pekerjaan andik mahesa ditemui bilangan kebayoran jakarta selatan sabtu  pertimbangan kondisi kesehatan andika mahesa sengaja membantasi pekerjaan keluarganya sibuk anak kali ya sibuknya dibagi kemarin jakarta gak malam besok lampung tinggal andika red anak buah pengalaman hidup dialaminya andika menyadari keluarga berusaha mendekatkan anak kerap membawa anaknya jalan-jalan mendekatkan buah hati lampung menenangkan jalan-jalan anak-anak jakarta kebanyakan nyasar jakarta aturanya ganjir genap penyanyi berusia ', 'andika mahesa pilih kerja vokalis kangen band sukses takluk hati perempuan cantik milik alas kuat putus andika mengaku jatuh sakit buat pikir kondisi sehat kerja tubruk kemarin masuk rumah sakit sakit nggak enak milih kerja andik mahesa temu bilang kebayoran jakarta selatan sabtu  timbang kondisi sehat andika mahesa sengaja membantasi kerja keluarga sibuk anak kali ya sibuk bagi kemarin jakarta gak malam besok lampung tinggal andika red anak buah alam hidup alami andika sadar keluarga usaha dekat anak kerap bawa anak jalan dekat buah hati lampung tenang jalan anak jakarta banyak nyasar jakarta aturanya ganjir genap penyanyi usia '),
(87, 1310, 'prosesi pemakaman ade irawan dilangsungkan sekitar pukul  wib di tpu tanah kusir jakarta selatan sabtu  ade dimakamkan satu liang lahat dengan mendiang suaminya bambang yang tutup usia pada  jenazah ade dikebumikan oleh cucu dan menantunya mayky wongkar isak tangis sempat mewarnai prosesi pemakaman dewi irawan terlihat menangis selama pemakaman berlangsung air matanya semakin deras ketika prosesi tabur bunga dia pun sempat mencium nisan ade irawan sambil menitikkan air mata ibu selamat bertemu dengan ayah ibu yang tenang ya di sana semoga ibu bahagia sama ayah ucap dewi irawan di tpu tanah kusir jakarta selatan sabtu  dewi irawan bisa lebih lega karena dia berhasil mewujudkan keinginan ade irawan yang terakhir kalinya yakni memakamkan almarhumah dalam satu liang lahat dengan ayahnya setelah  tahun ayah sekarang sudah ditemani ibu sampai ketemu nanti ya ibu tutur dewi irawan putra ade irawan adi bambang irawan mengucapkan terima kasih kepada orang-orang yang sudah mengantarkan ibunya ke peristirahatan terakhir dia pun meminta para pelayat untuk memaafkan semua kesalahan yang dilakukan ibunya baik yang disengaja ataupun yang tidak semasa hidupnya kalau ada yang memiliki masalah utang piutang biasa menghubungi kami selaku keluarga ucapnya ade irawan meninggal pada jumat  kemarin di rumah sakit fatmawati jakarta selatan setelah mendapat perawatan intensif selama sekitar  hari ade irawan meninggal setelah mengeluhkan sesak nafas dia menderita penyakit jantung dan paru-paru ade irawan meninggal setelah  hari dari mninggnya sang putri ria irawan ria meninggal pada  januari  lalu akibat penyakit kanker kelenjar getah bening yang dideritanya', 'prosesi pemakaman ade irawan dilangsungkan  wib tpu tanah kusir jakarta selatan sabtu  ade dimakamkan liang lahat mendiang suaminya bambang tutup usia  jenazah ade dikebumikan cucu menantunya mayky wongkar isak tangis mewarnai prosesi pemakaman dewi irawan menangis pemakaman air matanya deras prosesi tabur bunga mencium nisan ade irawan menitikkan air mata selamat bertemu ayah tenang ya semoga bahagia ayah dewi irawan tpu tanah kusir jakarta selatan sabtu  dewi irawan lega berhasil mewujudkan ade irawan kalinya memakamkan almarhumah liang lahat ayahnya  ayah ditemani ketemu ya dewi irawan putra ade irawan adi bambang irawan terima kasih orang-orang mengantarkan ibunya peristirahatan pelayat memaafkan kesalahan ibunya disengaja hidupnya memiliki utang piutang menghubungi keluarga ade irawan meninggal jumat  kemarin rumah sakit fatmawati jakarta selatan perawatan intensif  ade irawan meninggal mengeluhkan sesak nafas menderita penyakit jantung paru-paru ade irawan meninggal  mninggnya sang putri ria irawan ria meninggal  januari  akibat penyakit kanker kelenjar getah bening dideritanya', 'prosesi makam ade irawan langsung  wib tpu tanah kusir jakarta selatan sabtu  ade makam liang lahat mendiang suami bambang tutup usia  jenazah ade dikebumikan cucu menantu mayky wongkar isak tangis warna prosesi makam dewi irawan tangis makam air mata deras prosesi tabur bunga cium nisan ade irawan titik air mata selamat bertemu ayah tenang ya moga bahagia ayah dewi irawan tpu tanah kusir jakarta selatan sabtu  dewi irawan lega hasil wujud ade irawan kali makam almarhumah liang lahat ayah  ayah teman ketemu ya dewi irawan putra ade irawan adi bambang irawan terima kasih orang antar ibu istirahat layat maaf salah ibu sengaja hidup milik utang piutang hubung keluarga ade irawan tinggal jumat  kemarin rumah sakit fatmawati jakarta selatan awat intensif  ade irawan tinggal keluh sesak nafas derita sakit jantung paru ade irawan tinggal  mninggnya sang putri ria irawan ria tinggal  januari  akibat sakit kanker kelenjar getah bening derita'),
(88, 1311, 'helmy yahya tidak tinggal diam usai dirinya diberhentikan sebagai direktur utama dirut oleh dewan pengawas dewas lpp tvri sejak kamis  kemarin dia bersama kuasa hukumnya chandra hamzah tengah mempersiapkan langkah hukum terbaik guna mengahadapi dewas mantan wakil ketua kpk dalam jumpa pers mengatakan bahwa ada sejumlah langkah hukum yang tersedia untuk mengadvokasi kasus yang menimpa helmy yahya namun sayangnya chandra hamzah masih enggan untuk memberikan bocorannya meski beberapa kali didesak awak media enggan membeberkannya dia meminta wartawan bersabar menunggu perkembangannya dalam satu minggu ke depan di uu ada silakan saja dibaca langkah-lahkah hukumnya apa saja sedang kami bicarakan dan ada beberapa opsi sabar dulu ya mungkin dalam satu minggu ke depan ucap chandra hamzah dalam jumpa pers di bilangan gatot subroto jakarta jumat  dalam kesempatan itu dia juga sempat mengungkap kontradiksi yang tertera dalam surat pemberhentian dewas terhadap helmy yahya point yang dia sorot helmy dipecat secara terhormat namun kemudian diungkap alasan di balik pemecatan kalau dipecat secara terhormat berarti tidak ada kesalahan dong ucapnya chandra hamzah juga mempertanyakan pengangkatan pelaksana tugas direktur utama tvri setelah diberhentikannya helmy yahya dia secara tegas mengatakan bahwa dewas tidak memiliki kewenangan untuk mengangkat plt sebagaimana tertuang dalam peraturan pemerintah no  tahun  tentang lpp tvri dalam aturannya tidak ada kewenangan dewan pengawas untuk mengangkat plt dewan pengawas hanya memiliki kewenangan untuk mengangkat dan memberhentikan direksi kalau tidak ada artinya apa silakan diartikan sendiri kata chandra hamzah selain itu pria kelahiran  februari  itu juga menyoroti sistem kolektif kolegial yang terjadi di dalam direksi tvri menurutnya karena direksi tvri menganut sistem kolektif kolegial seharusnya pemberhentian itu bukan hanya helmy yahya semua direktur seharusnya juga ikut diberhentikan oleh dewas tapi faktanya yang diberhentikan cuma helmy yahya tandas chandra hamzah ', 'helmy yahya tinggal diam diberhentikan direktur utama dirut dewan pengawas dewas lpp tvri kamis  kemarin kuasa hukumnya chandra hamzah langkah hukum terbaik mengahadapi dewas mantan wakil ketua kpk jumpa pers langkah hukum tersedia mengadvokasi menimpa helmy yahya sayangnya chandra hamzah enggan bocorannya kali didesak awak media enggan membeberkannya wartawan bersabar menunggu perkembangannya minggu uu silakan dibaca langkah-lahkah hukumnya bicarakan opsi sabar ya minggu chandra hamzah jumpa pers bilangan gatot subroto jakarta jumat  kesempatan mengungkap kontradiksi tertera surat pemberhentian dewas helmy yahya point sorot helmy dipecat terhormat diungkap alasan pemecatan dipecat terhormat kesalahan chandra hamzah pengangkatan pelaksana tugas direktur utama tvri diberhentikannya helmy yahya dewas memiliki kewenangan mengangkat plt tertuang peraturan pemerintah no   lpp tvri aturannya kewenangan dewan pengawas mengangkat plt dewan pengawas memiliki kewenangan mengangkat memberhentikan direksi silakan diartikan chandra hamzah pria kelahiran  februari  menyoroti sistem kolektif kolegial direksi tvri menurutnya direksi tvri menganut sistem kolektif kolegial pemberhentian helmy yahya direktur diberhentikan dewas faktanya diberhentikan helmy yahya chandra hamzah ', 'helmy yahya tinggal diam diberhentikan direktur utama dirut dewan awas dewas lpp tvri kamis  kemarin kuasa hukum chandra hamzah langkah hukum baik mengahadapi dewas mantan wakil ketua kpk jumpa pers langkah hukum sedia advokasi timpa helmy yahya sayang chandra hamzah enggan bocor kali desak awak media enggan beber wartawan sabar tunggu kembang minggu uu sila baca lang lah hukum bicara opsi sabar ya minggu chandra hamzah jumpa pers bilang gatot subroto jakarta jumat  sempat ungkap kontradiksi tera surat pemberhentian dewas helmy yahya point sorot helmy pecat hormat ungkap alas pecat pecat hormat salah chandra hamzah angkat laksana tugas direktur utama tvri diberhentikannya helmy yahya dewas milik wenang angkat plt tuang atur perintah no   lpp tvri atur wenang dewan awas angkat plt dewan awas milik wenang angkat memberhentikan direksi sila artik chandra hamzah pria lahir  februari  sorot sistem kolektif kolegial direksi tvri turut direksi tvri anut sistem kolektif kolegial pemberhentian helmy yahya direktur diberhentikan dewas fakta diberhentikan helmy yahya chandra hamzah '),
(89, 1312, 'setelah melalui perseteruan panjang dan proses secara internal helmy yahya resmi dicopot oleh dewan pengawas tertanggal  januari  surat pemberhentian dari dewas pun telah dikeluarkan seiring ditolaknya klarikasi sekaligus pembelaan helmy yahya setebal  halaman tidak terima terima diberhentikan oleh dewas sebagai dirut tvri helmy yahya pun mempersiapkan pelawanan dengan menggandeng mantan wakil kpk chandra hamza sebagai kuasa hukum di sini saya didampingi oleh kuasa hukum saya bang chandra hamza dan wibowo mukti ucap helmy yahya dalam jumpa pers di bilangan gatot subroto jakarta jumat  helmy menduga pemecatan dirinya oleh dewas akibat menayangkan liga inggris yang memakan dana cukup besar dan diambil dari penerimaan negara bukan pajak pnbp menurut helmy semua proses itu ditempuh secara benar sehingga tidak ada yang cacat prosedur administrasi anggarannya memang enggak ada karena anggaran  approvalnya pada awal tahun sementara tawaran itu datang di tengah tahun tapi kan kami setiap tahun punya pnpb dari sewa pemancar iklan dan lain-lain setelah kami hitung bisa masuk anggarannya terang helmy yahya bagi saudara kandung tantowi yahya itu tvri bisa mendapatkan liga inggris seharusnya suatu kebanggaan karena semua stasiun televisi termasuk tvri ingin ada program yang disukai banyak orang yang menandakan eksistensinya di masyarakat semakin terlihat nyata semua stasiun di dunia ingin memiliki sebuah program killer content monster content atau lokomotif content yang membuat orang menonton tvri karena jangkauannya lima kali lipat dari tv lain akhirnya mendapatkan kami bekerja sama dengan mola tv untuk menayangkan liga inggris tutur helmy yahya awalnya dia mengaku tidak percaya bisa mendapat kepercayaan untuk menayangkan liga inggris kesuksesan tvri menayangkan siaran itu tidak lepas dari infrastruktur memadai dengan jangkauan yang luas hal itu kemudian membuat banyak orang bertanya-tanya dalam kesempatan yang sama chandra hamzah mengatakan dirinya baru ditunjuk oleh helmy yahya menjadi kuasa hukum dia pun masih akan mempelajarinya duduk permasalahan kliennya untuk memberikan saran langkah hukum apa yang akan diambil nanti chadra menganggap pemberhentian helmy yahya tidak sesuai prosedur sebab tidak ada tanggapan terkait pembelaan yang dilakukan kliennya sebelum akhirnya diambil keputusan pemecatan orang yang mempunya kewenangan bisa dipermasalahkan apabilang dia sewenang-wenang melaksanakan kewenangannya tutur chandara hamzah', 'perseteruan proses internal helmy yahya resmi dicopot dewan pengawas tertanggal  januari  surat pemberhentian dewas dikeluarkan seiring ditolaknya klarikasi pembelaan helmy yahya setebal  halaman terima terima diberhentikan dewas dirut tvri helmy yahya pelawanan menggandeng mantan wakil kpk chandra hamza kuasa hukum didampingi kuasa hukum bang chandra hamza wibowo mukti helmy yahya jumpa pers bilangan gatot subroto jakarta jumat  helmy menduga pemecatan dewas akibat menayangkan liga inggris memakan dana diambil penerimaan negara pajak pnbp helmy proses ditempuh cacat prosedur administrasi anggarannya anggaran  approvalnya tawaran pnpb sewa pemancar iklan lain-lain hitung masuk anggarannya terang helmy yahya saudara kandung tantowi yahya tvri liga inggris kebanggaan stasiun televisi tvri program disukai orang menandakan eksistensinya masyarakat nyata stasiun dunia memiliki program killer content monster content lokomotif content orang menonton tvri jangkauannya kali lipat tv mola tv menayangkan liga inggris helmy yahya mengaku percaya kepercayaan menayangkan liga inggris kesuksesan tvri menayangkan siaran lepas infrastruktur memadai jangkauan luas orang kesempatan chandra hamzah helmy yahya kuasa hukum mempelajarinya duduk permasalahan kliennya saran langkah hukum diambil chadra menganggap pemberhentian helmy yahya sesuai prosedur tanggapan terkait pembelaan kliennya diambil keputusan pemecatan orang mempunya kewenangan dipermasalahkan apabilang sewenang-wenang melaksanakan kewenangannya chandara hamz