(90, 1313, 'meghan markle baik-baik saja dari semua masalah yang dihadapinya selama sepekan terakhir buktinya istri pangeran harry itu terlihat menyetir di bandara internasional victoria kanada menjemput teman-temannya saat pangeran harry masih fokus di inggris meghan markle terlihat mengemudi sendiri ke bandara internasional victoria di kanada dilansir dari pink villa yang mengutip express uk meghan tiba di bandara untuk menjemput salah seorang teman dekatnya mengemudi land rover hitam meghan sampai ke bandara untuk menjemput teman dan instruktur pilates heather dorak namun duchess of sussex tidak keluar dari mobil ibunda archie itu juga melakukan me time dengan minum teh dan menghabiskan waktu berinteraksi dengan sahabatnya dari balik mobil meghan tampak mengenakan pakaian kasual dengan topi beanie gelap dan kacamata hitam untuk melindungi dirinya dari cuaca cerah selama  menit menunggu di tempat parkir meghan tampak bersemangat sahabatnya dorak yang duduk di kursi belakang bukan hanya teman baik tetapi juga guru pilates-nya meghan diyakini bertemu dorak untuk mengikuti kursus di pusat kebugaran pilates platinum di los angeles ms dorak dan suaminya matt cohen adalah sahabat yang juga hadir di pernikahan meghan dan harry pada mei  sebelumnya meghan juga pada hari selasa  terlihat naik pesawat amfibi menuju pulau vancouver untuk bertemu teman-temannya pertama dia menuju ke pusat kota downtown eastside pada hari yang sama meghan juga mengunjungi justice for girls sebuah organisasi yang mendukung dan memberdayakan gadis-gadis remaja yang membutuhkan', 'meghan markle baik-baik dihadapinya sepekan buktinya istri pangeran harry menyetir bandara internasional victoria kanada menjemput teman-temannya pangeran harry fokus inggris meghan markle mengemudi bandara internasional victoria kanada dilansir pink villa mengutip express uk meghan bandara menjemput salah teman dekatnya mengemudi land rover hitam meghan bandara menjemput teman instruktur pilates heather dorak duchess of sussex mobil ibunda archie me time minum teh menghabiskan berinteraksi sahabatnya mobil meghan mengenakan pakaian kasual topi beanie gelap kacamata hitam melindungi cuaca cerah  menit menunggu parkir meghan bersemangat sahabatnya dorak duduk kursi teman guru pilates-nya meghan diyakini bertemu dorak mengikuti kursus pusat kebugaran pilates platinum los angeles ms dorak suaminya matt cohen sahabat hadir pernikahan meghan harry mei  meghan selasa  pesawat amfibi pulau vancouver bertemu teman-temannya pusat kota downtown eastside meghan mengunjungi justice for girls organisasi mendukung memberdayakan gadis-gadis remaja membutuhkan', 'meghan markle baik hadap pekan bukti istri pangeran harry setir bandara internasional victoria kanada jemput teman pangeran harry fokus inggris meghan markle kemudi bandara internasional victoria kanada lansir pink villa kutip express uk meghan bandara jemput salah teman dekat kemudi land rover hitam meghan bandara jemput teman instruktur pilates heather dorak duchess of sussex mobil ibunda archie me time minum teh habis interaksi sahabat mobil meghan enak pakai kasual topi beanie gelap kacamata hitam lindung cuaca cerah  menit tunggu parkir meghan semangat sahabat dorak duduk kursi teman guru pilates nya meghan yakin bertemu dorak ikut kursus pusat bugar pilates platinum los angeles ms dorak suami matt cohen sahabat hadir nikah meghan harry mei  meghan selasa  pesawat amfibi pulau vancouver bertemu teman pusat kota downtown eastside meghan unjung justice for girls organisasi dukung memberdayakan gadis remaja butuh'),
(91, 1314, 'komedian entis sutisna alias sule dikabarkan segera melangsungkan pernikahan dengan kekasihnya pada april  mendatang pernikahan sule seharusnya digelar pada februari bulan depan namun hari bahagia tersebut terpaksa ditunda karena rizky febian dan putri tengah berduka atas meninggalnya sang ibunda lina jubaedah sayangnya sule sampai saat ini masih merahasiakan dengan siapa dia akan menikah pada april mendatang namun dikatakan sule akan menikah dengan kekasihnya yang berprofesi sebagai pramugari dari salah satu maskapai penerbangan bernama fanny dikonfirmasi tentang kabar pernikahan tersebut sule yang dihubungi melalui sambungan telepon tidak membenarkan ataupun membantah maaf saya lagi kerja nih nanti saja ya ucapnya saat dihubungi jumat  sementara itu sebelumnya pengacara sule dose hudaya mengungkapkan berkas-berkas administrasi pernikahan kliennya sudah siap meskipun belum didaftarkan ke kantor urusan agama kua kala itu dose menyebut sule akan menikah dengan kekasihnya yang bukan dari kalangan artis bukan dari kalangan artis ucapnya ketika itu hal serupa juga sempat diungkapkan sule saat diwawancarai beberapa waktu lalu dia menyebut akan menikah dari perempuan yang bukan berasal dari kalangan publik figur orang biasa ucap sule pada waktu itu', 'komedian entis sutisna alias sule dikabarkan melangsungkan pernikahan kekasihnya april  pernikahan sule digelar februari bahagia terpaksa ditunda rizky febian putri berduka meninggalnya sang ibunda lina jubaedah sayangnya sule merahasiakan menikah april sule menikah kekasihnya berprofesi pramugari salah maskapai penerbangan bernama fanny dikonfirmasi kabar pernikahan sule dihubungi sambungan telepon membenarkan membantah maaf kerja nih ya dihubungi jumat  pengacara sule dose hudaya berkas-berkas administrasi pernikahan kliennya didaftarkan kantor urusan agama kua dose menyebut sule menikah kekasihnya kalangan artis kalangan artis sule diwawancarai menyebut menikah perempuan berasal kalangan publik figur orang sule', 'komedian entis sutisna alias sule kabar langsung nikah kasih april  nikah sule gelar februari bahagia paksa tunda rizky febian putri duka tinggal sang ibunda lina jubaedah sayang sule rahasia meni april sule meni kasih profesi pramugari salah maskapai terbang nama fanny konfirmasi kabar nikah sule hubung sambung telepon benar bantah maaf kerja nih ya hubung jumat  acara sule dose hudaya berkas administrasi nikah klien daftar kantor urus agama kua dose sebut sule meni kasih kalang artis kalang artis sule wawancara sebut meni perempuan asal kalang publik figur orang sule'),
(92, 1315, 'sektiar  hari dari meninggalnya ria irawan akibat penyakit kanker sang ibunda yakni ade irawan menyusul di keabadian pada hari ini jumat  ade mengembuskan napas terakhirnya di rumah sakit fatmawati jakarta selatan pada pukul  wib ade irawan meninggal di usia  tahun kabar meninggalnya ade irawan menyebar di sejumlah grup wartawan inalillahi wa inna illaihi rojiun telah meninggal dunia ibu adek irawan di rs fatmawati hari ini jumat  jan pukul  wib rumah duka lebak lestari indah residen jln anggrek lestari indah blok n no  lebak bulus-jaksel demikian isi pesan yang beredar di beberapa grup wartawan melalui akun instagram pribadinya rekan sesama artis melly goeslaw pun menyampaikan ucapan bela sungkawa atas meninggalnya ade irawan disertai unggahan foto ade pelantun jika itu mendoakan supaya ade irawan bisa bersama-sama lagi dengan ria irawan di surga innalillahi wa inna illaihi rojiun selamat jalan tante ade irawan bahagia berkumpul kembali dengan ria di surga allah swt alfatihah buat tante dan ria ucap melly goeslaw sampai saat ini belum diketahui secara pasti penyebab meninggalnya ade irawan namun beberapa waktu lalu dia diketahui sempat melakukan perawatan akibat penyakit paru-paru yang dideritanya ade irawan termasuk aktris ngetop pada zamannya dia terjun ke dunia seni peran pertama kalinya pada  lewat film di ambang fadjar setelah itu puluhan film dia bintangi di antaranya film berjudul tjinta di udjung tahun si janda kembang fajar menyingsing jinak-jinak merpati dan masih banyak lagi yang lainnya selain sebagai aktris ade irawan juga sempat menulis skenario dua film yang dia tulis skenarionya adalah fajar menyingsing dan belas kasih', 'sektiar  meninggalnya ria irawan akibat penyakit kanker sang ibunda ade irawan menyusul keabadian jumat  ade mengembuskan napas terakhirnya rumah sakit fatmawati jakarta selatan  wib ade irawan meninggal usia  kabar meninggalnya ade irawan menyebar grup wartawan inalillahi wa inna illaihi rojiun meninggal dunia adek irawan rs fatmawati jumat  jan  wib rumah duka lebak lestari indah residen jln anggrek lestari indah blok n no  lebak bulus-jaksel isi pesan beredar grup wartawan akun instagram pribadinya rekan artis melly goeslaw ucapan bela sungkawa meninggalnya ade irawan disertai unggahan foto ade pelantun mendoakan ade irawan ria irawan surga innalillahi wa inna illaihi rojiun selamat jalan tante ade irawan bahagia berkumpul ria surga allah swt alfatihah tante ria melly goeslaw penyebab meninggalnya ade irawan perawatan akibat penyakit paru-paru dideritanya ade irawan aktris ngetop zamannya terjun dunia seni peran kalinya  film ambang fadjar puluhan film bintangi film berjudul tjinta udjung si janda kembang fajar menyingsing jinak-jinak merpati aktris ade irawan menulis skenario film tulis skenarionya fajar menyingsing belas kasih', 'sektiar  tinggal ria irawan akibat sakit kanker sang ibunda ade irawan susul abadi jumat  ade embus napas akhir rumah sakit fatmawati jakarta selatan  wib ade irawan tinggal usia  kabar tinggal ade irawan sebar grup wartawan inalillahi wa inna illaihi rojiun tinggal dunia adek irawan rs fatmawati jumat  jan  wib rumah duka lebak lestari indah residen jln anggrek lestari indah blok n no  lebak bulus jaksel isi pesan edar grup wartawan akun instagram pribadi rekan artis melly goeslaw ucap bela sungkawa tinggal ade irawan serta unggah foto ade lantun doa ade irawan ria irawan surga innalillahi wa inna illaihi rojiun selamat jalan tante ade irawan bahagia kumpul ria surga allah swt alfatihah tante ria melly goeslaw sebab tinggal ade irawan awat akibat sakit paru derita ade irawan aktris ngetop zaman terjun dunia seni peran kali  film ambang fadjar puluh film bintang film judul tjinta udjung si janda kembang fajar singsing jinak merpati aktris ade irawan tulis skenario film tulis skenario fajar singsing belas kasih');
