(93, 1316, 'sejumlah pasangan seleberiti diberikan kemudahan untuk mendapatkan momongan namun ada beberapa publik figur yang harus bersabar lebih lama untuk menimang buah hati yang dinanti-nantikan berikut  artis yang belum mendapat momongan meskipun sudah lama menikah  rianti cartwright- cassanova alfonso rianti cartwright menikah dengan cassanova alfonso pada  september  meski pernikahan mereka sudah hampir memasuki usia satu dekade rianti masih belum hamil tidak menyerah dan optimis pasangan ini masih terus berusaha untuk memiliki momongan hingga sekarang pada maret  lalu rianti diketahui menjalani program bayi tabung namun sepertinya program yang dilakukan pemain film ayat-ayat cinta itu belum membuahkan hasil pasangan ini masih menikmati masa-masa belum memiliki anak dengan melakukan hal-hal romantis berdua bersama sang suami  dewi sandra- agus rahman dewi sandra menikah dengan agus rahman pada  desember  setelah menikah dengana agus dewi sandra mengubah penampilan dengan berhijab sejak  sekalipun usia pernikahan pasangan ini sudah memasuki tahun ke- dewi sandra belum kunjung berbadan dua ketika ditanya wartawan apakah dirinya akan melakukan program bayi tabung sebagaimana dilakukan sejumlah selebriti dewi sandra tidak memberi jawaban secara spesifik ada memang dengan program ada yang dengan berdoa ada yang melakukan terapi ada yang lebih ekstrem lagi biarlah allah yang menentukan takdir dalam menjadi seorang ibu atau tidak kata dewi sandra dalam sebuah kesempatan  dhini aminarti- dimas seto dini aminarti dan dimas seto menikah pada  desember  meski usia pernikahan mereka sudah genap  tahun pasangan ini sampai sekarang belum mendapat momongan tidak menyerah pasangan ini masih terus berusaha dini aminarti dan dimas seto masih mengupayakan memiliki momongan dengan cara normal dengan memperhatikan pola hidup sehat namun untuk melakukan program bayi tabung dini aminarti dan dimas seto belum tertarik untuk saat ini belum ke arah sana bayi tabung ikhtiar saja ya saya bukan tipe orang yang makannya macam-macam makan normal tidak berlebihan olahraga insya allah kalau allah takdirkan pada saatnya akan indah pada waktunya kata dimas seto saat ditemui di bilangan blok m jakarta selatan kamis   lyla naga- feby pernikahan naga lyla dengan feby rizky andhika siregar digelar pada  januari  mereka belum dikaruniai buah hati hingga sekarang sejumlah usaha perna sudah dilakukan naga lyla dan feby mulai dari melakukan pola hidup sehat terapi hingga melakukan program bayi tabung namun sempat gagal pada  silam ditemui di penghujung tahun  naga lyla mengatakan dirinya dan istri masih akan mencoba melakukan program bayi tabung untuk kedua kalinya  dea ananda- ariel nidji mantan penyanyi cilik dea ananda dan ariel nidji menikah pada  agustus  silam mereka masih terus berusaha memiliki anak memasuki usia pernikahan mereka di tahun ke- ini beruntung kondisi ini tidak membuat keduanya stress dea ananda mengatakan bahwa sambil menanti hadirnya si kecil ia dan ariel memilih untuk menikmati masa-masa pacaran dalam naungan pernikahan  fera feriska  al fathir muchtar fera feriska melangsungkan pernikahan dengan al fathir muchtar pada  september  dan belum memiliki anak seperti pasangan lainnya mereka masih terus berupaya agar bisa memiliki keturunan fahir dan fera juga sempat melakukan pemeriksaan kesehatan ke rsia kemang jakarta selatan supaya cepat hamil  zaskia sungkar  irwansyah zaskia sungkar dan irwansyah juga belum dianugerahi buah hati meskipun usia pernikahan mereka kini genap  tahun pasangan yang menikah pada  januari  itu diketahui melakukan program kehamilan namun belum ditakdirkan tuhan untuk memiliki momongan kendati demikian zaskia sungkar dan irwansyah tetap bersemangat untuk bisa memiliki buah hati yang sudah sangat diidam-idamkan bahkan di momen perayaan ulang tahun pernikahan ke- kemarin zaskia sungkar secara khusus memohon kepada tuhan supaya cepat hamil sehingga bisa memiliki anak di tahun depan', 'pasangan seleberiti kemudahan momongan publik figur bersabar menimang buah hati dinanti-nantikan  artis momongan menikah  rianti cartwright- cassanova alfonso rianti cartwright menikah cassanova alfonso  september  pernikahan memasuki usia dekade rianti hamil menyerah optimis pasangan berusaha memiliki momongan maret  rianti menjalani program bayi tabung program pemain film ayat-ayat cinta membuahkan hasil pasangan menikmati masa-masa memiliki anak hal-hal romantis berdua sang suami  dewi sandra- agus rahman dewi sandra menikah agus rahman  desember  menikah dengana agus dewi sandra mengubah penampilan berhijab  usia pernikahan pasangan memasuki ke- dewi sandra kunjung berbadan wartawan program bayi tabung selebriti dewi sandra spesifik program berdoa terapi ekstrem biarlah allah menentukan takdir dewi sandra kesempatan  dhini aminarti- dimas seto aminarti dimas seto menikah  desember  usia pernikahan genap  pasangan momongan menyerah pasangan berusaha aminarti dimas seto mengupayakan memiliki momongan normal memperhatikan pola hidup sehat program bayi tabung aminarti dimas seto tertarik arah bayi tabung ikhtiar ya tipe orang makannya macam-macam makan normal olahraga insya allah allah takdirkan indah dimas seto ditemui bilangan blok m jakarta selatan kamis   lyla naga- feby pernikahan naga lyla feby rizky andhika siregar digelar  januari  dikaruniai buah hati usaha perna naga lyla feby pola hidup sehat terapi program bayi tabung gagal  silam ditemui penghujung  naga lyla istri mencoba program bayi tabung kalinya  dea ananda- ariel nidji mantan penyanyi cilik dea ananda ariel nidji menikah  agustus  silam berusaha memiliki anak memasuki usia pernikahan ke- beruntung kondisi stress dea ananda hadirnya si ariel memilih menikmati masa-masa pacaran naungan pernikahan  fera feriska  al fathir muchtar fera feriska melangsungkan pernikahan al fathir muchtar  september  memiliki anak pasangan berupaya memiliki keturunan fahir fera pemeriksaan kesehatan rsia kemang jakarta selatan cepat hamil  zaskia sungkar  irwansyah zaskia sungkar irwansyah dianugerahi buah hati usia pernikahan genap  pasangan menikah  januari  program kehamilan ditakdirkan tuhan memiliki momongan kendati zaskia sungkar irwansyah bersemangat memiliki buah hati diidam-idamkan momen perayaan ulang pernikahan ke- kemarin zaskia sungkar khusus memohon tuhan cepat hamil memiliki anak', 'pasang seleberiti mudah momong publik figur sabar timang buah hati nanti  artis momong meni  rianti cartwright  cassanova alfonso rianti cartwright meni cassanova alfonso  september  nikah masuk usia dekade rianti hamil serah optimis pasang usaha milik momong maret  rianti jalan program bayi tabung program main film ayat cinta buah hasil pasang nikmat masa milik anak hal romantis dua sang suami  dewi sandra  agus rahman dewi sandra meni agus rahman  desember  meni dengana agus dewi sandra ubah tampil hijab  usia nikah pasang masuk ke- dewi sandra kunjung badan wartawan program bayi tabung selebriti dewi sandra spesifik program doa terapi ekstrem biar allah tentu takdir dewi sandra sempat  dhini aminarti  mas seto aminarti mas seto meni  desember  usia nikah genap  pasang momong serah pasang usaha aminarti mas seto upaya milik momong normal hati pola hidup sehat program bayi tabung aminarti mas seto tarik arah bayi tabung ikhtiar ya tipe orang makan macam makan normal olahraga insya allah allah takdir indah mas seto temu bilang blok m jakarta selatan kamis   lyla naga  feby nikah naga lyla feby rizky andhika siregar gelar  januari  karunia buah hati usaha perna naga lyla feby pola hidup sehat terapi program bayi tabung gagal  silam temu hujung  naga lyla istri coba program bayi tabung kali  dea ananda  ariel nidji mantan penyanyi cilik dea ananda ariel nidji meni  agustus  silam usaha milik anak masuk usia nikah ke- untung kondisi stress dea ananda hadir si ariel pilih nikmat masa pacar naung nikah  fera feriska  al fathir muchtar fera feriska langsung nikah al fathir muchtar  september  milik anak pasang upaya milik turun fahir fera periksa sehat rsia kemang jakarta selatan cepat hamil  zaskia sungkar  irwansyah zaskia sungkar irwansyah anugerah buah hati usia nikah genap  pasang meni  januari  program hamil takdir tuhan milik momong kendati zaskia sungkar irwansyah semangat milik buah hati idam momen raya ulang nikah ke- kemarin zaskia sungkar khusus mohon tuhan cepat hamil milik anak'),
(94, 1317, 'lina jubaedah mendiang mantan istri komedian entis sutisna alias sule dikabarkan meninggalkan harta dalam jumlah besar menurut pengacara lina harta ibu rizky febian itu disebut-sebut mencapai rp  miliar berupa tanah rumah kontrakan salon perhiasan dan lain-lain hal itu diungkapkan abdurahman t pratomo selaku pengacara mendiang lina dia mengetahui daftar aset kekayaan lina setelah menangani kasus perceraian lina dengan sule sekitar tahun  silam tak sampai disitu saja abdurahman menyebut kekayaan lina bisa lebih besar jumlahnya adanya miliaran piutang yang belum tertagihkan lina dulu juga sempat menyodorkan daftar piutang jumlahnya hampir menyentuh rp  miliar kata abdurrahman kepada wartawan belum lama ini abdurrahman sempat menyinggung masalah piutang ini kepada teddy menurut penuturannya teddy mengakui dana milik lina masih berada di tangan pihak yang berutang dan belum dibayarkan hingga sekarang kemarin itu sempat komunikasi dengan beliau dan mengingat aset mendiang suaminya cukup kooperatif tutur abdurahman lebih lanjut lina meninggal pada sabtu  januari  saat dalam perjalanan menuju rumah sakit al islam bandung jawa barat lina sempat disebut meninggal karena permasalahan pada lambung dan darah tinggi', 'lina jubaedah mendiang mantan istri komedian entis sutisna alias sule dikabarkan meninggalkan harta pengacara lina harta rizky febian disebut-sebut mencapai rp  miliar tanah rumah kontrakan salon perhiasan lain-lain abdurahman t pratomo pengacara mendiang lina daftar aset kekayaan lina menangani perceraian lina sule  silam disitu abdurahman menyebut kekayaan lina miliaran piutang tertagihkan lina menyodorkan daftar piutang menyentuh rp  miliar abdurrahman wartawan abdurrahman menyinggung piutang teddy penuturannya teddy mengakui dana milik lina tangan berutang dibayarkan kemarin komunikasi beliau aset mendiang suaminya kooperatif abdurahman lina meninggal sabtu  januari  perjalanan rumah sakit al islam bandung jawa barat lina meninggal permasalahan lambung darah', 'lina jubaedah mendiang mantan istri komedian entis sutisna alias sule kabar tinggal harta acara lina harta rizky febian sebut capai rp  miliar tanah rumah kontrak salon hias lain abdurahman t pratomo acara mendiang lina daftar aset kaya lina tangan cerai lina sule  silam situ abdurahman sebut kaya lina miliar piutang tagih lina sodor daftar piutang sentuh rp  miliar abdurrahman wartawan abdurrahman singgung piutang teddy tutur teddy aku dana milik lina tangan utang bayar kemarin komunikasi beliau aset mendiang suami kooperatif abdurahman lina tinggal sabtu  januari  jalan rumah sakit al islam bandung jawa barat lina tinggal masalah lambung darah'),
(95, 1318, 'hubungan antara kate middleton dan meghan markle dikabarkan tidak akur lantaran sempat berselisih paham dan tidak harmonis selama beberapa bulan terakhir ketidakharmonisan itu juga berpengaruh pada hubungan anak-anak mereka anak-anak kate yakni george charlotte dan louis disebutkan baru bertemu dengan archie anak meghan sebanyak dua kali dilansir dari mirror jumat  archie pertama kali bertemu dengan sepupunya pada bulan juli  di sebuah acara polo berminggu-minggu setelah ia lahir keluarnya meghan dan pangeran harry dari kerajaan inggris pun semakin membuat renggang hubungan antara archie dan ketiga sepupunya yang lain sejak lahir pun archie tinggal sangat jauh dari anak-anak kate setelah kelahirannya pada bulan mei sebelum dibawa pergi ibunya ke kanada pada bulan november archie telah tinggal di frogmore cottage di windsor yang berjarak  mil dari istana kensington di mana george charlotte dan louis tinggal perseteruan meghan dan kate akhirnya membuat publik juga memprediksi ada ketegangan antara pangeran harry dan pangeran william meski begitu sumber-sumber istana buckingham dengan tegas membantah perselisihan itu pernah terjadi', 'hubungan kate middleton meghan markle dikabarkan akur lantaran berselisih paham harmonis ketidakharmonisan berpengaruh hubungan anak-anak anak-anak kate george charlotte louis bertemu archie anak meghan kali dilansir mirror jumat  archie kali bertemu sepupunya juli  acara polo berminggu-minggu lahir keluarnya meghan pangeran harry kerajaan inggris renggang hubungan archie ketiga sepupunya lahir archie tinggal anak-anak kate kelahirannya mei dibawa pergi ibunya kanada november archie tinggal frogmore cottage windsor berjarak  mil istana kensington george charlotte louis tinggal perseteruan meghan kate publik memprediksi ketegangan pangeran harry pangeran william sumber-sumber istana buckingham membantah perselisihan', 'hubung kate middleton meghan markle kabar akur lantar selisih paham harmonis ketidakharmonisan pengaruh hubung anak anak kate george charlotte louis bertemu archie anak meghan kali lansir mirror jumat  archie kali bertemu sepupu juli  acara polo minggu lahir keluar meghan pangeran harry raja inggris renggang hubung archie tiga sepupu lahir archie tinggal anak kate lahir mei bawa pergi ibu kanada november archie tinggal frogmore cottage windsor jarak  mil istana kensington george charlotte louis tinggal seteru meghan kate publik memprediksi tegang pangeran harry pangeran william sumber istana buckingham bantah selisih'),
(96, 1319, 'santi ibu sambung yang juga istri dari mark sungkar menepis selentingan kabar yang menyebut zaskia sungkar kini tengah berbadan dua menurut penuturannya zaskia sampai sekarang belum hamil namun tengah berusaha keras supaya cepat mendapat momongan sekarang belum tapi sedang berusaha keras ucap santi saat berbincang dengan jawaposcom melalui sambungan telepon sebagai orang tua santi dan mark sungkar tentu selalu mendoakan supaya kia  sapaan akrab zaskia sungkar cepat dapat momongan iya kita doain biar cepat dapat momongan ucapnya baca juga ibu sambung angkat bicara soal kabar zaskia sungkar hamil selain dirinya dan mark sungkar santi menyebut keluarga besar dan para sahabat sudah tidak sabar menantikan kehamilan zaskia sungkar mereka pun juga ikut mengirim doa untuk kia dan keluarga apalagi usia pernikahan zaskia sungkar dengan irwansyah sudah mencapai  tahun semua keluarga teman-teman yang sayang irwan dan kia dari dulu berharap supaya mereka cepat punya momongan tutur santi lebih lanjut zaskia sungkar sejatinya melakukan program kehamilan sejak beberapa tahun lalu namun ketika itu masih terputus-putus dia bersama irwansyah kadang lupa tengah melakukan program kehamilan lantaran sibuk dengan setumpuk pekerjaan namun belakangan zaskia sungkar mulai fokus menjalani program kehamilan demi mendapatkan buah hati kadang-kadang kita program nih habis itu liburan lupa hilang ingat lagi dua tahun lagi kata zaskia sungkar dalam vlog baim paula gue sama irwan sama soalnya ya sudah santai saja pas sekarang-sekarang ini baru serius menjalani program kehamilan imbuh saudara kandung shireen sungkar itu zaskia sungkar menyatakan bahwa dirinya sudah ingin sekali hamil tepat di momen perayaan ulang tahun pernikahannya yang ke- bersama irwansyah belum lama ini dia mem-posting foto kebersamaan dengan sang suami saat tengah berada di california zaskia sungkar berdoa supaya pada tahun depan keluarga kecilnya lebih berwarna dengan kehadiran buah hati happy anniversary sayang enggak berasa sudah  tahun nikah sama kamu insya allah tahun depan bertiga ya sayang anak ya bukan istrinya yang nambah sayang kamuuuu tulis zaskia di instagram pribadinya zaskiasungkar', 'santi sambung istri mark sungkar menepis selentingan kabar menyebut zaskia sungkar berbadan penuturannya zaskia hamil berusaha keras cepat momongan berusaha keras santi berbincang jawaposcom sambungan telepon orang tua santi mark sungkar mendoakan kia  sapaan akrab zaskia sungkar cepat momongan iya doain biar cepat momongan baca sambung angkat bicara kabar zaskia sungkar hamil mark sungkar santi menyebut keluarga sahabat sabar menantikan kehamilan zaskia sungkar mengirim doa kia keluarga usia pernikahan zaskia sungkar irwansyah mencapai  keluarga teman-teman sayang irwan kia berharap cepat momongan santi zaskia sungkar sejatinya program kehamilan terputus-putus irwansyah kadang lupa program kehamilan lantaran sibuk setumpuk pekerjaan zaskia sungkar fokus menjalani program kehamilan buah hati kadang-kadang program nih habis liburan lupa hilang zaskia sungkar vlog baim paula gue irwan ya santai pas sekarang-sekarang serius menjalani program kehamilan imbuh saudara kandung shireen sungkar zaskia sungkar hamil momen perayaan ulang pernikahannya ke- irwansyah mem-posting foto kebersamaan sang suami california zaskia sungkar berdoa keluarga kecilnya berwarna kehadiran buah hati happy anniversary sayang berasa  nikah insya allah bertiga ya sayang anak ya istrinya nambah sayang kamuuuu tulis zaskia instagram pribadinya zaskiasungkar', 'santi sambung istri mark sungkar tepis selenting kabar sebut zaskia sungkar badan tutur zaskia hamil usaha keras cepat momong usaha keras santi bincang jawaposcom sambung telepon orang tua santi mark sungkar doa kia  sapa akrab zaskia sungkar cepat momong iya doain biar cepat momong baca sambung angkat bicara kabar zaskia sungkar hamil mark sungkar santi sebut keluarga sahabat sabar nanti hamil zaskia sungkar kirim doa kia keluarga usia nikah zaskia sungkar irwansyah capai  keluarga teman sayang irwan kia harap cepat momong santi zaskia sungkar sejati program hamil putus irwansyah kadang lupa program hamil lantar sibuk tumpuk kerja zaskia sungkar fokus jalan program hamil buah hati kadang program nih habis libur lupa hilang zaskia sungkar vlog baim paula gue irwan ya santai pas sekarang serius jalan program hamil imbuh saudara kandung shireen sungkar zaskia sungkar hamil momen raya ulang nikah ke- irwansyah mem posting foto kebersamaan sang suami california zaskia sungkar doa keluarga kecil warna hadir buah hati happy anniversary sayang asa  nikah insya allah tiga ya sayang anak ya istri nambah sayang kamuuuu tulis zaskia instagram pribadi zaskiasungkar'),
(97, 1320, 'publik selama ini hanya menebak-nebak bagaimana sebetulnya komunikasi dan hubungan kate middleton dan meghan markle belakangan terungkap bahwa keduanya ternyata sudah tidak akur sejak lama dilansir dari the sun jumat  meghan dan kate disebut sudah tidak berbicara selama enam bulan keduanya bahkan juga sudah tidak tergabung dengan kelompok whatsapp keluarga kerajaan hal ini makin jelas setelah meghan tidak datang di ulang tahun kate yang ke- di istana kensington meghan dan harry juga tidak hadir pada akhir pekan ulang tahun kate di sandringham minggu lalu mundurnya meghan dan harry dari kerajaan pun membuat hubungan meghan dan kate semakin keruh apalagi meghan dan harry sudah lebih dulu berkonsultasi dengan pihak-pihak eksternal sebelum mereka mengajukan niatnya itu ke ratu salah satu sumber mengatakan bahwa meghan dan harry adalah sahabat dekat elton john mereka ternyata sudah curhat ke penyanyi top inggris tersebut ihwal keinginan untuk meninggalkan kehidupan kerajaan sebelum mereka memberi tahu ratu dan mengumumkannya ke publik sir elton selalu siap berbicara di telepon untuk harry dan meghan setiap hari memang meghan dan harry membuat keputusan sendiri tetapi elton john telah menjadi bahu untuk bersandar dan mendengarkan curhatan kata salah satu sumber seorang juru bicara untuk sir elton mengatakan bahwa sang rocketman mendukung harry dan meghan untuk mengendalikan sendiri hidup mereka elton sangat mendukung setiap keputusan yang dibuat pasangan itu tanpa pengaruh luar dan demi kebahagiaan masa depan dan kesejahteraan jelasnya tak hanya itu meghan rupanya juga meminta saran dari mantan ibu negara as hillary clinton yang mengunjunginya di frogmore cottage windsor pada bulan november lalu meghan barangkali merasa minder larena latar belakangnya meghan merasa beberapa anggota keluarga kerajaan memandang rendah dirinya karena latar belakangnya jelas sumber tersebut', 'publik menebak-nebak komunikasi hubungan kate middleton meghan markle terungkap akur dilansir the sun jumat  meghan kate berbicara enam tergabung kelompok whatsapp keluarga kerajaan meghan ulang kate ke- istana kensington meghan harry hadir pekan ulang kate sandringham minggu mundurnya meghan harry kerajaan hubungan meghan kate keruh meghan harry berkonsultasi pihak-pihak eksternal mengajukan niatnya ratu salah sumber meghan harry sahabat elton john curhat penyanyi top inggris ihwal meninggalkan kehidupan kerajaan ratu mengumumkannya publik sir elton berbicara telepon harry meghan meghan harry keputusan elton john bahu bersandar mendengarkan curhatan salah sumber juru bicara sir elton sang rocketman mendukung harry meghan mengendalikan hidup elton mendukung keputusan pasangan pengaruh kebahagiaan kesejahteraan meghan saran mantan negara as hillary clinton mengunjunginya frogmore cottage windsor november meghan barangkali minder larena latar belakangnya meghan anggota keluarga kerajaan memandang rendah latar belakangnya sumber', 'publik tebak nebak komunikasi hubung kate middleton meghan markle ungkap akur lansir the sun jumat  meghan kate bicara enam gabung kelompok whatsapp keluarga raja meghan ulang kate ke- istana kensington meghan harry hadir pekan ulang kate sandringham minggu mundur meghan harry raja hubung meghan kate keruh meghan harry konsultasi pihak eksternal ajuk niat ratu salah sumber meghan harry sahabat elton john curhat penyanyi top inggris ihwal tinggal hidup raja ratu umum publik sir elton bicara telepon harry meghan meghan harry putus elton john bahu sandar dengar curhatan salah sumber juru bicara sir elton sang rocketman dukung harry meghan kendali hidup elton dukung putus pasang pengaruh bahagia sejahtera meghan saran mantan negara as hillary clinton unjung frogmore cottage windsor november meghan barangkali minder larena latar belakang meghan anggota keluarga raja pandang rendah latar belakang sumber'),
(98, 1321, 'belum lama ini pasangan irwansyah dan zaskia sungkar merayakan ulang tahun pernikahan mereka yang ke- posting foto berdua di instagram pasangan yang menikah pada  januari  itu sempat membuat caption menarik tentang buah hati yang sudah dinanti-nantikan keduanya happy anniversary sayang nggak berasa sudah  tahun nikah sama kamu insyaallah tahun depan ber  ya sayang anak ya bukan istrinya yang nambah sayang kamuuuu tulis zaskia pada akun instagram zaskiasungkar rabu  postingan itu lantas dibanjiri doa netizen mereka mendoakan supaya zaskia sungkar cepat dianugerahi kehamilan dan mempunyai anak bersama irwansyah namun ada juga yang menduga hal itu sebagai isyarat zaskia kalau dirinya kini tengah hamil muda sehingga pada tahun depan sudah memiliki momongan santi istri dari mark sungkar yang merupakan ibu sambung akhirnya buka suara dia mengatakan bahwa zaskia sungkar belum hamil sampai saat ini postingan yang dibuat kia sapaan akrab zaskia di instagram bukan kode terkait kehamilan tapi lebih sebagai sebuah doa yang dipanjatkan zaskia sungkar tepat di momen perayaan ulang tahun pernikahannya yang ke- sampai sekarang sih belum lagi berusaha terus mohon doanya saja sekarang zaskia sama irwan lagi umrah kan postingan di instagram itu berdoa mas orang kan bisa setiap saat berdoa dan di ulang tahun ke- mudah-mudahan secepatnya punya anak beber santi kepada jawaposcom melalui sambungan telepon kamis  dia pun meminta para penggemar irwansyah dan zaskia sungkar serta masyarakat secara umum untuk ikut mendoakan suapa kia cepat memiliki momongan apalagi sejak beberapa waktu lalu zaskia sungkar diketahui sudah melakukan program kehamilan dia pun sempat bolak-balik ke rumah sakit dan brkonsultasi dengan dokter sebagai bagian dari program kehamilan yang dilakukannya bantu doanya saja ramai-ramai bantu doanya semuanya biar cepat diijabah ya pinta santi ibu sambung zaskia sungkar', 'pasangan irwansyah zaskia sungkar merayakan ulang pernikahan ke- posting foto berdua instagram pasangan menikah  januari  caption menarik buah hati dinanti-nantikan happy anniversary sayang nggak berasa  nikah insyaallah ber  ya sayang anak ya istrinya nambah sayang kamuuuu tulis zaskia akun instagram zaskiasungkar rabu  postingan lantas dibanjiri doa netizen mendoakan zaskia sungkar cepat dianugerahi kehamilan anak irwansyah menduga isyarat zaskia hamil muda memiliki momongan santi istri mark sungkar sambung buka suara zaskia sungkar hamil postingan kia sapaan akrab zaskia instagram kode terkait kehamilan doa dipanjatkan zaskia sungkar momen perayaan ulang pernikahannya ke- sih berusaha mohon doanya zaskia irwan umrah postingan instagram berdoa mas orang berdoa ulang ke- mudah-mudahan secepatnya anak beber santi jawaposcom sambungan telepon kamis  penggemar irwansyah zaskia sungkar serta masyarakat mendoakan suapa kia cepat memiliki momongan zaskia sungkar program kehamilan bolak-balik rumah sakit brkonsultasi dokter program kehamilan dilakukannya bantu doanya ramai-ramai bantu doanya biar cepat diijabah ya pinta santi sambung zaskia sungkar', 'pasang irwansyah zaskia sungkar raya ulang nikah ke- posting foto dua instagram pasang meni  januari  caption tarik buah hati nanti happy anniversary sayang nggak asa  nikah insyaallah ber  ya sayang anak ya istri nambah sayang kamuuuu tulis zaskia akun instagram zaskiasungkar rabu  postingan lantas banjir doa netizen doa zaskia sungkar cepat anugerah hamil anak irwansyah duga isyarat zaskia hamil muda milik momong santi istri mark sungkar sambung buka suara zaskia sungkar hamil postingan kia sapa akrab zaskia instagram kode kait hamil doa panjat zaskia sungkar momen raya ulang nikah ke- sih usaha mohon doa zaskia irwan umrah postingan instagram doa mas orang doa ulang ke- mudah cepat anak beber santi jawaposcom sambung telepon kamis  gemar irwansyah zaskia sungkar serta masyarakat doa suapa kia cepat milik momong zaskia sungkar program hamil bolak-balik rumah sakit brkonsultasi dokter program hamil laku bantu doa ramai bantu doa biar cepat diijabah ya pinta santi sambung zaskia sungkar'),
(99, 1322, 'sejumlah artis tanah air sukses menurunkan berat badan mereka secara drastis hingga lebih dari  kg mereka melakukan hal tersebut lantaran khawatir akan kondisi kesehatan dengan bobot tubuh yang besar selain alasan kesehatan tentunya mereka juga menurunkan bobot demi tampil lebih sempurna ketika berada di depan kamera berikut  artis yang sukses turunkan berat badan lebih dari  kg  ricky cuaca aktor sekaligus pembawa acara ricky cuaca sukses menurunkan berat badannya cukup drastis hingga  kg dia berhasil menurunkan berat badan yang semula  kg menjadi  kg dengan menjalani olahraga fitnes secara teratur dan juga olahraga plank sekedar penggambaran plank adalah olahraga mirip push up namun berbeda dengan push up plank tumpuan tubuh terletak pada siku tangan dan kaki gara-gara berusaha cukup keras untuk menurunkan berat badan ricky cuaca sempat terjatuh sakit kondisinya drop dan sempat  hari mengalami demam tinggi selain berolahraga ricky cuaca menurunkan berat badan juga dengan makan makanan berat satu kali sehari dia mengupayakan tidak mengkonsumsi makanan yang mengandung gula dan karbohidrat  dewi hughes presenter dewi hughes sukses menurunkan berat badan hingga  kg dalam waktu  bulan diet yang dilakukannya disebut diet kenyang diet kenyang ala dewi hughes adalah dia bisa makan dalam porsi banyak tapi tidak dengan menu nasi putih porsi yang diberbanyak dikonsumsinya adalah sayuran umbi-umbian dan buah-buahan dewi hughes juga tidak mengkonsumsi makanan yang digoreng atau dihangatkan kembali ia memperbanyak minum air putih dan air kelapa untuk detoksifikasi tubuh dengan penampilan barunya yang terlihat kurus dewi hughes tampak lebih cantik lebih rapi dan tentu lebih mudah dalam memilih pakaian di balik kunci suksesnya melakukan diet pikiran disebut dewi hughes juga memiliki peran yang sangat penting kesalahan banyak perempuan yang melakukan diet kata hughes karena ingin kurus padahal menurut perempuan berhijab itu seharusnya fokus utamanya adalah ingin sehat 