(100, 1323, 'musisi ahmad dhani ikut angkat bicara ihwal mulan jameela yang dikait-kaitkan dengan investasi bodong pt kam and kam berbasis aplikasi memiles sempat beredar kabar bahwa mulan akan dipanggil penyidik polda jawa timur untuk diminta keterangannya tentang kasus itu ahmad dhani yang ditemui usai jumpa pers tour konser dewa  di fx sudirman mengatakan bahwa kabar pemanggilan mulan terlalu mengada-ngada menurut dhani istrinya tidak ada kaitan sama sekali dengan investasi bodong tersebut karena perannya hanya sebagai pengisi acara mbak mulan kan cuma nyanyi mulan sama sekali tidak ikut investasinya dia cuma nyanyi dan dibayar profesional kata ahmad dhani di hadapan awak media dhani menduga nama mulan jameela jadi dikait-kaitkan dengan kasus ini karena merupakan publik figur dan mudah menjadi sorotan media mungkin mbak mulan lebih menarik buat media sehingga yang dibicarakan nama mbak mulan ucap ahmad dhani sementara itu ali lubis selaku pengacara mulan jameela juga menegaskan bahwa peran kliennya hanya sebagai penyanyi sebagai seorang penyanyi mulan pun dibayar secara profesional ketika tampil pada waktu itu dibayarnya profesional itu bukan top up atau ikut investasi sama sekali bukan kalau nominal bayarannya rahasia lah kata ali lubis', 'musisi ahmad dhani angkat bicara ihwal mulan jameela dikait-kaitkan investasi bodong pt kam and kam berbasis aplikasi memiles beredar kabar mulan dipanggil penyidik polda jawa timur keterangannya ahmad dhani ditemui jumpa pers tour konser dewa  fx sudirman kabar pemanggilan mulan mengada-ngada dhani istrinya kaitan investasi bodong perannya pengisi acara mbak mulan nyanyi mulan investasinya nyanyi dibayar profesional ahmad dhani hadapan awak media dhani menduga nama mulan jameela dikait-kaitkan publik figur mudah sorotan media mbak mulan menarik media dibicarakan nama mbak mulan ahmad dhani ali lubis pengacara mulan jameela peran kliennya penyanyi penyanyi mulan dibayar profesional tampil dibayarnya profesional top up investas