(101, 1324, 'komedian entis sutisna alias sule bakal melepas masa duda pada tahun ini pernikahannya dengan sang kekasih dijadwalkan pada april  pengacara sule dose hudaya mengatakan bahwa pernikahan ayah dari rizky febian dan putri delina itu awalnya akan digelar pada februari  namun saat ini anak-anak dia masih dalam suasana berkabung usai meninggalnya lina mantan istri sule alhasil sule terpaksa menunda pernikahannya pada april  mendatang rencana awalnya nikahnya di tanggal  februari tapi diundur di bulan april ucap dose hudaya saat dihubungi melalui sambungan telepon rabu  untuk calon istri sule dose menyebut bukan berasal dari kalangan artis dia mengatakan hubungan sule dengan calon istrinya itu tidak terlalu lama meski begitu keduanya sudah memiliki kesamaan pandangan dalam melihat masa depan pernikahan sule rencananya akan digelar di jakarta namun sampai saat ini proses administrasi di kantor urusan agama kua belum dimasukkan padahal berkas-berkasnya sudah siap kalau surat-suratnya sudah dipersiapkan ucapnya sebelumnya sule memang sempat mengungkapkan bahwa dirinya ingin menikah di tahun ini dengan perempuan pilihan hatinya sule pun sudah sempat meminta izin untuk menikah lagi kepada anak-anaknya termasuk rizky febian bukan target ya tapi pernikahan akan terjadi di tahun  perempuan biasa kan yang sudah sama di bidang seni tutur sule seperti diketahui sule sempat menikah dengan mendiang lina jubaedah namun rumah tangga mereka berujung pada perceraian setelah  tahun membangun bahtera rumah tangga mereka resmi cerai pada  september  dengan adanya ketok palu dari pengadilan agama cimahi bandung jawa barat dari hasil pernikahan sule dengan mendiang lina mereka dikaruniai empat orang anak masing-masing bernama rizky febian adriansyach putri delina andriyani rizwan adriansyach dan ferdinan ardiansyach', 'komedian entis sutisna alias sule melepas duda pernikahannya sang kekasih dijadwalkan april  pengacara sule dose hudaya pernikahan ayah rizky febian putri delina digelar februari  anak-anak suasana berkabung meninggalnya lina mantan istri sule alhasil sule terpaksa menunda pernikahannya april  rencana nikahnya tanggal  februari diundur april dose hudaya dihubungi sambungan telepon rabu  calon istri sule dose menyebut berasal kalangan artis hubungan sule calon istrinya memiliki kesamaan pandangan pernikahan sule rencananya digelar jakarta proses administrasi kantor urusan agama kua dimasukkan berkas-berkasnya surat-suratnya dipersiapkan sule menikah perempuan pilihan hatinya sule izin menikah anak-anaknya rizky febian target ya pernikahan  perempuan bidang seni sule sule menikah mendiang lina jubaedah rumah tangga berujung perceraian  membangun bahtera rumah tangga resmi cerai  september  ketok palu pengadilan agama cimahi bandung jawa barat hasil pernikahan sule mendiang lina dikaruniai orang anak bernama rizky febian adriansyach putri delina andriyani rizwan adriansyach ferdinan ardiansyach', 'komedian entis sutisna alias sule lepas duda nikah sang kasih jadwal april  acara sule dose hudaya nikah ayah rizky febian putri delina gelar februari  anak suasana kabung tinggal lina mantan istri sule alhasil sule paksa tunda nikah april  rencana nikah tanggal  februari undur april dose hudaya hubung sambung telepon rabu  calon istri sule dose sebut asal kalang artis hubung sule calon istri milik sama pandang nikah sule rencana gelar jakarta proses administrasi kantor urus agama kua masuk berkas surat siap sule meni perempuan pilih hati sule izin meni anak rizky febian target ya nikah  perempuan bidang seni sule sule meni mendiang lina jubaedah rumah tangga ujung cerai  bangun bahtera rumah tangga resmi cerai  september  ketok palu adil agama cimahi bandung jawa barat hasil nikah sule mendiang lina karunia orang anak nama rizky febian adriansyach putri delina andriyani rizwan adriansyach ferdinan ardiansyach'),
(102, 1325, 'kurang lebih sudah sekitar  hari lina jubaedah ibu dari rizky febian dan putri delina meninggal meski sebelumnya cukup sedih ditinggal sang ibunda selama-lamanya kini kesedihan itu perlahan mulai berkurang ikky dan putri kini jadi lebih tegar hal itu diungkapkan ariani adik bungsu mendiang lina dari komunikasi yang terbangun cukup intens antara dirinya dengan ikky dan putri ariani merasakan kesedihan mereka sudah mulai berkurang alhamdulillah sudah enggak terlalu sedih iya kita sering komunikasi kan keponakan ucap ariani kepada jawaposcom melalui sambungan telepon rabu  dia pun berusaha menyemangati ikky dan putri supaya tidak terlalu larut dalam kesedihan karena kesedihan kini tidak akan terlalu banyak menolong sebaliknya kesedihan malah bisa membuat keadaan semakin memburuk ikky dan putri harus tegar jangan terlalu sedih berlebihan ucapnya lebih lanjut ketika disinggung soal proses hukum yang sedang bergulir di polrestabes bandung jawa barat terkait meninggalnya mendiang lina ariani mengaku tidak mengikutinya dia pun menyerahkan permasalahan ini kepada rizky febian selaku pihak pelapor kalau itu perkembangan kasus kurang tahu ikky sama putri enggak cerita-cerita sama keluarga ucap ariani meski dirinya tidak terlalu mengikuti proses hukum yang sedang berjalan dia penasaran ingin segera mengetahui penyebab pasti meninggalnya sang kakak dia pun berharap polisi bisa segera mengungkapkannya supaya rasa penasarannya itu bisa segera terobati kabid humas polda jawa barat kombes pol saptono erlangga sebelumnya menyatakan hasil otopsi lina kemungkinan baru akan keluar setelah dua minggu tim forensik butuh waktu yang cukup lama untuk menganalisis penyebab meninggalnya lina kemungkinan hasil otopsi lina akan keluar pada  januari  mendatang hasil otopsi kurang lebih dua minggu nanti diinfokan mas perkiraan dari tim forensik hasilnya kurang lebih dua minggu ada riksa lab dan analisis tim forensik tutur kombes pol saptono erlangga kepada wartawan beberapa waktu lalu seperti diketahui lina jubaedah mantan istri komedian sule yang juga ibunda penyanyi rizky febian meninggal pada sabtu  lalu saat dalam perjalanan menuju rumah sakit al islam bandung jawa barat proses kematiannya dinilai janggal hal itu yang membuat rizky febian melaporkannya polrestabes bandung jawa barat pada senin  januari ', ' lina jubaedah rizky febian putri delina meninggal sedih ditinggal sang ibunda kesedihan perlahan berkurang ikky putri tegar ariani adik bungsu mendiang lina komunikasi terbangun intens ikky putri ariani merasakan kesedihan berkurang alhamdulillah sedih iya komunikasi keponakan ariani jawaposcom sambungan telepon rabu  berusaha menyemangati ikky putri larut kesedihan kesedihan menolong kesedihan memburuk ikky putri tegar sedih disinggung proses hukum bergulir polrestabes bandung jawa barat terkait meninggalnya mendiang lina ariani mengaku mengikutinya menyerahkan permasalahan rizky febian pelapor perkembangan ikky putri cerita-cerita keluarga ariani mengikuti proses hukum berjalan penasaran penyebab meninggalnya sang kakak berharap polisi mengungkapkannya penasarannya terobati kabid humas polda jawa barat kombes pol saptono erlangga hasil otopsi lina minggu tim forensik butuh menganalisis penyebab meninggalnya lina hasil otopsi lina  januari  hasil otopsi minggu diinfokan mas perkiraan tim forensik hasilnya minggu riksa lab analisis tim forensik kombes pol saptono erlangga wartawan lina jubaedah mantan istri komedian sule ibunda penyanyi rizky febian meninggal sabtu  perjalanan rumah sakit al islam bandung jawa barat proses kematiannya dinilai janggal rizky febian melaporkannya polrestabes bandung jawa barat senin  januari ', ' lina jubaedah rizky febian putri delina tinggal sedih tinggal sang ibunda sedih perlahan kurang ikky putri tegar ariani adik bungsu mendiang lina komunikasi bangun intens ikky putri ariani rasa sedih kurang alhamdulillah sedih iya komunikasi keponakan ariani jawaposcom sambung telepon rabu  usaha semangat ikky putri larut sedih sedih tolong sedih buruk ikky putri tegar sedih singgung proses hukum gulir polrestabes bandung jawa barat kait tinggal mendiang lina ariani mengaku ikut serah masalah rizky febian lapor kembang ikky putri cerita keluarga ariani ikut proses hukum jalan penasaran sebab tinggal sang kakak harap polisi ungkap penasaran obat kabid humas polda jawa barat kombes pol saptono erlangga hasil otopsi lina minggu tim forensik butuh analisis sebab tinggal lina hasil otopsi lina  januari  hasil otopsi minggu info mas kira tim forensik hasil minggu riksa lab analisis tim forensik kombes pol saptono erlangga wartawan lina jubaedah mantan istri komedian sule ibunda penyanyi rizky febian tinggal sabtu  jalan rumah sakit al islam bandung jawa barat proses mati nilai janggal rizky febian lapor polrestabes bandung jawa barat senin  januari ');
INSERT INTO `sa_berita` (`id_berita`, `judul_berita`, `kategori_berita`, `jenis_data`, `isi_berita`) VALUES
(1223, 'Jatuhkan Cerrone, Conor McGregor Hanya Butuh 40 Detik!', 'OLAHRAGA', 'DATA LATIH', 'Petarung berkewarganegaraan Irlandia Conor McGregor membuktikan dirinya tak hanya bermulut besar. Ini setelah McGregor mencatat kemenangan sensasional atas lawannya di arena UFC (Ultimate Fighting Championship), T-Mobile Arena, Las Vegas, Sabtu malam waktu setempat (18/1).\r\n\r\nSejak awal, McGregor tampil menekan dan nyaris tidak memberi kesempatan kepada lawannya, Donald ‘Cowboy’ Cerrone untuk berkembang. Beberapa kali tendangan lutut McGregor telak mengenai kepala Cerrone.\r\n\r\nSetelah melihat lawannya mulai tak berdaya, McGregor pun melancarkan pukulan bertubi-tubi. Hingga membuat lawannya terdesak.\r\n\r\nMelihat Cerrone jadi ‘sansak hidup’, wasit Herb Dean pun memutuskan menghentikan pertarungan. Meski pertarungan itu baru berjalan 40 detik. McGregor pun akhirnya dinyatakan menang TKO (technical knockout).\r\n\r\nSetelah memastikan kemenangan atas Cerrone, seperti biasa, McGregor pun kembali dengan mulut besarnya. “Aku membuat sejarah malam ini. Aku membuat rekor baru. Aku petarung pertama dalam sejarah UFC yang meraih kemenangan KO di kelas bulu, di kelas ringan dan sekarang di kelas welter – di tiga divisi berat, jadi aku sangat bangga akan hal itu,” kata McGregor,” ujarnya, seperti dilansir BBC.'),
(1225, 'Meski Baru Beberapa Hari, Pelatih Baru Arema Sudah Jatuh Hati dengan Ademnya Malang', 'OLAHRAGA', 'DATA LATIH', 'Roberto Carlos Mario Gomez baru tiga hari ini tinggal di Kota Malang. Meski begitu, pelatih baru Arema FC sudah langsung jatuh hati dengan suasana Kota Malang.\r\n\r\n“Saya senang dengan kondisi kota ini,” ujar Gomez, belum lama ini.\r\n\r\nCuaca yang tidak panas, tapi juga tidak terlalu dingin dinilai memberi efek yang bagus bagi para pemain. Apalagi bila Arema FC berlatih di lapangan yang representatif, dengan kondisi rumput yang bagus.\r\n\r\n“Saya hanya ingin lapangan yang mendukung. Karena kondisi lapangan itu penting bagi saya,” kata pelatih berkewarganegaraan Argentina ini.\r\n\r\nSelama tiga hari, antara Kamis (16/1) sampai Sabtu (18/1) Arema FC menggelar latihan di Stadion Gajayana. Tapi mulai hari ini, hingga beberapa hari ke depan, Arema FC berlatih di Lapangan Kusuma Agrowisata Kota Batu.\r\n\r\n“Coach Gomez suka di daerah pegunungan seperti Batu, Malang,” tukas General Manajer Arema FC, Ruddy Widodo.\r\n\r\nBagi Gomez, Kota Batu juga bukan tempat yang asing. Musim lalu, saat masih menjadi pelatih Borneo FC, Gomez juga menggelar Training Center (TC) selama seminggu di Kota Batu.'),
(1226, 'Abduh dan Angga Teken Kontrak di Persebaya, Segera Bicara ke Persikabo', 'OLAHRAGA', 'DATA LATIH', 'Abduh Lestaluhu dan Angga Saputra seharusnya sudah berkostum Persebaya Surabaya. Sebab, versi tim berjuluk Green Force tersebut, keduanya sudah membukukan tanda tangan kontrak dengan Persebaya. Bahkan, Abduh dan Angga sudah menerima sebagian uang muka. Namun, ketika sudah tanda tangan kontrak dengan Persebaya, keduanya malah bergabung dengan Persikabo. Abduh juga sudah berlatih bersama tim asal Kota Hujan tersebut.\r\n\r\nInformasi bahwa Abduh dan Angga sudah tanda tangan kontrak dengan Persebaya diungkapkan Aji Santoso kepada Jawa Pos kemarin pagi (18/1). Di sela-sela latihan di Stadion Universitas Negeri Yogyakarta (UNY), pelatih Persebaya itu menyebut tanda tangan kontrak terjadi beberapa waktu lalu. Yakni, saat ikatan keduanya dengan PS Tira Persikabo –nama Persikabo sebelumnya– sudah berakhir.\r\nPersebaya Surabaya\r\n\r\n”Karena keduanya sudah tanda tangan kontrak dengan kami, urusan ini saya serahkan ke manajemen Persebaya,” kata Aji. Dia meminta manajemen Persebaya melakukan pembicaraan dengan manajemen Persikabo. ”Saya tentu berharap hal yang terbaik untuk kami,” ujarnya.\r\n\r\nMantan pelatih tim nasional tersebut berharap Abduh dan Angga bisa bergabung dengan Persebaya. Sebab, keduanya sudah disiapkan sebagai bagian dari tim utama Persebaya musim 2020. Abduh mengisi bek kiri yang ditinggalkan Ruben Sanadi. Di posisi itu, Persebaya baru memiliki Nasir.\r\n\r\nSementara itu, Angga diharapkan bisa mengisi posisi di bawah mistar setelah kepergian Miswar Saputra. Satu kiper lain rencananya diisi Rivky Mokodompit. Persebaya pun kini masih menunggu kedatangan Rivky untuk bergabung dalam pemusatan latihan di Jogjakarta.\r\n\r\nKarena masih kosong, selama beberapa hari jalannya pemusatan latihan, posisi kiper untuk sementara memakai dua penjaga gawang yang dipinjam dari Persebaya U-20. Ababil Syahbela Bram Susanto Putra dan Andika Ramadani.\r\n\r\n”Soal Angga dan Abduh kami akan segera berbicara dengan manajemen Persikabo. Sebab, Angga dan Abduh memang sudah tanda tangan kontrak dengan kami. Mereka juga sudah menerima sebagian DP,” kata Sekretaris Persebaya Surahman.\r\n\r\nPersebaya tentu akan mencari solusi terbaik dalam pembicaraan dengan manajemen Persikabo. ”Agar semua pihak tidak sama-sama dirugikan. Termasuk mencari solusi terbaik soal karir Angga dan Abduh sebagai pemain bola sekaligus prajurit,” ujar pria yang akrab disapa Ram tersebut.\r\n\r\nSementara itu, kemarin sore salah seorang pemain muda Persebaya M. Supriadi telah bergabung dengan skuad Green Force di Jogjakarta. Supriadi bergabung ke Persebaya setelah pulang dari seleksi timnas U-19. Dia pulang lantaran cedera engkel. ”Supriadi memang sudah memberi tahu kami. Kalau soal Rivky (Mokodompit) nanti saja. Dibicarakan yang ada saja dulu,” ucap Ram saat dikonfirmasi tentang Supriadi dan rencana bergabungnya Rivky.'),
(1227, 'All Indonesian Final Jilid 6, Bisakah Hendra/Ahsan Bangkit?', 'OLAHRAGA', 'DATA UJI', 'Pertemuan klasik terjadi di sektor ganda putra. Pasangan nomor satu dunia Marcus Fernaldi Gideon/Kevin Sanjaya Sukamuljo kembali bersua ganda nomor dua dunia Hendra Setiawan/Mohammad Ahsan.\r\n\r\nKeduanya berhasil menjaga tradisi all Indonesian final. Ini sudah kali keenam mereka menyegel gelar bagi Indonesia bahkan sebelum pertandingan berlangsung.\r\n\r\nTahun lalu ada lima partai puncak yang memperseterukan pasangan senior dan junior itu. Dua di antaranya terjadi di istora. Semuanya dimenangi Marcus/Kevin. Hendra/Ahsan selalu mengaku sulit mengimbangi kecepatan sang lawan yang berjuluk Minions itu.\r\n\r\nBisa jadi hasil yang sama akan terulang. Bisa juga, Hendra/Ahsan yang bangkit dan menang.\r\nMarcus Fernaldi Gideon/Kevin Sanjaya Sukamuljo akan berusaha mempertahankan gelar juara di Istora Senayan, Jakarta hari ini (19/1). (Nafielah Mahmudah/PP PBSI)\r\n\r\n’’Nggak ada persiapan khusus. Penting fokus pada permainan sendiri dan persiapan yang terbaik saja,’’ ucap Marcus soal kans hari ini. ’’Mereka punya banyak kelebihan. Salah satunya pengalaman. Kami sudah hafal satu sama lain. Kami harus fokus dan tak boleh lengah,’’ timpal Kevin.\r\n\r\nMinions saat ini memantapkan pola baru. Mereka memperbaiki rotasi. Memang belum mulus. Kadang-kadang mereka kehilangan fokus dan menjadi gampang ditekan lawan.\r\n\r\nItu bisa dilihat dari laga babak pertama melawan Marcus Ellis/Chris Langridge asal Inggris serta perempat final melawan Goh Sze Fei/Nur Izzuddin asal Malaysia.\r\n\r\nTadi malam hampir terjadi lagi di game kedua. Dalam kondisi tidak diuntungkan angin, Minions merasakan tekanan lawan semakin besar. Mereka tertinggal 7-11 saat interval.\r\n\r\n’’Kami belum dapat feeling-nya di awal game kedua. Pertengahan game baru dapat,’’ jelas Marcus. Melawan Hendr/Ahsan yang begitu cermat memanfaatkan angin, itu tak boleh terjadi lagi.\r\n\r\nThe Daddies (julukan Hendra/Ahsan), di sisi lain, mengaku belum menemukan taktik untuk mengalahkan Minions. Mereka hanya berencana istirahat dan menjaga kondisi.\r\n\r\nMarcus/Kevin (Indonesia) vs Ahsan/Hendra (Indonesia)\r\n\r\n1 Peringkat 2\r\n\r\n28/24 Usia 32/35\r\n\r\n168 cm/170 cm Tinggi 173 cm/183 cm\r\n\r\n10 H2H 2\r\n\r\nPertemuan Terakhir: 20/10/19 (Denmark Open) Marcus/Kevin menang 21-14, 21-13'),
(1228, 'Lawan Greys/Apri, Ganda No 1 Denmark: Penonton Tak Bikin Kami Takut', 'OLAHRAGA', 'DATA UJI', 'Butuh waktu sepuluh bulan bagi Greysia Polii/Apriyani Rahayu untuk bisa menembus babak final turnamen BWF Tour. Kali terakhir, hal itu terjadi di India Open 2019.\r\n\r\nGreysia/Apriyani tahun lalu berhasil mencapai dua final. Sebelumnya, mereka mencapai partai puncak Malaysia Masters 2019. Namun, hanya di India itulah, pasangan nomor delapan dunia tersebut bablas menjadi juara.\r\n\r\nSetelah itu, fenomena hebat tersebut tak pernah terjadi lagi.\r\n\r\nKemarin mereka memastikan tiket final setelah mengalahkan pasangan Korea Selatan yang sedang naik daun, Kim So-yeong/Kong Hee-yong dalam straight games 21-19, 21-15. Itu adalah kemenangan perdana mereka atas pasangan nomor empat dunia tersebut.\r\n\r\nHari ini lawan mereka agak berbeda. Bukan pasangan Jepang maupun Korsel yang lain. Melainkan pasangan kejutan, yakni Maiken Fruergaard/Sara Thygesen asal Denmark.\r\n\r\nLolosnya Fruergaard/Thygesen ke final sungguh tak disangka. Dalam perjalanannya, ganda putri nomor 1 Denmark yang menempati peringkat ke-30 dunia tersebut, sangat impresif. Mereka menghajar pasangan nomor tiga dunia Yuki Fukushima/Sayaka Hirota di babak 16 besar.\r\n\r\nLalu, kemarin (18/1), giliran unggulan keempat yang juga peraih emas Olimpiade Rio 2016 Misaki Matsutomo/Ayaka Takahashi yang dipulangkan. Itu menjadi sinyal bahwa mereka sangat berbahaya.\r\nSara Thygesen (kiri) dan Maiken Fruergaard mengaku tidak takut kepada tekanan penonton Istora Senayan, Jakarta, di final hari ini (19/1). (BWF Badminton)\r\n\r\n”Kami rasa, tekanan ada di pihak tuan rumah, sedangkan kami tidak punya tekanan apa pun,” ujar Fruergaard dalam konferensi pers setelah pertandingan.\r\n\r\nDia melanjutkan, gemuruh Istora yang mengerikan tidak membuat dirinya dan Thygesen takut. Itu malah bisa jadi beban buat Greysia/Apriyani. ”Penonton mengharapkan pemain Indonesia yang menang. Kami akan main tanpa beban saja dan berusaha sebaik-baiknya,” kata Fruergaard.\r\n\r\nSudah lima kali Greysia/Apriyani bertemu dengan Fruergaard/Thygesen. Selama itu pula kemenangan selalu berpihak kepada Indonesia. Melihat tren permainan Greysia/Apriyani kemarin, kans juara jelas ada.\r\n\r\nApri tampil hebat dengan smes-smesnya yang keras. Tak hanya powerful, pemain 21 tahun itu juga cerdik dalam penempatan bola. Dia juga mampu melakukan cover lapangan yang sangat baik, mengejar bola dengan vitalitas sangat tinggi.\r\n\r\nJuga, yang paling penting, clean. Minim error. Di sisi lain, Greysia perlu memperbaiki servisnya yang sering tanggung.\r\n\r\n”Jaga kondisi sih yang paling penting. Recovery. Karena ini posisi sudah 0-0 lagi. Hasil yang tadi harus dilupakan, harus pikirkan pertandingan selanjutnya,” tegas Apri setelah pertandingan.\r\n\r\n”Kami belum puas dengan hasil ini. Masih ada satu pertandingan lagi (final, Red) dan harus dimenangi,” imbuh Greysia.'),
(1229, 'Yasonna Disorot, Kalangan Pakar Bingung Kenapa PDIP Ngotot Bela Diri', 'POLITIK', 'DATA LATIH', 'Keterlibatan Yasonna H Laolly dalam kasus Pergantian Antar-waktu caleg PDIP, menuai banyak sorotan. Salah satunya dari kalangan pakar.\r\n\r\nPengamat politik dari Political and Public Policy Jerry Massie meminta agar Yasonna H Laoly lebih fokus sebagai Menteri Hukum dan Hak Asasi Manusia (Menkumham) daripada terlibat dalam pembentukan tim hukum PDIP. Itu terkait kasus suap komisioner Komisi Pemilihan Umum Wahyu Setiawan dan kaburnya Harun Masiku.\r\n\r\n“Harusnya Yasonna lebih fokus ke tupoksinya sebagai Menkumham,” kata Jerry, di Jakarta, Minggu.\r\n\r\nMenurut dia, keterlibatan Yasonna dalam pembelaan PDIP yang membentuk tim hukum secara etika politik kurang elegan. “Di PDIP banyak kan para advokat, lawyer, kan bisa memberikan mereka kesempatan,” ujar Jerry.\r\n\r\nJerry melihat, PDIP saat ini tengah memainkan politik bela diri saat kadernya Harun Masiku terlibat dalam kasus dugaan suap Komisioner KPU, Wahyu Setiawan yang terkena OTT oleh KPK beberapa waktu lalu.\r\n\r\nJerry pun mengakui bahwa jika memiliki tugas ganda memang agak berat antara negara dan kepentingan partai. Di PDIP, Yasonna menjabat sebagai Ketua DPP PDIP bidang Bidang Hukum dan Perundang-undangan.\r\n\r\n“Saran saya Pak Yasonna lebih fokus ke masalah hukum seperti kasus seorang pelajar yang membela pacarnya dari begal justru terancam hukuman seumur hidup, dan memperbaiki lapas-lapas yang bermasalah,” tuturnya.\r\n\r\nMeskipun, menurutnya, belum ada UU yang melarang tugas Menkumham untuk melakukan dukungan terhadap kepentingan partai, terlebih Yasonna menjabat ketua DPP PDIP. Karena kan ada wakilnya yang bisa menggantikan posisinya.\r\n\r\n“Pertanyaan saya kenapa mereka ngotot membentuk tim untuk membela partai habis-habisan. Semua akan terjawab dalam persidangan Tipikor,” ujarnya.\r\n\r\nSementara itu, Peneliti dan pengamat politik Centre for Strategic and International Studies (CSIS) Arya Fernandes menilai para menteri yang telah terpilih dalam kabinet pemerintahan sebaiknya melepas jabatan yang melekat di partai untuk menghindari terjadinya konflik kepentingan di kemudian hari.\r\n\r\n“Menurut saya sebaiknya secara etik para menteri yang berasal dari partai politik memang sebaiknya harus memilih, jika fokus menjadi menteri, tentu dengan melepaskan jabatan di partai politiknya,” ujar Arya saat dihubungi Antara, Minggu.\r\n\r\nArya juga mengatakan, sikap itu juga akan menimbulkan persepsi publik yang negatif terkait profesionalitas kabinet.\r\n\r\nPada akhirnya, sikap para menteri yang seperti ini juga akan merugikan Presiden Joko Widodo. Arya pun berharap Presiden memiliki peraturan untuk menterinya agar bisa profesional menjalankan tugas pemerintahan.\r\n\r\n“Sebaiknya Presiden punya kebijakan khusus untuk meminta menteri-menteri tersebut bekerja profesional sebagai pejabat publik. Ini untuk menghindari konflik kepentingan seperti ini,” ujar Arya.\r\n\r\nSebelumnya, Menteri Hukum dan HAM Yasonna Laoly memperoleh kritikan dari sejumlah pihak setelah hadir dalam konferensi pers PDI Perjuangan menindaklanjuti OTT KPK terkait kasus dugaan suap PAW anggota DPR.\r\n\r\nNamun, Yasonna mengklarifikasi hal tersebut dengan menyebut bahwa kapasitasnya pada acara itu bukan sebagai Menkumham, melainkan sebagai Ketua DPP PDIP Bidang Hukum dan Perundang-Undangan untuk mengumumkan pembentukan tim hukum terkait kasus dugaan suap yang menjerat Komisioner KPU Wahyu Setiawan dan politikus PDIP Harun Masiku.\r\n\r\n“Saya tidak ikut di tim hukum. Saya ketua DPP-nya membentuk tim hukum. Waktu kita bentuk saya umumkan, itulah tugas saya. Tim hukum koordinatornya Pak Teguh Samudra,” kata dia di Yogyakarta, Jumat (17/1).\r\n\r\nHal ini terkait Menteri Hukum dan HAM Yasonna Laoly yang memperoleh kritikan dari sejumlah pihak setelah hadir dalam konferensi pers PDI Perjuangan menindaklanjuti OTT KPK terkait kasus dugaan suap PAW anggota DPR.\r\n\r\nNamun, belakangan Yasonna mengklarifikasi hal tersebut dengan menyebut bahwa kapasitasnya pada acara itu bukan sebagai Menkumham, melainkan sebagai Ketua DPP PDIP Bidang Hukum dan Perundang-Undangan untuk mengumumkan pembentukan tim hukum terkait kasus dugaan suap yang menjerat Komisioner KPU Wahyu Setiawan dan politikus PDIP Harun Masiku.\r\n\r\n“Saya tidak ikut di tim hukum. Saya ketua DPP-nya membentuk tim hukum. Waktu kita bentuk saya umumkan, itulah tugas saya. Tim hukum koordinatornya Pak Teguh Samudra,” kata dia di Yogyakarta, Jumat (17/1).'),
(1230, 'Tolak Omnibus Law, Buruh Siap Demo', 'POLITIK', 'DATA LATIH', 'Tiga puluh ribu buruh bakal serbu gedung Dewan Perwakilan Rakyat (DPR), Senayan, Jakarta, besok (20/1). Massa buruh menuntut draf rancangan undang-undang (RUU) cipta lapangan kerja melalui mekanisme omnibus law didrop.\r\n\r\nBuruh menilai, omnibus law klaster ketenagakerjaan tidak proburuh. Dimulai dari pembahasan yang tidak melibatkan unsur buruh hingga poin-poin yang dirasa bakal mereduksi pekerja dalam negeri.\r\n\r\nSekretaris Jenderal Federasi Serikat Pekerja Metal Indonesia (FSPMI) Riden Hatam Aziz menuturkan dua hal paling krusial dalam poin omnibus law cipta lapangan kerja. Yakni, soal hubungan kerja dan upah minimum.\r\n\r\nSoal hubungan kerja, fleksibilitas yang digaungkan pemerintah sejatinya menyesatkan. Status hubungan kerja yang dipermudah malah bisa memunculkan ketidakjelasan status pekerja.\r\n\r\n”Kontrak saja kami menolak karena tidak ada kepastian kerja. Apalagi sekarang fleksibel, pasti lebih tidak jelas,” ujarnya dalam acara pernyataan bersama serikat buruh yang tergabung dalam Konfederasi Serikat Pekerja Indonesia (KSPI) di Jakarta kemarin (18/1).\r\n\r\nMenyoal tentang upah minimum, buruh memiliki pandangan sama. Skema upah per jam yang dilemparkan oleh Menteri Ketenagakerjaan (Menaker) Ida Fauziyah justru menjerumuskan. Sebab, dengan hitungan gaji per jam, skema jaminan sosial jadi tidak jelas. Pasalnya, selama ini jaminan sosial dihitung berdasar gaji per bulan.'),
(1231, 'Yasonna Dinilai Tidak Profesional Sebagai Menkumham', 'POLITIK', 'DATA LATIH', 'Menteri Hukum dan HAM (Menkumham) Yasonna Hamonangan Laoly dinilai tidak profesional sebagai jajaran Menteri Kabinet Indonesia Maju. Bahkan, Yasonna dipandang harus diberikan sanksi terkait keterlibatannya dalam tim hukum PDI Perjuangan.\r\n\r\n“Fenomena ini menunjukkan kegagalan dari pemerintah sekarang yang tidak bisa membedakan antara kepentingan kelompok (partai politik) dengan kepentingan negara. Selain itu, ini juga menunjukan betapa tidak profesional dan kompetennya para pejabat negara yang dipilih oleh Jokowi,” kata aktivis antikorupsi, Erwin Natosmal Oemar kepada JawaPos.com, Sabtu (17/1).\r\n\r\nBahkan Erwin menilai, sistem presidensial dianggap belum berhasil. Karena Jokowi masih berada di bawah bayang-bayang partai politik. “Dari sudut ketatanegaraan, hal ini menunjukan bahwa sistem presidensial tidak berhasil. Posisi presiden di era Jokowi masih di bawah bayang-bayang partai politik,” ucap Erwin.\r\n\r\nOleh karena itu, Erwin menganjurkan untuk mengembalikan kepercayaan publik, Yasonna harus diberi sanksi meski memang dirinya berlatarbelakang politikus PDIP. Namun, sejatinya dia merupakan Menteri Kabinet Indonesia Maju.\r\n\r\n“Untuk mengembalikan ketidakpercayaan masyarakat kepada kepemimpinan Jokowi, Jokowi dan Menkopolhukam harus memberikan sanksi dan opsi kepada Menkumham, apakah jadi pejabat negara yang profesional atau pejabat partai politik,” pungkasnya.\r\n\r\nSebelumnya, Menteri Hukum dan HAM Yasonna H Laoly terlihat turut mendampingi pimpinan PDI Perjuangan Sekjen Hasto Kristiyanto, saat memberi pernyataan pers di kantor DPP PDIP, Jalan Diponegoro, Menteng, Jakarta Pusat pada Rabu (15/1) kemarin.\r\n\r\nPada kesempatan itu, Yasonna menyampaikan, dibentuknya tim hukum DPP PDIP untuk meluruskan pemberitaan mengenai keterlibatan DPP PDIP dalam kasus suap Wahyu Setiawan.\r\n\r\n“Belakangan ini nampaknya pemberitaan sudah semakin mengarah ke mana-mana tanpa boleh kami katakan tanpa didukung oleh fakta dan data yang benar. Karenanya, DPP menugaskan di samping kami bagian dari anggota Fraksi kami, juga kami menunjuk beberapa pengacara untuk menjadi tim hukum kami,” pungkasnya.'),
(1232, 'ICW: Presiden Tak Memahami Kondisi Pemberantasan Korupsi', 'POLITIK', 'DATA UJI', 'Indonesia Corruption Watch (ICW) menyesalkan pernyataan Presiden Joko Widodo (Jokowi) yang menyebut Undang-Undang Nomor 19/2019 tentang KPK tidak melemahkan kinerja pemberantasan korupsi. Padahal, KPK terbukti telah melakukan operasi tangkap tangan (OTT) terhadap Bupati Sidoarjo, Saiful Ilah dan Komisioner KPU, Wahyu Setiawan.\r\n\r\n“Pernyataan tersebut semakin menggambarkan bahwa Presiden (Jokowi) memang tidak memahami kondisi pemberantasan korupsi yang terjadi saat ini,” kata peneliti ICW, Kurnia Ramadhana dalam keterangannya, Sabtu (18/1).\r\n\r\nKurnia mengatakan adanya UU KPK hasil revisi terbukti melemahkan kinerja KPK. Hal ini dilihat dari gagalnya KPK melakukan penggeledahan di kantor DPP PDIP.\r\n\r\n“Padahal dengan UU KPK lama proses penggeledahan yang sifatnya mendesak bisa dilakukan tanpa harus melalui izin Pengadilan Negeri. Namun karena perubahan regulasi prosesnya semakin lambat karena mesti melalui izin dari Dewan Pengawas,” ucap Kurnia.\r\n\r\nKurnia tak habis pikir, mengapa Presiden Jokowi menyebut KPK tetap kuat meski adanya revisi UU. Dia memandang, aktor pelemahan KPK sebenarnya merupakan Presiden Jokowi.\r\n\r\n“Hal terpenting adalah bahwa Presiden Joko Widodo adalah salah satu aktor utama selain dari DPR yang membuat suram kondisi pemberantasan korupsi,” sesalnya.\r\n\r\nSebelumnya, Presiden Jokowi menepis soal anggapan pelemahan kinerja KPK dalam aturan barunya yaitu Undang-Undang Nomor 19 Tahun 2019. Dua operasi tangkap tangan (OTT) yang dilakukan KPK terakhir disebut Jokowi sebagai bukti KPK masih bertaji.\r\n\r\n“Buktinya saya sudah sampaikan KPK melakukan OTT, ke bupati dan KPU meskipun Komisonernya masih baru, Dewasnya masih baru,” kata Jokowi di Kompleks Istana Kepresidenan, Jakarta, Jumat (17/1).'),
(1233, 'Arema FC Bidik Bintang Liga Malaysia, Opsi Kalau Bauman dan Eze Lepas', 'OLAHRAGA', 'DATA LATIH', 'Skuad Arema FC belum sepenuhnya lengkap. Khususnya untuk slot legiun asing. Saat ini baru Oh In-kyun yang merapat, dari total empat kuota pemain asing yang diperbolehkan di Liga 1 2020.\r\n\r\nArtinya, perburuan untuk tiga pemain makin gencar dilakukan. Sebelumnya Arema hampir memiliki satu pemain yang menjadi incaran, yakni Santiago Nicolas Carrera. Namun, pemain asal Uruguay, yang sebelumnya bermain di tim Serie C Italia itu batal bergabung.\r\n\r\nBagi Pelatih Arema FC Roberto Carlos Mario Gomez, untuk slot asing tersebut terbilang penting. Pasalnya, bakal menjadi penunjang tim. Seperti diketahui, untuk kompetisi tahun ini, Arema kedatangan beberapa aktor lapangan hijau yang potensial.\r\n\r\nDi antarannya adalah Pandi Lestaluhu, Dave Musataine, Bagas Adi Nugroho, sampai Kushedya Hari Yudo. ”Jika kami mendapatkan tambahan pemain bagus, saya rasa kesempatan semakin besar untuk kompetisi mendatang,” ungkap pria asal Argentina itu.\r\n\r\nNah, siapa sosok yang bakal merapat ke Malang, baik Gomez maupun manajemen Singo Edan seperti bersepakat masih menyembunyikan nama itu. Tapi, mantan pelatih Borneo FC menginginkan sosok yang mau bekerja keras.\r\n\r\n”Terpenting bermain dengan karakter,” ungkap pria berusia 62 tahun itu. Terkait perburuan pemain asing, pelatih asal Argentina itu dikabarkan bakal membawa mantan anak asuhnya ke Arema. Di antaranya, Jonathan Bauman dan Ezechiel N’Douassel yang semula dilatih Gomez saat masih di Persib Bandung.\r\n\r\nGomez juga tidak memungkiri jika kualitas dua pemain itu akan cocok dengan skemanya. ”Tentang Eze dan Bauman, mereka adalah pemain yang bagus,” ungkapnya. Meski memberikan pujian, namun pelatih berusia 62 tahun masih enggan mengiyakan apakah Bauman dan Eze akan masuk skuad Arema.\r\n\r\n”Mereka memang bagus, tapi tidak hanya mereka daftar pemain bagus,” ungkap Mario. Sementara itu, menurut sumber di internal Arema, Bauman dan Eze memang menjadi salah satu yang direkomendasi Gomez. Namun, jika tidak sesuai budget, maka sangat mungkin untuk mencari sosok yang lain.\r\n\r\n”Informasinya untuk dua striker terkendala, dia angka dan administrasi,” terang sumber itu. Jadi, dia menambahkan, dengan kompetisi yang semakin dekat, sangat besar peluang mencari sosok lainnya. ”Sudah disiapkan plan B untuk strikernya,” kata dia.\r\n\r\n”Informasinya adalah penyerang belum pernah berlaga di Liga 1, tapi secara kemampuan sudah diketahui pelatih,” imbuh sumber itu.\r\n\r\nMeski masih abu-abu, namun Singo Edan santer dirumorkan dengan banyak nama. Di antaranya, mantan anak asuh Gomez di tim yang pernah dilatih sebelumnya. Di antaranya dua mantan anak asuhnya di klub Liga Malaysia, Jorge Pereyra Diaz, dan Gabriel Miguel Guerra, sampai Bojan Malisic, mantan pemainnya di Persib Bandung.'),
(1234, 'Shin Tae-yong Bawa 28 Pemain Timnas U-19 untuk TC ke Thailand', 'POLITIK', 'DATA UJI', 'Manajer timnas Indonesia Shin Tae-Yong memastikan hanya membawa 28 pemain seleksi timnas U-19 Indonesia atau berkurang dua dari rencana sebelumnya 30 pemain untuk menjalani pemusatan latihan (TC) di Thailand.\r\n\r\n”Tadinya memang saya mau memilih 30 orang, tetapi saat ini berubah menjadi 28 pemain. Saya melihat mereka memiliki kekhasan dan kemampuan berbeda di setiap posisi,” ujar Tae-yong setelah memimpin seleksi hari terakhir di Stadion Wibawa Mukti, Cikarang Timur, Jumat.\r\n\r\nKe-28 pemain itu akan diumumkan secara resmi dalam laman resmi PSSI. Menurut pelatih asal Korea Selatan itu, para pemain seleksi timnas U-19 memiliki kemampuan olah bola yang bagus, bahkan di luar perkiraannya. Akan tetapi, pesepak bola muda Tanah Air itu mempunyai kelemahan yang mencolok yaitu fisik.\r\n\r\n“Fisik menjadi masalah terbesar. Kemampuan mereka memang lebih bagus dari perkiraan saya, tetapi kondisi fisik mereka lebih buruk dari prediksi,” kata Tae-yong.\r\n\r\nSebanyak 54 pemain kelahiran 2001 dan 2002 mengikuti seleksi timnas U-19 di Stadion Wibawa Mukti dari 13 sampai 17 Januari 2020. Ke-28 pemain akan berangkat ke Negeri Gajah Putih pada 20 Januari 2020. Pada 2020, timnas U-19 akan mengikuti Piala AFF U-19, yang waktunya belum ditentukan, dan Piala Asia U-19 2020 yang digelar pada 14-31 Oktober 2020 di Uzbekistan. Setelah itu, Garuda Nusantara bersiap tampil pada Piala Dunia U-20 2021.'),
(1235, 'Ini Adalah Pembuktian Conor McGregor yang Tenang dan Tak Emosional', 'POLITIK', 'DATA UJI', 'Demam tarung Conor McGregor kontra Donald Cerrone sudah menjangkiti Amerika Serikat sepekan terakhir. Puncaknya akan dituntaskan hari ini (19/1) WIB saat keduanya berduel langsung di oktagon yang berdiri di T-Mobile Arena, Las Vegas.\r\n\r\nPantas jika penggila UFC menanti-nantikan duel tersebut. Selain sudah 14 bulan tak bertarung, setelah kalah oleh Khabib Nurmagomedov pada 2018, McGregor seakan ingin mengubah citranya menjelang pertarungannnya kali ini. Dia lebih tenang, tidak emosional, dan nyaris tanpa sumpah serapah seperti yang dikenal orang di masa lampau.\r\n\r\nApakah dengan citra baru tersebut McGregor bisa meraih kemenangan sekaligus simpati dari fans? McGregor jelas lebih dijagokan. Siapa pun lawannya, petarung Republik Irlandia itu menggaransi bakal mempersembahkan pertarungan besar dan mungkin berdarah-darah.\r\n\r\nSepanjang karirnya, McGregor sudah 25 kali naik oktagon. Sebanyak 21 kali dituntaskan dengan kemenangan. Dari jumlah tersebut, 18 kali melalui KO, 1 submission, dan 2 by decision (menang angka).\r\n\r\nSejauh ini, The Notorious –julukan McGregor– sudah menelan empat kekalahan. Semua lewat submission. Termasuk kekalahan terakhirnya melawan Khabib dua tahun lalu. Tentu saja kali ini dia bakal berhati-hati terhadap kelemahannya itu. ’’Aku tidak akan terburu-buru. Aku akan memberikan tekanan kepada Donald dan membuat dia kesakitan,’’ ujarnya sebagaimana dikutip Daily Star.\r\n\r\nJulukan Si Jahat yang telanjur ditabalkan kepada McGregor akan terkonfirmasi pagi ini. Apakah citranya yang dulu sudah benar-benar ditinggalkan dengan tampil lebih tenang dan tidak menggebu-gebu? Atau ayah dua anak itu hanya memainkan opera sabun dadakan demi meraih simpati publik?\r\n\r\nCerrone sendiri punya jejak kemenangan dengan submission yang cukup panjang. Sebanyak 17 dari 36 kemenangan yang dia raih sejauh ini didapat dari cekikan, tekukan lengan, atupun triangle choke (posisi kedua kaki mengunci tubuh diakhiri dengan kuncian tangan lawan). ’’Aku tahu langkah yang harus diambil, agar tidak lambat di awal duel,’’ kata Cerrone sebagaimana dikutip CBS Sports.\r\n\r\nTale of the Tape\r\n\r\nConor McGregor vs Donald Cerrone\r\n\r\n31 tahun Usia 36 tahun\r\n\r\nNotorius Julukan Cowboy\r\n\r\n21-4 Rekor 36-13\r\n\r\nIrlandia Asal Amerika Serikat\r\n\r\n175 cm Tinggi Badan 183 cm\r\n\r\n77 kg Berat Badan 77 kg\r\n\r\n188 cm Jangkauan 185 cm'),
(1236, '6 Manfaat Rutin Makan Terong, Termasuk Stabilkan Gula Darah', 'OLAHRAGA', 'DATA LATIH', 'Terong merupakan sayuran unik dan ada yang berwarna ungu. Berbagai macam olahan terong dalam masakan bisa disajikan dalam bentuk sayur atau dibuat pedas seperti balado. Terong adalah sayuran rendah kalori dan ternyata kaya akan serat dan nutrisi, serta punya manfaat besar untuk kesehatan.\r\n\r\nTerong juga boleh dikonsumsi oleh ibu hamil dan menyusui. Dilansir dari Medical News Today, Jumat (17/1), satu porsi terong dapat menyediakan setidaknya 5 persen dari kebutuhan harian seseorang akan serat, tembaga, mangan, B-6, dan tiamin. Terong juga mengandung vitamin dan mineral lainnya. Selain itu, terong adalah sumber senyawa fenolik yang bertindak sebagai antioksidan.\r\nBerikut Manfaat Terong untuk Kesehatan\r\n\r\n1. Antioksidan\r\nKaya antioksidan. Antioksidan adalah molekul yang membantu tubuh menghilangkan radikal bebas, molekul tidak stabil yang dapat merusak sel jika mereka menumpuk dalam jumlah besar. Makanan yang mengandung antioksidan dapat membantu mencegah berbagai penyakit. Di antara antioksidan dalam terong adalah anthocyanin, termasuk nasunin, lutein, dan zeaxanthin.\r\n\r\n2. Kesehatan Jantung\r\nSerat, potasium, vitamin C, vitamin B-6, dan antioksidan dalam terong semuanya mendukung kesehatan jantung. Sebuah ulasan yang diterbitkan pada 2019 menyarankan bahwa makan makanan yang mengandung flavonoid tertentu, termasuk anthocyanin, membantu mengurangi penanda peradangan yang meningkatkan risiko penyakit jantung.\r\n\r\n3. Cegah Kanker\r\nTerong kaya akan sifat antioksidan yang membantu melindungi tubuh dari kerusakan yang disebabkan oleh radikal bebas. Sehingga terong juga dapat mencegah banyak penyakit kronis seperti penyakit jantung dan kanker.\r\n\r\n4. Kurangi Kolesterol\r\nDilansir dari Pink Villa, kandungan terong dapat membantu mengurangi risiko penyakit jantung. Telah diuji pada kelinci dengan kolesterol tinggi. Terong memiliki kadar kolesterol LDL dan trigliserida yang lebih rendah.\r\n\r\n5. Mengatur Gula Darah\r\nTerong juga membantu menjaga kadar gula tetap terjaga. Karena terong kaya serat, yang baik untuk saluran sistem pencernaan. Serat dapat menurunkan gula darah dan memperlambat laju pencernaan sehingga penyerapan gula dalam tubuh lebih efektif. Penyerapan yang lebih lambat menjaga kadar gula darah stabil dan mencegah peningkatan kadar gula.\r\n\r\n6. Turunkan Berat Badan\r\nTerong kaya serat dan rendah kalori, yang bisa menurunkan berat badan. Serat bisa menyehatkan pencernaan dan meningkatkan rasa kenyang, sehingga akan mengurangi asupan kalori.'),
