(1238, 'Ketua MPR Ajak Pemerintah AS Jaga Kondusifitas Keamanan Dunia', 'POLITIK', 'DATA LATIH', 'Ketua MPR Bambang Soesatyo mengajak Pemerintah Amerika Serikat bersama menjaga situasi kondusif keamanan di berbagai belahan dunia. Tak terkecuali di kawasan Semenanjung Korea.\r\n\r\nTerlebih Korea Selatan dan Korea Utara sudah saling membuka diri. Di Asian Games 2018 lalu yang diadakan di Jakarta, Korea Selatan dan Korea Utara bisa bersatu dibawah bendera Unifikasi Korea di tiga cabang olahraga, yakni Kano, Dayung, dan Basket.\r\n\r\nLangkah baik tersebut, kata politikus yang biasa disapa Bamsoet itu harus disambut dan didukung berbagai negara, terutama Amerika Serikat. Reunifikasi Korea akan membuat Asia Timur semakin damai.\r\n\r\n“Tak hanya di Asia Timur, ketegangan yang beberapa waktu lalu terjadi di Asia Tenggara terkait sikap Tiongkok yang tak menghormati keputusan UNCLOS 1982 di Laut Natuna juga perlu mendapat perhatian serius dari Amerika yang memiliki Hak Veto di Perserikatan Bangsa-Bangsa (PBB) sebagai Anggota Tetap Dewan Keamanan PBB,” ujar Bamsoet usai menerima Duta Besar Amerika Serikat untuk Indonesia, Joseph R. Donovan Jr, di Ruang Kerja Ketua MPR RI, Jakarta, Senin (20/1).\r\n\r\nMenurut Bamsoet, sikap Amerika Serikat yang menghormati kedaulatan Indonesia seharusnya juga dicontoh Tiongkok. Ketidakpatuhan negeri tirai bambu itu terhadap hukum UNCLOS 1982 yang membuat ketegangan antara Tiongkok dengan Indonesia di Laut Natuna, tak boleh dibiarkan karena bisa membuat preseden buruk di kemudian hari.\r\n\r\nMantan Ketua DPR RI 2014-2019 ini menekankan, walaupun antara Indonesia dengan Amerika Serikat memiliki perbedaan pandangan terkait berbagai situasi geopolitik internasional, seperti situasi di Iran dan Palestina, namun perbedaan tersebut jangan sampai mengganggu hubungan baik kedua negara yang telah terjalin erat sejak tahun 1949.\r\n\r\n“Kedua negara harus tetap saling menghormati dan menghargai pandangannya masing-masing, dengan tetap membuka ruang dialog untuk mencari solusi terbaik dalam mewujudkan dunia yang lebih aman dan damai,” paparnya.\r\n\r\nDijelaskan Bamsoet, salah satu tujuan berbangsa dan bernegara Indonesia, sebagaima dituliskan dalam pembukaan UUD NRI 1945, yakni ikut melaksanakan ketertiban dunia yang berdasarkan kemerdekaan, perdamaian abadi dan keadilan sosial. Karena itu, terkait kondisi di Iran yang akhir-akhir ini sedang menegang, kita harapkan baik Iran dan Amerika bisa saling menahan diri.\r\n\r\n“Demi menjaga situasi Timur Tengah tetap kondusif, dan menghindari kemungkinan terjadinya perang terbuka,” jelas Bamsoet.\r\n\r\nBamsoet yang merupakan, Wakil Ketua Umum KADIN Indonesia ini juga mengapresiasi kesepakatan (MoU) antara Amerika Serikat dengan Tiongkok yang ditandatangani Presiden Amerika Serikat Donald Trump dan Wakil Perdana Menteri China, Liu He, di Amerika, Rabu (15/1/20) waktu setempat. MoU tersebut sangat membantu meredakan ketegangan perang dagang Amerika – Tiongkok yang juga berdampak pada berbagai negara, tak terkecuali Indonesia.\r\n\r\n“Akibat semakin tegangnya Amerika dan Tiongkok selama lebih kurang dua tahun ini, menyebabkan penurunan pertumbuhan ekonomi global lebih dari 0,5 persen. Karena itu, kesepakatan tersebut membawa angin segar bagi berbagai negara. Semakin kondusifnya perekonomian global, juga akan membawa keuntungan bagi Indonesia,” tandas Bamsoet.'),
(1239, 'Liverpool Tidak Lagi Pakai New Balance Mulai Musim Depan', 'OLAHRAGA', 'DATA LATIH', 'Liverpool Tidak Lagi Pakai New Balance Mulai Musim Depan\r\n'),
(1240, 'Pakar Nilai Pemain Sepak Bola Asal Tiongkok Kurang Bermutu', 'OLAHRAGA', 'DATA LATIH', 'Pakar Nilai Pemain Sepak Bola Asal Tiongkok Kurang Bermutu\r\n'),
(1241, 'Catat 5 Makanan dan Minuman yang Bisa Cegah Kanker Serviks', 'KESEHATAN', 'DATA LATIH', 'Area leher rahim atau serviks bisa terserang virus Human Papiloma (HPV) pemicu kanker serviks. Salah satu untuk mencegah kanker serviks adalah menjalani gaya hidup dan hubungan yang sehat. Termasuk dengan mengasup makanan yang sehat.\r\n\r\nMakan sehat tidak diragukan lagi, penting untuk kesehatan. Menurut American Cancer Society, risiko perempuan terkena kanker dapat berkurang jika makan minimal 5 porsi buah dan sayuran setiap hari.\r\n\r\nTentu saja ada alasan biologis karena buah dan sayuran kaya antioksidan yang secara alami dapat memperlambat atau menghentikan proses yang menyebabkan sel kanker bermutasi. Dilansir dari Livehack, Minggu (19/1), ada beberapa makanan dan minuman yang bisa dikonsumsi untuk membuat serviks lebih sehat.\r\n\r\n1. Wortel\r\n\r\nWortel bukan hanya untuk mata tetapi wortel mengandung beta-karoten dan karoten. Sehingga bisa melawan penyerapan karsinogen ke dalam sel-sel tubuh. Anda bisa memakannya mentah, memasaknya, atau memasukkannya sebagai bagian dari salad.\r\nTeh hijau mengandung polifenol yang bagu untuk mencegah kanker. (Healthline)\r\n\r\n2. Teh Hijau\r\n\r\nTeh Hijau adalah minuman alternatif yang juga terkenal dengan banyak manfaat kesehatan. Salah satu alasannya adalah antioksidan di dalam teh hijau. Selain itu teh hijau mengandung polifenol yang merupakan jenis antioksidan yang membantu mencegah pembelahan dan penggandaan sel kanker.\r\n\r\n3. Kacang Polong\r\n\r\nKacang polong dapat menjadi makanan favorit semua orang. Selain murah, tinggi serat, dan tinggi protein, kacang polong mencegah kerusakan sel-sel. Fitokimia yang merupakan komponen dalam kacang-kacangan dianggap memperlambat pertumbuhan tumor. Fitokimia ini melindungi sel-sel sehat agar tidak diubah menjadi sel kanker.\r\n\r\n4. Selada\r\n\r\nSelada adalah bagian dari sayuran hijau yang mengandung flavonoid. Dianggap oleh banyak orang sebagai sumber nutrisi yang memberikan tingkat perlindungan terhadap kanker.\r\n\r\n5. Roti Gandum\r\n\r\nRoti gandum bisa mengisi jumlah karbohidrat. Makanan ini kaya karbohidrat sama pentingnya dengan buah-buahan dan sayuran, dan mengandung vitamin B6. Vitamin ini diperlukan untuk mengatur sistem kekebalan tubuh, menjaga metabolisme sel darah merah, dan meningkatkan kesehatan sistem saraf serta menyehatkan tubuh secara keseluruhan.'),
(1242, 'Benarkah Matcha Layak Dijadikan Sebagai Minuman Kesehatan?', 'KESEHATAN', 'DATA UJI', 'Dengan teknik tersebut, maka tingkat polifenolnya akan lebih tinggi. Selain itu, daun teh matcha akan memiliki karakter manis dengan rasa umami (gurih). Daunnya pun akan lebih hijau.\r\n\r\n“Jadi kita gak berasa pahit aja tapi ada creamy-nya yang gak bisa didapatkan di teh hijau,” ujar Ratna salam talkshow perayaan National Matcha Day yang jatuh pada 14 Januari di Jakarta beberapa waktu lalu.\r\n\r\nProses inilah yang menyebabkan antioksidan matcha lebih tinggi. Terlebih, ketika meminum matcha, sama saja memakan daun teh secara utuh. Beda dengan teh hijau yang hanya diambil sarinya aja saat diseduh.\r\n\r\n“Kalau teh itu kita seduh artinya daunnya tidak kita makan, nah kalau matcha inikan bentuknya powder maka smeuahya kita minum, maka kadarnya jauh lebih tinggi dari yang diseduh,” tukasnya.\r\n\r\nSeperti dilansir dari Healthline, Rabu (15/1), antibiotik yang terkandung dalam matcha memang bisa menangkal radikal bebas hingga membantu menstabilkan sel yang rusak.\r\n\r\nLantas, bisakah matcha dijadikan minuman kesehatan?\r\n\r\nRatna dengan tegas mengatakan tidak. Dalam arti, minuman matcha asli hanya bisa dijadikan sebagai relaksasi guna menenangkan diri. Bonusnya, ungkap Ratna, seseorang bisa merasakan manfaat dari antioksidan yang diberika matcha tadi.\r\n\r\n“Tapi ini (matcha) bukan minuman kesehatan kaya vitamin. Hanya memang lebih sehat dibandingkan minum soda,” sambungnya.'),
(1245, 'Simak 5 Cara Sederhana Jaga Kesehatan Area Leher Rahim', 'KESEHATAN', 'DATA UJI', 'Menjadi perempuan harus lebih telaten menjaga kebersihan organ intim. Sehingga area sistem reproduksi bisa tetap sehat, salah satunya area leher rahim atau serviks.\r\n\r\nDokter Spesialis Kulit dan Kelamin Rumah Sakit Surya Husadha Denpasar, Bali, dr. Laksmi Duarsa menjelaskan, masalah yang ada pada organ reproduksi juga bisa menyebabkan gangguan atau masalah pada kulit. Misalnya saja keputihan di area intim bisa menyebabkan gatal.\r\n\r\n“Sebetulnya bicara serviks memang kaitannya dengan kesehatan kandungan. Tetapi itu juga bisa mengganggu area kulit kelamin dari komplikasi serviks yang tak sehat, bisa juga penyakit kelamin dan lainnya,” jelas dr. Laksmi kepada JawaPos.com, baru-baru ini.\r\n\r\nMaka dia menyarankan agar perempuan tetap bersih dan higienis dalam merawat organ intimnya agar serviks tetap sehat. Seperti apa cara paling sederhana?\r\n\r\n1. Untuk Perempuan Dewasa\r\n\r\nPerempuan menikah atau dewasa tentu paling baik adalah dengan tetap setia berhubungan intim pada satu pasangan. Jikapun memang sudah tertular penyakit, konsultasikan dengan dokter guna penanganan yang tepat.\r\n\r\n2. Untuk Perempuan Remaja\r\n\r\nDengan pendampingan orang tua, remaja harus mendapatkan edukasi yang penting agar mengerti tentang pendidikan seks. Seks di luar nikah atau sebelum menikah akan berdampak pada kesehatan reproduksi.\r\n\r\n3. Jaga Kebersihan Miss V\r\n\r\nPerempuan juga harus rutin menjaga kebersihan organ intim. Sebab area vagina rentan untuk lembab. Bersihkan Miss V setiap hari.\r\n\r\n“Setiap hari saat mandi dibersihkan, pakai sabun boleh tapi jangan terlalu keras,” jelas dr. Laksmi.\r\n\r\n4. Rutin Ganti Celana Dalam\r\n\r\nMenjaga kebersihan Miss V juga penting dilakukan agar menjaga organ intim tetap bersih dan higienis. Sebaiknya ganti celana dilakukan dua kali sehari.\r\n\r\n“Selain dicuci sebaiknya disetrika juga agar bakteri atau kumannya hilang,” katanya.\r\n\r\n5. Rutin Ganti Pembalut\r\n\r\nGanti pembalut setiap 4 jam sekali minimal. Ketika sudah terlihat kotor, sebaiknya diganti.\r\n\r\n“Dan pilih pembalut sebaiknya sesuai dengan kulit ya. Jangan sampai nanti alergi kalau enggak cocok sama bahannya,” jelasnya.'),
(1246, 'Kata Ayudia Bing Slamet terkait Konflik di Teman Tapi Menikah 2', 'ENTERTAINMENT', 'DATA LATIH', 'Kisah perjalanan cinta Ayudia Bing Slamet dan suaminya, Ditto Percussion kembali diangkat dalam film ‘Teman Tapi Menikah 2’. Kali ini bukan tentang perjalanan masa-masa remaja mereka, tapi cerita soal kehidupan pernikahan dan berumah tangga.\r\n\r\nBagi Ayudia, menikah bukan hal yang mudah. Ada banyak tantangan dan konflik atau masalah yang harus dihadapi. Semua itu tertuang dalam jalan cerita film ‘Teman Tapi Menikah 2’.\r\n\r\n“Bagaimana film ini bercerita soal menikah, bagaimana saat hamil, mau jadi ibu, dan berbagai kehidupan setelah menikah,” jelas Ayudia dalam konferensi pers, Senin (20/1).\r\n\r\nTak hanya soal perbedaan dengan pasangan, tapi juga soal menyatukan dua keluarga besar. Termasuk tantangan menjadi orang tua yang harus mendidik dan membesarkan anak juga dibutuhkan kerja sama.\r\n\r\n“Mengurus anak dan mendidik. Dan di film kedua ini juga banyak pesan seputar kehamilan, cara menjadi ibu baru dan lainnya,” tutur Ayudia.\r\n\r\nSedangkan Ditto mengungkapkan, film kedua ini diharapkan bisa memberikan pesan bagi masyarakat. Terutama pasangan muda tentang pernikahan.\r\n\r\n“Berapapun jumlah penontonnya banyak yang akan kami sampaikan bahwa kehidupan pernikahan seperti apa mungkin lebih pesan-pesannya bisa sampai juga. Akan banyak pesan positif bagi para calon ibu dan ibu baru,” tutur Ditto.'),
(1247, 'Di Teman Tapi Menikah 2, Mawar De Jongh Pakai Perut Silikon', 'ENTERTAINMENT', 'DATA LATIH', 'Aktris cantik Mawar De Jongh didapuk berperan menjadi karakter Ayudia di film ‘Teman Tapi Menikah 2’. Dikatan, jalan cerita film kedua jauh lebih maju dari ‘Teman Tapi Menikah’ yang pertama. Film kedua menceritakan problem yang dialami pasangan Ayudia Bing Slamet dan Ditto Percussion atau Muhammad Pradana Budiarto menjalani pernikahan.\r\n\r\nTentunya ada peran di mana Mawar De Jongh beradegan sebagai ibu hamil saat Ayudia mengandung anaknya. Mawar De Jongh, yang memerankan tokoh Ayudia, justru mengaku sempat merasa tidak nyaman berakting di film ini. Karena ia harus memerankan ibu hamil.\r\n\r\n“Tentunya saya senang sekali bisa bergabung dalam film Teman Tapi Menikah 2, dengan karakter yang menantang. Kalau kesulitan pasti saya mengalami. Sempat tidak nyaman dengan perut silikonnya, karena berat saat peran hamil. Tapi, lama kelamaan terbiasa juga,” jelasnya dalam konferensi pers, Senin (20/1).\r\n\r\nKetika dibandingkan dengan Vanesha Prescilla, Mawar mengungkapkan tentunya dirinya memiliki karakter yang berbeda. Namun, dia berusaha untuk mendalami karakternya sebagai ibu rumah tangga yang bertransformasi dari usia aslinya yakni masih 18 tahun.\r\n\r\n“Pastinya bagaimana pun cara saya dan Vanesha beda. Kali ini menceritakan tentang nikah jadi beda, bagaimana saat hamil hormonnya, mood-nya. Dan saya juga tanya Ayu, gimana pas hamil dan jalannya,” jelas Mawar.\r\n\r\nLalu Mawar juga harus beberapa kali jalan bareng Ayudia sebelum syuting untuk mendalami perannya. Mawar berusaha banyak mengobrol dan membangun rasa nyaman antar sahabat.\r\n\r\n“Belajar karakter hamil saya dapat catatan psikolgis orang hamil nanya ke mama juga, nanya ke Ayu juga. Bagaimana dia hamil dan melahirkan. Prosesnya lumayan lama mendalaminya, dari saya terima script prosesnya satu bulan,” katanya.\r\n\r\nFilm ‘Teman Tapi Menikah 2’ akan tayang serentak diseluruh bioskop Indonesia pada 27 Februati 2020 yang akan datang. Jalan cerita film kedua nanti akan bergerak maju mengikuti kehidupan pernikahan Ayudia Bing Slamet dan Ditto Percussion.'),
(1248, 'Teman Tapi Menikah 2, Mawar De Jongh Gantikan Vanesha Prescilla', 'ENTERTAINMENT', 'DATA LATIH', 'Aktor Adipati Dolken kembali memerankan Ditto Percusion dalam ‘Teman Tapi Menikah 2’. Namun kali ini, pasangan Adipati dalam film diganti dengan Mawar De Jongh, yang berperan sebagai Ayudia Bing Slamet. Sehingga, tidak akan ada sosok Vanesha Prescilla dalam film kali ini.\r\n\r\nSukses masuk dalam jajaran film Box Office Indonesia, Falcon Pictures segera merilis film ‘Teman Tapi Menikah 2’. Film itu bercerita tentang kisah hidup dan perjalanan cinta Ayudia Bing Slamet dan Ditto Percussion.\r\n\r\nSedikit berbeda dengan film sebelumnya, tokoh Ayudia Bing Slamet tidak lagi diperankan oleh Vanesha Prescilla. Sebagai gantinya, Falcon Pictures memilih Mawar De Jongh yang sukses mendapatkan perhatian saat memerankan tokoh Anelies dalam film ‘Bumi Manusia’.\r\n\r\nProduser Falcon Pictures, Frederica mengungkapkan, film ‘Teman Tapi Menikah 2’ ada sedikit perbedaan konsep dengan masuknya Mawar. ‘Tapi, saya yakin, Mawar mampu mendalamin karakter Ayu. Semoga film ini bisa kembali masuk jajaran film Box Office Indonesia,” katanya dalam konferensi pers, Senin (20/1)\r\n\r\nSementara itu, Rako Prijanto yang kembali menyutradarai film ‘Teman Tapi Menikah 2’, mengaku sangat senang dengan film ini. Untuk menggarap sekuel film Teman Tapi Menikah, ada tantangan sendiri.\r\n\r\n“Persiapan paling khusus adalah bagaimana bekerjasama dengan Adipati Dolken dan Mawar De Jongh agar mereka bisa mendapatkan chemistry,” ungkapnya.\r\n\r\nAdipati Dolken yang memerankan tokoh Ditto Percussion mengaku tidak mengalami kesulitan beradu akting dengan Mawar. Dia memang mengakui, Vanesha dan Mawar adalah dua sosok yang berbeda yang pastinya memiliki tantangan tersendiri untuk membangun chemistry.\r\n\r\n“Tidak sulit membangun chemistry dengan Mawar. Mungkin awalnya sedikit canggung, tapi setelah ngobrol semua langsung cair,” jelas Adipati.\r\n\r\nAdipati mengakui banyak jalan cerita yang jauh lebih berkembang daripada film pertama. Dia menilai keduanya adalah sosok yang berbeda.\r\n\r\nFilm ‘Teman Tapi Menikah 2’ akan tayang serentak diseluruh bioskop Indonesia pada 27 Februati 2020 yang akan datang. Film itu sebelumnya sukses dengan film pertamanya yang masuk kategori Box Office.');
INSERT INTO `sa_berita` (`id_berita`, `judul_berita`, `kategori_berita`, `jenis_data`, `isi_berita`) VALUES
(1249, 'Masuk 4 Nominasi, Andmash Kamaleng: Bangga Karena Top Five Lagunya', 'ENTERTAINMENT', 'DATA LATIH', 'Andmesh Kamaleng termasuk penyanyi muda berbakat yang lagu-lagunya masuk dalam top chart platform digital streaming baik video maupun audio. Lagu-lagunya juga masuk dalam top chart situs berbagi video Youtube sepanjang tahun 2019.\r\n\r\nLagu-lagunya masuk dalam pencarian tertinggi, nama Andmesh pun kini masuk dalam empat nominasi sekaligus di ajang pemberian penghargaan Billboard Indonesia Music Awards 2020. Yaitu kategori Top 100 Song the Year, Top Streaming Song of the Year (audio), Top Streaming Song of the Year (video) dan Top Radio Airplay of the Year.\r\n\r\nLagu yang dibawakan Andmesh bertajuk Hanya Rindu masuk dalam nominasi kategori Top 100 Song the Year Billboard Music Awards 2020. Andmesh bersaing dengan nomine lainnnya yang memiliki jam terbang di atasnya di industri hiburan Tanah Air. Seperti Yovie Widianto, Tulus, Glenn Fredly (Adu Rayu), Judika (Cinta Karena Cinta), Marion Jola, Laleilmanino (Rayu) dan Budi Doremi (Tolong).\r\n\r\nPada kategori Top Streaming Song of the Year (video), lagu Cinta Luar Biasa Andmesh Kamaleng bersaing dengan Cinta Karena Cinta (Judika), Kartonyo Medot Janji (Denny Caknan), Salah Apa Aku ( Ilir 7) dan Tolong – Budi Doremi.\r\n\r\nSementara pada kategori Top Streaming Song of the Year (audio), Andmash Kamaleng berrajuk Cinta Luar Biasa bersaing dengan nomine yaitu Yovie Widianto, Tulus, Glenn Fredly (Adu Rayu), Judika ( Cinta Karena Cinta ), Marion Jola, Laleilmanino (Rayu) dan Budi Doremi (Tolong).\r\n\r\nAndmesh lewat lagu Hanya Rindu juga dihadapkan pada pesaing yang tidak kalah hebatnya pada kategori Top Radio Airplay of the Year. Karena pesaingnya adalah Yovie Widianto, Tulus, Glenn Fredly (Adu Rayu), NOAH (Wanitaku), Judika (Cinta Karena Cinta), dan Marion Jola, Laleilmanino (Rayu).\r\n\r\nBisa masuk empat nominasi sekaligus di ajang pemberian penghargaan Billboard Music Awards 2020, Andmesh Kamaleng mengaku tidak percaya. Dia tidak pernah menyangka kalau dirinya yang merupakan penyanyi pendatang baru bisa menapat kesempatan masuk ke dalam nominasi sebanyak itu.\r\n\r\n“Masih enggak nyangka ya. Tapi bangga karena top five itu empat lagunya Andmesh yang masuk ke dalam Billboard Indonesia Music Awards 2020,” kata Andmesh Kamaleng saat ditemui di bilangan Kebon Jeruk, Jakarta Barat, Senin (20/1).\r\n\r\nMerasa dirinya termasuk anak bawang di industri musik Indonesia, dia tidak terlalu berambisi untuk menang. Apalagi Andmesh tahu kalau nomine lainnya merupakan musisi hebat dimana kemampuan mereka di dalam bermusik sudah tidak diragukan lagi.\r\n\r\n“Kalau Andmesh masuk nominasi saja bersaing sama kayak Judika, Budi Doremi, itu sudah bangga banget sih. Karena bisa bersaing dengan orang-orang yang sangat luar biasa. Ke depannya apapun hasilnya Andmash tetap akan terima, tapi kalau optimis untuk dapatinnya ada sih. Paling enggal salah satu dari 4 kategori itu,” tutur Andmesh.\r\n\r\nDia pun akan gencar untuk mempromosikan dirinya di media sosial supaya bisa mendapat dukungan berupa vote dari para penggemarnya. Para pemenang dari masing-masing kategori akan ditentukan pada malam puncak pemberian penghargaan Bilboard Indonesia Music Awards 2020 yang akan digelar pada 26 Februari 2020 mendatang.'),
(1250, 'Ini Nominasi Lengkap Billboard Indonesia Music Awards', 'ENTERTAINMENT', 'DATA LATIH', 'Ajang pemberian penghargaan Billboard Music Awards 2020 digelar untuk pertama kalinya di Indonesia. Penghargaan ini diberikan guna mengapresiasi insan musik Tanah Air yang sudah bekerja keras melahirkan karya.\r\n\r\nMalam puncak perhelatan Billboard Indonesia Music Awards 2020 akan dilaksanakan pada 26 Februari 2020 mendatang dan dimeriahkan oleh sederet penyanyi yang juga menjadi nominasi. Diantaranya adalah Andmesh Kamaleng, Cakra Khan dan masih banyak lagi yang lainnya.\r\n\r\nBerbeda dari ajang pemberian penghargaan lainnya, Billboard Indonesia Music Awards memasukkan daftar nominasi berdasarkan data-data yang masuk 100 peringkat tertinggi tangga lagu. Bukan hanya pada tangga lagu Billboard saja, tapi juga memasukkan chart lain dan juga pemeringkatan tertinggi yang diperoleh dari media sosial.\r\n\r\n“Perbedaannya dari cara menghasilkan nominasinya. Kalaborasi Billboard dari berbagai platform musik dikumpulkan semua datanya yang kemudian menjadi nominasi. Kedua mengenai periode waktu tidak hanya terpaku pada periode tertentu saja. Ini menariknya dan membedakan sama penghargaan yang lain. Malam puncaknya pada 26 Februari dan tayang live di RCTI,” ungkap Dini Putri selaku Direktur Program RCTI dalam jumpa pers di bilangan Kebon Jeruk, Jakarta Barat, Senin (20/1).\r\n\r\nSementara itu, Adib Hidayat selaku Editor in Chief Billboard Indonesia mengatakan bahwa ajang pemberian penghargaan ini sengaja dibuat untuk memotivasi para penyanyi supaya mau mempromosikan lagu yang sudah dirilis sebagai barometer sebuah kesuksesan lagu. Adib sendiri sempat tercengang beberapa nama baru melejit di tangga lagu yang belum dikenalinya sebelumnya.\r\n\r\n“Tentu semuanya mengacu pada apa yang sedang terjadi di luar sana. Chart membuat teman-teman semangat menciptakan lagu-lagu. Buat label juga bisa kerja keras bagaimana lagu artisnya bisa masuk tangga lagu. Karena semuanya sistem digital kadang kita enggak hafal. Tapi ketika nama-nama baru muncul orang akan langsung, oh ini Andmesh Kamaleng atau yang lainnya,” tutur Adib Hidayat.\r\n\r\nBillboard Indonesia Music Awards 2020 memiliki belasan kategori penghargaan. Mulai dari kategori Top 100 Song of The Year, Top Collaboration Song of The Year dan yang lainnya. Para pemenangnya ditentukan dari hasil vote melalui media sosial.\r\n\r\nBerikut daftar lengkap nominasi Billboard Indonesia Music Awards 2020:\r\n\r\n1. Top 100 Song of the Year\r\nA. Adu Rayu – Yovie Widianto, Tulus, Glenn Fredly\r\nB. Cinta Karena Cinta – Judika\r\nC. Hanya Rindu – Andmesh\r\nD. Rayu – Marion Jola, Laleilmanino\r\nE. Tolong – Budi Doremi\r\n\r\n2. Top Collaboration Song of the Year\r\nA. Adu Rayu – Yovie Widianto, Tulus, Glenn Fredly\r\nB. Amin Paling Serius – Sal Priadi & Nadin Amizah\r\nC. Bebas – Iwa K, Sheryl Sheinafia, Maizura, Agatha Pricilla\r\nD. Tak Ingin Pisah Lagi – Marion Jola, Rizky Febian\r\nE. Waktu yang Salah – Firesa Besari feat Tantri\r\n\r\n3. Top New Artist of the Year\r\nA. Arsy Widianto – Dengan Caraku (with Brisia Jodie)\r\nB. Brisia Jodie – Kisahku\r\nC. Hindia (Baskara Putra) – Membasuh (feat Rara Sekar)\r\nD. Marion Jola – Jangan (feat Rayi Putra)\r\nE. Nadin Amizah – Sorai\r\n\r\n4. Top Streaming Song of the Year (audio)\r\nA. Adu Rayu – Yovie Widianto, Tulus, Glenn Fredly\r\nB. Cinta Karena Cinta – Judika\r\nC. Cinta Luar Biasa – Andmesh\r\nD. Rayu – Marion Jola, Laleilmanino\r\nE. Tolong – Budi Doremi\r\n\r\n5. Top Streaming Song of the Year (video)\r\nA. Cinta Karena Cinta – Judika\r\nB. Cinta Luar Biasa – Andmesh\r\nC. Kartonyo Medot Janji – Denny Caknan\r\nD. Salah Apa Aku – Ilir 7\r\nE. Tolong – Budi Doremi\r\n\r\n6. Top Social Artist of the Year\r\nA. Agnez Mo – Diamonds (feat French Montana)\r\nB. Fiersa Besari – Celengan Rindu\r\nC. Hindia (Baskara Putra) – Membasuh (feat Rara Sekar)\r\nD. Kunto Aji – Pilu Membiru\r\nE. Rich Brian – 100 Degrees\r\n\r\n7. Top Male Singer of the Year\r\nA. Andmesh – Cinta Luar Biasa\r\nB. Budi Doremi – Tolong\r\nC. Fiersa Besari – Waktu yang Salah (feat Tantri)\r\nD. Judika – Cinta Karena Cinta\r\nE. Rizky Febian – Berpisah Itu Mudah (with Mikha Tambayong)\r\n\r\n8.Top Female Singer of the Year\r\nA. Brisia Jodie – Kisahku\r\nB. Hanin Dhiya – Berkawan dengan Rindu\r\nC. Marion Jola – Rayu (with Laleilmanino)\r\nD. Nadin Amizah – Sorai\r\nE. Yura Yunita – Intuisi\r\n\r\n9. Top Duo/Group/Band of the Year\r\nA. GAC (Gamaliel Audrey Cantika – Suara\r\nB. HIVI! – Jatuh Bangkit Kembali\r\nC. Juicy Luicy – Tak Terbaca\r\nD. Noah – Wanitaku\r\nE. The Overtunes – Bicara (feat Monita Tahalea)\r\n\r\n10. Top Radio Airplay of the Year\r\nA. Adu Rayu – Yovie Widianto, Tulus, Glenn Fredly\r\nB. Cinta Karena Cinta – Judika\r\nC. Hanya Rindu – Andmesh\r\nD. Rayu – Marion Jola, Laleilmanino\r\nE. Wanitaku – Noah\r\n\r\n11. Top Karaoke Song of the Year\r\nA. Akhir Cinta – Panbers\r\nB. Dia – Anji\r\nC. Harusnya Aku – Armada\r\nD. Kangen – Dewa 19\r\nE. Kekasih Bayangan – Cakra Khan\r\n\r\n12. Top Throwback Hits of the Year\r\nA. Berharap Tak Berpisah – Reza Artamevia\r\nB. Dan – Sheila on 7\r\nC. Kangen – Dewa 19\r\nD. Kecewa – Bunga Citra Lestari\r\nE. Kenangan Terindah – Samsons\r\nF. Manusia Bodoh – Ada Band'),
(1251, 'Gaya Bos Baru Garuda Pimpin Manajemen', 'BISNIS', 'DATA LATIH', 'Menteri Badan Usaha Milik Negara (BUMN) Erick Thohir telah menunjuk Irfan Setiaputra untuk memimpin PT Garuda Indonesia (Persero) Tbk menggantikan Ari Askhara. Irfan berkomitmen untuk membawa Garuda menjadi perusahaan yang lebih baik lagi.\r\n\r\nIrfan mengatakan, dirinya akan menjaga kekompakan dengan para Direksi dan Komisaris. Menurutnya, keterbukaan disetiap perbedaan pendapat dapat menentukan titik tengah dalam mencari solusi terbaik untuk kemajuan perseroan.\r\n\r\n“Saya selalu menganggap perbedaan pedapat itu karunia, dan 10 kepala jauh lebih bagus dari 1 kepala. saya orang mau terbuka terhadap semua inputan. mestinya ngga ada yang melimit kita untuk diskusikan segala macam, apapun, perbedaan pendapat saya ngga bilang konfilik ya, dan saya rasa di banyak perusahaan selalu ada perbedaan perbedaan pendapat yg mengedepankan azas,” ujarnya saat dihubungi oleh wartawan, Rabu (22/1).\r\n\r\nIrfan menekankan, apapun keputusan yang diambil oleh manajemen tidak mengganggu keselamatan atau menciptakan persepsi palsu. Dengan demikian, keuntungan perusahaan dapat dicapai. “Ini tanggung jawab semua karyawan,” ucapnya.\r\n\r\nNamun, kata Irfan, dalam mengejar keuntungan tidak boleh mengorbankan faktor keselamatan dan pelayanan, termasuk persoalan harga tiket. “Jadi kita musti ketemu satu titik harga itu harus reasonable. Reasonable ini nggak semua orang bisa naik garuda, tapi buat kita perusahaan ini bisa untung, mengurangi cicilan, dan mengembangkan,” jelasnya.\r\n\r\nIrfan mengaku, dirinya juga tidak ingin Garuda mendapat suntikan dana terus-menerus. Sehingga, manajemen akan terus melakukan inovasi dan mencari strategi terbaik dengan tetap meraup untung dari penjualan tiket pesawat.\r\n\r\n“Kalau perusahaan ngga untung kan mesti disuntik terus, tapi sebagai CEO kok saya malu hati juga kalau begitu. Tapi kan banyak penumpang yang nggak peduli sama harga terutama yang kantor. Ya saya akan bicara dengan corporate (or copilot) ratusan juta dolar kok ngotot bener naik garuda murahan,” tutupnya.'),
(1252, 'Persebaya Masih Berharap Abduh dan Angga, Persikabo Klaim Bertahan', 'OLAHRAGA', 'DATA LATIH', 'Abduh Lestaluhu dan Angga Saputra sejatinya sudah bergabung dengan Persebaya Surabaya. Kedua pemain itu sudah melakukan teken kontrak. Bahkan, keduanya juga sudah menerima uang dari manajemen Green Force, julukan Persebaya.\r\n\r\nTapi, Abduh dan Angga memilih bertahan di Tira Persikabo Bogor. Bahkan, Abduh sempat memposting tanda tangan perpanjangan kontrak dengan Tira Persikabo di akun instagram-nya. Postingan tersebut kini sudah dihapus. Apakah itu sinyal kalau Angga dan Abduh ke Persebaya?\r\nPersebaya Surabaya\r\n\r\n“Sejauh ini masih proses. Semoga dalam satu atau dua hari ke depan ada kejelasan soal status mereka,” kata Ram Surahman, Sekretaris Persebaya.\r\n\r\nRam menegaskan, sejauh ini manajemen Green Force tak melakukan pelanggaran dalam proses kontrak dua pemain itu. Dalam regulasi disebutkan bahwa setiap tim bisa melakukan negosiasi dengan pemain yang tinggal menyisakan satu bulan masa kontrak dengan klubnya. Kebetulan, Persebaya melakukan negosiasi dalam masa tersebut. “Artinya kan tidak ada masalah. Hanya saya nggak bisa buka kapan tanggal pastinya kami melakukan tanda tangan kontrak,” jelas Ram. Saat ini, pihak Persebaya sudah menjalin komunikasi dengan seluruh elemen untuk kembali mendapatkan dua pemain itu. Sebab, tidak mudah bisa menyelesaikan permasalahan tersebut.\r\n\r\n“Yang jelas kami sudah menjalin komunikasi dengan manajemen Tira Persikabo. Termasuk dengan atasan Abduh di kesatuannya,” terang Ram. Ram berharap proses transfer dua pemain ini segera rampung. Sebab, Persebaya berencana melakukan launching tim pada awal bulan depan.\r\n\r\nDi sisi lain, pihak Tira Persikabo melalui Direktur Pengembangan Bisnis Rhendie Arindra menegaskan, sampai sekarang belum ada kesepakatan apapun dengan Persebaya soal kedua pemain tersebut. Namun, Rhendie membenarkan jika kemarin (22/1) pihaknya dan Persebaya bertemu di Jakarta. Kedua belah pihak membahas soal Abduh dan Angga. ’’Tapi tidak menyepakati apapun ya,’’ tegasnya. Artinya, Rhendie secara tegas menyatakan kalau kedua pemain tersebut masih milik timnya. Kedua pemain tersebut sudah dikontrak secara resmi untuk satu musim ke depan. Bahkan, sudah ikut latihan dalam rangka persiapan menuju Liga 1 2020. ’’Abduh dan Angga masih pemain kami, itu yang benar,’’ katanya.'),
(1253, 'Ganda Indonesia No 82 Dunia, Sang Juara Dunia Junior, ke Babak Utama', 'OLAHRAGA', 'DATA LATIH', 'Juara dunia junior 2019 Leo Rolly Carnando/Daniel Marthin menjalani debutnya pada ajang Super 300 dengan baik.\r\n\r\nLeo/Daniel yang sekarang menempati ranking 82 dunia itu lolos ke babak utama Thailand Masters 2020 via kemenangan atas ganda putra tuan rumah Maneepong Jongjit/Krit Tantianankul dalam rubber game dengan skor 22-24, 21-17, 21-18.\r\n\r\nPada babak pertama besok (22/1), Leo/Daniel akan menghadapi rekannya sesama pemain pelatnas PBSI Mohammad Reza Pahlevi Isfahani/Sabar Karyaman Gutama.\r\n\r\n”Kami sudah sama-sama tahu permainannya. Yang penting besok harus lebih fight dan siap lagi. Harus all out,” kata Daniel dalam siaran pers PP PBSI yang diterima Jawa Pos.\r\n\r\n”Target kami ingin mengeluarkan permainan terbaik saja dulu. Fokus setiap babak dan jangan lengah dari lawan,” imbuh Leo.\r\n\r\nPertandingan babak kualifikasi di Indoor Stadium Huamark, Bangkok hari ini (21/1) berlangsung ketat. Leo/Daniel baru bisa menang dalam tempo 70 menit.\r\n\r\nPada game pertama, Leo/Daniel sempat tertinggal 13-16. Namun, mereka berhasil mencetak lima angka beruntun dan unggul 18-16. Pertandingan kemudian menjadi intens. Jongjit/Tantianankul sempat mencapai game point lebih dulu dalam kondisi 20-19. Namun, Leo/Daniel membalik dan memimpin 21-20.\r\n\r\nPertandingan semakin menegangkan. Adu setting terjadi. Namun, Jongjit/Tantianankul berhasil mengambil momentum menang untuk merebut game pertama dalam keunggulan 24-22.\r\n\r\nPada game kedua, Leo/Daniel tidak memberikan kesempatan bagi lawan untuk berkembang. Sejak awal, mereka terus unggul dalam perolehan angka dan mengambil game kedua dengan nyaman.\r\n\r\nPada game penentuan, Leo/Daniel sempat tertekan dan tertinggal 3-8. Namun, mereka dengan sabar terus mencetak angka dan akhirnya bisa menyamakan kedudukan dalam posisi 9-9.\r\n\r\nSetelah itu kejar-mengejar poin terjadi.\r\n\r\nDan sejak unggul 16-15, Leo/Daniel tidak pernah lagi tertinggal dari lawan. Mereka akhirnya mampu memenangkan pertandingan dan merebut tiket babak utama.\r\n\r\n”Bolanya di sini berat, lawannya juga nggak gampang mati, mereka kuat. Apalagi salah satu pemainnya tadi juga senior (Jongjit, berusia 28 tahun, Red). Sudah banyak pengalamannya,” kata Daniel.\r\n\r\n”Selain bolanya berat, di sini lapangan juga ada angin. Terus mereka juga main defensenya bagus,” tambah Leo.'),
(1254, 'Jaksa Agung Minta Siswa SMA yang Bunuh Begal Dikembalikan ke Orang Tua', 'POLITIK', 'DATA UJI', 'Kasus siswa SMA yang membunuh begal di Malang terdengar sampai Jakarta. Kasus yang hari ini memasuki sidang pembacaan tuntutan itu bahkan mendapat atensi dari Jaksa Agung ST Burhanuddin. Dia menyatakan, jaksa hanya akan menuntut ZA, inisial siswa SMA itu, dengan hukuman dikembalikan ke orang tuanya.\r\n\r\nPernyataan tersebut disampaikan Burhanuddin setelah rapat kerja dengan komisi III di gedung DPR kemarin (20/1). Dia menyatakan, pembunuhan itu terjadi karena ZA berusaha membela diri. Namun, ZA tidak dalam keadaan terpaksa penuh. Sebab, kata dia, sebenarnya si begal tidak punya keinginan memerkosa pacar ZA. Namun, ZA kadung membawa senjata tajam. Senjata itulah yang digunakan pelajar tersebut untuk membela diri dan menghabisi korban.\r\n\r\nBurhanuddin menegaskan bahwa kejaksaan tidak menahan ZA. Menurut dia, hari ini ada pembacaan tuntutan dari jaksa penuntut umum (JPU). ’’Tuntutannya juga akan kami kembalikan ke orang tuanya,’’ tegasnya.\r\n\r\nSementara itu, kemarin (20/1) diadakan sidang tertutup di Ruang Sidang Anak Pengadilan Negeri Kepanjen. Agendanya mendengarkan keterangan saksi-saksi. Salah seorang saksi adalah VN, teman perempuan ZA yang berada di lokasi kejadian. Saat ditemui seusai sidang, VN kembali menceritakan peristiwa tersebut. Semua berawal pada 8 September 2019. Saat itu, ZA dan VN selesai menonton konser musik di Stadion Kanjuruhan. Perempuan kelahiran 2002 itu menerangkan, waktu kejadian sekitar pukul 19.00 di ladang tebu, Serangan, Gondanglegi, Malang.\r\n\r\nZA memilih jalur alternatif untuk pulang. Jalur tersebut dianggap lebih cepat lantaran aksesnya lebih enak. Namun, jalan itu sepi. ’’Melewati ladang tebu,’’ katanya. Pada saat itulah mereka dibuntuti empat orang yang mengendarai dua motor. Para pelaku langsung memepet dan memaksa ZA menepikan motornya. Kemudian, pelaku merampas handphone dan motor korban. ’’Handphone Mas ZA sudah diberikan karena diancam,’’ cerita VN. Dua pelaku, yakni Misnan dan Aliwafa, hendak merampas motor ZA. ’’Di situ saya inget betul. Saya juga diancem-ancem mau diperkosa,’’ jelas dia.\r\n\r\nMendengar ancaman pemerkosaan itu, ZA yang semula menurut akhirnya melawan. Dia mengambil pisau dapur yang berada di jok motor. Pisau itu ditusukkan ke Misnan. ZA lalu ganti mengancam Aliwafa. ’’Ndredeg gak keruan, Mas. Aku langsung ambil motornya untuk ditarik ke belakang karena disuruh Mas ZA,’’ jelas VN. Menurut dia, ZA tidak tahu bahwa Misnan akhirnya meninggal dunia. '),
(1255, 'Kata Kemenkominfo Soal Modus Penipuan dengan Penggantian SIM Card', 'TEKNOLOGI', 'DATA LATIH', 'Kementerian Komunikasi dan Informatika (Kemenkominfo) mengajak operator seluler, bank dan masyarakat selaku pengguna untuk lebih waspada dan berhati-hati. Hal tersebut berkaitan dengan modus penipuan registrasi kartu dan menggunakan penggantian Subscriber Identity Module (SIM) atau kartu SIM.\r\n\r\nHal tersebut disampaikan Menkominfo Johnny G.Plate setelah beredar upaya pembobolan rekening Bank melalui pergantian SIM Card yang dialami salah satu pengguna layanan seluler Indosat Ooredoo beberapa waktu lalu. Direktur Jenderal Aplikasi Informatika (Aptika) Kemenkominfo, Semuel Abrijani Pangerapan mengatakan bahwa perlu suatu kehati-hatian dalam melakukan registrasi ataupun pergantian kartu SIM.\r\n\r\n“Kalau kita lihat dari kasus yang teman-teman ketahui, ini adalah suatu rangkaian, tidak bisa satu saja yang bisa menjadi wujud permasalahan,” Semuel dalam Konferensi Pers terkait Pembobolan Rekening Bank melalui Pergantian SIM Card di gedung Kemenkominfo, Jakarta, Rabu (22/01).\r\n\r\nPria yang akrab disapa Semmy itu juga menyebut kasus ini adalah salah satu dari banyak kasus serupa yang mengemuka dan perlu diwaspadai. “Ini adalah pembelajaran bagi kita semua baik bagi operator, bank terkait dan juga masyarakat bahwa di era digital ini makin banyak kegiatan-kegiatan yang bisa mencari kelemahan-kelemahan dari pada sistem yang ada, ini adalah suatu pembelajaran bagi kita dan untuk perbaikan untuk semuanya,” jelasnya.\r\n\r\nLebih lanjut, Semmy menambahkan, Kemenkominfo dan BRTI telah mengeluarkan surat edaran kepada operator seluler untuk kembali mengingatkan lebih berhati-hati dalam menyikapi persoalan yang terjadi.\r\n\r\n“Kami dari Kominfo dan juga dari pihak BRTI sudah mengeluarkan surat edaran untuk mengingatkan kembali kepada Operator untuk selalu berhati-hati, menerapkan kehati-hatian dalam melakukan registrasi apabila terjadi proses pergantian SIM Card yang dibutuhkan oleh konsumennya,” imbuhnya.\r\n\r\nDi wilayah regulasi, katanya, pemerintah juga sebenarnya sudah mempunyai aturan terkait tata kelola registrasi dan pergantian SIM Card, yakni Peraturan Menteri Nomor 12 Tahun 2016 yang sudah diperbaharui menjadi Peraturan Pemerintah Nomor 21 Tahun 2017 terkait registrasi pelanggan jasa telekomunikasi.\r\n\r\nDalam kesempatan yang sama, Komisioner BRTI I Ketut Prihadi Kresna menyatakan kalau pihaknya akan memperketat SOP terkait mekanisme pergantian kartu SIM pascabayar berkaca pada kasus pembobolan rekening bank melalui pergantian kartu SIM.\r\n\r\nKetut menyatakan, BRTI dalam waktu dekat akan melakukan evaluasi bersama operator untuk mekanisme penggantian kartu. “Kalau memang ada celah, bisa tidak dilakukan standarisasi untuk sistem keamanan yang ada. Jadi tidak hanya berdasarkan kepada satu identitas tapi lebih dari satu identitas untuk bisa menutup celah-celah keamanan tadi,” ungkapnya.\r\n\r\nTerkait dengan carut marut registrasi SIM dengan melibatkan data kependudukan berupa KTP atau KK, dirinya tak memungkiri bahwa memang masih banyak kebocoran terkait penggunaan data orang lain. “Kita sudah bicara dengan operator, ini saya minta untuk lebih ketat,” tegasnya.'),
(1256, 'Waduh, Puluhan Ribu Foto Pengguna Tinder Perempuan Dibagikan Tanpa Izin ke Forum Kejahatan Siber', 'TEKNOLOGI', 'DATA LATIH', 'Anda yang bermain aplikasi kencan online sebaiknya berhati-hati. Pasalnya, lebih dari 70 ribu foto perempuan pengguna Tinder dibagikan tanpa izin pada suatu forum kejahatan siber. Hal ini berpotensi merugikan pengguna dalam jangka panjang dalam hal penipuan dan pelanggaran privasi.\r\n\r\nDikutip dari Fox Business (21/1), Aaron DeVera, peneliti di Cybersecurity White Ops mengatakan telah menemukan hampir 16 ribu foto pengguna Tinder di website yang biasa dikenal sebagai trading malware.\r\n\r\n“Data sejenis ini umumnya menarik para penipu, biasa digunakan sebagai koleksi akun palsu untuk meyakinkan korban di platform lain,” ujar DeVera.\r\n\r\n“Stalker atau penguntit biasanya menggunakan cara yang lebih tertarget, dalam upaya untuk menambah koleksi data yang digunakan secara individu,” sambungnya.\r\n\r\nDeVera mengatakan kepada Gizmodo bahwa foto-foto tersebut itu dikaitkan dengan file teks yang berisi sekitar 16.000 ID pengguna Tinder. Untuk sementara, mengubah kata sandi akun dapat menjadi langkah awal untuk melindungi privasi pengguna Tinder.\r\n\r\nLebih lanjut, belum diketahui secara pasti apakah Tinder menginformasikan pengguna yang terkena kejahatan siber ini.'),
(1257, 'Qualcomm Rilis Tiga Chipset Terbaru, Dukung Konektivitas Cepat 4G', 'TEKNOLOGI', 'DATA LATIH', 'Qualcomm Technologies resmi mengumumkan peluncuran tiga mobile platform terbaru yakni Qualcomm Snapdragon 720G, 662, dan 460. Ketiga mobile platform tersebut mendukung konektivitas cepat 4G, menggunakan fitur kunci Wi-Fi 6, dan Bluetooth 5.1. Selain itu terintegrasi dengan teknologi audio Qualcomm FastConnect dan masih banyak lagi.\r\n\r\nVice President, Product Management, Qualcomm Technologies, Inc, Kedar Kondap mengatakan, pengguna ponsel pintar saat ini menginginkan konektivitas yang cepat, tanpa batas, fitur-fitur canggih, dan baterai yang tahan lama. “Perluasan portofolio 4G kami membuat mitra kami dapat menawarkan solusi canggih yang memenuhi permintaan dunia dan memberikan pengalaman gaming yang luar biasa di berbagai lapisan dan segmen harga,” ujarnya dalam keterangan tertulisnya kepada JawaPos.com.\r\n\r\nSelain itu, ketiga chipset tersebut juga menjadi yang pertama kalinya didukung Qualcomm Location Suite yang didukung hingga tujuh satelit secara bersamaan di perangkat seluler. Termasuk di dalamnya penggunaan semua satelit operasi NavIC untuk lokasi yang lebih akurat, penguncian lokasi awal atau TTFF (time-to-first-fix) yang lebih cepat, dan peningkatan layanan berbasis lokasi agar lebih akurat.\r\n\r\nPerangkat berbasis Snapdragon 720G diharapkan tersedia secara komersial pada Q1 2020 dan perangkat berbasis Snapdragon 662 dan 460 diperkirakan akan tersedia secara komersial pada akhir 2020.\r\n\r\nSnapdragon 720G\r\nChipset ini hadir dengan fitur-fitur Qualcomm Snapdragon Elite Gaming, kemampuan fotografi atau video yang ditingkatkan dan kinerja yang diklaim lebih cerdas. Memanfaatkan fitur Snapdragon Elite Gaming dari platform mobile kelas premium, Snapdragon 720G menghadirkan permainan game HDR yang disebut lebih baik dari Qualcomm aptX Adaptive.\r\n\r\nSelain bermain game, konten video HDR dan streaming video super-smooth dengan Qualcomm Spectra 350L ISP (image signal processor) juga diklaim hadir pada chipset ini. User nantinya juga dapat mengambil video 4K atau mengambil foto hingga besaran 192 megapiksel.\r\n\r\nSnapdragon 720G juga menghadirkan Qualcomm AI Engine generasi kelima terbaru dengan Qualcomm Hexagon Tensor Accelerator yang ditingkatkan. Dan, memungkinkan sejumlah pengalaman AI baru untuk gaming, fotografi, voice assistant, dan kesadaran kontekstual yang always on.\r\n\r\nSelain itu, dengan subsistem FastConnect 6200, Snapdragon 720G dapat menggandakan kecepatan dan jangkauan WiFi untuk permainan dan penelusuran website. Chipset 720G juga menghadirkan fitur utama dari WiFi 6 seperti penggunaan antena 8×8 dengan MIMO multi, Target Wake Time untuk efisiensi daya hingga 67 persen, dan rangkaian keamanan WPA3 yang lengkap. Bluetooth 5.1 terintegrasi dengan kemampuan audio canggih.\r\n\r\nUser disebut akan merasakan penghematan daya dan peningkatan kinerja. Hal itu karena proses teknologi 8nm Snapdragon 720G dan arsitektur CPU yang ditingkatkan.\r\n\r\nSnapdragon 662\r\nUntuk pertama kalinya, Snapdragon 662 menghadirkan kemampuan kamera dan AI yang menakjubkan ke seri 600. Dengan menampilkan Qualcomm Spectra 340T terbaru yang mendukung konfigurasi tiga kamera baru dan peralihan yang mulus di antara keduanya.\r\n\r\nISP yang lebih kuat akan mendukung pengambilan foto dalam format HEIF (High Efficiency Image File) untuk kualitas gambar yang menakjubkan dengan ukuran setengahnya. Penambahan pada Qualcomm AI engine generasi ketiga dengan Hexagon Vector Extensions dan Qualcomm Spectra 340T juga disebut akan memberikan pengalaman pengguna berbasis AI seperti avatar, fotografi malam, dan otentikasi wajah serta suara.\r\n\r\nSnapdragon 662 juga dilengkapi Snapdragon X11 LTE modem baru dengan kecepatan unduh hingga 390 Mbps berkat 2-carrier aggregation, 2×2 MIMO dan modulasi 256-QAM, dengan kecepatan unggah hingga 150 Mbps.\r\n\r\nSnapdragon 460\r\nPada seri chipset ekonomis, dikatakan merupakan lompatan besar dalam kinerja pada semua seri 400. Chipset seri 400 digadang-gadang membawa banyak peningkatan dalam segi konektivitas, AI, dan kamera untuk pasar ponsel pintar generasi selanjutnya.\r\n\r\nUntuk pertama kalinya dalam seri 400, Snapdragon 460 menampilkan performa CPU dan arsitektur GPU yang diperbarui. Masing-masing menghasilkan peningkatan hingga 70 persen untuk inti CPU dan 60 persen untuk arsitektur GPU.\r\n\r\nSementara itu, kinerja sistem secara keseluruhan diklaim meningkat dua kali dibandingkan generasi sebelumnya. Prosesor Hexagon dengan Qualcomm Hexagon Vector eXtensions (HVX) juga diperkenalkan ke dalam seri 400 untuk pertama kalinya.\r\n\r\nDilengkapi dengan Qualcomm AI Engine generasi ketiga dan Qualcomm Sensing Hub untuk pengalaman AI baru dalam fotografi dan voice assistance. Qualcomm Spectra 340 ISP juga merupakan salah satu dari banyak tambahan baru pada seri 400. Chipset ini memungkinkan platform untuk mengambil foto yang menakjubkan dan memberi dukungan untuk tiga kamera.\r\n\r\nModem Snapdragon X11 LTE terintegrasi memungkinkan untuk kecepatan unduh hingga 390 Mbps dan mengunggah hingga 150 Mbps.'),
(1258, 'Persaingan Digital Makin Ketat, Open Source Bisa Diandalkan', 'TEKNOLOGI', 'DATA LATIH', 'Ketangguhan software open source tampaknya semakin bisa diandalkan. Bahkan open source dinilai bisa menjadi solusi untuk memenangkan persaingan era digital yang semakin ketat. Selain andal dan aman, software berbasis open source juga menawarkan kebebasan dan keleluasaan ketimbang software berlisensi.\r\n\r\nPT Equnix Business Solutions menemukan bahwa peralihan dari software lisensi berbayar ke open source bisa menghemat setidaknya sekitar 50 persen dari total anggaran IT pada sistem tersebut. “Untuk bisa bersaing, perusahaan harus memiliki infrastruktur TI yang mumpuni karena itulah PostgreSQL hadir sebagai solusi,” ujar Julyanto Sutandang, pakar PostgreSQL sekaligus CEO PT Equnix Business Solutions dalam keterangan tertulisnya, Selasa (21/1).\r\n\r\nMenurut dia, sistem database open source performanya terbukti lebih unggul dibanding sistem database berbayar manapun. “Selain kemandirian berkat lisensi non-komersial berbasiskan open source, PostgreSQL memiliki skalabilitas jauh lebih baik,” katanya.\r\n\r\nSelain itu, tumbuhnya perusahaan startup yang semakin mmenjamur juga dikatakan tak mungkin bisa terjadi jika tanpa peran software open source. “Tak mungkin mereka akan berkembang pesat jika sejak awal mereka sudah terbenani dengan biaya tinggi untuk software. Efisiensi biaya hanya bisa terjadi dengan menggunakan software open source,” uterangnya.\r\n\r\nPerusahaan startup ini, lanjutnya, sudah mulai menggeroti perbankan dan Old Establish Enterprise lainnya. “Revolusi industri modern akan dimulai dari sini. Kita harus mampu berubah dan mendisrupsi diri kita kalau tidak mau dilibas oleh mereka,” sambungnya.\r\n\r\nSementara di sisi perbankan, persaingan yang sangat ketat juga menuntut efisiensi tinggi dan sistem database open source PostgreSQL akan menjadi solusi untuk Database RDBMS. Performanya yang tinggi akan menjadikan perusahaan tidak lagi tergantung pada sistem database komersial. “PostgreSQL adalah raja database untuk sistem transaksional tinggi yang dapat digunakan sebagai alternatif utama dalam dunia bisnis,” jelas Julyanto.\r\n\r\nDiketahui, PostgreSQL diklaim merupakan RDBMS dengan fitur paling lengkap di dunia saat ini dan dinobatkan sebagai RDBMS of the Year 2018 oleh DB-Engine selama dua tahun berturut-turut. Di sisi popularitas, DB-Engines melaporkan bahwa database open source mengalami peningkatan popularitas setiap tahunnya sejak 2013 dan telah menggerus pangsa pasar database komersial. Sekalipun database komersial masih memimpin pasar, tapi database open source menunjukkan tren penguatan untuk menjadi mayoritas dalam tempo 12 hingga 18 bulan mendatang.'),
(1259, 'Wapres Ma\'ruf Amin Dukung Iradiator Gamma', 'TEKNOLOGI', 'DATA LATIH', 'Wakil Presiden (Wapres) Ma’ruf Amin tertarik pada fasilitas iradiator gamma milik Badan Tenaga Nuklir Nasional (Batan). Dengan fasilitas itu, proses pembusukan komoditas seperti sayur, buah, hingga ikan bisa diperlambat. Dia berharap dibangun fasilitas iradiator gamma di sejumlah daerah.\r\n\r\nKetertarikan Ma’ruf itu disampaikan Menristek Bambang Brodjonegoro kemarin (20/1). ’’Pak Wapres sangat tertarik dengan salah satu kegiatan Batan, yaitu melakukan semacam sterilisasi,’’ tuturnya. Setelah proses radiasi di fasilitas iradiator, makanan hasil panen atau olahan ikan yang tadinya cepat busuk bisa menjadi tahan lama.\r\n\r\nSaat ini Batan baru memiliki fasilitas iradiator gamma di kompleks Puspiptek Serpong. Karena hanya ada satu unit, pemanfaatan radiasi sangat sibuk. Setiap hari mereka menerima bahan-bahan dari produsen makanan atau pertanian untuk dilakukan proses radiasi. Tujuannya, produk-produk itu lebih tahan lama dan siap dijual ke berbagai penjuru Indonesia.\r\n\r\n’’Pak Wapres meminta saya mendorong Batan agar menambah peralatan iradiator gamma di berbagai tempat di Indonesia,’’ paparnya.'),
(1260, 'Dibanderol Rp 14,8 Juta, Sebagus Apa Earphones Louis Vuitton?', 'TEKNOLOGI', 'DATA LATIH', 'Brand high-fashion Louis Vuitton kembali bekerja sama dengan Master & Dynamic untuk meluncurkan Horizon Earphones terbaru. Melansir Ubergizmo (20/1), Horizon Earphone baru ini didasarkan pada model MW07 Plus yang akan menawarkan hingga 10 jam waktu mendengarkan.\r\n\r\nEarphone ini juga hadir dengan casing unik yang bisa menambah daya baterai tambahan hingga 20 jam. Artinya, pengguna bisa menggunakan earphone tersebut hingga 30 jam. Earphone ini memiliki beberapa varian warna mencolok, seperti neon kuning dengan logam monogram Louis Vuitton atau desain bunga khas merek tersebut.\r\n\r\nDriver earphone juga memiliki ukuran 10mm, yang bisa digunakan secara independen. Kedua driver tersebut juga telah dilengkapi dengan konektivitas Bluetooth 5.0. Horizon Earphone dilaporkan memiliki mode ambient listening untuk melakukan percakapan langsung, peningkatan active noise cancellation, dan mikrofon yang lebih sensitif untuk fungsi suara serta panggilan telepon.\r\n\r\nSesuai dengan segmen merek mewah, Horizon Earphone ini dibanderol mahal dengan seharga Rp 14,8 juta. Sebelumnya, Louis Vuitton dan Master & Dynamic telah meluncurkan Horizon Earphones yang menggunakan seri MW07 pada tahun lalu. Diketahui, perangkat itu sebelumnya dibanderol sekitar Rp 13,6 juta.\r\n\r\nTampaknya dengan harganya yang cukup mahal, earphone ini akan lebih berguna untuk memenuhi kebutuhan bergaya para konsumennya. Apakah kamu tertarik membeli earphone terbaru dari Louis Vuitton ini?'),
(1261, 'Manjakan Mata, Begini Bocoran Layar Oppo Find X2', 'TEKNOLOGI', 'DATA LATIH', 'Menjelang perilisan Oppo Find X2, kini beredar bocoran terkait layar smartphone tersebut. Dilansir dari GizmoChina (20/1), layar smartphone ini disebut akan memiliki resolusi QHD+ dan kecepatan refresh 120Hz. Menurut Digital Chat Station, layarnya juga akan memiliki resolusi 3168×1440 piksel.\r\n\r\nLayar Oppo Find X2 juga bakal menggunakan panel OLED melengkung yang dibuat oleh Samsung. Kabarnya, layar smartphone ini bakal memiliki ukuran 6,5 inci dan disertai lubang pada sudut kiri atas layar untuk menempatkan kamera selfie. Sementara itu, kombinasi dari resolusi QHD+ dan kecepatan refresh 120Hz tentu akan memengaruhi masa pakai baterainya.\r\n\r\nPada bulan lalu, Wakil Presiden Oppo, Brian Shen juga telah mengungkapkan bahwa Find X2 akan membawa sejumlah peningkatan pada layar dibandingkan pendahulunya. Tampaknya, kita masih harus bersabar menunggu beberapa waktu lagi, untuk mendapat bocoran lebih banyak mengenai smartphone tersebut.\r\n\r\nOppo Find X2 juga telah dikabarkan memiliki prosesor Qualcomm Snapdragon 865 dan modem Snapdragon X55 untuk dukungan jaringan 5G. Sebelumnya, telah muncul gambar paten untuk desain unik kamera belakang Oppo Find X2 dengan susunan kamera berbentuk siklus bulan.\r\n\r\nDalam render paten 3D tersebut, terlihat bahwa kamera belakangnya disusun membentuk cekungan dari kiri ke kanan. Di bagian atas susunan kamera tersebut juga terdapat sebuah lingkaran di atas susunan kamera tersebut akan memiliki fungsi khusus atau tidak. Kamera belakangnya juga berjumlah tiga buah, dengan LED Flash yang berada di paling kiri.'),
(1262, 'Dulu Dianggap Alay, TikTok Kini Lampaui Instagram dan Facebook', 'TEKNOLOGI', 'DATA LATIH', 'Aplikasi TikTok yang dulu dianggap sebagai aplikasi alay kini berubah menjadi populer. Aplikasi yang memunculkan nama Bowo Alpenliebe itu kini berhasil mengalahkan bahkan Facebook, Instagram, dan YouTube untuk angka unduhan sepanjang 2019.\r\n\r\nData tersebut diungkapkan oleh firma riset SensorTower. Sebagaimana dikutip JawaPos.com dari laman resminya, Minggu (19/1), pada 2019 lalu dikatakan membuahkan hasil bagi pengembang aplikasi. Selama 12 bulan terakhir, unduhan tumbuh 9,1 persen menjadi 114,9 miliar dengan 30,6 miliar di antaranya di App Store dan 84,3 miliar dari Google Play.\r\n\r\nWhatsApp, Facebook, Messenger, dan Instagram masih menduduki empat dari 5 tempat teratas. Namun kali ini, TikTok melonjak dari posisi keempat pada 2018 ke tempat kedua sepanjang 2019 karena popularitasnya di pasar seperti India, Amerika Serikat, dan Brasil.\r\n\r\nLaporan ini memberikan perhatian khusus pada Q4 2019, yaitu antara 1 Oktober dan 31 Desember 2019. Aplikasi lain selama periode itu seperti Call of Duty adalah game yang paling diinginkan, dengan lebih dari 180 juta unduhan. Game yang berada di posisi kedua Sand Balls mendapat separuh dari perolehan Call of Duty.\r\nIlustrasi: SensorTower ungkap TikTok jadi aplikasi paling banyak diunduh sepanjang tahun 2019. (SensorTower).\r\n\r\nPendapatan dari TikTok juga diungkapkan tumbuh 540 persen per tahun. Pengguna terbanyak dari TikTok tetap sebagian besar berasal dari Tiongkok dengan mereka juga setia melakukan pembelian dalam aplikasi atau In App Purchasing.\r\n\r\nTikTok yang namanya kian populer pada 2019 juga dikatakan memiliki pendapatan hingga USD 40 juta atau sekitar Rp 545,9 miliar. Pendapatan ini tercatat hingga Desember 2019, menempatkan aplikasi besutan ByteDance ini berada di posisi ke 7 sebagai aplikasi dengan pendapatan tertinggi dari kategori non-game.\r\n\r\nMasih dari SensorTower, aplikasi video sosial TikTok adalah aplikasi non-game keempat yang paling banyak diunduh di dunia selama 2019 lalu dengan angka unduhan mencapai 655,8 juta pemasangan.\r\n\r\nAplikasi non-game ketiga yang paling banyak diunduh tahun ini berada di atas TikTok adalah WhatsApp di posisi nomor 1 dengan 707,4 juta pemasangan dan Messenger di nomor dua dengan 636,2 juta unduhan. Facebook berada di nomor empat dengan 587 juta unduhan dan Instagram di nomor lima dengan 376,2 juta unduhan.\r\n\r\nRamai Di Tanah Air\r\n\r\nKepopuleran TikTok juga kian terasa di tanah air. Bahkan kini, di feed Instagram ramai ditemui video-video pendek TikTok oleh selebritas tanah air.\r\n\r\nSelebriti papan atas pun kini mulai banyak yang menggunakan TikTok. Kebanyakan video yang mereka tampilkan adalah dance cover dengan potongan lagu pendek.\r\n\r\nDian Sastrowardoyo, Gisella Anastasia, Marion Zola, Vanessa Angel Agnez Mo dan bahkan artis senior Slamet Rahardjo adalah sedikit dari para pelaku seni tanah air yang mulai bermain TikTok. Tak hanya itu, pengacara kondang di tanah air Hotman Paris Hutapea juga baru-baru ini kedapatan bermain TikTok dengan meniru gerakan dance yang tengah populer. '),
(1263, 'Adu Teknis Realme 5i Vs Redmi Note 8, Siapa Lebih Unggul?', 'TEKNOLOGI', 'DATA LATIH', 'Beberapa hari lalu, Realme meluncurkan Realme 5i, varian paling murah di antara keluarga Realme 5 Series lainnya yang sudah hadir lebih dulu. Perangkat dijual dengan harga yang terbilang sangat terjangkau. Hal tersebut merujuk kepada spesifikasi jeroan Realme 5i yang ditopang oleh System on Chip (SoC) Qualcomm Snapdragon 665.\r\n\r\nMenariknya, perangkat dengan jeroan yang sama dari kompetitor Realme 5i adalah Redmi Note 8 (reguler). Redmi Note 8 juga menjadi device yang terang-terangan diadu spesifikasinya oleh Realme Indonesia kala peluncuran Realme 5i pada Rabu (15/1) lalu.\r\n\r\nHandset tersebut hadir lebih dulu dari Realme 5i dengan tawaran harga yang sedikit lebih mahal dari Realme 5i. Oleh karenanya, JawaPos.com ingin mengadu teknis keduanya. Realme 5i vs Redmi Note 8, tawaram chipset yang sama dengan rentang harga berbeda.\r\n\r\nPerforma dan Dapur Pacu\r\n\r\nPertama, mengawali langkah yang paling penting pada adu teknis kali ini yakni sektor jeroan. Kami akan mulai dari urusan jeroan atau dapur pacu lengkap dengan performanya. Sebagai permulaan, kami memulai lebih dahulu dari Realme 5i sebagai perangkat yang paling anyar baru kemudian Redmi Note 8.\r\n\r\nDari sektor dapur pacu, Realme 5i membawa bekal prosesor bikinan Qualcomm, yakni Snapdragon Snapdragon 665 AIE atau Artificial Intelligence Engine. Sebagai informasi, perangkat dengan jargon Quad Camera Battery King ini hadir dengan Snapdragon 665 yang diproduksi dalam fabrikasi 11 nm dan arsitektur delapan inti Kryo.\r\n\r\nMasih untuk urusan performa, chipset Qualcomm Snapdragon 665 AIE membawa detail performa Octa-core (4×2.0 GHz Kryo 260 Gold & 4×1.8 GHz Kryo 260 Silver). Mendukung keandalan perangkat, Realme 5i dilengkapi pula GPU Adreno 610 untuk menjamin kinerja grafis yang lancar.\r\n\r\nMendukung keandalan performa, handset ini hadir dengan pilihan RAM/ROM 3/32 GB, 4/64 GB, dan 4/128 GB. Tenang, jika memori internalnya kurang, kamu bisa menambahkan penyimpanannya menggunakan MicroSD hingga 256 GB. Urusan kantong, perangkat ini ditawarkan dengan harga masing-masing varian, yakni Rp 1,7 jutaan, Rp 1,9 jutaan, dan Rp 2,2 jutaan untuk varian RAM/ROM 3/32 GB, 4/64 GB, dan 4/128 GB.\r\n\r\nBeralih ke produk selanjutnya, yakni Redmi Note 8. Handset yang resmi melenggang di Indonesia pada 18 Oktober lalu ini datang dalam tiga varian penyimpanan RAM/ROM juga. Redmi Note 8 ditawarkan dengan harga mulai Rp 1,9 jutaan untuk varian RAM/ROM 3/32 GB. Kemudian banderol Rp 2,1 jutaan untuk model 4/64 GB, dan Rp 2,7 jutaan untuk model paling tinggi dengan RAM/ROM 6/128 GB.\r\n\r\nDari sektor performa dan dapur pacunya, di atas kertas, Realme 5i dengan Redmi Note 8 tampak imbang. Keduanya ditawarkan dengan jeroan yang sama dengan kemampuan yang sama, yakni Snapdragon 665 AIE dengan proses fabrikasi 11 nm dan arsitektur delapan inti Kryo.\r\nSmartphone Xiaomi Redmi Note 8 Pro. (Rian Alfianto/JawaPos.com)\r\n\r\nLayar dan Desain\r\n\r\nAspek kedua, yang juga kami bandingkan antara Realme 5i dengan Redmi Note 8 adalah layar dan desain. Dari segi layar, keduanya terdapat kesamaan. Keduanya sama-sama mengusung layar bertakik atau notch berbentuk serupa huruf V dengan gaya tetesan air di ujung tengah bagian atas layarnya sebagai rumah dari kamera selfie-nya.\r\n\r\nDimulai dari Realme 5i, perangkat yang bersangkutan hadir dengan layar water drop notch 6,5 inci yang menyajikan rasio screen-to-body sebesar 89 persen yang menghasilkan tampilan lebar. Layar Realme 5 memiliki aspek rasio 20:9 dengan resolusi HD Plus dengan 1.600 x 720 piksel.\r\n\r\nMasih di bagian layar, material layar Realme 5i masih sama dengan Realme Series sebelumnya, yakni IPS LCD capacitive touchscreen 16 M colors. Secara garis besar, layarnya terbilang tajam dan terang dengan kemampuan menangkal sinar matahari yang baik dan cukup cerah.\r\n\r\nBeralih ke Redmi Note 8, handset tersebut kurang lebih sama dengan Realme 5i untuk sektor layar, yakni melenggang dengan layar IPS LCD 16 M colors. Bedanya terletak pada ukurannya yakni hanya 6,3 inci saja sementara Realme 5i memiliki ukuran yang sedikit lebih luas sebesar 6,5 inci. Dari sektor layar, keduanya juga sama-sama bisa tampil baik.\r\n\r\nBergeser ke bagian belakang, kedua perangkat yang kami bandingkan juga sama-sama hadir dengan desain kekinian yang kinclong. Namun untuk urusan desain, Realme 5i tampak lebih segar jika kini dibandingkan dengan Redmi Note 8.\r\n\r\nRealme 5i di bagian belakang hadir dengan sentuhan warna baru yang unik. Finishing-nya tetap berkilauan tetapi tidak mengkilap seperti kaca. Hal ini kami suka, perangkat jadi terkesan taft alias gagah, rigid di genggaman tangan, dan tentunya tidak mudah tergores.\r\n\r\nSementara untuk Redmi Note 8, kendati sama kinclongnya, sayang bagian desain di belakang perangkat masih berkilauan. Cenderung pasaran. Untuk kasus ini memang agak subjektif, suka-sukaan. Tinggal pilih mana desain yang kamu suka.\r\n\r\nDari sektor desain, utamanya layar, menurut kami, Realme 5i lebih unggul ketimbang Redmi Note 8. Hal itu terlihat dari ukurannya. Redmi Note 8 hanya membawa layar berukuran 6,3 inci sementara Realme 5i hadir dengan bentang 6,5 inci. Buat yang suka layar lega, Realme 5i tentu lebih menarik.\r\n\r\nKamera\r\n\r\nFaktor selanjutnya yang tidak kalah penting dalam pertimbangan konsumen mana kala membeli smartphone baru saat ini adalah urusan fotografi atau kamera. Meski hadir menyasar segmen dan target market yang sama yakni segmen ekonomis, Realme 5i hadir dengan ukuran kamera yang lebih kecil ketimbang Redmi Note 8 yakni pada sektor kamera utama.\r\n\r\nRealme 5i seperti juga sudah kami ulas sebelumnya, handset tersebut hadir dengan empat kamera di bagian belakang. Angka-angka kamera Realme 5 sendiri yang disebut sebagai AI quad camera masing-masing berukuran 12 MP PDAF f/1.8, 8 MP wide angle f/2.25, lensa makro 2 MP f/2.4, dan lensa depth sensor 2 MP. Berada di bagian depan, Realme 5i disematkan kamera depan 8 MP dengan aperture f/2.0.\r\n\r\nBeralih ke Redmi Note 8, handset tersebut unggul ketimbang Realme 5i kalau bicara angka ‘MP’. Rincian kamera Redmi Note 8 untuk kamera belakangnya masing-masing mempunyai sensor 48 MP f/1.8 wide, 8 MP f/2.2 16 mm (ultrawide), 2 MP f/2.4 macro, dan 2 MP f/2.4 sensor kedalaman. Jika Realme 5i hanya hadir dengan kamera selfie 8 MP, Redmi Note 8 hadir dengan kamera selfie 13 MP f/2.0.\r\n\r\nDari aspek kamera, kedua perangkat memang membawa keunggulan dan kekurangan masing-masing. Redmi Note 8 misalnya, unggul dari segi ukuran. Namun begitu Realme 5i juga tak boleh dianggap remeh. Perangkat tersebut kini hadir sebagai smartphone dengan fitur quad camera termurah di pasaran.\r\n\r\nJawabannya siapa yang lebih unggul? Tergantung, kamu mau menang angka MP dengan sedikit lebih mahal, atau jumlah kamera sama yang dapat ditebus dengan budget yang minim? Sesuaikan sendiri.\r\nPerbandingan spesifikasi Redmi Note 8 vs Realme 5i. (Rian Alfianto/JawaPos.com)\r\n\r\nBaterai, Security, dan Harga\r\n\r\nPerbandingan terakhir yang ingin JawaPos.com ulik adalah dari segi baterai, fitur keamanan (security), dan apalagi kalau bukan urusan kantong. Kalau Realme 5i kalah di sektor kamera ketimbang Redmi Note 8, di sisi baterai tidak demikian.\r\n\r\nRealme 5i hadir dengan batera besar berukuran 5.000 mAh, sementara Redmi Note 8 hanya 4.000 mAh saja. Dengan baterai segitu, user tentu leluasa menggunakan perangkat untuk beragam kebutuhan tanpa takut kehabisan daya sepanjang hari. Tren baterai besar sendiri dimulai awal 2019 dengan kehadiran Samsung Galaxy M Series dan Asus Zenfone Max Pro M2.\r\n\r\nMenyuplai daya baterai yang besar, handset Realme 5i dibekali sistem pengisian daya 10 W. Dalam paket pembelian juga tersedia 5V2A adapter charger.\r\n\r\nSementara untuk keamanannya, Realme 5i hadir dengan fitur yang terbilang komplet. Sebut saja fitur face unlock dan fitur keamanan biometrik seperti fingerprint scanner hadir pada perangkat ini. Sistem keamanan tersebut merupakan pelengkap dari yang sudah ada seperti nomor sandi dan pola.\r\n\r\nFitur face unlock-nya cepat dibandingkan dengan metode unlock lainnya. Begitu pun fingerprint-nya yang multifungsi ini dapat membuka Realme 5i dengan sangat cepat. Fitur keamanan fingerprint di Realme 5i juga memiliki medan sentuh yang terbilang luas dan sensitif di keseluruhan areanya.\r\n\r\nDari segi harga, perangkat terbilang hadir dengan banderol yang sangat kompetitif melihat segmen yang ditujunya dan lawan-lawannya di pasaran. Realme 5i di pasaran ditawarkan dengan tiga pilihan harga sesuai dengan kapasitas penyimpanan RAM/ROM, yakni Rp 1,7 jutaan, Rp 1,9 jutaan, dan Rp 2,2 jutaan untuk varian RAM/ROM 3/32 GB, 4/64 GB, dan 4/128 GB.\r\n\r\nTerakhir untuk Redmi Note 8. Urusan daya baterai, seperti sudah disinggung di atas, perangkat ini hadir dengan baterai yang tak sebesar Realme 5i. Ukurannya hanya 4.000 mAh saja.\r\n\r\nSama seperti Realme 5i, aspek selanjutnya yang mana adalah aspek keamanan. Redmi Note 8 juga hadir dengan sistem keamanan yang sama dengan Realme 5i. Sistem keamanan dimaksud adalah pilihan keamanan standard seperti PIN dan pola. Sementara untuk fitur keamanan biometrik, perangkat ditambahkan dengan fitur face ID dan fingerprint yang terletak di bagian layar atau under display fingerprint scanner.\r\n\r\nSementara untuk urusan kantong, Redmi Note 8 di Indonesia seperti sudah diulas di atas, handset ini hanya melenggang dengan harga mulai Rp 1,9 jutaan untuk varian RAM/ROM 3/32 GB. Kemudian banderol Rp 2,1 jutaan untuk model 4/64 GB dan Rp 2,7 jutaan untuk model paling tinggi dengan RAM/ROM 6/128 GB.\r\n\r\nAtas adu teknis kedua perangkat Realme 5i dan Redmi Note 8 tersebut, apakah sudah ada gambaran perangkat mana yang akan kamu pilih jika berencana meminang dua pilihan smartphone tersebut? Semua memiliki keunggulan dan kekurangan masing-masing. Sesuaikan saja dengan kebutuhan dan keuangan kamu.'),
(1264, 'Spirit Pendidikan Karakter dalam Perayaan Natal di ITN Malang', 'PENDIDIKAN', 'DATA LATIH', 'Suasana bahagia terpancar dari Aula Kampus 1 ITN (Institut Teknologi Nasional) Malang, Selasa (21/1). Di tempat itu, civitas akademika ITN, khususnya yang beragama Nasrani menggelar perayaan Natal.\r\n\r\nKali ini, perayaan Natal mengangkat tema ‘Hiduplah sebagai Sahabat’. Tema ini diambil dari kitab Yohanes ayat 14-15.\r\n\r\nEvent ini tak hanya melibatkan dosen, dan mahasiswa, tapi juga staf. Hadir pula Ketua P2PUN (Perkumpulan Pengelola Pendidikan Umum dan Teknologi Nasional) Ir Kartiko Ardi Widodo.\r\n\r\nRektor ITN Dr Ir kustamar, MT berharap, perayaan ini bisa mendorong pengembangan karakter di kampus ITN. Juga meningkatkan kerukunan dan nilai kebangsaan antar seasama. “Saya berharap kita dapat kompak mengembangkan karakter kita dan meningkatkan kerukunan dan kebangsaan diantara kita,” ujarnya.\r\n\r\nSementara itu, Ketua Panitia Acara Dortauli Situmeang SSos mengatakan, yang istiewa dari perayaan kali ini adalah hadirnya para purna atau pensiunan ITN. Baik dosen maupun staf.\r\n\r\nPihak kampus senagaja mengundang mereka agar tali persaudaraan tetap terjaga. Sebagai cinderamata, kampus memberikan karikatur kepada mereka. “Mereka masih bagian dari keluarga ITN,” kata dia.');
INSERT INTO `sa_berita` (`id_berita`, `judul_berita`, `kategori_berita`, `jenis_data`, `isi_berita`) VALUES
(1265, 'Jangan Asal, Perhatikan 4 Hal Saat Siapkan Dana Pendidikan Anak', 'PENDIDIKAN', 'DATA LATIH', 'Sebagai orangtua, Anda pasti ingin memberikan segala hal yang terbaik bagi anak. Salah satu kebutuhan yang wajib diberikan kepada anak adalah pendidikan. Saat mulai menginjak usia 4 tahun, kebutuhan pendidikan bagi buah hati harus Anda siapkan dengan baik.\r\n\r\nKeperluan untuk mengenyam ilmu itu pun harus Anda berikan setidaknya hingga anak lulus SMA. Sudah dapat dibayangkan berapa banyak biaya yang harus dikucurkan demi memenuhi kebutuhan tersebut.\r\n\r\nBelum lagi jika Anda menginginkan tingkat pendidikan lebih tinggi bagi anak. Perguruan tinggi bisa menghabiskan dana hingga ratusan juta rupiah jika jurusan yang diambil cukup bergengsi.\r\n\r\nDengan tingginya biaya pendidikan yang harus disiapkan, menabung untuk kebutuhan\r\ntersebut tentu hendaknya Anda lakukan sejak dini. Perkiraan untuk dana pendidikan yang diperlukan juga sudah harus diperhitungkan dengan matang agar kegiatan menabung bisa dilakukan secara terencana.\r\n\r\nMenghitung dana pendidikan tentu membutuhkan banyak pertimbangan tentang apa saja yang diperlukan sang anak saat memilih edukasi yang bakal ditempuh. Dengan mempunyai perencanaan yang matang tentang pendidikan, biaya yang perlu disisihkan juga menjadi lebih jelas.\r\n\r\nOleh karena itu, dalam menyiapkan biaya pendidikan yang dibutuhkan anak, hendaknya Anda mempertimbangkan dengan baik. Bila saat ini Anda tengah menyiapkan dana pendidikan anak, sebaiknya perhatikan hal ini dulu seperti dikutip dari Cermati.com, Senin (20/1).\r\n\r\n1. Ketahui Alur Pendidikan yang Diinginkan\r\n\r\nMenentukan alur pendidikan yang bakal dijalani anak dapat memberikan gambaran tentang nominal biaya yang harus Anda siapkan. Meski perhitungannya tidak bisa didapatkan secara akurat, setidaknya Anda dapat membuat skala pada perkiraan dana yang dibutuhkan untuk memenuhi pendidikan tersebut.\r\n\r\nPastinya, saat Anda ingin buah hati mendapatkan gelar S1 atau bahkan S2, biaya yang harus disiapkan juga cukup tinggi. Dengan begitu, perencanaan anggaran juga harus Anda lakukan dengan matang.\r\n\r\nSelain itu, beberapa hal yang lebih kecil seperti, lokasi sekolah dan pemilihan antara sekolah negeri atau swasta juga akan memengaruhi total dana yang dibutuhkan dana. Bahkan, pemilihan jurusan juga memiliki keperluan yang berbeda pula saat di sekolah.\r\n\r\nJadi, rencanakan terlebih dahulu alur pendidikan anak Anda agar gambaran pengeluaran bisa didapatkan. Bila perlu, tanyakan pada relasi Anda yang memiliki anak dalam usia sekolah perihal kebutuhan yang harus disiapkan dalam memberikan fasilitas pendidikan yang memadai.\r\n\r\n2. Perhitungkan Kenaikan Biaya Pendidikan di Masa Depan\r\n\r\nBukan rahasia umum bahwa biaya pendidikan akan selalu meningkat setiap tahunnya. Terlebih lagi untuk sekolah swasta. Karena tidak mendapat subsidi pemerintah, kenaikan tarif di sekolah swasta bisa sangat signifikan per tahunnya.\r\n\r\nInflasi pada biaya pendidikan memang lumrah terjadi. Tak jarang pula kenaikan biaya pendidikan jauh lebih tinggi ketimbang kenaikan harga kebutuhan pokok. Dengan alasan tersebut, hendaknya Anda memperkirakan tingkat inflasi pada sekolah yang ingin dituju.\r\n\r\nMenanyakan kepada pihak sekolah secara langsung mengenai aturan inflasi biaya juga bukan hal yang dilarang. Dengan begitu, perkiraan kenaikan biaya pendidikan yang Anda inginkan akan menjadi lebih akurat.\r\n\r\n3. Tentukan Durasi Menabung untuk Biaya Pendidikan\r\n\r\nSetelah mengetahui biaya pendidikan dan tingkat inflasi yang mungkin terjadi, gambaran tentang banyaknya dana yang harus Anda kumpulkan tentu menjadi lebih jelas. Dengan begitu, merencanakan lama waktu menabung bisa Anda hitung dengan seksama.\r\n\r\nMemulai menabung untuk biaya pendidikan memang hendaknya Anda lakukan sejak dini. Dengan begitu, kondisi keuangan Anda nantinya akan menjadi lebih siap dalam memenuhi kebutuhan pendidikan anak.\r\n\r\nBiasanya, biaya pendidikan yang wajib Anda lunasi dengan segera adalah uang pangkal. Dalam memenuhi kewajiban tersebut, Anda dapat mencicilnya dengan cara menabung biasa atau dengan berinvestasi.\r\n\r\n4. Pertimbangkan Jenis Investasi yang Bisa Dipilih\r\n\r\nJika masa mengenyam pendidikan anak masih lama, mengumpulkan dana dengan cara berinvestasi adalah cara terbaik yang bisa Anda pilih. Secara umum, ada 4 jenis investasi yang bisa Anda pilih, yaitu, investasi logam mulia, Surat Utang Negara, reksa dana, dan saham.\r\n\r\nJika lama waktu menyiapkan dana pendidikan anak lebih dari 5 tahun, Anda bebas memilih satu dari 4 instrumen investasi tersebut. Namun, jika durasi persiapan kurang dari 3 tahun ,sebaiknya Anda memilih jenis investasi logam mulia atau Surat Utang Negara, karena investasi tersebut bisa diperjualbelikan saat dibutuhkan.'),
(1266, 'Berkat Kampung Heritage Kayutangan, Prof Lalu Mulyadi Jadi Profesor ITN Malang', 'PENDIDIKAN', 'DATA LATIH', 'Tahun lalu, Wali Kota Malang Sutiaji menetapkan kawasan kayutangan sebagai Ibukota Heritage Malang Raya. Sebelum pencanangan itu, Dosen ITN (Institut Teknologi Nasional) Malang Prof Dr Ir Lalu Mulyadi telah melakukan riset di kawasan tersebut.\r\n\r\nRiset itu dia tuangkan dalam paper ‘Arsitektur Kota Berkelanjutan Berbasis Kearifan Lokal’.\r\n\r\nProfesor bidang ilmu arsitektur ini menjelaskan 3 tujuan utama arsitektur kota. Yakni aspek kenyamanan, aspek kekuatan atau kekokohan dan terakhir aspek keindahan.\r\n\r\n“Jika dikaitkan dengan pembangunan berwawasan identitas, fungsi dan peran arsitektur kota menjadi signifikan dalam menjaga warisan budaya yang tercermin,” ujar Lalu saat orasi.\r\n\r\nBersamaan dengan pengukuhannya, ia juga meluncurkan buku yang digarap bersama dua dosen ITN Malang lainnya. Buku yang berjudul ‘Potensi Kampung Heritage Kayutangan Sebagai Destinasi Wisata di Kota Malang’ itu merupakan wujud dari penelitiannya.\r\n\r\nDi buku tersebut dijabarkan bahwa selain arsitekturnya yang khas, Kayutangan juga mencerminkan wajah kota. Seperti gereja dan masjid yang bersanding, toko buku, toko eskrim, sampai hotel dengan bangunan kunonya.\r\n\r\nOleh karena itu ia mengusulkan agar ada konsep ulang untuk bisnis yang ada di lingkungan sekitar Kayutangan. Bersamaan dengan itu pun promosinya harus melaju kencang seperti Malioboro di Yogyakarta. Termasuk jalur pedestrian yang perlu pembenahan.\r\n\r\n“Pesan untuk pemerintah keraifan lokal itu sebagai suatu eleman yang menunjang untuk kenyamanan bagi yang tinggal di sana. Ibaratnya rumah bagaimana rumah itu bisa nyaman ditinggali meski dijujuk banyak wisatawan,” bebernya.\r\n\r\nSementara itu, Rektor ITN Malang, Dr Ir Kustamar MT mengatakan bahwa Prof Lalu merupakan profesor ke 5 ITN Malang dan sekaligus profesor aktif kedua. Ia menargetkan tahun ini ada 3-4 guru besar baru di ITN Malang.\r\n\r\n“Insya Allah nambah jadi 3 atau 4. Para dosen ini sekarang sedang berproses. Ya semoga saja sampai akbir 2020 mencapai target.\r\n\r\nDalam pengukuhan itu hadir pula Kepala Lembaga Layanan Pendidikan Tinggi (LL Dikti) wilayah VII Jawa Timur, Prof Dr Ir Suprapto DEA. “Hebat sekali ITN Malang ini. Memang di 2020 ini saya targetkan universitas swasta meencetak minimal 25 guru besar,” ujar dia.'),
(1267, 'Wakil Wali Kota Malang Bangga Jadi Alumni SMPN 6 Malang', 'PENDIDIKAN', 'DATA LATIH', 'Acara puncak peringatan HUT ke-60 SMPN 6 Malang, Sabtu (18/1) berlangsung meriah. Apalagi dengan hadirnya Wakil Wali Kota Malang Sofyan Edi Jarwoko.\r\n\r\nEdi hadir tidak hanya dalam kapasitasnya sebagai wakil wali kota. Tapi juga sebagai alumni.\r\n\r\nYa, Edi tercatat sebagai alumni SMPN 6 Malang angkatan 1983.\r\n\r\n“Saya sangat senang bisa datang ke almamater sekolah saya ini. Semoga di hari jadi yang k-60 tahun ini, SMPN 6 Malang semakin rajin mengukir prestasi. Yang jelas saya bangga menjadi alumninya, selamat ulang tahun,” kata Edi saat memberi sambutan.\r\n\r\nUsai memberikan sambutan, Edi menyerahkan secara simbolis bantuan pendidikan yang dihimpun dari para alumni. Bantuan itu berupa uang tunai senilai Rp 11,4 juta yang diberikan kepada 152 siswa kurang mampu.\r\n\r\n“Semoga bantuan ini bermanfaat dan bisa digunakan sebaik-baiknya. Dan jangan lupa untuk terus belajar dan mengembangkan diri,” sambung politisi Partai Golkar tersebut\r\n\r\nSetelah itu, Edi berdiri di dekat pagar SMPN 6 Malang sambil membawa bendera start. Dia pun lantas mengangkat bendera itu sebagai tanda dimulainya jalan sehat. “Hati-hati di jalan, utamakan keselamatan,” kata pria 52 tahun ini.\r\n\r\nSebelum meninggalkan lokasi, Edi juga sempat mengelilingi stan bazar. Ada 17 stan dari wali murid, 1 stan alumni, dan 10 stan sponsor. Stan-stan itu menjual berbagai macam makanan, souvenir alumni sampai menjual frame kacamata.\r\n\r\nDi tengahnya terlihat panggung berdiri yang diisi pentas seni dari para siswa. Ada penampilan tari, band, hingga pembagian doorprize menarik. Para siswa pun terlihat asik meramaikan acara sambil mengunyah kudapan bazarnya\r\n\r\nDisela-sela gelaran ini hadir pula Direktur Jawa Pos Radar Malang, Kurniawan Muhammad dan Kepala Dinas Pendidikan Kota Malang, Dra Zubaidah. “Hari ini harus lebih baik dari kemarin, hari esok harus lebih baik dari sekarang,” kata Zubaidah.\r\n\r\nSementara itu, Kepala SMPN 6 Malang Risna Widyawati, SPd berharap prestasi sekolah yang ia pimpin semakin meningkat dan kolaborasi dengan berbagai pihak semakin luas. “Saya sampaikan juga terima kasih kepada alumni yang sudah membantu menggelar acara semeriah ini,” tuturnya.'),
(1268, 'Semarak HUT ke-60 SMPN 6 Malang, Mulai dari Alumni Mengajar, hingga Bagi-Bagi Sembako', 'PENDIDIKAN', 'DATA LATIH', 'SMPN 6 Malang genap berusia 60 tahun pada 15 Januari lalu. Sebagai bagian dari peringatan hari jadinya, SMPN 6 Malang menggelar sejumlah acara, Jumat (17/1) dan Sabtu (18/1).\r\n\r\nMengusung tema ‘Ukir Prestasi jadi Prasasti’, acara HUT melibatkan Ika Spenmal (Ikatan Alumni SMPN 6 Malang). Di antaranya, para alumni menjadi pengajar pada program alumni mengajar.\r\n\r\n“Mulai angkatan 1965 semuanya terlibat. Mereka bukan mengajar pelajaran tapi lebih kepada motivasi. Ada 24 kelas.  Yang diajar kelas 7-8,” ujar Kepala SMPN 6 Malang Risna Widyawati, S.Pd.\r\n\r\nSelain itu digelar pula tasyakuran, istigosah dan pembagian sembako gratis. Sebanayk 151 paket sembako didistribusikan siswa ke daerah di sekitar SMPN 6 Malang. Terutama di Kelurahan Bareng.\r\n\r\n“Isinya ada beras, minyak, kecap, dan masih banyak lagi. Ini juga bagian dari sumbangan alumni untuk kami,” imbuhnya.\r\n\r\nAdapun hari ini, alumni juga menghimpun dana untuk sumbangan pendidikan bagi siswa yang kurang mampu. Totalnya senilai Rp 11,4 juta untuk 152 siswa dan diberikan secara simbolis oleh Wakil wali Kota Malang, Sofyan Edi Jarwoko selaku alumni SMPN 6 Malang tahun 1983.\r\n\r\nDi kemeriahan acara jalan sehat dan bazar hari ini pun alumni juga menggeber sembako murah. Menjual beragam bahan pokok seperti beras sampai minyak dengan harga yang lebih murah dari harga pasaran. “Ini juga berkat alumni lho,” timpalnya.\r\n\r\nSementara Ketua IKA Spenmal, Sugiyono mengatakan bahwa sejak 10 tahun terakhir memang alumni selalu aktif memeriahkan hari jadi SMPN 6 Malang. Pria yang akrab disapa Yangkung ini merinci untuk acara tersebut, para alumni mengumpulkan data kurang lebih Rp 15 juta.\r\n\r\n“Ini lebih banyak, tahun kemarin hanya Rp 2 juta. Uangnya kami serahkan pada panitia semua terserah dibuat konten acara apa. Yang penting kami ingin acara ini meriah dan bisa menimbulkan kesan,” ungkap alumni SMPN 6 tahun 1973 itu.\r\n\r\nIa berharap momen ulang tahun tak hanya menjadi selebrasi, tapi juga saat-saat mengingat sejarah. “Disini tempat mengingat, mengenang kembali dedikasi SMPN 6 Malang, dari gurunya, staffnya. Semoga SMPN 6 semakin berprestasi,” imbuh dia.'),
(1269, 'Beasiswa S2 ke Kampus Ternama di Jepang, Mau?', 'PENDIDIKAN', 'DATA LATIH', 'Kabar gembira bagi pemburu beasiswa. Ajinomoto Indonesia kembali memberikan program pascasarjana bagi para lulusan sarjana di Tanah Air. Tahun ini, melalui Ajinomoto Foundation membuka peluang generasi muda untuk melanjutkan studi ke tujuh kampus ternama di Jepang.\r\n\r\n“Yakni, Universitas Tokyo, Universitas Kyoto, Universitas Ochanomizu, Kagawa Nutrition University, Universitas Nagoya, Universitas Waseda, dan Institut Teknologi Tokyo,” beber Manajer Hubungan Masyarakat Ajinomoto Indonesia Indra Nurcahyo. Beasiswa yang ditawarkan khusus untuk program master (S2) bidang ilmu gizi dan teknologi pangan.\r\n\r\nProgram beasiswa Ajinomoto Post-Graduate Scholarship, kata Indra, sudah dilaksanakan sejak 2010. Setiap tahunnya diberikan hanya untuk satu orang. “Ini beasiswa penuh ditanggung Ajinomoto Indonesia,” jelasnya.\r\n\r\nTahun 2019, Akrim Said menjadi orang yang beruntung meraih beasiswa tersebut. Pria 26 tahun tersebut lulusan Institut Pertanian Bogor. Kini, dia sedang menjalani studi di Kagawa Nutrition University.\r\n\r\n“Saya sangat bersyukur terpilih menjadi salah satu penerima beasiswa Ajinomoto. Seleksi dan persaingan mendapatkannya cukup ketat. Mengingat, pilihan kampusnya merupakan yang terbaik di Jepang,” terang mahasiswa asal Makassar itu. Dan perlu diketahui, lanjut dia, setelah lulus program master tidak ada ikatan kerja khusus. '),
(1270, 'Nadiem Sadar Strategi Ciptakan SDM Unggul Tak Seperti Bikin Aplikasi', 'PENDIDIKAN', 'DATA LATIH', 'Menteri Pendidikan dan Kebudayaan (Mendikbud) Nadiem Makarim mengatakan, pihaknya akan melakukan terobosan dalam menciptakan Sumber Daya Manusia (SDM) unggul seperti keinginan Presiden RI Joko Widodo. Nadiem mengaku, mengatasi masalah di sektor pendidikan sangat sulit.\r\n\r\nBahkan negara maju sekalipun membutuhkan waktu sekitar 10 hingga 15 tahun. Sehingga, dirinya akan mencoba melakukan lompatan yang dapat menarik sistem hingga 20 persen.\r\n\r\n“Saya di sini bukan untuk benerin, tapi melakukan lompatan. Enggak bisa dicapai 5 tahun tapi mungkin 10-20 persen sistem ini bisa lompat. 5-15 tahun itu bisa ke tarik dari 20 persen ini,” ujarnya di gedung Tribrata Jakarta, Jumat (17/1).\r\n\r\nMenurutnya, menciptakan SDM membutuhkan adanya transformasi. SDM unggul tidak akan terwujud jika hanya mengandalkan kebijakan pemerintah.\r\n\r\nPeran masyarakat, orang tua, serta guru juga dibutuhkan. “SDM unggul bukan hanya unggul di Indonesia. Unggul itu relatif di panggung dunia,” imbuhnya.\r\n\r\nNadiem menyebut, selama ini pemerintah menggunakan administrasi pendidikan dan regulasi untuk menciptakan SDM unggul. Padahal, administrasi pendidikan bukanlah suatu metode pembelajaran.\r\n\r\nAtas dasar itu, dirinya akan membuat terobosan yakni program merdeka belajar. Program ini akan membebaskan guru dalam mengimplementasikan metode yang cocok untuk siswa-siswinya.\r\n\r\n“(Tadinya) Saya kira sistem manajemen yang bisa dikasih insentif secara otomatis pendidikannya akan baik. Tapi enggak. Karena produk ini bukan suatu layanan atau apps, tapi manusia. Tingkat kompleksitas enggak sama dengan private sector,” pungkasnya.'),
(1271, '12 Hari Sejak Launching Aplikasi Gapura UB Diunduh Lebih Dari 12 Ribu Pengguna', 'PENDIDIKAN', 'DATA LATIH', 'Universitas Brawijaya (UB) pada Minggu (5/1) telah meluncurkan aplikasi Gapura UB. Aplikasi ini merupakan sistem informasi layanan terpadu yang memberikan kemudahan terkait sistem informasi UB.\r\n\r\nSistem ini menyediakan seluruh menu dari website Gapura UB. Ya, menggunakan sistem Single Sign On (SSO) yang berkolaborasi dengan Gsuite. Sejak dilaunching data Jumat (17/1) aplikasi ini sudah diunduh sebanyak 12 ribu kali\r\n\r\nKepala UPT TIK UB, Achmad Basuki, S.T.,M.MG.,Ph.D, mengatakan, kemunculan Gapura UB merupakan wujud Gapura UB yang berambisi dengan motto Satu Aplikasi Banyak Kemudahan.\r\n\r\n“Tidak banyak aplikasi mobile, satu aplikasi yang bisa untuk orang tua, mahasiswa, dosen dan karyawan, jadi ada dua pilihan mengakses Gapura UB sebagai pengunjung saja untuk mengetahui informasi secara umum misal fakultasnya apa saja, termasuk statistik dan kalender akademik ada,” ujar Abas, sapaan akrabnya.\r\n\r\nSaat ini Abas mengatakan aplikasi tersebut sudah diunduh oleh 10 ribu lebih pengguna android dan 2700 lebih pengguna iPhone. Meskipun Gapura UB belum bisa memenuhi harapan semua pengguna, namun ke depan aplikasi ini akan terus mengalami perbaikan termasuk memperbanyak fitur.\r\n\r\n“Responnya positif, ratingnya bagus dan banyak masukan, pengguna yang banyak kan mahasiswa dan dosen dengan Gapura UB mereka sangat terbantu, meskipun saat ini konsepnya masih baca informasi, kedepan akan pelan-pelan akan kami integrasikan demi pelayanan lebih baik,” bebeenya.\r\n\r\nPerlu diketahui, kemudahan yang ditawarkan pada aplikasi ini adalah terkait mengakses informasi. Satu aplikasi, menampilkan banyak informasi termasuk menampilkan menu yang berbeda antara dosen, mahasiswa, karyawan, orang tua dan pengunjung biasa.\r\n\r\nMahasiswa bisa mengakses semua informasi yang masuk melalui hanya dengan login menggunakan Nomor Induk Mahasiswa (NIM). Menu yang tersaji pun akan berbeda dengan pengunjung biasa.\r\n\r\nTerdapat informasi khusus contohnya melihat profil mahasiswa, status, pembayaran biaya kuliah dan tagihan, waktu pembayaran, rekap hasil studi di masing-masing semester, dan lain sebagainya.\r\n\r\n“Buat orang tua pun juga beda, dengan masuk menggunakan akun yang kami sediakan melalui fakultas juga bisa melihat perkembangan studi anaknya, demikian pula bagi dosen bisa melihat jadwal mengajarnya, mahasiswa bimbingan akademiknya, dan ada informasi mengenai remunerasi beliau,” urainya. '),
(1272, 'Mahasiswa Ingat! Berbahasa ke Dosen Ada Etikanya', 'PENDIDIKAN', 'DATA LATIH', 'Mahasiswa, sering dalam sikap berbahasa tidak memperdulikan etika. Padahal, bahasa pun ada etikanya, tergantung dengan siapa kita berbicara.\r\n\r\n“Tindak tutur di diri mahasiswa itu perlu dibiasakan. Ada hal-hal yang tidak tepat, simpel tapi perlu dibenahi terkait kesantunan bahasa, khususnya ke dosen,” tukas Suryantoro MPd, Ketua Program Studi Pendidikan Bahasa dan Sastra Indonesia Unikama dalam acara Sarasehan Mahasiswa dan Dosen Prodi Pendidikan Bahasa dan Sastra Indonesia, Jumat, (17/1).\r\n\r\nMenurut Suryantoro, ranah komunikasi di umum dan akademik harus dibedakan. “keduanya itu harus dipisahkan, perlu kesadaran dari diri mahasiswa untuk,” tambah Surya di Aula Sarwakirti Unikama.\r\n\r\nMenyebut contoh, mahasiswa yang sering menghubungi dosen melalui perpesanan instant Whatsapp seringkali mengabaikan etika berbahasa ini.\r\n\r\nMaka dari itu, Unikama mencoba menyatukan visi dan pandangan lewat forum. Bertajuk sarasehan, semua mahasiswa angkatan dan dosen, kaprodi hingga dekanat Prodi Pendidikan Bahasa Indonesia disatukan dalam sebuah forum informal.\r\n\r\nAcaranya simpel. Mereka duduk bersama, lesehan. Unikama ingin mahasiswa lebih menghargai bahasa, kedua pihak yang disatukan dalam jaring akademik itu pun bertukar ilmu dan pandangan.\r\n\r\n“Sengaja acara dikemas dalam forum sarasehan begini agar tidak ada sekat diantara mahasiswa dan dosen. Kami mencoba mensosialisasikan penggunaan bahasa dalam forum yang rileks, jadi tidak ada jarak dan sekat,” tuturnya.\r\n\r\nSementara itu, acara ini dibuat juga sebagai rangkaian dari peringatan Hari Bahasa Nasional atau yang biasa disebut bulan bahasa. Narasumbernya, berasal dari dosen internal Unikama.\r\n\r\nAcara ini juga mengajari pendewasaan karakter melalui bahasa kepada mahasiswa, terutama di Media Sosial. “Mahasiswa Unikama nantinya kami harap bisa jadi semacam contoh dalam penggunaan bahasa yang baik di medsos,” tutupnya.'),
(1273, 'Kemendikbud Ubah Skema Penyaluran BOS, Langsung ke Sekolah', 'PENDIDIKAN', 'DATA LATIH', 'Kementerian Pendidikan dan Kebudayaan berencana akan mengubah penyaluran program Bantuan Operasional Sekolah (BOS) pada tahun ini. Bantuan tersebut akan langsung disalurkan dari pemerintah pusat ke sekolah. Harapannya, agar bisa segera digunakan oleh sekolah yang membutuhkan.\r\n\r\nPlt Direktur Jenderal Pendidikan Anak Usia Dini, Pendidikan Dasar dan Menengah (PAUD Dikdasmen) Harris Iskandar membenarkan adanya perubahan mekanisme penyaluran BOS. ”Nanti akan diluncurkan oleh Mas Menteri (Mendikbud Nadiem Makarim), mimggu depan. Tunggu saja,” ucapnya kepada Jawa Pos, Kamis (16/1).\r\n\r\nSekretaris Jenderal Kemendikbud Ainun Naim menilai, perubahan penyaluran BOS langsung ke sekolah lebih efektif. Bisa diterima lebih cepat ke sekolah yang memang membutuhkan. Penyalurannya dari Kementerian Keuangan langsung kepada sekolah.\r\n\r\nKemendikbud berperan memberikan data sekolah untuk menentukan jumlah anggaran yang dibutuhkan. Sementara itu, pemerintah daerah (Pemda) yang selama ini menjadi tangan kedua menyalurkan dana BOS, kini bertugas memonitor kinerja sekolah saja.\r\n”Selain itu, untuk pengawasan dan pengelolaan BOS selanjutnya sudah ada perangkat seperti inspektorat pusat maupun daerah. Setiap kementerian/lembaga tentu ada guideline-nya,” terang Ainun.\r\n\r\nPerubahan tersebut ditengarai akibat banyak laporan sekolah yang terlambat menerima dana BOS. Pengamat pendidikan Indra Charismiadji membenarkan hal tersebut. Tidak dimungkiri, lanjut dia, banyak permainan terkait dana pendidikan di tingkat Pemda. Misalnya, menggunakan dana pendidikan untuk program lain yang tidak sesuai peruntukannya.\r\n\r\n”Saya lebih suka (penyaluran dana BOS) langsung,” ucap Indra. Jadi, sudah tidak ada lagi penyalahgunaan maupun penyelewengan anggaran pendidikan di tingkat Pemda. Hanya saja, sampai saat ini Indra mempertanyakan tidak adanya evaluasi terkait BOS. Mulai dari sisi efektivitas, pelaksanaan, dan hasilnya penggunaan anggaran.\r\n\r\n”Bisa jadi BOS yang membuat mutu pendidikan kita stagnan. Karena orang sibuk ngurusin administrasi,” tandas Indra'),
(1274, 'Punya Rumah Sakit Sendiri, hingga Koas ke Arab Saudi, Inilah Nilai Plus Kuliah di FK UIN', 'PENDIDIKAN', 'DATA LATIH', 'siswa kelas XII SMA/SMK sudah bisa mendaftarkan diri untuk mengikuti SNMPTN (Seleksi Nasional Masuk Perguruan Tinggi Nasional).\r\n\r\nBagi yang ingin kuliah di FK (Fakultas Kedokteran) di Malang, pilihannya beragam. Salah satunya di FKIK (Fakultas Kedokteran dan Ilmu Kesehatan) UIN Maliki (Universitas Islam Negeri Maulana Malik Ibrahim).\r\n\r\nApa saja nilai plus kuliah di FK UIN Maliki? Berikut ulasannya.\r\n\r\n1. Bakal Jadi Dokter Religius\r\n\r\nDi UIN Malang, setiap maba (mahasiswa baru), termasuk dari FKIK wajib masuk Ma’had atau asrama selama dua semester. Khusus untuk mahasiswa FKIK akan ditempatkan di Ma’had Kedokteran atau Mabna Ar-Razi yang lokasinya berada di Kampus II UIN aliki di Kota Batu.\r\n\r\nSelama di asrama, para mahasiswa juga mendapatkan pembekalan tentang agama islam. Jadi, diharapkan, ketika lulus nanti, mereka akan menjadi pribadi yang religius.\r\n\r\n2. Bakal Punya Rumah Sakit Pendidikan\r\n\r\nBersamaan dengan dibukanya FKIK, UIN Maliki Malang juga menyiapkan pembangunan rumah sakit pendidikan. Rencananya, pembangunan rumah sakit ini akan dilakukan mulai tahun ini. Lokasinya di Kampus II UIN Maliki Malang di Kota Batu.\r\n\r\nSembari menunggu rampungnya pembangunan rumah sakit itu, saat ini UIN Malang memanfaatkan RST Soepraoen sebagai rumah sakit pendidikannya. Berbagai praktik dan transfer ilmu telah dijalin UIN Malang bersama Kesdam V Brawijaya.\r\n\r\n3. Bisa Koas di Saudi Arabia\r\n\r\nBeberapa waktu yang lalu, Rektor UIN Malang Prof Dr Abdul Haris, M.Ag mengatakan bahwa sejumlah mahasiswa kedokteran akan dikirim koas (ko asisten) atau praktik menjadi asisten dokter di Saudi Arabia. Keberangkatan mereka direncanakan Bulan Juli.\r\n\r\nYa, di Jurusan Kedokteran UIN Malang, mahasiswa disediakan pilihan kompetensi dokter haji. Sehingga mahasiswa yang memilih fokus itu akan dikirim ke Saudi Arabia untuk belajar memeriksa jamaah haji disana.'),
(1275, 'Konjen Kinabalu Malaysia Sambut Mahasiswa KKN UMM', 'PENDIDIKAN', 'DATA LATIH', 'Sebanyak 26 mahasiswa KKN Universitas Muhammadiyah Malang (UMM) tiba di Malaysia. Para mahasiswa KKN yang datang bersama Kepala Divisi KKN Direktorat Penelitian dan Pengabdian Kepada Masyarakat Universitas Muhammadiyah Malang (DPPKM UMM) disambut oleh Konsulat Jenderal Kinabalu Sabah, Malaysia Khrisna Djelani.\r\n\r\nDalam sambutannya, Khrisna mengungkapkan, Malaysia siap menerima pengabdian mahasiswa KKN UMM dengan program-program yang sudah dirancang termasuk bidang pendidikan.\r\n\r\n“Menjalani program pengabdian masyarakat melalui KKN ini, nantinya kalian akan turut aktif membantu proses pembelajaran di sekolah-sekolah CLC (Community Learning Center) yang membina anak-anak Pekerja Migran Indonesia (PMI) di Sabah, Malaysia. Juga mendapat banyak pembelajaran, pengalaman dan kesan tersendiri dalam memaknai ‘nasionalisme’ di luar negeri. Jaga diri dengan baik dan harumkan nama Indonesia, selalu membawa paspor selama berada di luar negeri (Sabah, Malaysia),” pesan Khrisna.\r\n\r\nDi kota pusat pemerintahan untuk Pantai Barat negeri Sabah ini diperkirakan ada lebih dari 600 ribu Warga Negara Indonesia (WNI). Jumlah ini baru perkiraan dari berbagai aktivitas yang dilakukan oleh Konsulat Jenderal Republik Indonesia (KJRI) Kinabalu, Malaysia.\r\n\r\n“Yang tercatat di kantor kami hanya 151 ribu orang,” ujar Cahyono Rustam, Pelaksana Fungsi Penerangan Sosial Budaya KJRI, Kota Kinabalu saat memberi kuliah umum pada agenda Pengarahan dan Pelepasan Kuliah Kerja Nyata (KKN) Universitas Muhamamdiyah Malang (UMM) semester genap 2019/2020, Senin (6/1/2020).\r\n\r\nRata-rata para WNI yang datang ke Kinabalu untuk bekerja. Ada yang legal, memiliki majikan dan surat izin kerja. Adapula yang ilegal melalui berbagai jalan tikus. “Tiap bulan, kami memfasilitasi pemulangan WNI oleh Malaysia. Jumlahnya sekitar 300-an orang,” tuturnya.\r\n\r\nPekerja Migran Indonesia (PMI), sebutan pengganti TKI, tidak hanya bekerja. Ada juga yang menikah lalu memiliki anak. Anak-anak yang lahir dari hasil pernikahan para PMI ini mayoritas tidak memiliki surat keterangan resmi seperti akta kelahiran. Mereka menikah hanya dengan syarat agama.\r\nMahasiswa KKN UMM bersama-putra putri pekerja imigran dari Indonesia.\r\n\r\nDalam hal ini KJRI bertugas mengusahakan untuk membuatkan berbagai surat keterangan sepadan untuk anak-anak para PMI. Untuk pendidikan, anak-anak PMI tidak dapat bersekolah di sekolah negeri Malaysia. Hal ini terkait dengan undang-undang yang dimiliki Malaysia.\r\n\r\n“Bagi orang asing yang memiliki pendapatan di bawah 5.000 ringgit Malaysia, anak-anaknya tidak dapat disekolahkan di sekolah negeri,” ucapnya.\r\n\r\nKeadaan ini membuat pemerintah melalui KJRI menginisiasi berbagai metode demi pendidikan anak-anak PMI agar tetap mendapatkan asupan pengetahuan. Indonesia melakukan negosiasi dengan pemerintahan Malaysia untuk mendirikan sekolah-sekolah alternatif.\r\n\r\nNegosiasi ini pun berhasil, Indonesia mendapatkan izin untuk mendirikan sekolah alternatif. Antusias WNI begitu besar, pada saat awal berdirinya saja ada 1000-an murid yang belajar.\r\nMahasiswi KKN UMM berinteraksi dengan Konjen RI Kinabalu Malaysia saat acara penyambutan.\r\n\r\nPada 2008, Indonesia melakukan negosiasi lagi dengan Malaysia untuk mendirikan lingkup belajar yang lebih besar bernama Community Learning Center (CLC). Pemerintah serius menangani berbagai masalah yang dihadapi para WNI di Malaysia, utamanya pendidikan bagi anak-anak.\r\n\r\n“Anda-anda yang yang KKN di sana nanti, mari kita bantu mendidik anak-anak WNI untuk berwawasan luas dan mencintai Indonesia,” kata Cahyono yang pernah menjadi pengajar sementara di FISIP UMM ini.'),
(1276, 'Murid dan Guru Ketagihan Belajar Berhitung Lewat Permainan Kartu', 'PENDIDIKAN', 'DATA LATIH', 'Mengajak belajar sambil bermain merupakan metode ampuh agar anak antusias. Apalagi jika hal tersebut dilakukan untuk mengajar mata pelajaran matematika yang biasanya kurang diminati.\r\n\r\nSalah satu permainan yang cocok menjadi teman belajar adalah Wendell 7 yang mana permainan berjenis kartu itu mengajak para murid untuk menghitung tanpa alat bantu.\r\n\r\nKepala Sekolah SDN 05 Pasar Minggu, Awaluddin yang menjadi sekolah pertama yang diperkenalkan dengan metode ini menyebutkan bahwa dia sangat senang. Sebab, anak didiknya menjadi antusias dalam belajar menghitung.\r\n\r\n“Sangat menyenangkan, keren banget itu, anak-anak kita itu berkembang ini-nya (otak). kalau dulu kan 15 tambah 15 berapa? 30 kan, kalau sekarang itu istilahnya diketahui kalau jumlahnya 30, murid-murid ayo cari angka yang sesuai,” kata dia kepada JawaPos.com di lokasi, Jakarta, Rabu (15/1).\r\n\r\nYang di maksudkan antusias oleh Awaluddin yaitu adalah murid tidak hanya melihat atau terdiam saja. Namun, juga ikut aktif untuk berpikir didalam permainan Wendell 7.\r\n\r\n“Luar biasa, langsung terlibat semua, ini kelebihannya permainan. Saya bersama guru-guru juga sudah membicarakan hal itu (diterapkan). Saya akan briefing dulu untuk nerapin hal ini. Saya yakin nggak ada yang diem aja kalau dengan model begini, terlibat semua. Kita terapkan dalam pembelajaran dan kita sesuaikan dengan studi, artinya mengaktifkan anak itu dengan cara seperti ini, kerja kelompok misalnya,” katanya.\r\n\r\nSalah satu murid yang ikut bermain adalah Radit, sambil tersenyum, ia mengaku senang dan ingin belajar sambil bermain lagi. “Seru, seru banget, itu gampang kok mainnya,” ucap murid kelas 5 itu.\r\n\r\nHal yang sama juga diungkapkan oleh Desila yang menceritakan bahwa permainan itu dapat dipahami dengan mudah. Apalagi card game ini membuat dirinya bisa berkompetisi dengan murid yang lain.\r\n\r\n“Bisa kok (mainnya), seru dan seneng banget, itu kan tadi cari angka 7, 17 sama 27 dan kita tadi dikasih 5 kartu, angka-angkanya itu dari 1 sampai 10, misalnya ada angka 1, 5, 7, 2 dan 5. 5 tambah 5 tambah 2 kan 17, itu kita dapet 3 poin, soalnya kan kita gunain 3 kartu. Seru banget, mau main lagi,” jelasnya girang.'),
(1277, 'Mau Belajar Matematika yang Menyenangkan? Cobain Deh Main Wendell 7', 'PENDIDIKAN', 'DATA LATIH', 'Bagi sebagian banyak orang, matematika yang berisi angka-angka bukanlah hal yang diminati untuk dipelajari. Akan tetapi, dengan adanya permainan Wendell 7, matematika yang awalnya membosankan dapat menjadi menyenangkan.\r\n\r\nWendell 7 sendiri merupakan sebuah permainan kartu yang dicetuskan oleh Wendell Parnell pada 2011 lalu. Permainan ini tercipta atas kekhawatirannya terhadap generasi sekarang yang lebih mengandalkan mesin daripada otak untuk berhitung.\r\n\r\nWendell saat ditemui JawaPos.com ketika memperkenalkan pertama kalinya card game di Indonesia, lokasi tepatnya di SDN 05 Pasar Minggu, Jakarta Selatan, mengatakan bahwa rencananya permainan ini akan ditambahkan variasinya. Jadi, bukan hanya pertambahan.\r\n\r\n“Nantinya akan ada pengurangan, pembagian dan perkalian dengan metode kartu, itu nanti akan kita bicarakan karena masih proses. Sekarang masih langkah awal, kita akan launching secara bertahap,” tuturnya di lokasi, Jakarta, Rabu (15/1).\r\n\r\nAlasan utama mengunjungi Indonesia adalah untuk menimbulkan rasa bahwa matematika adalah suatu hal yang menyenangkan. Sebab, pada dasarnya anak-anak biasa menganggap kalau pelajaran tersebut menyebalkan.\r\n\r\n“Karena saya tertarik dengan 200 juta lebih penduduk Indonesia, khususnya anak-anak yang mungkin tidak memiliki komputer untuk bermain. Wendell 7 ini juga bisa dimainkan di mana saja sekaligus belajar matematika tanpa harus menggunakan teknologi, seperti yang tadi kita lihat, anak-anak itu merasa sangat antusias ketika dia bermain ini dan mereka itu tidak menganggap kalau itu adalah pelajaran matematika,” tuturnya.\r\n\r\nDirinya bersama tim tidak hanya mengunjungi satu sekolah selama memperkenalk permainan tersebut di Indonesia. Akan tetapi, juga di 7 sekolah lain mulai dari tingkat SD sampai SMA yang akan berlangsung hingga 23 Januari mendatang.\r\n\r\n“Nanti akan ada orang yang mengembangkan (mengenalkan permainan Wendell 7) khusus di Indonesia. Bermain ini tidak harus setiap hari, bisa dalam satu bulan itu 3 kali di mana 1 kelas itu bisa dibuat 4 tim karena itu bisa mengembangkan kreativitas dan kompetisi mereka,” ujar dia.\r\n\r\nIa berharap bahwa suatu saat permainan ini dapat berdampak positif pada masyarakat Indonesia, khususnya yang masih mengenyam pendidikan.\r\n\r\n“Saat ini kan mereka gampangin karena adanya kalkuator, saya ingin mengembangkan pemikiran-pemikiran anak-anak saat ini di mana mereka menggunakan otaknya bukan mesin untuk menghitung. Dengan adanya ini saya berharap bisa terkenang nantinya menjadi salah satu pencipta permainan matematika yang menyenangkan,” jelasnya.\r\n\r\nUntuk mendapatkan Wendell 7, masyarakat dapat mengakses website www.wendell7.com dan membelinya dengan harga AUD 20 atau Rp 200.000. “Kita akan jual lebih murah di Indonesia. Kita akan produksi di sini dan harganya lebih murah, mungkin tahun-tahun ini sudah produksi kartunya,” kata Wendell.'),
(1278, 'Bumi Ternyata Simpan Material Tertua dari Matahari', 'PENDIDIKAN', 'DATA LATIH', 'Pada 50 tahun silam, sebuah meteor jatuh ke Bumi dan mendarat di Australia. Penelitian terbaru mengungkap temuan mengagetkan, bahwa meteor itu mengandung debu bintang atau stardust yang terbentuk sekitar 5 sampai 7 miliar tahun lalu.\r\n\r\nDiketahui meteor dan debu bintangnya adalah material solid tertua yang pernah ditemukan di planet ini. Sebagai gambaran, Matahari kita berumur sekitar 4,6 miliar tahun sehingga debu bintang itu sudah eksis jauh sebelum Matahari dan Tata Surya.\r\n\r\nDebu bintang di meteor bernama Murchison itu disebut sebagai ‘butiran pra Matahari’ karena terbentuk sebelum adanya bintang kita.\r\n\r\nDikutip dari CNN (15/1), bintang lahir saat gas, debu dan panas berpadu dengan cara yang tepat. Mereka bisa eksis jutaan sampai miliaran tahun sebelum sekarat dan melepaskan penyusun utamanya ke antariksa.\r\n\r\nMeteor, seandainya tidak menabrak terlalu banyak benda, dapat menjadi semacam kapsul waktu dengan material pembentuk bintang yang ‘terjebak’ di tubuhnya. Namun, penemuan debu bintang di meteor yang jatuh ke Bumi sangat jarang, hanya 5 persen di antaranya mengandung material tersebut.\r\n\r\nStudi terbaru soal Murchison dipublikasikan di jurnal National Academy of Sciences. “Ini merupakan salah satu studi paling menarik yang pernah saya kerjakan,” kata Philip Heck, salah satu peneliti dari University of Chicago.\r\n\r\n“Itu adalah material solid tertua yang pernah ditemukan dan memberitahu kita terkait bagaimana bintang terbentuk di galaksi kita. itu adalah sampel solid dari bintang,” jelasnya.\r\n\r\nSebagian debu bintang yang didapat berusia sekitar 4,6 sampai 4,9 miliar tahun. Sebagian lagi lebih tua dari 5,5 miliar tahun. Disimpulkan pula bahwa 7 miliar tahun silam, bintang-bintang mulai banyak terbentuk.\r\n\r\n“Sangat menarik mengamati sejarah galaksi kita. Debu bintang adalah material tertua yang pernah menyambangi Bumi dan darinya, kita bisa belajar soal bintang, asal karbon di tubuh kita dan dari mana oksigen berasal. Dengan debu bintang, kita bisa melacak material sebelum adanya Matahari,” pungkasnya.'),
(1279, 'Di Balik Perjuangan Empat Mahasiswa ITN Malang Borong Medali di Kejuaraan Taekwondo', 'PENDIDIKAN', 'DATA LATIH', 'Prestasi mahasiswa Institut Teknologi Nasional (ITN) Malang semakin melejit saja. Di awal tahun ini, sebanyak 4 mahasiswa berhasil memborong 5 medali di bidang taekwondo.\r\n\r\nKeempat mahasiswa tersebut berhasil membawa pulang medali itu dari Kejuaraan 2nd Instiper di Yogyakarta pada 11-12 Januari 2020 yang digelar Institut Pertanian Stiper (Instiper) Yogyakarta dengan jumlah peserta 650 orang.\r\n\r\nBernika Natasya Ifada, mahasiswa Teknik Geodesi bahkan meraih 2 medali yakni perak dan perunggu. Ia meraih medali perak Poomsae (seni/jurus bela diri) individual putri dan medali perunggu Kyorugi (fight) Female Under 62.\r\n\r\n“Latihannya lumayan dadakan. Tapi kalau saya alhamdulillah memang dari dulu terlatih beladiri yang dinilai dari keindahan ya jadi bersyukur lancar,” ceritanya.\r\n\r\nSedangkan kawannya, Reva Nabila Putri, mahasiswa Teknik Lingkungan membawa medali emas. Ia meraih medali itu di cabang Kyorugi (fight) Female under 57.\r\n\r\n“Latihannya mepet banget kurang seminggu. Sempat diet air putih juga agar bisa turunin berat badan 2 kg. Eh tapi gagal, ya bersyukur itu nggak jadi masalah,” ungkapnya.\r\n\r\nLain cerita lagi dengan Pamungkas Hutapea yang meraih medali perunggu Kyorugi(fight) under 74. Ia mengatakan sebenarnya sangat ingin mengikuti kejuaraan di kelas berat bawahnya yakni under 68.\r\n\r\n“Tapi saya ada masalah berat badan usai liburan. Akhirnya ya naik kelas. Sempat mau nurunin ya gagal. Ya sudah ikur kelas 74 akhirnya,” curhat mahasiswa Teknik Sipil ini.\r\n\r\nTerakhir cerita Alvin Ahlunnizar peraih medali perak Kyorugi (fight) Male Under 54. Mahasiswa Teknik Geodesi ini mengaku jelang pertandingan tubuhnya penuh dengan lebam dan sempat membuatnya resah.\r\n\r\n“Selama latihan ada bekas cidera. Kayak lebam-lebam gitu tapi masih kuat tanding. Sebenarnya target saya emas, nanti lag lain kesempatan,” tegasnya.\r\n\r\nWakil Rektor III Bidang Kemahasiswaan, Alumni, dan Kerjasama ITN Malang Fourry  Handoko, ST., SS.,MT,., Ph.D, mengatakan bakal terus mendorong mahasiswa mengikuti ajang di luar kanpus baik akademik maupun non akademik.\r\n\r\n“Selalu kami dukung apa yang mereka ikuti. Tidak cuma akademik saja, non akademik juga kami dorong,” jelasnya.'),
(1280, 'Mahasiswa Kedokteran UIN Malang Bakal Praktik Profesi ke Saudi Arabia', 'PENDIDIKAN', 'DATA LATIH', 'Tahun ini, Universitas Islam Negeri (UIN) Malang bakal meluluskan angkatan pertama Jurusan Kedokteran Fakultas Kedokteran dan Ilmu Kesehatan (FKIK).\r\n\r\nRektor UIN Malang, Prof Dr Abdul Haris, M.Ag mengatakan, dari lulusan itu, sejumlah mahasiwa yang mengambil keterampilan kedokteran haji. Tahun ini mereka bakal dikirim ke Saudi Arabia untuk menjalani ko asisten atau koas.\r\n\r\n“Jadi kedokteran haji itu keterampilan yang mereka ambil khusus untuk penanganan jamaah haji. Belum tahu ya jumlahnya berapa,” kata Haris.\r\n\r\nKoas sendiri adalah praktik profesi mahasiswa yang masih dalam tahap pendidikan dalam memenuhi kompetensi sebelum dinyatakan sebagai seorang dokter. Biasanya kegiatan ini dilakukan dalam waktu 1 tahun.\r\n\r\nDalam keterampilan dokter haji, seorang mahasiswa kedokteran mempelajari hal-hal dasar dari kesehatan manusia utamanya jelang haji, saat beribadah sampai kepulangan jamaah haji.\r\n\r\n“Nanti mereka diarahkan untuk mengidentifikasi penyakit apa daja yang sering diderita jamaah haji disana. Bagaimana penanganannya. Juga sebelumnya mereka harus tau vaksin sebelum berangkat. Termasuk memastikan jamaah tak sakit saat pulang,” bebernya.\r\n\r\nHaris mengatakan koas ini akan dilakukan mahasiswa kedokteran pada Bulan Juni 2020. Waktu itu dipilih karena belum memasuki musim haji. Sehingga saat musim haji nanti, mahasiswa sudah lebih banyak pengetahuannya.\r\n\r\n“Di sana kami juga tugaskan dosen untuk mengawasi. Tepatnya sebagai petugas haji juga. Jadi saat praktik nanti dosen dibantu mereka (mahasiswa),” tutupnya.'),
(1281, 'Gandeng UB, Ahli Toksinologi Bakal Buat Riset Antibisa Ular', 'PENDIDIKAN', 'DATA LATIH', 'Fenomena munculnya ular di pemukiman warga, nampaknya akan terus berlangsung. Terutama di musim hujan. Kementerian Kesehatan RI pun mengambil langkah untuk mengatasi hal tersebut.\r\n\r\nSalah satunya adalah membuat program pengembangan antibisa hewan dan tumbuhan beracun. Beberapa ahli yang digandeng adalah Dr dri Tri Maharani, MSi, SpEM. Satu-satunya spesialis toksinologi bidang ular ini mengaku bakal segera melakukan riset mendalam.\r\n\r\n“Tanggal 30 Desember kemarin saya dipanggil Kemenkes bersama Direktur Biofarma juga. Tahun depan targetnya ada satu antibisa. Nanti saya riset, dan biofarma yang memproduksi,” ungkapnya saat Dies Natalis Fakultas Kedokteran Universitas Brawija, Minggu (12/1).\r\n\r\nDalam risetnya nanti, Tri bakal menggandeng dua universitas. Yaitu Universitas Brawijaya (UB) dan Universitas Padjajaran (Unpad). Nantinya akademisi Fakultas Kedokteran UB hingga mahasiswa akan diajak untuk meriset ular di penjuru Indonesia.\r\n\r\n“UB ini bakal jadi pionirnya. Dan ini universitas pertama atau piloct projectnya yang sangat interest dengan penelitian tentang antibisa ular,” bebernya.\r\n\r\nIa meminta bantuan UB dalam hal edukasi. Ia meminta tolong agar UB dapat membuat produk promosi misalnya film atau artikel riset yang mengedukasi masyarakat seputar toksinologi khususnya bidang ular.\r\n\r\n“Dalam edukasi harus ada integrasi keilmuwan. Nggak bisa cuma soal medisnya saja. UB saya harap dapat meriset dan mempromosikan mindset magis menjadi medis,” jelas alumni FK UB tersebut.\r\n\r\nSementara Advicer WHO bidang gigitan ular itu mengatakan kerjasama dengan Unpad lebih pada pengembangan snake farm. Untuk meriset ular katanya harus ada peternakan ular untuk mempelajari antibisanya.\r\n\r\n“Ini kabar gembira, kita akan punya snake farm. Kalau mau cepat mudah saja, panggil komunitas ular. Seminggu udah penuh itu snake farm,” kelakarnya.\r\n\r\nKatanya untuk meriset satu antibisa ukat dibutuhkan waktu 5-10 tahun. Namun ia optimis, jika selutih masyarakat Indonesia bergerak maka tidak ada yang tidak mungkin untuk menciptakan antibisa bagi 77 jenis ular berbisa di Indonesia.\r\n\r\n“Kalau monovalen mungkin lebih mudah. Biayanya ya paling Rp 1-5 miliar. Bagi saya Thailand yang 30 juta penduduk aja bisa, masa kita yanb 278 juta penduduk nggak bisa,” tutupnya.'),
(1282, 'Universitas Brawijaya Segera Buka Prodi Spesialis Bedah Plastik dan Rekonstruksi', 'PENDIDIKAN', 'DATA LATIH', 'Saat ini, di Indonesia hanya ada 200 dokter spesialis bedah plastik. Angka ini tentu saja amat kecil bila melihat tingginya permintaan terhadap bedah plastik.\r\n\r\nBerangkat dari masalah ini, Fakultas Kedokteran (FK Universitas Brawijaya (UB) dalam waktu dekat bakal membuka Program Pendidikan Dokter Spesialis (PPDS) Ahli Bedah dan Rekonstruksi.\r\n\r\n“Mungkin akan dimulai pada semester ganjil nanti, September 2020,” jelas Dekan Fakultas Kedokteran (FK) Universitas Brawijaya (UB) Malang, Dr dr Wisnu Barlianto MSi Med SpA (K), saat berbicara dalam Dies Natalis FK UB ke 46, Minggu (12/1).\r\n\r\nKepala Departemen Bedah Plastik FK UB, dr Herman Yosef Limpat Wihastyoko, Sp.BP-RE(K) mengatakan saat ini proses pengajuan Prodi Bedah Plastik sudah memasuki tahap koreksi dari rektorat UB. Untuk selanjutnya disetujui dan di-upload.\r\n\r\n“Untuk visitasi sudah selesai, juga untuk sarana prasarana telah memadai. Targetnya ya pertengahan tahun ini sudah dibuka. Kalau nggak gitu tahun depan,” bebernya.\r\n\r\nSementara untuk kuota awal nantinya UB akan membuka 2-3 mahasiswa spesialis. “Dengan prodi ini kami harapkan UB dapat menjadi penyumbang dokter spesialis. Minimal 1 rumah sakit ada 1 dokter ahli bedah,” tutupnya.'),
(1283, 'UMM Lepas 1.210 Mahasiswa KKN Internasional dan Reguler', 'PENDIDIKAN', 'DATA LATIH', 'Universitas Muhammadiyah Malang (UMM) melaksanakan program pengabdian masyarakat dengan mendampingi anak-anak pekerja migran lewat skema progran Kuliah Kerja Nyata (KKN) Internasional.\r\nPerwakilan mahasiswa berfoto bersama usai pembekalan KKN di Gedung Kuliah Bersama (GKB) 1.\r\n\r\nMenurut Wakil Rektor III UMM Dr. Sidik Sunaryo, SH.,MSi., MHum, selain melakukan pengabdian di berbagai bidang, kali ini skema KKN internasional Universitas UMM difokuskan pada penanganan serius para tenaga kerja Indonesia di luar negeri.\r\n\r\n“Utamanya perihal peningkatan kualitas pendidikan. Misalnya mahasiswa yang bakal diterjunkan di Kota Kinabalu, Negeri Sabah, Malaysia,” katanya dalam keterangan resminya, Selasa (7/1/2020).\r\n\r\nSelain skema KKN internasional di Kinabalu, Malaysia, mahasiswa UMM juga disebar ke sejumlah daerah. Untuk regional Jawa Timur di antaranya Malang Raya, Kota Probolinggo, Kabupaten Tulungagung dan Kabupaten Madiun.\r\n(ki-ka) Kadiv KKN UMM, Ir. Alik Anshory Alamsyah, MT; Direktur DPPM, Prof. Dr Yus Mochamad Cholily, MSi; 2 Mahasiswa KKN; Konsulat Jenderal RI Pelaksana Fungsi Penerangan Sosial Budaya KJRI Kota Kinabalu, Malaysia, Cahyono Rustam dan Wakil Rektor III UMM, Dr. Sidik Sunaryo, SH.,MSi.,MHum.\r\n\r\nDi kota pusat pemerintahan untuk Pantai Barat negeri Sabah ini diperkirakan ada lebih dari enam ratus ribu warga negara Indonesia (WNI). Jumlah ini baru perkiraan dari berbagai aktivitas yang dilakukan oleh Konsulat Jenderal Republik Indonesia (KJRI) Kinabalu, Malaysia.\r\n\r\n“Yang tercatat di kantor kami hanya 151.000 orang,” ujar Cahyono Rustam, Pelaksana Fungsi Penerangan Sosial Budaya KJRI, Kota Kinabalu saat memberi kuliah umum pada agenda Pengarahan dan Pelepasan Kuliah Kerja Nyata (KKN) Universitas Muhamamdiyah Malang (UMM) semester genap 2019/2020, Senin (6/1/2020).\r\nRata-rata para WNI yang datang ke Kinabalu untuk bekerja. Ada yang legal, memiliki majikan dan surat izin kerja. Adapula yang ilegal melalui berbagai jalan tikus.\r\n\r\n“Tiap bulan, kami memfasilitasi pemulangan WNI oleh Malaysia. Jumlahnya sekitar 300-an orang,” tuturnya di hadapan 1210 peserta KKN.\r\nPekerja Migran Indonesia (PMI), sebutan pengganti TKI, tidak hanya bekerja. Ada juga yang menikah lalu memiliki anak. Anak-anak yang lahir dari hasil pernikahan para PMI ini mayoritas tidak memiliki surat keterangan resmi seperti akta kelahiran. Mereka menikah hanya dengan syarat agama.\r\n\r\nDalam hal ini KJRI bertugas mengusahakan untuk membuatkan berbagai surat keterangan sepadan untuk anak-anak para PMI. Untuk pendidikan, anak-anak PMI tidak dapat bersekolah di sekolah negeri Malaysia. Hal ini terkait dengan undang-undang yang dimiliki Malaysia.\r\n\r\n“Bagi orang asing yang memiliki pendapatan di bawah 5.000 ringgit Malaysia, anak-anaknya tidak dapat disekolahkan di sekolah negeri,” ucapnya.\r\n\r\nKeadaan ini membuat pemerintah melalui KJRI menginisiasi berbagai metode demi pendidikan anak-anak PMI agar tetap mendapatkan asupan pengetahuan. Indonesia melakukan negosiasi dengan pemerintahan Malaysia untuk mendirikan sekolah-sekolah alternatif.\r\n\r\nNegosiasi ini pun berhasil, Indonesia mendapatkan izin untuk mendirikan sekolah alternatif. Antusias WNI begitu besar, pada saat awal berdirinya saja ada 1000-an murid yang belajar.\r\n\r\nPada 2008, Indonesia melakukan negosiasi lagi dengan Malaysia untuk mendirikan lingkup belajar yang lebih besar bernama Community Learning Center (CLC). Pemerintah serius menangani berbagai masalah yang dihadapi para WNI di Malaysia, utamanya pendidikan bagi anak-anak.\r\n\r\n“Anda-anda yang yang KKN di sana nanti, mari kita bantu mendidik anak-anak WNI untuk berwawasan luas dan mencintai Indonesia,” kata Cahyono yang pernah menjadi pengajar sementara di FISIP UMM ini.'),
(1284, 'Ekspor Ikan Tuna dari Gorontalo Melonjak', 'PENDIDIKAN', 'DATA LATIH', 'Stasiun Karantina Ikan dan Pengendalian Mutu (SKIPM), mencatat volume ekspor tuna dari Provinsi Gorontalo pada 2019 mengalami kenaikan 173 persen berbanding tahun sebelumnya.\r\n\r\nKepala SKIPM Provinsi Gorontalo Hamzah di Gorontalo, Minggu, mengatakan pada 2019 ekspor mencapai 140,8 ton, sedangkan pada 2018 tercatat 51,5 ton.\r\n\r\n“Volume ekspor tertinggi di bulan Desember 2019 yaitu mencapai 26 ton,” ujar dia.\r\n\r\nIa menegaskan bahwa Provinsi Gorontalo memiliki potensi yang bagus untuk ekspor tuna ke sejumlah negara.\r\n\r\n“Kami terus mendorong pengusaha perikanan lainnya agar dapat melakukan ekspor komoditi perikanan melalui sosialiasi penerapan HACCP di unit pengolahan ikan,” kata dia.\r\n\r\nHal itu dilakukan agar unit pengolahan ikan nantinya dapat disertifikasi HACPP, di mana sertifikat tersebut merupakan salah satu persyaratan dalam melakukan ekspor komoditi perikanan.\r\n\r\n“Saat ini unit pengolahan ikan yang telah memiliki sertifikat HACCP di Gorontalo baru tiga unit, yaitu CV Camar Laut, CV Berkat Adidaya, dan CV Baris Anugerah,” kata dia.\r\n\r\nIa pun berharap, ekspor perikanan pada 2020 lebih meningkat dengan negara tujuan yang lebih luas.');
INSERT INTO `sa_berita` (`id_berita`, `judul_berita`, `kategori_berita`, `jenis_data`, `isi_berita`) VALUES
(1285, 'Simbol Kemandirian, Makna Magis di Balik Anting Meghan Markle', 'ENTERTAINMENT', 'DATA LATIH', 'Meghan Markle kini sudah hidup mandiri di Kanada setelah mundur dari Kerajaan Inggris bersama suaminya, Pangeran Harry. Ibunda Archie itu seolah ingin menyampaikan kepada dunia bahwa keputusan itu tepat dipilihnya dan dia akan kuat menjadi mandiri. Pesan itu disampaikannya lewat simbol-simbol dari perhiasan yang dia kenakan.\r\n\r\nSetelah mundur dari kerajaan, Meghan masih aktif mengunjungi organisasi amal yang berpusat di Kanada. Baru-baru ini dia mengunjungi organisasi perempuan di Kanada dengan gaya kasual dan sederhana seperti dilansir dari Bustle, Kamis (23/1).\r\n\r\nDalam kunjungan itu, Meghan mengenakan aksesori anting yang penuh makna. Menurut Yahoo Style, anting-anting Meghan Markle dalam kunjungan amal pertamanya di Kanada membawa pesan khusus. Bukan hanya menjadikannya sekadar cantik.\r\n\r\nDirancang oleh desainer Emily Mortimer, anting-anting emas dan berlian itu diberi nama Dewi Hera. Dalam mitologi Yunani, Hera dikenal sebagai jiwa yang memimpin dan mandiri. Lalu sering dikenal sebagai pelindung perempuan. Sehingga saat menggunakan anting tersebut, menjadikan Duchess sosok yang kuat dan mendukung kesetaraan gender.\r\n\r\nSaat mengenakan anting-anting itu, Meghan Markle mengunjungi dua organisasi perempuan. Pertama adalah Pusat Kota Downtown Vancouver Eastside. Di sana, perempuan dapat menerima tempat tinggal dan kebutuhan dasar serta bertemu dengan advokat yang bekerja atas nama mereka. Lalu kunjungan keduanya, Meghan Markle minum teh dengan perempuan dari Justice for Girls Canada untuk membahas keadilan serta hak-hak masyarakat adat.\r\n\r\nAnting-anting Hera milik Meghan Markle juga bukan barang baru. Bukan kali pertama dikenakannya. Seperti banyak barang di lemari pakaiannya, Duchess of Sussex sering mengulang memakai aksesori yang sama. Sebelumnya dia juga pernah memakainya saat Oktober 2019 ketika dia menghadiri diskusi panel tentang kesetaraan gender sebagai bagian dari KTT One Young World.\r\n\r\nRupanya anting-anting Hera itu menjadi favorit Meghan Markle sebagai simbol perempuan kuat. Dan itu ditunjukkannya pula saat menghadiri acara bersama perempuan kuat lainnya.'),
(1286, 'Tidak Akur, Kate Middleton Ternyata Contek Gaya Busana Meghan Markle', 'ENTERTAINMENT', 'DATA LATIH', 'Meghan Markle dan Kate Middleton santer dikabarkan tidak akur. Meski begitu, Meghan tampaknya memberikan inspirasi sendiri untuk iparnya tersebut.\r\n\r\nDilansir dari Daily Mail, Rabu (22/1), Kate tampak meniru gaya Duchess of Sussex ketika dia tiba di Cardiff untuk urusan kerajaan. Kate tampak mengenakan mantel warna unta Massimo Dutti seharga 349 poundsterling atau setara Rp 6,2 jutaan yang sangat mirip dengan mantel Reiss seharga 345 poundsterling atau setara Rp 6,2 jutaan milik Meghan saat dikenakan dalam kunjungannya ke Canada House bulan ini.\r\n\r\nKedua mantel wol ini memiliki label lipat, pinggang yang disesuaikan dengan kancing, lengan kancing dan dua saku setinggi pinggul. Entah apakah mereka memang memiliki selera sama, namun Meghan saat itu memadukannya dengan rok sutera cokelat seharga 89,95 poundsterling atau setara Rp 1,6 jutaan yang dikenakan Meghan bulan ini. Rok itu berasal dari Massimo Dutti, toko high-end yang sama dengan mantel Kate Middleton. Entah apa maksud di balik gaya Kate Middleton yang mirip dengan iparnya itu.\r\n\r\nSementara itu, Kate memadukan mantelnya dengan sepatu bot Ralph Lauren, rok macan tutul warna coklat Zara yang serupa dengan rok sutra Meghan. Palet warna cokelat dari pakaian itu mirip dengan milik Meghan.\r\n\r\nPenampilan Kate itu ditampilkannya saat dua datang mengunjungi Welsh Capital untuk kunjungan keduanya selama 24 jam perjalanan di Inggris. Ibu dari tiga anak itu mengunjungi Cardiff untuk menghadiri kelas edukasi indera bayi di Ely and Careau Children’s Centre.\r\n\r\nKate memulai tur solonya di Birmingham. Dimulai dengan menghadiri pertemuan KTT Investasi Afrika-Inggris, lalu menggulirkan survei kesehatan anak, hingga menghadiri kelas edukasi anak. Kate terlihat semangat meski semua tugas kerajaan Meghan Markle barangkali dibebankan padanya. Sebab kini, Meghan Markle lebih memilih hidup mandiri bersama keluarga kecilnya di Kanada.'),
(1287, 'Mimpi Inul Inul Daratista yang Belum Kesampaian Membuat Panti Asuhan', 'ENTERTAINMENT', 'DATA LATIH', 'Pedangdut Idul Daratista berulang tahun ke-41 tahun, belum lama ini. Di usianya sekarang, istri dari Adam Suseno itu ingin memberikan manfaat yang sebesar-besarnya untuk banyak orang. Inul pun kepikiran membuat yayasan yang dapat menampung anak-anak kurang beruntung di momen ultahnya tahun ini.\r\n\r\n“Sebenarnya yang belum kesampian, saya mau bikin semacam kayak yayasan, satu tempat yang bisa bikin saya damai. Di sana ada masjid atau musala dan ada anak-anak yatim,” ujar Inul Daratista saat ditemui bilangan Pejaten Village, Jakarta Selatan, Rabu (22/1).\r\n\r\nUntuk saat ini Inul belum dapat merealisasikan keinginannya tersebut karena masih banyak hal yang perlu dipersiapkan. Salah satu yang paling mendasar, Inul belum menemukan lokasi yang tepat untuk membangun panti asuhan. Inul pun sudah mencari informasi terkait lokasi strategis yang kemungkinan bisa dijadikan tempat berdirinya panti asuhan.\r\n\r\n“Kepikirannya sekarang masih cari lahan prosesnya seperti apa, masih cari-cari informasi,” ucap pemilik nama lahir Ainur Rokhimah tersebut.\r\n\r\nSementara cita-cita yang sudah tercapai di usianya ke-41, Inul Daratista bisa memberangkatkan umrah 62 orang secara gratis. Mereka terdiri dari 59 orang pelanggan bisnis karaoke miliknya dan 3 orang lainnya karyawan dari pemilik Goyang Ngebor.\r\n\r\nSelama berada di Tanah Suci, Inul memastikan fasilitas yang diberikannya kepada 62 orang tersebut sama dengan yang didapat jamaah umrah lain. Rencananya mereka akan berangkat rame-rame ke Tanah Suci pada Maret 2020 mendatang.\r\n\r\n“Di sana mereka selama sekitar 9 hari. Di Madina 3 malam, di Mekkah 4 malam. Mereka dapat fasilitas yang didapat pada umumnya umrah yang lain. Ini full ibadah,” ucap Inul Daratista. '),
(1288, 'Teddy Sudah Serahkan Rumah dan Ruko ke Anak Perempuan Sule', 'ENTERTAINMENT', 'DATA LATIH', 'Teddy, suami dari mendiang Lina Jubaedah sudah menyerahkan aset berupa rumah dan ruko kepada Putri Delina, anak perempuannya dan komedian Entis Sutisna alias Sule. Penyerahan itu dilaksanakan sesuai amanah dari mendiang Lina sebelum meninggal.\r\n\r\nKabar penyerahan aset tersebut diungkapkan Teddy. “Betul, itu amanahnya sebelum almarhumah istri meninggal. Sudah ada ucapan dikasih nama Teh Putri,” ucap Teddy melalui pesan singkat.\r\n\r\nMenurut penuturannya, aset berupa rumah dan ruko itu diberikan Lina secara langsung kepada Putri. Teddy pun sempat menyaksikan prosesi penyerahan tersebut. “Kalau sertifikatnya baru kemarin karena sebelumnya masih dititip di koper travel merah ibunya,” ungkapnya lebih lanjut.\r\n\r\nTeddy kini bisa lebih tenang karena amanah almarhumah Lina sudah dia mulai tunaikan satu per satu. Dia pun mengatakan akan menuntaskan semua anamah dari mendiang istri, termasuk kepada Rizky Febian.\r\n\r\n“Iya semua amanat bakalan dikasihkan sesuai keinginan almarhumah. Alhamdulillah walaupun pemberitaan beda dengan kenyataan, saya terima asal almarhumah istri tenang,” tutur Teddy.\r\n\r\nSeperti diketahui, Lina Jubaedah meninggal di Bandung, Jawa Barat, pada Sabtu, 4 Januari 2020. Jenazahnya awalnya dimakamkan di pemakaman Sekelimus namun akhirnya dipindah ke TPU Nagrog, Ujung Berung, Bandung, atas kesepakatan bersama antara Rizky Febian dan Teddy usai dilakukan otopsi.\r\n\r\nBelakangan diketahui kalau mendiang Lina meninggalkan aset dalam jumlah besar. Jika dikalkulasi, harta peninggalan mantan istri komedian Sule itu diperkirakan mencapai Rp 10 miliar. Asetnya terbagi berupa rumah, kontrakan 32 pintu, tanah, salon, tanah dan yang lainnya.'),
(1289, 'Perkembangan Kasus Lina Jubaedah, Polisi Sudah Periksa 17 Saksi', 'ENTERTAINMENT', 'DATA LATIH', 'Kepolisian bergerak cepat menindaklanjuti laporan yang dilakukan Rizky Febian terkait meninggalnya Lina Jubedah yang diduga tidak wajar. Selain melakukan otopsi jenazah, polisi juga sudah memeriksa sejumlah saksi.\r\n\r\nSedikitnya sudah ada 17 saksi yang berhasil dimintai keterangan oleh penyidik dari Mapolrestabes Bandung, Jawa Barat. Para saksi tersebut terdiri dari saksi pelapor yaitu Rizky Febian, dokter Rumah Sakit Al Islam, satpam, orang yang memandikan jenazah Lina, dan yang lainnya.\r\n\r\n“Sudah ada 17 saksi yang sudah dimintai keterangan. Terakhir dokter Rumah Sakit Al Islam yang kami mintai keterangan,” ucap Kabid Humas Polda Jawa Barat Kombes Pol Saptono Erlangga kepada wartawan, Rabu (22/1).\r\n\r\nDokter Rumah Sakit Al Islam Bandung diminta keterangannya lantaran Lina sempat dilarikan ke rumah sakit tersebut sebelum akhirnya meninggal dunia. Penyidik merasa perlu untuk mendapatkan informasi dari dokter yang menangani untuk mengetahui kondisi terakhir Lina.\r\n\r\nSudah cukup banyak saksi yang diperiksa, kini penyidik tengah menunggu hasil otopsi atas jenazah Lina yang kemungkinan akan keluar dalam waktu dekat. Hasil otopsi sangat penting karena akan mengungkap fakta penyebab meninggalnya istri Teddy tersebut.\r\n\r\nJika hasil otopsi menyatakan bahwa kematian Lina tidak wajar, maka polisi akan mengembangkan kasus ini. Tentunya guna memburu siapa pelaku yang harus bertanggungjawab.\r\n\r\n“Karena tugas penyelidik membuat terang suatu tindak pidana,” ucap Saptono Erlangga lebih lanjut.\r\n\r\nSeperti diketahui, Lina Jubaedah yang merupakan ibunda dari penyanyi Rizky Febian dan Putri Delina meninggal pada Sabtu, 4 Januari 2020. Ia menghembuskan napas terakhir pada waktu Subuh setelah sempat pingsan di rumah dan dilarikan ke Rumah Sakit Al Islam, Bandung, Jawa Barat.\r\n\r\nPenyebab meninggalnya Lina awalnya disebut karena darah tinggi dan adanya permasalahan pada bagian lambung. Namun, belakangan Rizky Febian mempertanyakan penyebab meninggalnya Lina yang menduga ada ketidakwajaran. Sehingga dia pun membuat lapora polisi ke Polrestabes Bandung, Jawa Barat pada 6 Januari 2020.'),
(1290, 'Menebak Chemistry Jennifer Aniston dan Brad Pitt Lewat Bahasa Tubuh', 'ENTERTAINMENT', 'DATA LATIH', 'Momen Brad Pitt dan Jennifer Aniston saat bersama dulu\r\nSudah 15 tahun sejak Brad Pitt dan Jennifer Aniston bercerai, tapi hubungan keduanya kembali menjadi sorotan. Mereka ramai menjadi perbincangan setelah masing-masing memenangkan Penghargaan SAG pada 19 Januari lalu. Brad Pitt dan Jennifer Aniston mengadakan ‘reuni’ hangat di belakang panggung.\r\n\r\nSebuah foto yang diambil, keduanya yang menikah dari 2000 hingga 2005, tengah melakukan percakapan. Tak usah banyak kata-kata, tetapi bahasa tubuh mereka menyimpan sejuta makna. Apalagi ketika Brad Pitt menatap mantan istrinya dan memegang pergelangan tangannya.\r\n\r\nMata Brad Pitt, senyuman, dan ekspresi gembira, saat memandang Jennifer Aniston. Seolah terjadi percikan saat itu. Apakah mereka akan bernostalgia?\r\n\r\nDilansir dari OprahMag.com, Rabu (22/1), Pakar Bahasa Tubuh, Patti Woods, mengatakan publik tidak salah untuk langsung sampai pada kesimpulan bahwa ada chemistry di antara mereka. Dia menyebut ada ‘koneksi yang mendalam’ lewat foto. Wood menunjuk ke tangan kanan Pitt, yang memegangi penghargaan.\r\n\r\n“Penghargaannya ada di tangannya, tetapi dia memegangnya rendah, di bawah pinggangnya. Yang penting baginya adalah Jennifer,” kata Wood.\r\nMomen Brad Pitt dan Jennifer Aniston saat pegangan tangan. (Getty Images/Boldsky)\r\n\r\nTangan kiri Pitt, yang menggenggam tangan kanan Aniston mengatakan ‘tetaplah di sini bersamaku’. Wood melihat Aniston punya sikap peduli pada Pitt.\r\n\r\n“Ekspresinya adalah kombinasi yang sangat tulus dari tawa dan air mata,” kata Wood, kontras dengan posisi tubuhnya.\r\n\r\nMeski begitu Aniston berusaha untuk tetap membatasi diri. Sikap itu bisa dimengerti, sebab pasti masih tersisa rasa sedih dari masalah mereka terdahulu. Pernikahan mereka berakhir pada 2004, setelah Brad Pitt bertemu Angelina Jolie, calon istrinya, saat syuting Mr. dan Mrs. Smith.\r\n\r\nMenurut Wood, ini adalah momen interaksi yang ‘paling kuat’. Terlebih saat Brad Pitt tetap memegang tangan Jennifer Aniston saat ingin pergi.\r\n\r\nLalu bagaimana dengan Jennifer?\r\n\r\n“Lihat bagaimana jari-jarinya (Jennifer Aniston) bertumpu pada dada (Brad Pitt) dengan jari-jari canggung dan tidak rata terentang, dengan beberapa jari tertekuk? Penempatan jari yang canggung dan ketegangan jari menunjukkan pertentangan batinnya, keinginannya ingin tetap terhubung, tapi masih membatasi,” kata Wood.\r\n\r\nDalam laman US Magazine, momen manis di belakang panggung tersebut berasal dari jepretan seorang fotografer, Vivien Killilea Best. Dia berbagi detail foto di Instagram setelah pertunjukan, menggambarkan Brad Pitt yang penuh semangat memanggil nama Aniston ketika ia berada di belakang panggung.\r\n\r\n“Saya berada di belakang panggung di penghargaan SAG dan mendengar suara yang akrab berteriak ‘Aniston ! ANISTON!. Saya langsung berbalik dan melihat momen langka sesaat ini terjadi,” kata sang fotografer.\r\n\r\nDalam foto itu, keduanya terlihat sebentar berpegangan tangan dan berpelukan. Tatapan matanya tampak senang melihat satu sama lain. Bahkan ketika berada di belakang panggung, Brad Pitt menatap lewat layar tanpa berkedip saat mantan istrinya mengucapkan terima kasih atas penghargaan yang diterima.'),
(1291, 'Hasil Otopsi Jenazah Ibunda Rizky Febian Segera Dirilis', 'ENTERTAINMENT', 'DATA LATIH', 'Penyebab kematian ibunda penyanyi Rizky Febian dan Putri Delita, Lina Jubaedah, masih menunggu hasil otopsi. Seperti diketahui, pihak yang berwajib telah melakukan otopsi terhadap jenazah Lina pada 9 Januari 2020 lalu.\r\n\r\nLantas sejauh mana perkembangannya?\r\n\r\nKabid Humas Polda Jawa Barat Kombes Pol Saptono Erlangga sebelumnya mengatakan, hasil otopsi Lina diperkirakan akan keluar setelah 14 hari kerja. Mengacu pada keterangan yang disampaikan tersebut, hasil otopsi Lina akan keluar dalam waktu dekat. Dia meminta untuk menunggu dalam satu atau dua hari ke depan.\r\n\r\n“Untuk hasil otopsi, kita tunggu dalam satu atau dua hari ke depan. Karena normatifnya kan 14 hari kerja disampaikan dari laboratorium forensik, ” ujar Kombes Pol Saptono Erlangga, Rabu (22/1).\r\n\r\nDia pun berharap hasil otopsi Lina bisa diungkap dalam waktu dekat supaya ada kepastian terkait penyebab meninggalnya Lina yang menghembuskan napas terakhir pada Sabtu, 4 Jauari 2020. Hasil otopsi akan mengungkap fakta apakah kematian mantan istri Sule itu termasuk wajar atau tidak wajar.\r\n\r\n“Nanti kita lihat hasil otopsinya seperti apa. Apakah ada ketidakwajaran atau wajar karena sakit. Kami juga lagi menunggu hasilnya,” katanya lebih lanjut.\r\n\r\nJika ada temuan kalau meninggalnya Lina tidak wajar, Saptono Erlangga menegaskan pihak berwajib akan menindaklanjutinya. Tentunya untuk mengetahui siapa pelaku yang bertanggung jawab melakukan dugaan tindak pidana tersebut. Hasil otopsi ini erat kaitannya dengan perkembangan laporan Rizky Febian yang membuat laporan polisi ke Polrestabes Bandung, Jawa Barat, pada 6 Januari 2020.\r\n\r\n“Kalau ditemukan adanya ketidakwajaran, maka tugas penyidik mengungkap pelakunya,” ungkap Kombes Pol Saptono Erlangga.'),
(1292, 'Jadi Pemeran Pendukung, Dian Satro Akui Ingin Fokus Jadi Produser', 'ENTERTAINMENT', 'DATA LATIH', '20 tahun berkarya di panggung film Indonesia, aktris Dian Sastrowardoyo akhirnya memberanikan diri menjadi produser. Lewat film pertamanya bergenre komedi ‘Guru-guru Gokil’, Dian Sastro siap bergerak di belakang layar.\r\n\r\nBagi Dian Sastro, keputusannya untuk menjadi produser bukan tanpa perhitungan. Bermodal pengalaman dan jaringannya, Dian yakin kalau ia bisa mengangkat film yang berkualitas ke layar lebar.\r\n\r\nTapi, dalam film ‘Guru-Guru Gokil’ Dian pun masih tampil di depan layar. Hanya saja diakuinya, peran yang dimainkan Dian tidak besar. Sebab, dia khawatir jika porsinya dalam film ini besar, malah justru akan mengganggu fokusnya sebagai produser.\r\n\r\n“Sebenarnya gue enggak mau main awalnya, terus terang saja. Aku mundur ke pemeran pendukung karena aku enggak berani. Gimana aku bisa fokus belajar jadi produser kalau peran aku terlalu besar di film aku,” kata Dian Sastro saat ditemui di Plaza Senayan, Jakarta, Selasa (21/1).\r\n\r\nDalam film ‘Guru- Guru Gokil’ Dian Sastro berperan sebagai Nimala, seorang ibu yang tengah hamil namun harus tetap menjalani karir. Selain Dian, film ini dibintangi Gading Marten, Ibnu Jamil, Asri Welas, Faradina Mufti, Kevin Ardivola, Shakira Jasmine, Boris Bokir dan yang lainnya.\r\n\r\nFilm arahan sutradara Sammaria Sari Simanjuntak itu bercerita tentang Taat (Gading Marten), seorang yang berambisi untuk sukses mengejar pundi-pundi namun kerap menemui kegagalan dalam karir. Keadaan kemudian memaksa Taat untuk bekerja menjadi guru pengganti di sebuah sekolah. Tak lama setelah itu terjadi insiden yang menimpa para guru. Dari situ, pandangan Taat terhadap uang dan sebuah kesuksesan jadi berubah.'),
(1293, 'Meghan Markle Dijaga Polisi Saat Lintasi Hutan Bersama Archie', 'ENTERTAINMENT', 'DATA LATIH', ' Baby Archie digendong oleh ibunya, Meghan Markle. (Cosmopolitan)\r\n\r\nJawaPos.com – Meski sudah resmi mundur dari kerajaan Inggris, pengamanan bagi keluarga Meghan Markle dan Pangeran Harry masih tetap melekat. Keluarga mereka tetap dijaga bodyguard dari pihak kepolisian Inggris dan Kanada. Salah satu contohnya terlihat saat Meghan Markle sedang berjalan-jalan santai bersama anaknya, Archie, dan 2 anjing kesayangannya.\r\n\r\nDilansir dari Daily Mail, Rabu (22/1), pengawal kepolisian Inggris menjaga Meghan, Harry dan Archie di Vancouver yang telah berkoordinasi dengan pihak Kanada. Meskipun masih menjadi perdebatan siapa yang akan menanggung beban biaya pengamanan mereka selanjutnya.\r\n\r\nMeghan ceria sambil tersenyum berjalan melintasi hutan bersama Archie dan dua anjingnya. Meghan mengenakan busana olahraga training sambil menggunakan gendongan bayi di depan tubuhnya. Sementara dua polisi tetap mengawal dari jarak yang cukup dekat.\r\n\r\nTak hanya Meghan, tentunya suaminya, Pangeran Harry juga dikawal. Duke of Sussex, yang mendarat di Kanada, dikawal di pesawat oleh polisi.\r\n\r\n“Meghan dijaga oleh pengawalnya polisi Inggris dan seorang polisi Kanada Mountie. Harry terbang dengan pengawal juga tadi malam,” kata sumber kepada MailOnline.\r\n\r\nPolisi Mounties ternyata sudah lama akrab dengan Meghan Markle. Polisi tersebut juga ditempatkan di luar rumah Meghan di Toronto ketika ia mulai berkencan dengan Harry pada 2016. Dan sudah melindungi Gubernur Jenderal Kanada, perwakilan Ratu di negara itu.\r\n\r\nPerdana Menteri Justin Trudeau telah mengisyaratkan bahwa negaranya akan mengambil sebagian dari pengeluaran keamanan. Akan tetapi sebuah jajak pendapat terhadap 1.154 orang dewasa Kanada mengungkapkan minggu lalu bahwa 73 persen tidak ingin pemerintah mereka membayar biaya keamanan bagi pasangan itu.\r\n\r\nTerlepas dari semua itu, Meghan Markle terlihat ceria bersama Archie dan memang bersiap memulai kehidupan baru dengan keluarga kecilnya. Dan Archie akan semakin dekat dengan ibunda Meghan Markle, Doria Ragland.'),
(1294, '‘Solo Karir’, Kate Middleton Lakukan Survei Angka Kesehatan Anak', 'ENTERTAINMENT', 'DATA LATIH', 'Kini tugas kerajaan dilakukan oleh Kate Middleton sepenuhnya setelah iparnya, Meghan Markle, memilih keluar dari kerajaan. Usai mengawali tugas kerajaannya dengan bertemu para pemimpin Afrika dalam KTT Investasi Inggris-Afrika, kali ini ibunda 3 anak itu melakukan survei untuk melihat angka kesehatan dan kebahagiaan anak.\r\n\r\nDilansir dari Daily Mail, Rabu (22/1), Kate melakukan survei kesehatan anak usia dini. Dia berharap bisa mendapatkan data yang pasti untuk membuat perubahan bagi generasi yang akan datang. Duchess of Cambridge menghabiskan 24 jam keliling negara itu untuk mempublikasikan programnya itu\r\n\r\n“Sebagai orang tua, saya tahu betapa kami sangat menghargai kesehatan dan kebahagiaan masa depan anak-anak kami. Saya ingin mendengar masalah-masalah utama yang mempengaruhi keluarga dan masyarakat sehingga saya dapat memfokuskan pekerjaan saya di tempat yang paling dibutuhkan. Ambisi saya adalah untuk memberikan perubahan yang langgeng bagi generasi yang akan datang,” kata istri Pangeran William itu.\r\n\r\nKate menggulirkan survei jajak pendapat, ‘Lima Isu atau Masalah Besar bagi Balita’. Program ini dianggap sebagai program terbesar yang dilakukannya.\r\nKate Middleton melakukan survei untuk mengetahui tingkat kesehatan dan kebahagiaan anak. (PA)\r\n\r\nBerbicara di MiniBrum, sebuah kota mini seukuran anak di Thinktank, museum sains Birmingham, Kate menyapa anak-anak di sana dengan senyum ramah. Kate menyambut curhatan para orang tua soal anak.\r\n\r\n“Orang tua, wali, dan keluarga merawat anak-anak pada tahun-tahun awal Golden Age, jadi itu sebabnya saya benar-benar ingin mendengarkan para orang tua,” tutur Kate.\r\n\r\nMenurut Kate, tahun-tahun awal perkembangan anak sangat penting bagi kesehatan dan kebahagiaan di masa depan. Cantik mengenakan kemeja bermotif hijau cerah dan celana panjang berkaki lebar, Kate tur keliling ‘kota mini’ oleh ‘walikota mini’ berusia 8 tahun, Poppy Jordan.\r\n\r\nAnak-anak dari Henley Montessori School dan St Paul’s Nursery di Balsall Heath, menyambut Kate dengan hangat. Dia juga mengunjungi sebuah sudut bangunan, membantu mengangkat batu bata karet ke derek dan membantu seorang anak kecil untuk mengenakan topi keselamatannya.\r\n\r\nKate bertemu dengan orang tua muda, untuk memastikan bahwa ibu baru jangan merasa sendiri. Kelompok ini kemudian duduk bersama untuk membahas berbagai masalah seputar orang tua.\r\n\r\n“Apa yang kita alami antara usia nol sampai lima tahun membentuk otak anak berkembang. Sebagai seorang ibu, itu memberi saya perspektif yang berbeda,” katanya.\r\n\r\n“Ada begitu banyak tekanan pada orang tua untuk merasa tanggung jawab pada anak,” tambahnya.\r\n\r\nJajak pendapat akan dilakukan selama sebulan, dengan hasil yang akan terungkap pada bulan Maret. Setelah itu langkah selanjutnya akan dilakukan.\r\n\r\nKate telah mengerjakan program inisiatif sejak pernikahannya delapan tahun lalu, mendedikasikan sebagian besar keterlibatan publik dan pribadinya untuk pelayanan. Pada 2018, ia mengumpulkan sekelompok ahli dari akademisi, pendidikan, kesehatan, dan bidang lainnya untuk fokus membantu keluarga mengatasi perilaku anti-sosial, kecanduan dan kesehatan mental, yang telah memainkan peran penting dalam menyusun survei.'),
(1295, 'Keceriaan Meghan Markle Ajak Archie dan 2 Anjingnya Jalan-Jalan', 'ENTERTAINMENT', 'DATA LATIH', 'Meghan Markle dan Pangeran Harry sudah memulai kehidupan mereka sebagai orang biasa di Kanada. Meski sudah berstatus rakyat jelata, tetap saja mereka jadi sorotan media.\r\n\r\nSudah resmi keluar dari lingkaran kerajaan, Meghan Markle tampak begitu bahagia dan lepas. Hal itu ditunjukkan Meghan saat sedang berjalan-jalan dengan kedua anjingnya sambil menggendong Archie.\r\n\r\nDilansir dari Daily Mail, Selasa (21/1), Meghan, Archie dan anjing-anjingnya terlihat berjalan-jalan di Taman Regional Horth Hill, tak jauh dari rumah yang mereka sewa seharga 10 juta poundsterling (USD 14 juta) atau setara Rp 190-an miliar. Wajah Meghan nampak begitu berseri-seri\r\n\r\nMeghan tak cuma melakukan jalan-jalan biasa. Kegiatan itu ia lakukan untuk berolahraga. Disebutkan bahwa The Duchess of Sussex menghabiskan sejumlah uang untuk busana olahraganya. Tak kurang dari USD 98 (88 poundsterling) atau setara Rp 1,3 jutaan ia keluarkan untuk membeli legging Lululemon ‘Align’, zip-up angkatan laut, dan beanie rajutan.\r\n\r\nMeghan melengkapi penampilannya dengan sepatu Sienna ‘seharga USD 160 (120 poundsterling) atau setara Rp 2 jutaan dari merek Kanada. Diperkirakan Meghan akan lebih sering olahraga hiking, pilates dan yoga.'),
(1296, 'Netizen Ingin Jennifer Aniston dan Brad Pitt Akur Lagi', 'ENTERTAINMENT', 'DATA LATIH', 'Ada-ada saja yang dipikirkan warganet saat menanggapi isu hangat yang menerpa selebriti Brad Pitt dan Jennifer Aniston. Isu itu berlanjut lantaran keduanya tertangkap kamera media, sedang ‘reuni’ dan berbicara hangat satu sama lain di belakang panggung Screen Actor Guild (SAG) Awards.\r\n\r\nDilansir dari Mirror, Selasa (21/1), spekulasi atau tebak-tebakan netizen semakin ‘liar’ saat melihat foto Jennifer Aniston di akun media sosialnya di mana ada 2 foto. Foto pertama menunjukkan Aniston sedang berada di mobil dengan gaun yang ia kenakan di acara SAG Awards. Foto kedua, Aniston sengaja meletakkan gaun dan sepatu yang ia kenakan tadi di lantai kamar mandi dengan penghargaan yang dia raih di dekat bath tub.\r\n\r\nPenggemar langsung menggoda Aniston bahwa ada Pitt di dalam mobil itu. Candaan ini dilontarkan setelah pertemuan romantis Aniston dan Pitt di belakang panggung SAG Awards. Karuan saja, netizen langsung menyerbu kolom komentar foto tersebut.\r\n\r\n“Apakah Brad ada di sana bersama Anda?,” kata salah satu netizen.\r\n\r\n“Apakah Brad yang mengambil gambar?,” tanya netizen lain tak kalah penasaran.\r\n\r\n“Ayo kembali dengan Brad! Anda berdua cocok bersama lagi,” sergah para netizen lainnya.\r\n\r\nPitt sendiri terlihat tidak mau ambil pusing dengan rumor itu. Saat diwawancara Extra TV Renee Bargh, presenter asal Australia, Renee sempat menggoda Pitt dengan mengatakan ia punya chemistry yang luar biasa Aniston. Pitt dengan santai mengedipkan mata ke arah kamera sambil menganggukkan kepalanya ke arah presenter.'),
(1297, 'Perdana Rayakan Imlek, Betrand Peto Diberi Nama Tionghoa', 'ENTERTAINMENT', 'DATA LATIH', 'Betrand Peto untuk pertama kalinya akan merayakan Imlek setelah diadopsi oleh Ruben Onsu. Tak cuma itu, Betrand juga akan mendapat nama Tionghoa.\r\n\r\nDiungkapkan Ruben Onsu, Betrand sangat antusias untuk menyambut perayaan Imlek di tahun ini. “Dia ingin tahu perayaan Imlek di keluarga ayah (Ruben,red) itu seperti apa. Karena dia sudah semakin tahu tentang kami,” kata Ruben Onsu saat ditemui di bilangan Tendean, Jakarta Selatan, Selasa (21/1).\r\n\r\nRuben menuturkan, ia ingin memberi Betrand Peto nama Tionghoa karena semua anaknya juga memiliki nama Tionghoa. Meskipun, nama itu tidak untuk digunakan sebagai nama panggilan dalam kehidupan sehari-hari.\r\n\r\n“Thalia (putri Ruben, Red) kan punya nama Chinese, Thania juga punya. Akhirnya saya juga memberi nama Chinese untuk Betrand,” tuturnya lebih lanjut.\r\n\r\nMenurut penuturan Ruben, pemberian nama Chinese untuk Betrand menggunakan perhitungan tanggal lahir, hari, dan jam. Baru setelah itu dilakukan penjumlahan untuk kemudian dirumuskan nama yang paling tepat.\r\n\r\nNamun sayangnya dalam kesempatan itu Ruben belum mau buka-bukaan terkait nama yang diberikannya untuk Betrand. Akan tetapi Ruben berjanji mau memberi tahu ke publik ketika Hari Raya Imlek tiba yang akan jatuh pada Sabtu, 25 Januari 2020 mendatang.\r\n\r\n“Pokoknya nanti dikasih tahu lah,” ucap Ruben Onsu.'),
(1298, 'Demi Totalitas Peran, Tora Sudiro ‘Hilangkan’ Tato di Tubuhnya', 'ENTERTAINMENT', 'DATA LATIH', 'Tora Sudiro dikenal sebagai salah satu artis yang memiliki banyak tato pada sejumlah bagian tubuhnya. Namun dia tertantang untuk ‘menghilangkan’ tato yang memenuhi bagian- bagian tubuhnya itu demi totalitas perannya dalam film ‘Mangga Muda’. Bukan menghilangkan secara permanen, Tora memilih menghilangkannya dengan menggunakan make-up khsusus.\r\n\r\n“Tato enggak kelihatan ditutupin pakai make-up khusus. Kalau orang sewa aku sudah include makeup-nya, jadi memang bisa nutupin sendiri,” kata Tora Sudiro saat ditemui di XXI Plaza Senayan, Jakarta Pusat, belum lama ini.\r\n\r\nTerbiasa memiliki tato terus tiba-tiba hal itu tidak terlihat di badannya, Tora Sudiro sempat merasa ada yang kurang. Dia bahkan sempat merasa terganggu akibat perubahan drastis tersebut. Namun untungnya seiring berjalannya waktu syuting, Tora Sudiro mulai bisa beradaptasi dengan penampilan barunya.\r\n\r\nMenghilangkan tato menggunakan make-up ternyata tidak mampu bertahan lama. Menurut penuturan Tora, tato yang didempul dengan make-up hanya bisa bertahan paling lama sekitar setengah hari.\r\n\r\nDalam kesempatan itu dia juga mengatakan, sejatinya Tora tidak diminta untuk menghilangkan tato yang melekat di tubuhnya oleh sang sutradara. Namun mengingat karakter yang diperankannya itu dia anggap tidak tepat jika menggunakan tato, Tora Sudiro memiliki inisiatif sendiri untuk menghilangkannya.\r\n\r\n“Sutradaranya justru santai. Dia bilang enggak apa-apa kalau mau tatoan, cuma gue pikir kayaknya kurang cocok kalau peran ini bertato. Akhirnya gue tutupin,” tutur pemain film Warkop DKI Reborn itu.\r\n\r\nDalam film ‘Mangga Muda’, Tora Sudiro berperan sebagai Agil yang merupakan seorang supir taksi. Film ini mengisahkan lika-liku hidup Agil yang ingin memiliki keturunan namun tidak kunjung hamil.\r\n\r\nDemi memiliki anak, Agil sempat bernazar akan mengikuti semua permintaan istrinya ketika hamil. Namun siapa sangka, permintaan Luli malah membuat Agil pusing tujuh keliling.\r\n\r\nSelain Tora Sudiro, pemain lainnya adalah Alexandra Gottardo, Gary Iskak, dan Nafa Urbach. Film tersebut akan tayang di bioskop Tanah Air mulai 23 Januari 2020.'),
(1299, 'Gunakan Pesawat Komersial, Pangeran Harry Tiba di Kanada dengan Kasual', 'ENTERTAINMENT', 'DATA LATIH', 'Komitmennya untuk meninggalkan seluruh kemewahan dan tahta kerajaan, dibuktikan oleh Pangeran Harry. Dia membuktikan bahwa dia terbang ke Kanada menemui istrinya, Meghan Markle dan buah hatinya, Archie, dengan gaya seperti penumpang biasa. Tak begitu tampak mencolok pengamanan ekstra seperti biasanya.\r\n\r\nHarry sudah mulai terbiasa sederhana dengan naik pesawat jenis Boeing 747. Setelah menjalankan tugas kerajaan terakhir menyapa para pemimpin dunia di KTT Investasi Inggris-Afrika di London drngan jas dan dasi, Harry bersiap untuk melepas rindu bersama keluarga kecilnya.\r\n\r\nHarry tiba di Kanada, pada Senin malam (20/1), setelah terbang dari London Heathrow dengan menggunakan British Airways 85 seperti dilaporkan Mail Online. Harry tidak terbang naik pesawat jet pribadi.\r\n\r\nDilansir dari Mirror, Selasa (21/1), Harry terlihat tiba di Bandara Victoria dengan pakaian yang jauh lebih sederhana. Dia mengenakan beani biru, mantel hitam, dan celana jins sambil membawa ransel ala backpacker. Dia keluar dari pesawat Boeing 747 melalui tangga bersama dua penjaga keamanan.\r\nPangeran Harry saat tiba di Kanada. (Phil Harris)\r\n\r\nDia langsung dijemput dengan cepat menggunakan mobil minivan hitam. Harry akan pergi ke Montreal dan kemudian ke Vancouver, di mana dia akan naik mobil selama 25 menit ke Victoria di Pulau Vancouver, dan kemudian ke Mille Fleurs (rumah sewaan seharga 10 juta poundsterling atau setara Rp 180 miliar) tempat istri dan anaknya tinggal.\r\n\r\nSebelumnya pada hari Senin (20/1), Harry bertemu dengan Perdana Menteri Boris Johnson dan para pemimpin dunia di KTT di London, sebelum ia resmi meletakkan tahta pada musim semi.\r\nHarry memberikan pidato emosional dan mengatakan bahwa dia tidak punya pilihan lain selain menyerahkan tugas resminya dan membangun kehidupan baru di Kanada, di mana istri dan putranya sedang menunggunya.\r\n\r\nBaru-baru ini Meghan dan Archie terkihat keluar untuk berjalan-jalan di jalur hutan di Pulau Vancouver, dengan beagle dan seekor Labrador hitam. Sementara kakak, Duke of Cambridge, melanjutkan jadwal tugas kerajaan yang sibuk.'),
(1300, 'Ajak Mulan Jameela Nonton, Ahmad Dhani Penasaran dengan Akting Al', 'ENTERTAINMENT', 'DATA LATIH', 'Musisi Ahmad Dhani terlihat berada di XXI Epicentrum, Rasuna Said, Jakarta Selatan pada Senin (20/1) malam. Dia menghadiri acara gala premier film ‘Dignitate’. Tidak sendiri, Dhani terlihat bersama Mulan Jameela.\r\n\r\nDi hadapan wartawan, musisi pentolan Dewa 19 itu mengatakan kalau dirinya sengaja meluangkan waktu untuk hadir ke bioskop karena penasaran pengin melihat akting anak sulungnya, Ahmad Ghazali alias Al. Sehingga, kedatangan Ahmad Dhani juga sebagai bentuk dukungannya kepada Al.\r\n\r\n“Penasaran pengin nonton filmnya. Katanya bagus,” ujar Ahmad Dhani sesaat sebelum masuk ke dalam bioskop untuk nonton di bilangan Rasuna Said, Jakarta Selatan.\r\n\r\nMantan suami Maia Estianty itu menyatakan dirinya akan mendukung apapun yang dilakukan Al selama itu positif. Ahmad Dhani pun sangat setuju jika Al fokus di dunia akting selama yang bersangkutan merasa nyaman.\r\n\r\n“Pasti didukung. Apapun itu yang penting kan karya,” ucap Dhani yang belum genap sebulan keluar dari Rutan Cipinang lantaran sempat terjerat masalah hukum di tahun lalu.\r\n\r\nFilm ‘Dignitate’ menceritakan tentang sosol Alfi (Al Ghazali), anak SMA yang cerdas namun memiliki kepribadian keras dan galak. Dia kemudian bertemu dengan Alana (caitlin Halderman) di sekolah yang sama. Keduanya pun diceritakan sebagai sepasang kekasih meskipun sempat tidak berjalan mulus.\r\n\r\nSelain Al Ghazali dan Caitlin Halderman, pemain lainnya adalah Giorgino Abraham, Teuku Ryzki, Sophia Latjuba, Izabel Jahja dan Sonia Alyssa. Film tersebut akan tayang di bioskop mulai 23 Januari 2020.'),
(1301, 'Bikin Baper, Brad Pitt-Jennifer Aniston Pegangan Tangan Hingga Tatapan', 'ENTERTAINMENT', 'DATA LATIH', 'Sudah 15 tahun berlalu, setelah pasangan selebriti Brad Pitt dan Jennifer Aniston bercerai pada 2005. Ternyata percikan perasaan itu sepertinya masih ada. Terlihat dari momen kikuk yang bikin terbawa perasaan alias baper antara mereka berdua di belakang panggung SAG (Screen Actors Guild Awards) Awards 2020.\r\n\r\nKeduanya memang berteman, namun mantan pasangan itu terlihat kikuk saat tertangkap kamera sambil tertawa dan berpegangan tangan. Reuni mereka yang bersahabat mencuri perhatian netizen seperti dilansir dari Boldsky, Selasa (21/1).\r\n\r\nDalam foto terlihat Brad Pitt memegang tangan Jennifer. Keduanya pun telrihat bertatapan sambil tertawa.\r\nMomen Brad Pitt dan Jennifer Aniston saat pegangan tangan. (Getty images/Boldsky)\r\n\r\nJennifer Aniston tampak anggun dalam balutan gaun Dior. Dia mengenakan gaun sutera warna putih tanpa lengan. Dia melengkapi penampilannya, Jennifer terlihat mengenakan cincin berlian.\r\n\r\nSedangkan untuk rias wajahnya, sengaja dibuat rona yang ringan. Dengan lip gloss nude-toned mengkilap, tulang pipi berkontur, dan riasan mata ringan.  Di sisi lain, Brad Pitt tampil dengan sederhana mengenakan tuksedo hitam.\r\n\r\nDalam laman CNN, Jennifer Anison dan Brad Pitt menikah selama lima tahun dari 2000-2005. Ketika Jennifer Aniston mengambil penghargaannya sebagai pemenang aktor perempuan dalam seri drama, beberapa wartawan menangkap Brad Pitt menonton pidatonya di monitor di belakang panggung.\r\n\r\n“Terperangkap saat mata Brad Pitt memandang pemeran Rachel di FRIENDS yang memenangkan Sag Award, Brad Pitt tidak bisa berhenti tersenyum,” tulis E! reporter Jason Kennedy di Twitter.\r\n\r\nKemudian keduanya difoto bertukar di belakang panggung. Meme dan reaksi netizen pun baper. Keduanya salingbtatap dan Brad Pitt memegang erat pergelangan tangan Jennifer Aniston. Tapi sebelumnya, di Golden Globes awal bulan ini, Pitt menyebut Aniston sebagai ‘teman baik’.'),
(1302, 'Dipecat dari Dirut TVRI, Helmy Yahya Beberkan Kesuksesannya', 'ENTERTAINMENT', 'DATA LATIH', 'Sejak Kamis (16/1), Helmy Yahya dinyatakan resmi diberhentikan sebagai Direktur Utama (Dirut) TVRI oleh Dewan Pengawas (Dewas) LPP TVRI. Namun, Helmy pun tak tinggal diam dengan menempuh jalur hukum. Sejumlah karyawan pun sempat protes dengan menyegel kantor Dewas.\r\n\r\nLantas, apa saja sih sebenarnya pembenahan yang dianggap berhasil dilakukan Helmy Yahya?\r\n\r\nMenurut Helmy, dirinya berhasil menaikkan rating dan share televisi berplat merah tersebut. Sebelum menjabat sebagai Dirut, share TVRI tidak sampai 1 persen. Namun setelah Helmy Yahya menjadi Dirut, share naik menjadi 1,59. Bahkan tahun lalu sempat menembus share 1,65.\r\n\r\n“TVRI waktu kami masuk dalam kondisi yang sangat memprihatinkan tidak ditonton. Sharenya di bawah 1 persen. Kalau share di bawah 1 persen itu seperti meraung di ruang hampa tidak ada yang mendengar,” ucap Helmy Yahya.\r\n\r\nDi bawah kepemimpinan lelaki kelahiran 6 Maret 1963 ini, dilakukan rebranding logo setelah sebelumnya disebut-sebut jadul. Helmy mengubahnya jadi lebih kekinian dengan sentuhan menarik. Rebranding ini juga menjadi momentum baginya untuk melakukan perbaikan secara internal.\r\n\r\n“Ganti logo bukan semata-mata ganti logo. Tapi juga mengganti sistem karyawan bekerja, mengganti spirit dan luar biasa hasil dari rebranding. Programnya jadi bagus, orang mulai nonton, logo kami dikagumi dan karyawan sangat bangga sebagai karyawan TVRI dan itu penting,” ungkap Helmy Yahya.\r\n\r\nTVRI memiliki sejarah baru mempunyai peralatan terbaik. Bahkan stasiun TV milik pemerintah ini sudah percaya diri untuk menggarap event besar berkat canggihnya peralatan yang dimiliki.\r\n\r\n“Dulu peralatan TVRI dikatain. Tapi sekarang alatnya menjadi salah satu yang paling canggih di republik ini. Detik-detik proklamasi itu peralatannya TVRI, debat capres pertama itu peralatan TVRI,” ujarnya.\r\n\r\nPerlu diketahui, Helmy Yahya bersama Chandra Hamzah tengah mempersiapkan langkah hukum terbaik guna mengahadapi Dewas. Mantan Wakil Ketua KPK dalam jumpa pers mengatakan bahwa ada sejumlah langkah hukum yang tersedia untuk mengadvokasi kasus yang menimpa Helmy Yahya. Namun sayangnya, Chandra Hamzah masih enggan untuk memberikan bocorannya.'),
(1303, 'Ayah Meghan Markle Sebut Tindakan Anaknya Memalukan', 'ENTERTAINMENT', 'DATA LATIH', 'Ayah Meghan Markle, Thomas Markle, ikut angkat bicara tentang keputusan putrinya dan Pangeran Harry untuk tidak lagi menjadi anggota keluarga kerajaan. Thomas Markle marah atas keputusan putrinya itu dan menyebut keputusan itu sebagai perbuatan yang memalukan.\r\n\r\nDilansir dari People, Senin (20/1), alam sebuah wawancara dengan Channel 5 di Inggris, Thomas, 75, mengklaim bahwa pasangan itu sudah menghancurkan imej dan membuat keputusan ‘murahan’ bagi keluarga kerajaan. Dia menyesalkan sikap putrinya itu.\r\n\r\n“Agak memalukan bagi saya,” katanya ketus.\r\n\r\n“Sebab ketika mereka menikah, mereka sudah sepakat mengambil kewajiban, dan kewajiban itu adalah untuk menjadi bagian dari bangsawan dan untuk mewakili bangsawan dan itu keputusan bodoh bagi mereka jika tidak melakukannya,” tambah Thomas.\r\n\r\nBaginya ketika sudah memutuskan untuk menikah dengan keluarga kerajaan, artinya itu seperti keputusan mengikat selamanya yang tak bisa keluar begitu saja. Hal itu seharusnya sudah menjadi bagian dari komitmen.\r\n\r\n“Dan mereka (Meghan dan Harry) menghancurkannya. Mereka membuatnya seperti murahan,” tukasnya.\r\n\r\nDalam wawancara dengan Channel 5, Thomas mengatakan dia tidak berpikir Meghan atau Harry akan menemuinya usai kehidupan baru nanti. Namun Thomas melihat Meghan dan Harry seperti kehilangan arah.\r\n\r\n“Saya pikir mereka berdua berubah menjadi jiwa yang hilang pada saat ini. Saya tidak tahu apa yang mereka cari. Saya rasa mereka tidak tahu apa yang mereka cari,” tukasnya.\r\n\r\nDilansir dari Mirror, Thomas Markle juga membandingkan keputusan putrinya dengan harapan serta impian perempuan lainnya di dunia ini. Justru perempuan lain berharap dirinya bisa menjadi seorang putri tetapi Meghan justru melepasnya.\r\n\r\n“Dengan Meghan dan Harry berpisah dari Royals itu mengecewakan. Karena sebenarnya Meghan benar-benar sudah mendapatkan impian setiap gadis. Setiap gadis muda ingin menjadi seorang putri dan Meghan mendapatkan itu. Dan sekarang dia membuang itu,” kata Thomas.\r\n\r\nThomas Markle juga mengkritik Meghan dan Harry yang menggunakan dana publik untuk merenovasi rumah di Frogmore Cottage. Meskipun Harry akhirnya telah setuju untuk membayar biaya perbaikan tersebut.\r\n\r\n“Tampaknya USD 3 juta dan rumah 26 kamar tidak cukup puas bagi mereka. Itu agak memalukan bagi saya,” tambahnya.\r\n\r\nSementara itu, Istana Buckingham mengatakan Duke dan Duchess of Sussex berniat untuk membayar 2,4 juta poundsterling perbaikan rumah tersebut dan berusaha untuk mandiri secara finansial. Sedangkan Meghan Markle memutuskan akan membeli rumah baru di Kanada dan tinggal menetap di sana bersama keluarga kecilnya.'),
(1304, 'Rihanna Terlihat Jalan Bareng A$AP Rocky Setelah Putus dari Jameel', 'ENTERTAINMENT', 'DATA LATIH', 'Penyanyi R&B Rihanna baru saja dikabarkan putus dengan miliarder asal Arab Saudi, Hassan Jameel. Karena sedang berstatus single, maka siapapun pria yang dekat dengan Rihanna langsung menjadi obrolan penggemarnya.\r\n\r\nDilansir dari Cosmopolitan, Senin (20/1), baru-baru ini Rihanna beberapa kali tersorot publik telah menghabiskan waktu dengan rapper A$AP Rocky. Meskipun belum terkonfirmasi apa hubungan mereka, namun keduanya baru tampak sebatas dekat.\r\n\r\nUs Weekly melaporkan bahwa pada Jumat (18/1) malam, RiRi, sapaan Rihanna, tersenyum dan tertawa saat nongkrong dengan A$AP Rocky di belakang panggung di konser Yams Day Benefit di Brooklyn, New York. Lokasi ini juga menunjukkan, Rihanna dan Rocky punya catatan sejarah, karena pada 2013 mereka terlihat berciuman saat sedang syuting video musik bersama.\r\n\r\nNamun, keduanya sepertinya masih asyik dengan status teman. Mereka juga pernah bersama terlihat nongkrong selama Paris Fashion Week pada Juni 2019. Dan mereka juga pernah berjalan di karpet merah bersama di The Fashion Awards di London pada bulan Desember 2019.\r\n\r\nMungkin keduanya hanya berteman. Dan tak ada yang bisa menebak apakah Rihanna sudah move-on atau belum dari Hassan Jameel. Ditambah lagi, Rihanna sosok yang cenderung tertutup soal kehidupan pribadinya.\r\n\r\nPublik bahkan tidak tahu mengapa atau alasan apa yang membuat Rihanna dan Hassan putus. Apakah ada orang ketiga atau ada alasan lain.\r\n\r\nApa pun itu, publik menunggu kabar bahagia lanjutan dari Rihanna. Dan tentunya tetap dengan berbagai karyanya yang diharapkan akan menggebrak pada 2020 ini.'),
(1305, 'Putus dengan Hassan Jameel, Rihanna Kini Dekat dengan Drake', 'ENTERTAINMENT', 'DATA LATIH', 'Kemesraan penyanyi R&B Rihanna dengan miliarder asal Arab Saudi, Hassan Jameel, tampaknya tak akan terlihat lagi. Sebab pasangan itu dikabarkan sudah putus. Dan kini justru Rihanna digosipkan sedang dekat dengan Rapper, Drake.\r\n\r\nDilansir dari Cosmopolitan, Minggu (19/1), menurut laporan Us Weekly, Rihanna dan Hassan putus setelah berpacaran hampir selama tiga tahun. Rapper Drake disebut-sebut sedang PDKT dengan Rihanna dan sudah terlihat beberapa kali bareng Rihanna.\r\n\r\nMemang sebelumnya, Rihanna beberapa kali mengungkapkan hubungannya pada Hassan. Rihanna tampaknya saat itu memang belum berniat untuk menikah dalam waktu cepat.\r\n\r\n“Hanya Tuhan yang tahu itu, (kapan menikah) Nak. Kami hanya berencana, kan?,” katanya dalam sebuah wawancara.\r\n\r\nSumber-sumber sebelumnya menceritakan tentang betapa hebatnya dinamika hubungan Rihanna dan Hassan yang menyenangkan. Memang keduanya menjalin hubungan serius dan saling memahami dengan baik. Namun entah mengapa mereka kini memutuskan untuk berpisah.\r\n\r\nRihanna dan Drake baru-baru ini sedang dekat. Terlihat saat Drake mendekati Rihanna dengan hadir di pesta ulang tahun Rihanna pada Oktober. Tentu saja, kehadirannya di pesta tidak berarti apa-apa, tetapi bisa jadi menjadi awal percikan di antara keduanya.'),
(1306, 'Menetap di Kanada, Meghan Markle Naksir Rumah Seharga Rp 378 Miliar', 'ENTERTAINMENT', 'DATA LATIH', 'Usai mengumumkan mundur dari kerajaan Inggris, Pangeran Harry dan Meghan Markle serius menetap tinggal di Kanada. Selama ini sejak liburan, mereka tinggal menyewa sebuah villa di Kanada. Ternyata tak ingin terus-terusan menyewa, Meghan Markle sedang berburu properti untuk membeli rumah tinggal di sana.\r\n\r\nMeghan Markle sedang mengincar sebuah rumah di salah satu daerah paling eksklusif di Kanada. Rumah di tepi laut itu seharga USD 27 juta atau setara Rp 378 miliar di Vancouver, Kanada. Itu artinya mereka memang serius berencana untuk pindah permanen dan menetap.\r\n\r\nDilansir dari Pagesix, Minggu (19/1), Meghan Markle suka dengan sebuah rumah berukurab 6.900 meter persegi di lingkungan Kitsilano Vancouver dengan pemandangan Samudra Pasifik dan cakrawala Vancouver yang indah seperti dikutip dari The Sun. Rumah empat lantai itu memiliki 6 kamar tidur dan 5 kamar mandi dan pagar tinggi untuk privasi.\r\n\r\n“Meghan telah menyatakan minatnya pada rumah yang indah ini. Itu akan jadi tempat tingal sempurna untuknya, Harry dan Archie kecil,” kata seorang makelar minggu lalu.\r\n\r\n“Lingkungan itu dikenal sebagai surga bagi orang-orang kaya yang ingin suasana yang sangat santai. Saya yakin mereka (Meghan, Archie, Harry) akan sangat bahagia,” jelasnya.\r\n\r\nLingkungan rumah tersebut adalah lingkungan bagi sekelompok pengusaha kaya, termasuk miliarder Kanada Chip Wilson yang memiliki rumah di sana bernilai lebih dari USD 40 juta atau setara Rp 560 miliar.\r\n\r\nMeghan Markle memang punya selera tinggi. Keputusannya untuk menetap di Kanada jangka panjang memang bukan isapan jempol. Pulau Vancouver adalah suatu tempat di mana keluarga itu bisa lebih nyaman di tepi lautan. Selama ini Meghan tinggal di Toronto, Kanada, menyewa sebuah villa. Itu terserah pada Duke dan Duchess, apakah mereka akan memilih rumah di Toronto atau Vancouver.\r\n\r\nDalam laman Hello Magazine disebutkan, Kanada memang punya kenangan manis bagi pasangan itu. Saat masih pacaran, mereka tampil go public pertama kali pada bulan September 2017 di Invictus Games. Pangeran Harry diperkirakan akan pulang dari Inggris pekan depan.\r\n\r\nSetelah pengumuman mundur, Duchess of Sussex kini juga sudah mulai kembali hidup normal dengan melakukan sejumlah agenda. Salah satunya kunjungan ke markas organisasi untuk anak dan perempuan di Vancouver. Duke dan Duchess mengatakan mereka berencana untuk membagi waktu mereka antara Inggris dan Amerika Utara setelah mengumumkan mundur dari kerajaan.'),
(1307, 'Demi Anak dan Karir, Andika Mahesa Harus Bolak-balik Jakarta-Lampung', 'ENTERTAINMENT', 'DATA LATIH', 'Demi mendekatkan diri ke anak, Andika Mahesa membuat keputusan besar meninggalkan Ibukota dan kini tinggal di daerah kelahirannya di Lampung. Mau tak mau, ia harus bolak-balik Jakarta-Lampung ketika bekerja di industri hiburan Tanah Air.\r\n\r\n“Iya bolak balik Jakarta-Lampung. Dekat lah cuma 20 menit naik pesawat. Kadang mau tidur, belum tidur sudah keburu sampe,” ucap Andika Mahesa saat ditemui di bilangan Kebayoran Baru, Jakarta Selatan, Sabtu (18/1).\r\n\r\nSelain dengan alasan keluarga dan anak, Andika memutuskan untuk tinggal di Lampung supaya jaringan pertemanannya jadi lebih terjaga. Apalagi sebelumnya Andika Mahesa sempat berurusan dengan hukum akibat terjerat kasus penyalahgunaan narkoba.\r\n\r\n“Gue juga mulai milih-milih teman. Kalau dulu gue sama siapa saja berteman, akhirnya malah nganterin gue ke BNN. Kalau gue jatuh ke lubang yang sama dua kali, gue bodoh,” papar Andika.\r\n\r\nSelain menyeleksi pertemanan, penyanyi berjuluk Babang Tamvan itu juga tidak mau lagi pergi ke tempat hiburan malam. Di usianya sekarang ini, Andika merasa sudah bukan waktunya lagi dia melakukan kesenangan semu semacam itu.\r\n\r\n“Dugem sekarang gue juga gak mau. Paling lebih nongkrong di kafe ada live musik, nyanyi. gitu aja,” tandas Andika Mahesa. '),
(1308, 'Ditanya soal Haters, Andika Mahesa: Buah itu Kalau Manis Ditimpukin', 'ENTERTAINMENT', 'DATA LATIH', 'Andika Mahesa mengungkapkan bahwa semua lelaki di dunia ini bisa dikatakan ganteng karena tercipta sebagai makhluk terbaik di antara makhluk-makhluk Tuhan lainnya. Ketampanan bagi Andika bukan semata-mata diukur dari fisik. Menurutnya, tolok ukur utama ketampanan seseorang adalah hati dan perilaku.\r\n\r\n“Hatinya yang ganteng, bukan wajahnya. Memiliki wajah ganteng tapi suka nyakitin cewek, ya sama saja,” ucap Andika Mahesa saat diminta komentarnya terkait definisi ganteng di sebuah acara yang mengusung tajuk ‘Siap Ganteng di 2020 Bareng Shopee’ di bilangan Kebayoran Baru, Jakarta Selatan, Sabtu (18/1).\r\n\r\nSelain Andika Mahesa, acara ini juga dimeriahkan oleh podcaster BKR Brothers dan pegiat musik Kiki Aulia Ucup. Dalam kesempatan itu, Andika juga diminta untuk menyebut sosok ganteng versi dirinya.\r\n\r\nSetelah sempat berpikir sejenak, Andika kemudian menyebut Tukul Arwana sebagai sosok ganteng dalam imajinasinya. Dia menilai Tukul adalah sosok yang ganteng karena sukses memikat banyak orang lewat candaan dan kelucuan.\r\n\r\n“Tukul Arwana, karena menurut gue dia lucu. Ganteng itu relatif. Karena menurut gue semua cowok di dunia itu ganteng,” tuturnya.\r\n\r\nAndika Mahesa yang selama ini dijuluki sebagai Babang Tamvan dengan senang hati mau menerima julukan itu. Gara-gara predikat tersebut, katanya, para penggemar sekaligus barisan pembencinya jadi semakin banyak.\r\n\r\n“Gue senang banyak haters, karena setelah gue mengerti, gue jadi enggak baper. Buah kalau manis itu ditimpukin batu. Kalau buah enggak manis enggak akan ditimpukin batu,” tutur Andika agak filosofis.');
INSERT INTO `sa_berita` (`id_berita`, `judul_berita`, `kategori_berita`, `jenis_data`, `isi_berita`) VALUES
(1309, 'Tak Mau Sakit, Andika Mahesa Pilih-pilih Pekerjaan', 'ENTERTAINMENT', 'DATA LATIH', 'Andika Mahesa kini lebih pilih-pilih pekerjaan. Vokalis Kangen Band yang sukses menaklukkan hati sejumlah perempuan cantik itu memiliki alasan kuat di balik keputusannya tersebut.\r\n\r\nAndika mengaku dirinya sempat terjatuh sakit beberapa waktu lalu yang membuatnya harus memikirkan kondisi kesehatan. “Kalau dulu kan kerjaan ditubruk semua. Karena kemarin sempat masuk rumah sakit, jadi tahu bahwa sakit itu nggak enak. Sekarang agak milih-milih lah pekerjaan,” ucap Andik Mahesa saat ditemui di bilangan Kebayoran Baru, Jakarta Selatan, Sabtu (18/1).\r\n\r\nSelain pertimbangan kondisi kesehatan, Andika Mahesa juga sengaja membantasi pekerjaan demi keluarganya. “Lebih sibuk sama anak kali ya, sibuknya dibagi sekarang. Kan dari kemarin sudah di Jakarta, kalau gak malam ini atau besok sudah harus di Lampung (tempat tinggal Andika, Red) waktunya sama anak,” tuturnya.\r\n\r\nBuah dari pengalaman hidup yang sudah dialaminya, Andika kini menyadari akan pentingnya keluarga. Dia pun berusaha untuk lebih mendekatkan diri ke anak. Bahkan, ia kerap membawa anaknya jalan-jalan supaya bisa semakin mendekatkan diri kepada buah hati\r\n\r\n“Di Lampung itu selain menenangkan diri juga lebih bisa jalan-jalan sama anak-anak. Kalau di Jakarta kan kebanyakan nyasar, di Jakarta kan banyak aturanya, ganjir genap segala macam,” tutur penyanyi berusia 36 tahun itu.'),
(1310, 'Ade Irawan Dimakamkan Satu Liang Lahat dengan Suami', 'ENTERTAINMENT', 'DATA LATIH', 'Prosesi pemakaman Ade Irawan dilangsungkan sekitar pukul 10.25 WIB di TPU Tanah Kusir, Jakarta Selatan, Sabtu (18/1). Ade dimakamkan satu liang lahat dengan mendiang suaminya, Bambang, yang tutup usia pada 1979.\r\n\r\nJenazah Ade dikebumikan oleh cucu dan menantunya, Mayky Wongkar. Isak tangis sempat mewarnai prosesi pemakaman. Dewi Irawan terlihat menangis selama pemakaman berlangsung. Air matanya semakin deras ketika prosesi tabur bunga. Dia pun sempat mencium nisan Ade Irawan sambil menitikkan air mata.\r\n\r\n“Ibu, selamat bertemu dengan ayah. Ibu yang tenang ya di sana. Semoga Ibu bahagia sama ayah,” ucap Dewi Irawan di TPU Tanah Kusir, Jakarta Selatan, Sabtu (18/1).\r\n\r\nDewi Irawan bisa lebih lega karena dia berhasil mewujudkan keinginan Ade Irawan yang terakhir kalinya, yakni memakamkan almarhumah dalam satu liang lahat dengan ayahnya. “Setelah 40 tahun, ayah sekarang sudah ditemani ibu. Sampai ketemu nanti ya, ibu” tutur Dewi Irawan.\r\n\r\nPutra Ade Irawan, Adi Bambang Irawan mengucapkan terima kasih kepada orang-orang yang sudah mengantarkan ibunya ke peristirahatan terakhir. Dia pun meminta para pelayat untuk memaafkan semua kesalahan yang dilakukan ibunya baik yang disengaja ataupun yang tidak semasa hidupnya.\r\n\r\n“Kalau ada yang memiliki masalah utang piutang biasa menghubungi kami selaku keluarga,” ucapnya.\r\n\r\nAde Irawan meninggal pada Jumat (17/1) kemarin di Rumah Sakit Fatmawati, Jakarta Selatan, setelah mendapat perawatan intensif selama sekitar 2 hari. Ade Irawan meninggal setelah mengeluhkan sesak nafas. Dia menderita penyakit jantung dan paru-paru.\r\n\r\nAde Irawan meninggal setelah 11 hari dari mninggnya sang putri, Ria Irawan. Ria meninggal pada 6 Januari 2020 lalu akibat penyakit kanker kelenjar getah bening yang dideritanya.'),
(1311, 'Dampingi Helmy Yahya, Chandra Hamzah Sudah Persiapkan Langkah Hukum', 'ENTERTAINMENT', 'DATA LATIH', 'Helmy Yahya tidak tinggal diam usai dirinya diberhentikan sebagai Direktur Utama (Dirut) oleh Dewan Pengawas (Dewas) LPP TVRI sejak Kamis (16/1) kemarin. Dia bersama kuasa hukumnya Chandra Hamzah tengah mempersiapkan langkah hukum terbaik guna mengahadapi Dewas.\r\n\r\nMantan Wakil Ketua KPK dalam jumpa pers mengatakan bahwa ada sejumlah langkah hukum yang tersedia untuk mengadvokasi kasus yang menimpa Helmy Yahya. Namun sayangnya, Chandra Hamzah masih enggan untuk memberikan bocorannya.\r\n\r\nMeski beberapa kali didesak awak media, enggan membeberkannya. Dia meminta wartawan bersabar menunggu perkembangannya dalam satu minggu ke depan.\r\n\r\n“Di UU ada silakan saja dibaca. Langkah-lahkah hukumnya apa saja, sedang kami bicarakan dan ada beberapa opsi. Sabar dulu ya. Mungkin dalam satu minggu ke depan,” ucap Chandra Hamzah dalam jumpa pers di bilangan Gatot Subroto, Jakarta, Jumat (17/1).\r\n\r\nDalam kesempatan itu dia juga sempat mengungkap kontradiksi yang tertera dalam surat pemberhentian Dewas terhadap Helmy Yahya. Point yang dia sorot, Helmy dipecat secara terhormat namun kemudian diungkap alasan di balik pemecatan.\r\n\r\n“Kalau dipecat secara terhormat berarti tidak ada kesalahan dong,” ucapnya.\r\n\r\nChandra Hamzah juga mempertanyakan pengangkatan Pelaksana Tugas Direktur Utama TVRI setelah diberhentikannya Helmy Yahya. Dia secara tegas mengatakan bahwa Dewas tidak memiliki kewenangan untuk mengangkat Plt sebagaimana tertuang dalam Peraturan Pemerintah No 13 Tahun 2005 Tentang LPP TVRI.\r\n\r\n“Dalam aturannya tidak ada kewenangan Dewan Pengawas untuk mengangkat Plt. Dewan Pengawas hanya memiliki kewenangan untuk mengangkat dan memberhentikan direksi. Kalau tidak ada artinya apa? Silakan diartikan sendiri,” kata Chandra Hamzah.\r\n\r\nSelain itu, pria kelahiran 24 Februari 1967 itu juga menyoroti sistem kolektif kolegial yang terjadi di dalam direksi TVRI. Menurutnya, karena direksi TVRI menganut sistem kolektif kolegial, seharusnya pemberhentian itu bukan hanya Helmy Yahya. Semua direktur seharusnya juga ikut diberhentikan oleh Dewas.\r\n\r\n“Tapi faktanya yang diberhentikan cuma Helmy Yahya,” tandas Chandra Hamzah. '),
(1312, 'Beberkan Alasan Pemecatan di TVRI, Helmy Yahya Gandeng Chandra Hamzah', 'ENTERTAINMENT', 'DATA LATIH', 'Setelah melalui perseteruan panjang dan proses secara internal, Helmy Yahya resmi dicopot oleh Dewan Pengawas tertanggal 16 Januari 2020. Surat pemberhentian dari Dewas pun telah dikeluarkan seiring ditolaknya klarikasi sekaligus pembelaan Helmy Yahya setebal 1.200 halaman.\r\n\r\nTidak terima terima diberhentikan oleh Dewas sebagai Dirut TVRI, Helmy Yahya pun mempersiapkan pelawanan dengan menggandeng mantan Wakil KPK Chandra Hamza sebagai kuasa hukum. “Di sini saya didampingi oleh kuasa hukum saya Bang Chandra Hamza dan Wibowo Mukti,” ucap Helmy Yahya dalam jumpa pers di bilangan Gatot Subroto, Jakarta, Jumat (17/1).\r\n\r\nHelmy menduga pemecatan dirinya oleh Dewas akibat menayangkan Liga Inggris yang memakan dana cukup besar dan diambil dari Penerimaan Negara Bukan Pajak (PNBP). Menurut Helmy, semua proses itu ditempuh secara benar. Sehingga tidak ada yang cacat prosedur administrasi.\r\n\r\n“Anggarannya memang enggak ada karena anggaran 2019 approvalnya pada awal tahun. Sementara tawaran itu datang di tengah tahun. Tapi kan kami setiap tahun punya PNPB dari sewa pemancar, iklan dan lain-lain. Setelah kami hitung, bisa masuk (anggarannya),” terang Helmy Yahya.\r\n\r\nBagi saudara kandung Tantowi Yahya itu, TVRI bisa mendapatkan Liga Inggris seharusnya suatu kebanggaan. Karena semua stasiun televisi, termasuk TVRI, ingin ada program yang disukai banyak orang yang menandakan eksistensinya di masyarakat semakin terlihat nyata.\r\n\r\n“Semua stasiun di dunia ingin memiliki sebuah program killer content, monster content atau lokomotif content yang membuat orang menonton. TVRI karena jangkauannya lima kali lipat dari TV lain akhirnya mendapatkan. Kami bekerja sama dengan Mola TV untuk menayangkan Liga Inggris,” tutur Helmy Yahya.\r\n\r\nAwalnya dia mengaku tidak percaya bisa mendapat kepercayaan untuk menayangkan Liga Inggris. Kesuksesan TVRI menayangkan siaran itu tidak lepas dari infrastruktur memadai dengan jangkauan yang luas. Hal itu kemudian membuat banyak orang bertanya-tanya.\r\n\r\nDalam kesempatan yang sama, Chandra Hamzah mengatakan dirinya baru ditunjuk oleh Helmy Yahya menjadi kuasa hukum. Dia pun masih akan mempelajarinya duduk permasalahan kliennya untuk memberikan saran langkah hukum apa yang akan diambil nanti.\r\n\r\nChadra menganggap pemberhentian Helmy Yahya tidak sesuai prosedur. Sebab, tidak ada tanggapan terkait pembelaan yang dilakukan kliennya sebelum akhirnya diambil keputusan pemecatan.\r\n\r\n“Orang yang mempunya kewenangan bisa dipermasalahkan apabilang dia sewenang-wenang melaksanakan kewenangannya,” tutur Chandara Hamzah.'),
(1313, 'Nyetir Sendiri, Meghan Markle Jemput Sahabatnya di Bandara Kanada', 'ENTERTAINMENT', 'DATA LATIH', 'Meghan Markle baik-baik saja dari semua masalah yang dihadapinya selama sepekan terakhir. Buktinya istri Pangeran Harry itu terlihat menyetir di Bandara Internasional Victoria, Kanada, menjemput teman-temannya.\r\n\r\nSaat Pangeran Harry masih fokus di Inggris, Meghan Markle terlihat mengemudi sendiri ke Bandara Internasional Victoria di Kanada. Dilansir dari Pink Villa yang mengutip Express UK, Meghan tiba di bandara untuk menjemput salah seorang teman dekatnya.\r\n\r\nMengemudi Land Rover hitam, Meghan sampai ke bandara untuk menjemput teman dan instruktur pilates Heather Dorak. Namun, Duchess of Sussex tidak keluar dari mobil.\r\n\r\nIbunda Archie itu juga melakukan me time dengan minum teh dan menghabiskan waktu berinteraksi dengan sahabatnya. Dari balik mobil, Meghan tampak mengenakan pakaian kasual, dengan topi beanie gelap dan kacamata hitam untuk melindungi dirinya dari cuaca cerah.\r\n\r\nSelama 10 menit menunggu di tempat parkir, Meghan tampak bersemangat. Sahabatnya, Dorak, yang duduk di kursi belakang, bukan hanya teman baik tetapi juga guru pilates-nya. Meghan diyakini bertemu Dorak untuk mengikuti kursus di pusat kebugaran Pilates Platinum di Los Angeles. Ms Dorak dan suaminya Matt Cohen adalah sahabat yang juga hadir di pernikahan Meghan dan Harry pada Mei 2018.\r\n\r\nSebelumnya, Meghan juga pada hari Selasa (14/1), terlihat naik pesawat amfibi menuju Pulau Vancouver, untuk bertemu teman-temannya. Pertama, dia menuju ke Pusat Kota Downtown Eastside. Pada hari yang sama, Meghan juga mengunjungi Justice for Girls, sebuah organisasi yang mendukung dan memberdayakan gadis-gadis remaja yang membutuhkan.'),
(1314, 'Reaksi Sule Ketika Ditanyai Soal Kabar Pernikahannya', 'ENTERTAINMENT', 'DATA LATIH', 'Komedian Entis Sutisna alias Sule dikabarkan segera melangsungkan pernikahan dengan kekasihnya pada April 2020 mendatang. Pernikahan Sule seharusnya digelar pada Februari bulan depan. Namun hari bahagia tersebut terpaksa ditunda karena Rizky Febian dan Putri tengah berduka atas meninggalnya sang ibunda, Lina Jubaedah.\r\n\r\nSayangnya, Sule sampai saat ini masih merahasiakan dengan siapa dia akan menikah pada April mendatang. Namun dikatakan Sule akan menikah dengan kekasihnya yang berprofesi sebagai pramugari dari salah satu maskapai penerbangan bernama Fanny.\r\n\r\nDikonfirmasi tentang kabar pernikahan tersebut, Sule yang dihubungi melalui sambungan telepon tidak membenarkan ataupun membantah. “Maaf saya lagi kerja nih. Nanti saja ya,” ucapnya saat dihubungi, Jumat (17/1).\r\n\r\nSementara itu, sebelumnya pengacara Sule, Dose Hudaya mengungkapkan, berkas-berkas administrasi pernikahan kliennya sudah siap meskipun belum didaftarkan ke Kantor Urusan Agama (KUA). Kala itu Dose menyebut Sule akan menikah dengan kekasihnya yang bukan dari kalangan artis. “Bukan dari kalangan artis,” ucapnya ketika itu.\r\n\r\nHal serupa juga sempat diungkapkan Sule saat diwawancarai beberapa waktu lalu. Dia menyebut akan menikah dari perempuan yang bukan berasal dari kalangan publik figur.\r\n\r\n“Orang biasa,” ucap Sule pada waktu itu.'),
(1315, 'Berselang 11 Hari, Ade Irawan Menyusul Ria Irawan Tutup Usia', 'ENTERTAINMENT', 'DATA LATIH', 'Sektiar 11 hari dari meninggalnya Ria Irawan akibat penyakit kanker, sang ibunda yakni Ade Irawan menyusul di keabadian, pada hari ini, Jumat (17/1). Ade mengembuskan napas terakhirnya di Rumah Sakit Fatmawati, Jakarta Selatan pada pukul 14.22 WIB. Ade Irawan meninggal di usia 82 tahun.\r\n\r\nKabar meninggalnya Ade Irawan menyebar di sejumlah grup wartawan. “Inalillahi wa inna illaihi rojiun telah meninggal dunia Ibu Adek Irawan di rs fatmawati hari ini jumat 17 jan pukul 14.22 WIB. Rumah duka Lebak Lestari Indah Residen Jln Anggrek lestari Indah Blok N no 11 Lebak Bulus-Jaksel,” demikian isi pesan yang beredar di beberapa grup wartawan.\r\n\r\nMelalui akun Instagram pribadinya, rekan sesama artis, Melly Goeslaw pun menyampaikan ucapan bela sungkawa atas meninggalnya Ade Irawan. Disertai unggahan foto Ade, pelantun ‘Jika’ itu mendoakan supaya Ade Irawan bisa bersama-sama lagi dengan Ria Irawan di surga.\r\n\r\n“Innalillahi wa inna illaihi rojiun. Selamat jalan tante Ade Irawan. Bahagia berkumpul kembali dengan Ria di Surga Allah SWT. Alfatihah buat tante dan Ria,” ucap Melly Goeslaw.\r\n\r\nSampai saat ini belum diketahui secara pasti penyebab meninggalnya Ade Irawan. Namun, beberapa waktu lalu dia diketahui sempat melakukan perawatan akibat penyakit paru-paru yang dideritanya.\r\n\r\nAde Irawan termasuk aktris ngetop pada zamannya. Dia terjun ke dunia seni peran pertama kalinya pada 1964 lewat film Di Ambang Fadjar.\r\n\r\nSetelah itu, puluhan film dia bintangi. Di antaranya film berjudul Tjinta di Udjung Tahun, Si Janda Kembang, Fajar Menyingsing, Jinak-jinak Merpati dan masih banyak lagi yang lainnya.\r\n\r\nSelain sebagai aktris, Ade Irawan juga sempat menulis skenario. Dua film yang dia tulis skenarionya adalah Fajar Menyingsing dan Belas Kasih.'),
(1316, '7 Artis ini Belum Mendapat Momongan Meski Sudah Lama Menikah', 'ENTERTAINMENT', 'DATA LATIH', 'Sejumlah pasangan seleberiti diberikan kemudahan untuk mendapatkan momongan. Namun, ada beberapa publik figur yang harus bersabar lebih lama untuk menimang buah hati yang dinanti-nantikan.\r\n\r\nBerikut 7 artis yang belum mendapat momongan meskipun sudah lama menikah:\r\n\r\n \r\n\r\n1. Rianti Cartwright- Cassanova Alfonso\r\n\r\nRianti Cartwright menikah dengan Cassanova Alfonso pada 17 September 2010. Meski pernikahan mereka sudah hampir memasuki usia satu dekade, Rianti masih belum hamil. Tidak menyerah dan optimis, pasangan ini masih terus berusaha untuk memiliki momongan hingga sekarang.\r\n\r\nPada Maret 2019 lalu, Rianti diketahui menjalani program bayi tabung. Namun sepertinya program yang dilakukan pemain film Ayat-ayat Cinta itu belum membuahkan hasil. Pasangan ini masih menikmati masa-masa belum memiliki anak dengan melakukan hal-hal romantis berdua bersama sang suami.\r\n\r\n \r\n\r\n2. Dewi Sandra- Agus Rahman\r\n\r\nDewi Sandra menikah dengan Agus Rahman pada 11 Desember 2011. Setelah menikah dengana Agus, Dewi Sandra mengubah penampilan dengan berhijab sejak 2013. Sekalipun usia pernikahan pasangan ini sudah memasuki tahun ke-8, Dewi Sandra belum kunjung berbadan dua.\r\n\r\nKetika ditanya wartawan apakah dirinya akan melakukan program bayi tabung sebagaimana dilakukan sejumlah selebriti, Dewi Sandra tidak memberi jawaban secara spesifik.\r\n\r\n“Ada memang dengan program. Ada yang dengan berdoa, ada yang melakukan terapi, ada yang lebih ekstrem lagi. Biarlah Allah yang menentukan takdir dalam menjadi seorang ibu atau tidak,” kata Dewi Sandra dalam sebuah kesempatan.\r\n\r\n \r\n\r\n3. Dhini Aminarti- Dimas Seto\r\n\r\nDini Aminarti dan Dimas Seto menikah pada 12 Desember 2009. Meski usia pernikahan mereka sudah genap 10 tahun, pasangan ini sampai sekarang belum mendapat momongan. Tidak menyerah, pasangan ini masih terus berusaha.\r\n\r\nDini Aminarti dan Dimas Seto masih mengupayakan memiliki momongan dengan cara normal dengan memperhatikan pola hidup sehat. Namun untuk melakukan program bayi tabung, Dini Aminarti dan Dimas Seto belum tertarik untuk saat ini.\r\n\r\n“Belum ke arah sana (bayi tabung). Ikhtiar saja ya. Saya bukan tipe orang yang makannya macam-macam. Makan normal tidak berlebihan, olahraga. Insya Allah kalau Allah takdirkan pada saatnya, akan indah pada waktunya,” kata Dimas Seto saat ditemui di bilangan Blok M, Jakarta Selatan, Kamis (16/1).\r\n\r\n \r\n\r\n4. Lyla Naga- Feby\r\n\r\nPernikahan Naga Lyla dengan Feby Rizky Andhika Siregar digelar pada 27 Januari 2012. Mereka belum dikaruniai buah hati hingga sekarang.\r\n\r\nSejumlah usaha perna sudah dilakukan Naga Lyla dan Feby. Mulai dari melakukan pola hidup sehat, terapi, hingga melakukan program bayi tabung namun sempat gagal pada 2018 silam. Ditemui di penghujung tahun 2019, Naga Lyla mengatakan dirinya dan istri masih akan mencoba melakukan program bayi tabung untuk kedua kalinya.\r\n\r\n \r\n\r\n5. Dea Ananda- Ariel Nidji\r\n\r\nMantan penyanyi cilik Dea Ananda dan Ariel Nidji menikah pada 9 Agustus 2009 silam. Mereka masih terus berusaha memiliki anak memasuki usia pernikahan mereka di tahun ke-11 ini.\r\n\r\nBeruntung, kondisi ini tidak membuat keduanya stress. Dea Ananda mengatakan bahwa sambil menanti hadirnya si kecil, ia dan Ariel memilih untuk menikmati masa-masa pacaran dalam naungan pernikahan.\r\n\r\n \r\n\r\n6. Fera Feriska – Al Fathir Muchtar\r\n\r\nFera Feriska melangsungkan pernikahan dengan Al Fathir Muchtar pada 10 September 2006 dan belum memiliki anak.\r\n\r\nSeperti pasangan lainnya, mereka masih terus berupaya agar bisa memiliki keturunan. Fahir dan Fera juga sempat melakukan pemeriksaan kesehatan ke RSIA Kemang, Jakarta Selatan supaya cepat hamil.\r\n\r\n \r\n\r\n7. Zaskia Sungkar – Irwansyah\r\n\r\nZaskia Sungkar dan Irwansyah juga belum dianugerahi buah hati meskipun usia pernikahan mereka kini genap 9 tahun. Pasangan yang menikah pada 15 Januari 2011 itu diketahui melakukan program kehamilan, namun belum ditakdirkan Tuhan untuk memiliki momongan.\r\n\r\nKendati demikian, Zaskia Sungkar dan Irwansyah tetap bersemangat untuk bisa memiliki buah hati yang sudah sangat diidam-idamkan. Bahkan di momen perayaan ulang tahun pernikahan ke-9 kemarin, Zaskia Sungkar secara khusus memohon kepada Tuhan supaya cepat hamil sehingga bisa memiliki anak di tahun depan.'),
(1317, 'Ada Piutang Sebesar Rp 2 Miliar dalam Daftar Warisan Mendiang Lina', 'ENTERTAINMENT', 'DATA LATIH', 'Lina Jubaedah, mendiang mantan istri komedian Entis Sutisna alias Sule dikabarkan meninggalkan harta dalam jumlah besar. Menurut pengacara Lina, harta ibu Rizky Febian itu disebut-sebut mencapai Rp 10 miliar berupa tanah, rumah, kontrakan, salon, perhiasan dan lain-lain.\r\n\r\nHal itu diungkapkan Abdurahman T Pratomo selaku pengacara mendiang Lina. Dia mengetahui daftar aset kekayaan Lina setelah menangani kasus perceraian Lina dengan Sule sekitar tahun 2018 silam. Tak sampai disitu saja. Abdurahman menyebut kekayaan Lina bisa lebih besar jumlahnya adanya miliaran piutang yang belum tertagihkan.\r\n\r\n“Lina dulu juga sempat menyodorkan daftar piutang. Jumlahnya hampir menyentuh Rp 2 miliar,” kata Abdurrahman kepada wartawan, belum lama ini.\r\n\r\nAbdurrahman sempat menyinggung masalah piutang ini kepada Teddy. Menurut penuturannya, Teddy mengakui dana milik Lina masih berada di tangan pihak yang berutang dan belum dibayarkan hingga sekarang.\r\n\r\n“Kemarin itu sempat komunikasi dengan beliau dan mengingat aset mendiang. Suaminya cukup kooperatif,” tutur Abdurahman lebih lanjut.\r\n\r\nLina meninggal pada Sabtu, 4 Januari 2020 saat dalam perjalanan menuju Rumah Sakit Al Islam, Bandung, Jawa Barat. Lina sempat disebut meninggal karena permasalahan pada lambung dan darah tinggi.'),
(1318, 'Anak-anak Meghan Markle dan Kate Middleton Baru 2 Kali Bertemu', 'ENTERTAINMENT', 'DATA LATIH', 'Hubungan antara Kate Middleton dan Meghan Markle dikabarkan tidak akur lantaran sempat berselisih paham dan tidak harmonis selama beberapa bulan terakhir. Ketidakharmonisan itu juga berpengaruh pada hubungan anak-anak mereka.\r\n\r\nAnak-anak Kate, yakni George, Charlotte, dan Louis disebutkan baru bertemu dengan Archie, anak Meghan, sebanyak dua kali.\r\n\r\nDilansir dari Mirror, Jumat (17/1), Archie pertama kali bertemu dengan sepupunya pada bulan Juli 2018 di sebuah acara polo, berminggu-minggu setelah ia lahir.\r\n\r\nKeluarnya Meghan dan Pangeran Harry dari kerajaan Inggris pun semakin membuat renggang hubungan antara Archie dan ketiga sepupunya yang lain. Sejak lahir pun, Archie tinggal sangat jauh dari anak-anak Kate.\r\n\r\nSetelah kelahirannya pada bulan Mei sebelum dibawa pergi ibunya ke Kanada pada bulan November, Archie telah tinggal di Frogmore Cottage di Windsor yang berjarak 20 mil dari Istana Kensington di mana George, Charlotte dan Louis tinggal.\r\n\r\nPerseteruan Meghan dan Kate akhirnya membuat publik juga memprediksi ada ketegangan antara Pangeran Harry dan Pangeran William. Meski begitu, sumber-sumber Istana Buckingham dengan tegas membantah perselisihan itu pernah terjadi.'),
(1319, 'Zaskia Sungkar Jalani Program Kehamilan, Ibu Sambung Mendoakan', 'ENTERTAINMENT', 'DATA LATIH', 'Santi, ibu sambung yang juga istri dari Mark Sungkar menepis selentingan kabar yang menyebut Zaskia Sungkar kini tengah berbadan dua. Menurut penuturannya, Zaskia sampai sekarang belum hamil. Namun, tengah berusaha keras supaya cepat mendapat momongan.\r\n\r\n“Sekarang belum, tapi sedang berusaha keras,” ucap Santi saat berbincang dengan JawaPos.com melalui sambungan telepon.\r\n\r\nSebagai orang tua, Santi dan Mark Sungkar tentu selalu mendoakan supaya Kia – sapaan akrab Zaskia Sungkar, cepat dapat momongan. “Iya kita doain biar cepat dapat momongan,” ucapnya.\r\n\r\nBaca juga: Ibu Sambung Angkat Bicara Soal Kabar Zaskia Sungkar Hamil\r\n\r\nSelain dirinya dan Mark Sungkar, Santi menyebut keluarga besar dan para sahabat sudah tidak sabar menantikan kehamilan Zaskia Sungkar. Mereka pun juga ikut mengirim doa untuk Kia dan keluarga. Apalagi usia pernikahan Zaskia Sungkar dengan Irwansyah sudah mencapai 9 tahun.\r\n\r\n“Semua keluarga, teman-teman yang sayang Irwan dan Kia, dari dulu berharap supaya mereka cepat punya momongan,” tutur Santi lebih lanjut.\r\n\r\nZaskia Sungkar sejatinya melakukan program kehamilan sejak beberapa tahun lalu. Namun ketika itu masih terputus-putus. Dia bersama Irwansyah kadang lupa tengah melakukan program kehamilan lantaran sibuk dengan setumpuk pekerjaan. Namun, belakangan Zaskia Sungkar mulai fokus menjalani program kehamilan demi mendapatkan buah hati.\r\n\r\n“Kadang-kadang kita program nih, habis itu liburan. Lupa, hilang. Ingat lagi dua tahun lagi,” kata Zaskia Sungkar dalam Vlog Baim Paula. “Gue sama Irwan, sama soalnya ya sudah santai saja. Pas sekarang-sekarang ini baru (serius menjalani program kehamilan),” imbuh saudara kandung Shireen Sungkar itu.\r\n\r\nZaskia Sungkar menyatakan bahwa dirinya sudah ingin sekali hamil tepat di momen perayaan ulang tahun pernikahannya yang ke-9 bersama Irwansyah belum lama ini. Dia mem-posting foto kebersamaan dengan sang suami saat tengah berada di California. Zaskia Sungkar berdoa supaya pada tahun depan keluarga kecilnya lebih berwarna dengan kehadiran buah hati.\r\n\r\n“Happy anniversary sayang, enggak berasa sudah 9 tahun nikah sama kamu. Insya Allah tahun depan bertiga ya sayang (anak ya, bukan istrinya yang nambah) sayang kamuuuu,” tulis Zaskia di Instagram pribadinya, @zaskiasungkar15.'),
(1320, 'Meghan Markle dan Kate Middleton Ternyata Sudah 6 Bulan Musuhan', 'ENTERTAINMENT', 'DATA LATIH', 'Publik selama ini hanya menebak-nebak bagaimana sebetulnya komunikasi dan hubungan Kate Middleton dan Meghan Markle. Belakangan, terungkap bahwa keduanya ternyata sudah tidak akur sejak lama.\r\n\r\nDilansir dari The Sun, Jumat (17/1), Meghan dan Kate disebut sudah tidak berbicara selama enam bulan. Keduanya bahkan juga sudah tidak tergabung dengan kelompok WhatsApp keluarga kerajaan\r\n\r\nHal ini makin jelas setelah Meghan tidak datang di ulang tahun Kate yang ke-38 di Istana Kensington. Meghan dan Harry, juga tidak hadir pada akhir pekan ulang tahun Kate di Sandringham, Minggu lalu.\r\n\r\nMundurnya Meghan dan Harry dari kerajaan pun membuat hubungan Meghan dan Kate semakin keruh. Apalagi, Meghan dan Harry sudah lebih dulu berkonsultasi dengan pihak-pihak eksternal sebelum mereka mengajukan niatnya itu ke Ratu.\r\n\r\nSalah satu sumber mengatakan bahwa Meghan dan Harry adalah sahabat dekat Elton John. Mereka ternyata sudah curhat ke penyanyi top Inggris tersebut ihwal keinginan untuk meninggalkan kehidupan kerajaan sebelum mereka memberi tahu Ratu dan mengumumkannya ke publik.\r\n\r\n“Sir Elton selalu siap berbicara di telepon untuk Harry dan Meghan setiap hari. Memang Meghan dan Harry membuat keputusan sendiri, tetapi Elton John telah menjadi bahu untuk bersandar dan mendengarkan curhatan,” kata salah satu sumber.\r\n\r\nSeorang juru bicara untuk Sir Elton mengatakan bahwa sang Rocketman mendukung Harry dan Meghan untuk mengendalikan sendiri hidup mereka. “Elton sangat mendukung setiap keputusan yang dibuat pasangan itu, tanpa pengaruh luar dan demi kebahagiaan masa depan dan kesejahteraan,” jelasnya.\r\n\r\nTak hanya itu, Meghan rupanya juga meminta saran dari mantan Ibu Negara AS Hillary Clinton yang mengunjunginya di Frogmore Cottage, Windsor pada bulan November lalu. Meghan barangkali merasa minder larena latar belakangnya. “Meghan merasa beberapa anggota Keluarga Kerajaan memandang rendah dirinya karena latar belakangnya,” jelas sumber tersebut.'),
(1321, 'Ibu Sambung Angkat Bicara Soal Kabar Zaskia Sungkar Hamil', 'ENTERTAINMENT', 'DATA LATIH', 'Belum lama ini pasangan Irwansyah dan Zaskia Sungkar merayakan ulang tahun pernikahan mereka yang ke-9. Posting foto berdua di Instagram, pasangan yang menikah pada 15 Januari 2011 itu sempat membuat caption menarik tentang buah hati yang sudah dinanti-nantikan keduanya.\r\n\r\n“Happy anniversary sayang, nggak berasa sudah 9 tahun nikah sama kamu. InsyaAllah tahun depan ber 3 ya sayang. (anak ya bukan istrinya yang nambah) sayang kamuuuu,” tulis Zaskia pada akun Instagram @zaskiasungkar15, Rabu (15/1).\r\n\r\nPostingan itu lantas dibanjiri doa netizen. Mereka mendoakan supaya Zaskia Sungkar cepat dianugerahi kehamilan dan mempunyai anak bersama Irwansyah. Namun ada juga yang menduga hal itu sebagai isyarat Zaskia kalau dirinya kini tengah hamil muda. Sehingga pada tahun depan sudah memiliki momongan.\r\n\r\nSanti, istri dari Mark Sungkar yang merupakan ibu sambung akhirnya buka suara. Dia mengatakan bahwa Zaskia Sungkar belum hamil sampai saat ini. Postingan yang dibuat Kia, sapaan akrab Zaskia, di Instagram bukan kode terkait kehamilan. Tapi, lebih sebagai sebuah doa yang dipanjatkan Zaskia Sungkar tepat di momen perayaan ulang tahun pernikahannya yang ke-9.\r\n\r\n“Sampai sekarang sih belum. Lagi berusaha terus, mohon doanya saja. Sekarang Zaskia sama Irwan lagi umrah kan. (Postingan di Instagram) Itu berdoa Mas. Orang kan bisa setiap saat berdoa. Dan di ulang tahun ke-9, mudah-mudahan secepatnya punya anak,” beber Santi kepada JawaPos.com melalui sambungan telepon, Kamis (16/1).\r\n\r\nDia pun meminta para penggemar Irwansyah dan Zaskia Sungkar serta masyarakat secara umum untuk ikut mendoakan suapa Kia cepat memiliki momongan. Apalagi sejak beberapa waktu lalu Zaskia Sungkar diketahui sudah melakukan program kehamilan. Dia pun sempat bolak-balik ke rumah sakit dan brkonsultasi dengan dokter sebagai bagian dari program kehamilan yang dilakukannya.\r\n\r\n“Bantu doanya saja ramai-ramai, bantu doanya semuanya biar cepat diijabah ya,” pinta Santi, ibu sambung Zaskia Sungkar.'),
(1322, '5 Artis yang Sukses Turunkan Berat Badan di Atas 20 Kg', 'ENTERTAINMENT', 'DATA LATIH', 'Sejumlah artis Tanah Air sukses menurunkan berat badan mereka secara drastis hingga lebih dari 20 Kg. Mereka melakukan hal tersebut lantaran khawatir akan kondisi kesehatan dengan bobot tubuh yang besar.\r\n\r\nSelain alasan kesehatan, tentunya mereka juga menurunkan bobot demi tampil lebih sempurna ketika berada di depan kamera.\r\n\r\nBerikut 5 artis yang sukses turunkan berat badan lebih dari 20 Kg:\r\n\r\n \r\n\r\n1. Ricky Cuaca\r\n\r\nAktor sekaligus pembawa acara Ricky Cuaca sukses menurunkan berat badannya cukup drastis hingga 38 Kg. Dia berhasil menurunkan berat badan yang semula 135 Kg menjadi 97 Kg dengan menjalani olahraga fitnes secara teratur dan juga olahraga plank.\r\n\r\nSekedar penggambaran, plank adalah olahraga mirip push up. Namun berbeda dengan push up, plank tumpuan tubuh terletak pada siku tangan dan kaki.\r\n\r\nGara-gara berusaha cukup keras untuk menurunkan berat badan, Ricky Cuaca sempat terjatuh sakit. Kondisinya drop dan sempat 3 hari mengalami demam tinggi. Selain berolahraga, Ricky Cuaca menurunkan berat badan juga dengan makan makanan berat satu kali sehari. Dia mengupayakan tidak mengkonsumsi makanan yang mengandung gula dan karbohidrat.\r\n\r\n \r\n\r\n2. Dewi Hughes\r\n\r\nPresenter Dewi Hughes sukses menurunkan berat badan hingga 80 Kg dalam waktu 15 bulan. Diet yang dilakukannya disebut ‘diet kenyang’.\r\n\r\nDiet kenyang ala Dewi Hughes adalah dia bisa makan dalam porsi banyak tapi tidak dengan menu nasi putih. Porsi yang diberbanyak dikonsumsinya adalah sayuran, umbi-umbian dan buah-buahan. Dewi Hughes juga tidak mengkonsumsi makanan yang digoreng atau dihangatkan kembali. Ia memperbanyak minum air putih dan air kelapa untuk detoksifikasi tubuh.\r\n\r\nDengan penampilan barunya yang terlihat kurus, Dewi Hughes tampak lebih cantik, lebih rapi dan tentu lebih mudah dalam memilih pakaian. Di balik kunci suksesnya melakukan diet, pikiran disebut Dewi Hughes juga memiliki peran yang sangat penting. Kesalahan banyak perempuan yang melakukan diet, kata Hughes, karena ingin kurus. Padahal menurut perempuan berhijab itu, seharusnya fokus utamanya adalah ingin sehat.\r\n\r\n \r\n\r\n3. Tike Priyatnakusumah\r\n\r\nAktris sekaligus komedian Tike Priyatnakusumah berhasil menurunkan berat badan hingga 25 Kg dari bobot awal 103 Kg. Kunci sukses diet Tike Priyatnakusumah adalah dengan berkonsultasi ke dokter gizi. Selain berolahraga yang cukup, selama menjalani diet, dia sangat mengontrol porsi asupan makanan yang masuk ke dalam tubuh. Tike Priyatnakusumah juga beristirahat dengan teratur.\r\n\r\n \r\n\r\n4. Kemal Mochtar\r\n\r\nPenyiar radio Kemal Mochtar juga suskes menurunkan berat badan secara ekstrim. Bobot tubuh Kemal yang awalnya mencapai 120 Kg kini sudah susut menjadi 63 Kg.\r\n\r\nKunci sukses dia dalam menurunkan berat badan yaitu dengan dengan melakukan olahraga jalan setiap hari antara 30 sampai 60 menit. Olahraga jalan sengaja dilakukan Kemal karena dia tidak boleh melakukan olahraga berat lantaran memiliki keturunan penyakit jantung.\r\n\r\nDiet Kemal Mochtar juga sukses dilakukannya setelah berkonsultasi dengan dokter gizi. Semua asupan yang masuk ke dalam tubuhnya diperhitungkan. Hal itu yang membuat Kemal Mochtar sukses menurunkan berat badan hingga 57 Kg dalam waktu satu tahun.\r\n\r\n \r\n\r\n5. Gracia Indri\r\n\r\nGracia Indri sempat membuat pangling saat berat badannya turun hingga 23 Kg. Ternyata dia sengaja melakukan diet supaya bisa tampil lebih sempurna ketika berada di depan kamera dan layar kaca.\r\n\r\nGracia Indri menurunkan berat badannya dengan menjaga pola makan dan berolahraga secara teratur. Selama menjalani diet, Gracia tidak makan nasi putih dan daging sapi. Sementara olahraga yang dijalani Gracia Indri selama proses penurunan berat yaitu sepeda indoor, body combat, body pump dan lain-lain.'),
(1323, 'Ahmad Dhani Ungkap Peran Mulan Jameela dalam Kasus Investasi Bodong', 'ENTERTAINMENT', 'DATA LATIH', 'Musisi Ahmad Dhani ikut angkat bicara ihwal Mulan Jameela yang dikait-kaitkan dengan investasi bodong PT Kam and Kam berbasis aplikasi MeMiles. Sempat beredar kabar bahwa Mulan akan dipanggil penyidik Polda Jawa Timur untuk diminta keterangannya tentang kasus itu.\r\n\r\nAhmad Dhani yang ditemui usai jumpa pers tour konser Dewa 19 di FX Sudirman mengatakan bahwa kabar pemanggilan Mulan terlalu mengada-ngada. Menurut Dhani, istrinya tidak ada kaitan sama sekali dengan investasi bodong tersebut karena perannya hanya sebagai pengisi acara.\r\n\r\n“Mbak Mulan kan cuma nyanyi. Mulan sama sekali tidak ikut investasinya. Dia cuma nyanyi dan dibayar profesional,” kata Ahmad Dhani di hadapan awak media.\r\n\r\nDhani menduga nama Mulan Jameela jadi dikait-kaitkan dengan kasus ini karena merupakan publik figur dan mudah menjadi sorotan media. “Mungkin Mbak Mulan lebih menarik buat media sehingga yang dibicarakan nama Mbak Mulan,” ucap Ahmad Dhani.\r\n\r\nSementara itu, Ali Lubis selaku pengacara Mulan Jameela juga menegaskan bahwa peran kliennya hanya sebagai penyanyi. Sebagai seorang penyanyi, Mulan pun dibayar secara profesional ketika tampil pada waktu itu.\r\n\r\n“Dibayarnya profesional, itu bukan top up atau ikut investasi. Sama sekali bukan. Kalau nominal bayarannya rahasia lah,” kata Ali Lubis.'),
(1324, 'Sempat Tertunda, Sule Akan Menikah April Mendatang', 'ENTERTAINMENT', 'DATA LATIH', 'Komedian Entis Sutisna alias Sule bakal melepas masa duda pada tahun ini. Pernikahannya dengan sang kekasih dijadwalkan pada April 2020.\r\n\r\nPengacara Sule, Dose Hudaya, mengatakan bahwa pernikahan ayah dari Rizky Febian dan Putri Delina itu awalnya akan digelar pada Februari 2020. Namun, saat ini  anak-anak dia masih dalam suasana berkabung usai meninggalnya Lina, mantan istri Sule. Alhasil,  Sule terpaksa menunda pernikahannya pada April 2020 mendatang.\r\n\r\n“Rencana awalnya nikahnya di tanggal 22 Februari, tapi diundur di bulan April,” ucap Dose Hudaya saat dihubungi melalui sambungan telepon, Rabu (15/1).\r\n\r\nUntuk calon istri Sule, Dose menyebut bukan berasal dari kalangan artis. Dia mengatakan hubungan Sule dengan calon istrinya itu tidak terlalu lama. Meski begitu, keduanya sudah memiliki kesamaan pandangan dalam melihat masa depan.\r\n\r\nPernikahan Sule rencananya akan digelar di Jakarta. Namun sampai saat ini proses administrasi di Kantor Urusan Agama (KUA) belum dimasukkan padahal berkas-berkasnya sudah siap. “Kalau surat-suratnya sudah dipersiapkan,” ucapnya.\r\n\r\nSebelumnya, Sule memang sempat mengungkapkan bahwa dirinya ingin menikah di tahun ini dengan perempuan pilihan hatinya. Sule pun sudah sempat meminta izin untuk menikah lagi kepada anak-anaknya, termasuk Rizky Febian.\r\n\r\n“Bukan target ya, tapi (pernikahan) akan terjadi di tahun 2020. Perempuan biasa, kan yang sudah sama di bidang seni,” tutur Sule.\r\n\r\nSeperti diketahui, Sule sempat menikah dengan mendiang Lina Jubaedah. Namun rumah tangga mereka berujung pada perceraian setelah 20 tahun membangun bahtera rumah tangga. Mereka resmi cerai pada 20 September 2018 dengan adanya ketok palu dari Pengadilan Agama Cimahi, Bandung, Jawa Barat.\r\n\r\nDari hasil pernikahan Sule dengan mendiang Lina, mereka dikaruniai empat orang anak. Masing-masing bernama Rizky Febian Adriansyach, Putri Delina Andriyani, Rizwan Adriansyach, dan Ferdinan Ardiansyach.'),
(1325, '11 Hari Ditinggal Ibunda, Rizky Febian dan Putri Terlihat Lebih Tegar', 'ENTERTAINMENT', 'DATA LATIH', 'Kurang lebih sudah sekitar 11 hari Lina Jubaedah, ibu dari Rizky Febian dan Putri Delina, meninggal. Meski sebelumnya cukup sedih ditinggal sang ibunda selama-lamanya, kini kesedihan itu perlahan mulai berkurang. Ikky dan Putri kini jadi lebih tegar.\r\n\r\nHal itu diungkapkan Ariani, adik bungsu mendiang Lina. Dari komunikasi yang terbangun cukup intens antara dirinya dengan Ikky dan Putri, Ariani merasakan kesedihan mereka sudah mulai berkurang.\r\n\r\n“Alhamdulillah sudah enggak terlalu (sedih). Iya, kita sering komunikasi, kan keponakan,” ucap Ariani kepada JawaPos.com melalui sambungan telepon, Rabu (15/1).\r\n\r\nDia pun berusaha menyemangati Ikky dan Putri supaya tidak terlalu larut dalam kesedihan. Karena kesedihan kini tidak akan terlalu banyak menolong. Sebaliknya, kesedihan malah bisa membuat keadaan semakin memburuk.\r\n\r\n“(Ikky dan Putri) Harus tegar, jangan terlalu sedih berlebihan,” ucapnya lebih lanjut.\r\n\r\nKetika disinggung soal proses hukum yang sedang bergulir di Polrestabes Bandung, Jawa Barat, terkait meninggalnya mendiang Lina, Ariani mengaku tidak mengikutinya. Dia pun menyerahkan permasalahan ini kepada Rizky Febian selaku pihak pelapor.\r\n\r\n“Kalau itu (perkembangan kasus) kurang tahu. Ikky sama Putri enggak cerita-cerita sama keluarga,” ucap Ariani.\r\n\r\nMeski dirinya tidak terlalu mengikuti proses hukum yang sedang berjalan, dia penasaran ingin segera mengetahui penyebab pasti meninggalnya sang kakak. Dia pun berharap polisi bisa segera mengungkapkannya supaya rasa penasarannya itu bisa segera terobati\r\n\r\nKabid Humas Polda Jawa Barat Kombes Pol Saptono Erlangga sebelumnya menyatakan, hasil otopsi Lina kemungkinan baru akan keluar setelah dua minggu. Tim forensik butuh waktu yang cukup lama untuk menganalisis penyebab meninggalnya Lina. Kemungkinan hasil otopsi Lina akan keluar pada 23 Januari 2020 mendatang.\r\n\r\n“Hasil otopsi kurang lebih dua minggu. Nanti diinfokan Mas, perkiraan dari tim forensik hasilnya kurang lebih dua minggu. Ada riksa lab dan analisis tim forensik,” tutur Kombes Pol Saptono Erlangga kepada wartawan beberapa waktu lalu.\r\n\r\nSeperti diketahui, Lina Jubaedah, mantan istri komedian Sule yang juga ibunda penyanyi Rizky Febian, meninggal pada Sabtu (4/1) lalu saat dalam perjalanan menuju Rumah Sakit Al Islam, Bandung, Jawa Barat. Proses kematiannya dinilai janggal. Hal itu yang membuat Rizky Febian melaporkannya Polrestabes Bandung, Jawa Barat pada Senin, 6 Januari 2020.');
